Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (0,'wAZZ-UWGVHI','Let''s not forget that Apple Pay in 2014 required a brand new iPhone in order to use it.  A significant portion of Apple''s user base wasn''t able to use it even if they wanted to.  As each successive iPhone incorporated the technology and older iPhones were replaced the number of people who could use the technology increased.',95);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1,'wAZZ-UWGVHI','Here in NZ 50% of retailers don’t even have contactless credit card machines like pay-wave which support Apple Pay. They don’t like the high fees that come with these.',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2,'wAZZ-UWGVHI','I will forever acknowledge this channel with the help of your lessons and ideas explanations, Now It''s quite helpful while you''ll just sit at your comfort and monitor your account Growth.',161);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3,'wAZZ-UWGVHI','Whenever I go to a place that doesn’t take Apple Pay (doesn’t happen too often), it’s such a drag. Between ‘contactless Covid’ habits and my getting the Apple Card, I’ve gotten so used to Apple Pay that I get seriously annoyed when a store doesn’t take it. It feels like a shock, it’s crazy how quickly it took over my shopping routine! I’ve officially been brainwashed by Apple because now it feels so inconvenient to even carry a physical card in my pocket.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4,'wAZZ-UWGVHI','Apple Pay is so convenient, secure, and easy to use. I used it while at the Korean and Japanese airports, no need for physical credit cards.',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5,'wAZZ-UWGVHI','We’ve been hounding my bank to adopt Apple pay. I understand why they don’t want to do it with the extra fees, but its just so easy and quick at the checkout.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6,'wAZZ-UWGVHI','We only got Apple Pay in South Africa in 2020/2021 and it’s widely accepted.',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7,'wAZZ-UWGVHI','For now, I need both Apple Pay and the physical credit card.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (8,'wAZZ-UWGVHI','In the United States, we have an abundance of retailers that accept Apple Pay, but it''s still good to carry the physical card with you, being there are still a large quantity of places that do NOT accept Apple Pay.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9,'wAZZ-UWGVHI','In Cambodia, we have a universal QR code system, we scan and send money back and forth, all banks take no profit from merchant, they receive 100% of the payment. A lot of stores and supermarkets start abandon POS machine all together.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10,'b3x28s61q3c','Wow, you really went to town on the PSU test rack. That''s a serious bit of kit. Very flexible, good choices. Wouldn''t surprise me if Choma start offering this bespoke rack to the PSU makers. They all watch your videos, so they''ll want to make sure it passes on this exact same rack. You can really push the industry here. Well done. Open source the test interface hardware and software.',1344);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11,'b3x28s61q3c','The lab is the most exciting thing in IT I''ve seen for a while. This is reallly going to shake up how the qualiity of even basic components are manufactured.',198);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12,'b3x28s61q3c','Linus, I''m an engineer and love the LMG content across all the channels.  Very much looking forward to more lab content and hope your engineering team will get more on camera time and hosting roles.',365);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13,'b3x28s61q3c','There used to be a time where Linus was the smartest guy in the room, this video clearly shows that the team he has built are experts in their respective fields and make Linus look like a child. Kudos to Linus and LMG, you''ve grown beyond what I imagined. All the best!',211);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14,'b3x28s61q3c','Holy crap. I was looking at Chroma systems back when I was designing power supplies. Looks like you guys went all out! Re the multimeter: Most oscilloscopes are terrible for making accurate voltage measurements (8-10 bit ADCs). They are just for looking at the waveforms.',821);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15,'b3x28s61q3c','I love the direction this channel is going. Most tech channels, even the best trusted ones are going to review products based on their own experience or at most some things they can measure with their pc, but you''re really going to mathematically demonstrate if a product is a quality one and why it is, love it',150);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16,'b3x28s61q3c','I am more excited for the LTT Lab than I have been for a lot of content for a while now. As everyone seems to be saying, it''s exciting to see how enthusiastic this new crew is to get things running.',49);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17,'b3x28s61q3c','I adore the working relationship Linus has with his team. 99% of employees walk on eggshells around their boss and I wish it could be more like this.',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (19,'b3x28s61q3c','I love all the people LTT has added for labs. Clearly they''re knowledgeable and passionate about tech! Labs is gonna be killer. Love it!',2808);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (20,'4mgePWWCAmA','Linus!!! Just turn the key lights  180 and bounce them off the walls. You’ll get a much softer glow and shadow and way more even lighting. It’s such a simple fix. I’m not sure where along the lines people got the idea to beam the lights directly at your face ¿',456);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (21,'4mgePWWCAmA','Dan continues to be my new favorite, he has such an air of confidence about him and a comforting presence. Like Dan shows up and you just know things are going to be fine.',962);
