Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (26,'4mgePWWCAmA','Dan continues to be a favourite for me. He''s like the incredibly patient, but long-suffering Dad, who just gets on with things',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (27,'4mgePWWCAmA','Dan is a treasure. Your channel has long lacked a Mr. fixit type and while I am sad it''s not me, Dan appears quite capable and funny.',134);
