Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (40,'ErMwWXQxHp0','Guys, a quick note that you do NOT need all the high-end tech in order to do well at college. If you can (and you should), save as much money as you can while at college, pay your tuition in full and student loans as soon as possible instead of spending on liabilities like gadgets. Get the bare minimum you need and only spend money on products you know you are going to be using for 4-6 years (such as laptop). Don''t overspend on phone, headphones, lamps, tablets, etc.',23964);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (41,'ErMwWXQxHp0','this is hilarious. i was in a focus group over 4 years ago for Best Buy where they were asking college students how to advertise for Back to School. One of the kids next to me said "Maybe you should have someone like MKBHD talk about your products". Well... here we are',415);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (42,'ErMwWXQxHp0','Everyone has been saying it but I’ll throw my hat in as well. To any prospective college students, you DO NOT need to spend money on flagship products. I am about to graduate with a business degree and have been using a 7 year old laptop and the base iPad from late 2020. Both products have worked flawlessly and I have no intention of replacing them. The recommendations listed are ones I would never be able to afford even with my job I’m working as well. Do your own research on forums to see what your peers say the best value product is. I promise that if you buy a flagship product you will quickly see that you did not need it.',35);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (43,'ErMwWXQxHp0','Shoutout to my OnePlus phone and Huawei laptop for getting me through university feeling premium for MUCH less. Bonus ups for Ikea''s articulating lamps ($20 and I can see all my homework incredibly well without eye strain), the old door I refinished to use as a desktop, and wired earbuds under hardware store earmuffs as my "noise-cancelling headphones." And the same 2 sets of Hanes underwear from target for also lasting the whole ride.',233);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (45,'ErMwWXQxHp0','Most of the items you recommend are pretty pricey for a student. I''m not a student myself anymore but if I were one, more budget alternatives would make this video a lot better!',2106);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (46,'ErMwWXQxHp0','You don''t necessarily need the high-end and latest tech for University.  I used a 2009 macbook pro throughout my years at uni , had an iphone 6 and it worked out just fine. What''s important is to remain focused on getting that degree and graduating.',135);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (47,'ErMwWXQxHp0','Personally I feel like this is really out of touch. Most students won''t be able to afford these. In case anyone needs it: I believe Dave2D''s back to school video are honestly the best ones I''ve seen on the topic. Consider checking them out too before making a purchase decision.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (156,'N88OE2ZCHBM','I’m a Software developer. I understand the struggle but us tech workers should count our lucky stars. We are very privileged to be where we are. Most jobs outside of tech have less perks, much lower pay, and more stress. I am grateful everyday to be in this field. Once I accumulate enough wealth to purchase my freedom, I’ll see myself out.. maybe. In the meantime, I will run the race as long as I have to.',253);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (157,'N88OE2ZCHBM','The thing is, if you give someone all of these perks and a flexible schedule, you need to also give them the freedom to use that flexibility. You must make it clear that the company expects you to take down time, and you will not be frowned upon either officially or unofficially. Leadership needs to model that behavior by taking time off and making sure everyone knows they''re taking time off. This also empowers your teams, letting them know that you trust them to work without constantly staring over their shoulders.',48);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (158,'N88OE2ZCHBM','"Compare that to ... physicians, only 42% said they were burned out" - Yes, indeed, a perfectly acceptable percentage.',1041);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (159,'N88OE2ZCHBM','I worked a low paying tech job for six years and still felt the burn out. The problem is that tech is very fast paced and competition focused. You can barely keep up. Though I got promoted regularly, my higher ups told me the truth before they left, they said that I was severely underpaid based on my skills (essentially I branded myself a one stop shop for the marketing department as I am both technically knowledgeable, people oriented and strategic). I maxed out at $50K. So I decided to jump ship with little planned. Now I run a financial agency with my husband and we make $250K a year as entrepreneurs and we have the freedom to set our own lifestyle.',66);
