Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (174,'qiMnSaZWf3M','That motion alarm for protecting your laptop makes me laugh.  If you are taking a break away from your workplace do you really think that the alarm feature would deter a thief from simply knocking the device to the floor, pick up the laptop and (perhaps) step on the alarm and crush it in a moment of disdain.  By the time you get back with your latte after your phone notifies you of your impending bad luck your laptop will be off on an extended trip.',14);
