Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (176,'qiMnSaZWf3M','The Trene Control Alarm will not deter someone who really wants it.  They will just knock that gadget off and run with your property.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (177,'qiMnSaZWf3M','For anyone considering the Vaultek LifePod (3:00), there is a video on the LockPickingLawyer channel where he opens the safe with a fork. Don''t waste your money.',22);
