Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (180,'4AnyhHl3_tE','I spent hours researching dash cams a  year or so ago and it’s almost maddening how awful, sparse and misrepresented information on dash cams is. I was totally surprised how under developed they are. This is a video that is really necessary.',15300);
