Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (182,'4AnyhHl3_tE','A favourite trick is to upscale a low resolution image before applying the compression - that way they get to claim a higher resolution on the box.  I''ve analysed a few of these now.',72);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (49,'ErMwWXQxHp0','I have used Galaxy Tab S7 during my Ph.D. It''s been a lifesaver for me. First of all, it is really good for reading journals, note taking and scribbling on the pdf''s, secondly, it doesn''t strain your eye that much when you use a computer or a laptop always at a fixed distance, thirdly you get the premium version of noteshelf free with Tab s7 and lastly if you are from a STEM background and use a lot of illustrations or flow process diagrams, you can draw those easily with the stylus on Tab s7. I choose tab s7 over Apple Ipad Air for its ease of use, user interface, and cost (you get stylus for free with Tab S7 and in most cases keyboard too with a huge student discount).',126);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (50,'18fwz9Itbvo','When he says he''s a 400 year old beer wizard, I believe him.',5092);
