Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (56,'18fwz9Itbvo','Seasoned craft brewery tour guide here, and I’m so glad he ended on “Drink what you like.” Sometimes people get weirdly judgmental about the beer preferences of others. At the end of the day, there are hundreds of beer styles for a reason, so everyone can find at least one style they actually like.',127);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (57,'18fwz9Itbvo','This guy is a total bro. Not snobby at all and just wants people to enjoy beer in whatever way they want. Such a contrast with your stereotypical beverage elitists.',150);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (58,'18fwz9Itbvo','Y’all be picking the literal best professionals for these videos. Not only is everyone knowledgeable but they all seem passionate and eager to teach us.',75);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (59,'18fwz9Itbvo','This guy has a face made for movies, a voice made for radio, and a great personality!  I wanna see more of Garrett!',1584);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (60,'jXf04bhcjbg','Whenever we get people young enough to actually understand the internet, these giant tech companies might be broken up but as long as we have 90 year old senators asking tech CEOs how the internet works nothing will get done.',10826);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (61,'jXf04bhcjbg','I live for John''s roasts of AT&T.',787);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (62,'jXf04bhcjbg','Mad respect to John Oliver and his team for not making us watch ads during the show. Major props.',395);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (63,'jXf04bhcjbg','One important aspect I''m surprised was left out is that many of these companies (like Amazon) literally power the internet. Almost 30% of the websites on the internet are stored on Amazon servers, giving them even more access to data trends and physical control over the internet.',674);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (64,'jXf04bhcjbg','Shout to you John Oliver for giving me a brief trip down memory lane.  I''ve been in the telecommunications industry for almost 25 years - and my first job was at....MCI.  Great company that got swallowed up in a horrible merger with WorldCom.  Bing it and see how that disaster played out.',196);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (66,'jXf04bhcjbg','John Oliver deserves an Oscar for his ''Can Dolphins love you?" monologue',75);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (67,'jXf04bhcjbg','I would love to see these bills live. I live in a country where we had one company try and rule the internet, charging outrageous prices for it. They had specifically bought the copper network to do it. The government of NZ denied that as a defense as they were monopolising it, and forced them to open up. Suddenly it turned out it DIDN''T cost $300 to connect to unlimited internet, you could get that for $80!',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (68,'jXf04bhcjbg','Hey, something that might interest you. A couple of days ago my Amazon account was closed with no warning for after hours of wasted time they''re telling me it''s for excessive returns which I think is an error but that''s beside the point. When they closed my Amazon account all my Amazon devices that I own for years primarily all my Echo devices stopped working. I lost access to the Amazon Photos and Prime Video which I pay for. So apparently the devices you already own are subject to be disabled by Amazon on your perceived shopping habits! I assume the same applies to all other Amazon devices and services like fire OS tablets, Ring cameras, and probably AWS as well. Just wanted to make other people aware of this because they definitely don''t tell you this when you buy your hardware and services.',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (71,'2TqOmtTAMRY','The safety belt would''ve paired perfectly with the unicycle and those roller boot things',6495);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (72,'2TqOmtTAMRY','That was seriously the most enjoyable thing I''ve seen in awhile. I forgot how rad this channel is. Well done sir.',84);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (73,'2TqOmtTAMRY','Dude, I love how genuine your reactions were! I''ve had fun watching this, and not only: I was really interested to see what each one of those gadgets did.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (74,'2TqOmtTAMRY','Infinity Dodecahedrons are seriously cool. I bought another (smaller) one, and I really enjoy it. It''s definitely an eye catcher and a conversation starter!',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (75,'2TqOmtTAMRY','I personally enjoy the old school phones.  I have such a hard time hearing my iPhone at max volume without the speaker on.  If I worked in an office I would definitely buy one.  People forget how ergonomic those old phones are.  It''s not particularly comfortable holding a rectangle to your head.  I also have physically sensitive ears so any type of headphones, ear phones, whatever... cause me a bunch of pain.  Looks like a good product that can both be a gag and something for people out there like me who have a tough time using a regular mobile phone.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (76,'2TqOmtTAMRY','The fact he didn''t buy the Nicholas Cage spoon is outrageous.',2389);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (77,'2TqOmtTAMRY','I have to say it after watching this video it feels like the journey you''re on this year has been effective. It simply feels like you''re enjoying life and its what I enjoy most about watching your videos. You manage to pass that joy on. Just the musings of a random stranger. ¿',11);
