Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (79,'2TqOmtTAMRY','Quality quality quality is everything about this channel. Arun makes my mood happier video after video. Let''s be searious, the best part about this channel is Arun making his jokes and when he shows tech.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (81,'wLlL46pYcg4','"If machines produce everything we need, the outcome will depend on how things are distributed. Everyone can enjoy a life of luxurious leisure if the machine-produced wealth is shared, or most people can end up miserably poor if the machine-owners successfully lobby against wealth redistribution. So far, the trend seems to be toward the second option, with technology driving ever-increasing inequality." -- Stephen Hawking',103);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (82,'wLlL46pYcg4','as somebody with a comp sci degree and a decent amount of irl experience i will say edge computing is problematic at its core because client side workload like this is a huge security breach.  this is why even online video games avoid client side scripting.  it is a huge vector for exploit.  it is always interesting to watch a video like this because you are blown away when you listen regarding these other technologies you may not know allot about but when they cover a technology you know about you realize you must question the quality of the info in the other cases where you cannot determine the quality yourself',337);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (83,'wLlL46pYcg4','7:15 edge of the cloud 9:30 hydrogen fuel cell 11:00 star link 12:45 AI  GPT 3 14 50 lithium ion battery  17:20 block chain 19:50 quantum computing.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (84,'wLlL46pYcg4','Self-Healing Concrete is on paper a really good idea. There is just one small problem with it and comes from the fact that we are not using limestone for buildings as limestone has this one tiny problem with being rather frail. Yes it will make the concrete last a big longer, but it will also make it harder to see where the weaknesses of the structure is and only really postpone the disaster, if at all.',45);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (85,'wLlL46pYcg4','I''ve read that hydrogen can work it''s way through any container material. In your piece about graphen it was  stated that it is impermiable to gases -- even the lightest one. Assuming the narrator meant hydrogen, it might be a solution to the long term storage of hydrogen, perhaps.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (86,'wLlL46pYcg4','The fire suppression without water was incredible. It could save many lives and property especially if it could be auto activated like a heat detector. Imagine how much property and how many sleeping people could be saved, especially if this had a built in alarm and was rigged to keep hallways clear of fire. What an invention....WOW.',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (87,'wLlL46pYcg4','I''d really appreciate a study into the potential advantages of META Materials in manipulating light, EMF, heat and even replacing silicon as semiconductors. Nearly every industry can benefit from the improvements and cost reductions, META Materials can provide. Really enjoy your videos, thank you!',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (88,'wLlL46pYcg4','I was totally shocked that Fusion power generation wasn''t included - possibly as big a leap as quantum computing in its impact on humanity.',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (89,'wLlL46pYcg4','I love the one about the hydrogen fuel cells....Considering this technology has been around for about 20 years...Just hasn''t been used, due to a lack of pressure on the industry, and the fact that the patent was buried by large corporate interests.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (90,'R7qsau3X6Ks','I like the meme that says, ‘if it bites you and you die, it’s venomous; if you bite it and you die, it’s poisonous.’ I actually think it sums it up pretty clearly.',4026);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (91,'R7qsau3X6Ks','I wish that when people talked about types of skin damage, they''d acknowledge what that looks like for people with darker skin. we don''t get red rashes after sunburn. even my darkest bruises are often difficult to spot because of hyper-pigmentation. the stages of healing for cuts looks vastly different because we don''t see the same change in colors around the wound sight. not to mention when you look for images to identify clinical signs, 99% of those images are of lighter skin and only marginally helpful to us looking to identify potentially serious medical issues.',1038);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (92,'R7qsau3X6Ks','She has a very effective way of delivering information in a way that is accessible. Love her!',1812);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (93,'R7qsau3X6Ks','"If the lead singer is Bret Michaels then I''m sure it is Poison". That had me laughing for ages ¿',2369);
