Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (96,'R7qsau3X6Ks','My son had botox injections in his legs for years to relax his muscles enough so he could wear splits. He has cerebral palsy. It''s crazy knowing that this life changing treatment is also the most dangerous poison.',885);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (97,'R7qsau3X6Ks','My mom would''ve gone nuts for you while I was growing up lol. Her big "parent fear" was toxic chemicals and me getting poisoned so she was always lecturing me about stuff under the sink and making sure I didn''t touch the pesticides for the farm. Once she figured out she could call PBS and they''d send her Mr. Yuck stickers the house and barn were *covered* in them',309);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (98,'R7qsau3X6Ks','I love how she says that it is poison in the right dose, instead of the wrong dose.',120);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (99,'R7qsau3X6Ks','My husband got sun poisoning last year. All the symptoms you described. It was not fun. He said his sick were he got burned felt tight for a few months after. Luckily he is a nurse and he was able to give me advice on how to help him in his recovery.',281);
