Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (112,'pT_9hntWj34','What a tough selection this month! Whether it be the soundbar, the lamp speaker or even the pc panel display they all seem something that would really improve my set up, but for me it may have to be the soundbar one,  looks smart, has nice RGB and a decent size and price. Very good month of tech this month!',7);
