Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (120,'cj4lxmHQV0o','One really important point: those ionizers can produce potentially dangerous levels of ozone due to the negative ions they create in the air. I''d be cautious of all air ionizers, unless they are advertised specifically as bipolar ionizers. The one that you recommended DOES produce ozone, which can be very harmful',1753);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (121,'cj4lxmHQV0o','Been a good while since I''ve been a student but I still watched the vid to find out what cool gadgets are out there. Didn''t think I''d be walking away from it with a productivity tip, that idea of the simple timer is so good, instead of devices that can also do time. Great vid ,Frank.',46);
