Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (150,'N88OE2ZCHBM','In my experience, burnout comes from realizing that improved performance doesn''t produce improved rewards, it produces more work. The response to a job well done is never a couple days off or a timely bonus, instead good work is "rewarded" with the demand for twice as much work in the same amount of time. Firms see young workers as a productivity sponge to be squeezed for all it''s worth, young people are almost never treated as the company''s future.',1419);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (151,'N88OE2ZCHBM','I am 50 years old working in the high tech industry, mentally tired and sick of the weekly 8 to 5 routine. Never got a proper day off even through the pandemic.  Hats off to the millenials and GenZ that think differently and put more weight on LIVING rather than just WORKING.',960);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (152,'N88OE2ZCHBM','I think the pandemic has taught people the importance of multiple streams of income unfortunately having a job doesn’t mean security',2066);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (153,'N88OE2ZCHBM','Successful people don''t become that way overnight. What most people see at a glance wealth, a great career, purpose-is the result of hard work and hustle over time. I pray that anyone who reads this will be successful in life..',142);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (154,'N88OE2ZCHBM','As someone who used to work 80 hours a week, quitting my job to become a freelancer was the best thing I have ever done. Sure I still work a lot of hours and often close to 70-80 hrs a week, I feel like I am doing this for myself and not some corporation.',411);
