Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (516,'nv7owOSprnI','To be good at something you got to be doing it all the time. Why do you think the Americans are so good at war.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (517,'nv7owOSprnI','THE WORLD NEEDS TO HELP CONGO GOVERNMENT FINANCIALLY TO SAVE "SECOND LAST RAIN FOREST" FROM BEING MINED.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (519,'nv7owOSprnI','As a former combat planner in Vietnam, I agree with General Hodges. Putin''s ''attrition'' strategy is not well thought out. Firstly, they don''t have the right equipment, manpower or time. Ukraine has all of that except for ''equipment'' in sufficient quantities. Over time, the West''s resources will help Ukraine fill that gap.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (520,'nv7owOSprnI','A decisive battle between civilization and savagery has begun. Even in the Second World War it was not like that. Because the two savages were on different sides of the front. It was an inter-German showdown: the Germano-Slavic ethnic  of the Deutschs against the Germano-Celtic French and the English, and the Russian savagery was either together with the savagery of the Deutschs or against them. Now the front line has clearly been drawn between civilization and savagery. I see the philosophical law of contradiction: civilization is definitely a positive phenomenon, but it is mixed with negativity in the form of shame and cowardice: civilization has hid behind Ukraine and is waiting for something unknown. The memory of civilization''s victory in this war will be tainted with the memory of shame.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (521,'nv7owOSprnI','Europe is forever in debt for the bravery of Ukraine. Hopefully russia shall pay to rebuild Ukraina. Slava!',0);
