Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (245,'IHnhSxizVOA','This was a fascinating look at something I love, by some genuinely interested people. I will add that you can build a significantly cheaper race bike, for a lower key series and still have fun on the track. I have a Minitwin which is relatively cheap to run, but a friend of mine has a litre plus missile and every time he crashes it, it costs about £5k and six months at least to fix! However, I far prefer long adventure rides to whizzing around the track, all of which you can do on a minitwin. ¿',0);
