Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (261,'Fpof56HU6SY','Lots of profit negative tech startup companies with an over abundant of overpaid employees…..honestly who hasn’t seen this coming?',9);
