Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (266,'Fpof56HU6SY','That''s really a problem with service economy. Most tech companies don''t even produce a nail. They do things that are intangible, you cay easily live without them. If Netflix goes down I am sure there will not be any catastrophic event. If some manufacturing companies goes down, let''s say the one that makes baby formula, it could trigger a panic.',12);
