Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (282,'MtMkU-1p7-0','Interesting note: Real wasabi is difficult to cultivate and package and ship. It also grows only in a specific riverbank environment, which makes real wasabi expensive and in low supply. When young, real wasabi is a bit sweet not spicy. The "wasabi" that comes with your sushi dinner in America, it is most often just horseradish with green food coloring. This green-dyed horseradish replacing actual wasabi is known in the food world as an ersatz or a replica food.',213);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (283,'MtMkU-1p7-0','That “section of the tongue” theory is so funny to me because it’s what I was taught as a fact in my high school anatomy class and I was trying to test that out on my own and never could, I would always taste every flavor no matter where it was in my mouth. I have never heard anyone say it wasn’t true so it’s cool to hear now',891);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (284,'MtMkU-1p7-0','This woman is unbelievably amazing - I want a PhD in taste and I want her to be my professor - I’m a lawyer and after this ONE video I’m prepared to quit and pursue taste ¿',207);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (285,'MtMkU-1p7-0','What she said about the packaging affecting the taste is so true! I always think delivery pizza smells so good, and it’s the pizza in the cardboard box that makes it smell amazing. Just not the same without the box ¿',416);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (287,'MtMkU-1p7-0','The amount of people Wired gets to interview is amazing.....all of them has the passion of the kinds of job they r doing.... idk if "job" is the right word to use  when ua doing something what u love.',4284);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (288,'MtMkU-1p7-0','Also, the amount of carbonation to syrup isn''t set in the soda machines, and can be changed.  A soda with more carbonation is a ''dry'' soda. A restaurant I loved would mix their own rootbeer syrup, and you could ask for it to be a dry or sweet, whichever was your preference.',686);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (289,'QYlXL_8ei6g','Maybe it''s because I know she''s an audiologist but she annunciates everything beautifully and speaks with an even sound level. Like she clearly works with the hearing impared to naturally say every sound in a word to be heard as easily as possible',1550);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (290,'QYlXL_8ei6g','I’m so glad she talked about how hearing aids are more complicated than just a mic and speaker, as someone who has had two of them since I’ve been four I’ve had to explain that so many times (also having automatic Bluetooth ears is super cool)',496);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (291,'QYlXL_8ei6g','My doctor also told me that our ears are self-cleaning. But when I pressured her for some off-the-record advice, she finally conceded that if I really.. REALLY.. felt the need to clean inside my ear canal, I could go ahead and use my elbows. I just adore my doctor!',104);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (292,'QYlXL_8ei6g','Brilliant, well-spoken, well-enunciated, and a welcoming and animated face.  Great video!  I learned a lot.',279);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (293,'QYlXL_8ei6g','The way I was hyped to to this!! I was born with hearing loss, so I had to see MANY audiologist in my life so far. People like her made my life so much easier. Her talking about hearing aids and clearing up misconceptions or even spreading knowledge made me smile ear to ear.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (294,'QYlXL_8ei6g','About earplugs at concerts - there are a variety of frequency-balanced earplugs that protect your hearing while preserving the sound quality of the music (Eargasm and Hearos are a couple of examples). I HIGHLY recommend them!',195);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (295,'QYlXL_8ei6g','As someone who has been to many loud concerts and been in infantry, combat, and is now nearing 60, you should wear hearing protection whenever you can, same as sun protection for skin and sun glasses for your eyes.',265);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (296,'QYlXL_8ei6g','Honestly, my main take away is that I''ve been saying "tinnitus" wrong my whole life.',122);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (297,'QYlXL_8ei6g','Loved this as someone who previously studied to be an audiologist in the past. Also just love all of the "expert answers" videos on this channel. Thanks WIRED and Dr. Emily!',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (298,'QYlXL_8ei6g','This was super fascinating, although the part about the ear drum being able to self repair was the most surprising to me.',63);
