Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (305,'zFCFe38EIfE','Probably the best interview/Answers so far. He leaps off the screen with his eloquent and articulate manner. It is very apparent that he is simply a genius.',1379);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (306,'zFCFe38EIfE','This was so entertaining, I had no idea the person behind Dyson was a true, genuine and passionate inventor. And to see him speak so nicely about independent designers and the unfair problems they face was amazing!',71);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (308,'zFCFe38EIfE','I really wish we could see his full answers. I imagine this was a much longer video that had to be edited down. Release the directors’ cut!',366);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (309,'LOrkbagIpiY','Your videos make my weekend. It is something perfect that I can watch with my 4-year-old what we have lunch and it distracts him because his mom is leaving to work. Your videos honestly are lifesavers. Thank you',210);
