Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (312,'LOrkbagIpiY','Must admit, that new MX Master Mechanical keyboard looks and sounds great! Thinking of getting myself one of them now',17);
