Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (319,'UK5OHUmIgcc','Hey! By popular demand I made a list of all Cool Tech Under $50 products from the last 3 years archived so you can see it all on 1 page! https://lustre.ai/creator/randomfrankp',342);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (320,'UK5OHUmIgcc','My favorite product was definitely the wireless desk charger. Hope I can finally win one of these. Love your videos Frank, keep up the great work!',645);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (321,'UK5OHUmIgcc','On the wireless phone charger, I could see installing it under the wood in your nightstands if you have the right kind of furniture for the job. Also, the Echo Dot stand is super cute! Definitely made me think of Portal Turrets too!  Definitely my favorite!',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (322,'UK5OHUmIgcc','Loved the “invisible” charger, would definitely contribute to keeping my clean.',72);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (323,'UK5OHUmIgcc','Wow, that wireless desk charger is insanely cool. I would love one of those.',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (324,'UK5OHUmIgcc','This channel is actually really cool. Instead of being just a kickstarter compilation these are all actual product reviews. Going to watch a few more before subscribing but so far extremely good channel',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (325,'UK5OHUmIgcc','This might be the best episode of this series ever. So many great ideas!',40);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (326,'UK5OHUmIgcc','The charger was my favorite. The hidden feature is cool but what I really like is the easy under the desk installation that also saves space',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (327,'UK5OHUmIgcc','What an awesome video, I love to see new affordable products come out!  This makes me wonder why certain tech devices have such an immense shelf price.  If more technology can be produced at cheaper costs, there may be some advancement in the asking price from many everyday-used devices such as laptops or desktops',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (328,'UK5OHUmIgcc','I love wireless setups and the wireless charger is always a bonus! Thanks for the best content as always!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (329,'My2Tr3k1liw','Oh imagine when they get those sound wave extinguishers in giant sizes to catch the forest fires real quick. The people, animals and homes saved would be amazing. Not to mention the forests as well. What a brilliant invention. ¿¿¿¿',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (330,'My2Tr3k1liw','That fire extinguisher could potentially be attached to drones to put out lightning strike fires and prevent future forest fires',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (331,'My2Tr3k1liw','Imagine we could just buy a sized sheet of film like a screen protector then place it on any window or surface we like , such as a mirror , bench top or car windscreen , and then be able to utilise it like a touch screen ¿ would be more practical than buying an expensive mirror',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (333,'My2Tr3k1liw','Floating cities sound pretty promising, as free land is already scarce. The question is who will rescue the cities from violent storms, or protect them from armed pirates. A floating city will need its own defenses, but will that be allowed within the 12 mile territorial limit?',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (334,'My2Tr3k1liw','It’s awesome, but what happens to the humans that used to do these jobs?',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (335,'My2Tr3k1liw','I want to know what problem that Quantum computer solved in a few minutes that would take a normal computer 10,000 years.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (337,'My2Tr3k1liw','The claim about the quantum computer came and went. I''m not sure who is on top. I''d like to see more of the Chinese tech. We seem to have very little insight into what they are doing.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (338,'IUwqf08-FKU','I can confirm her squirrel facts.  I raised an orphaned one, and it was the sweetest cuddliest pet until it almost grown.  Woke up one morning an she acted like a wild animal: biting, scratching, trying to eat my face off...  It was a sad day, but I''ve checked wanting a squirrel off my list!',5662);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (339,'IUwqf08-FKU','Adore the collection of people you have answering questions. They are so intelligent in their respective subject and superbly passionate. Love learning more.',4836);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (340,'IUwqf08-FKU','I swear to God, every "can I have this exotic pet" question can just be answered with the words "Do you know what ''domestication'' is and how long it takes?"',1798);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (343,'IUwqf08-FKU','THANK YOU for addressing declawing cats, and how awful and hurtful it is to the cat!',2538);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (344,'IUwqf08-FKU','I have a cat who was declawed by a previous owner. He has so many behavioral issues that are typical of declawed cats. He was just at the vet yesterday for litter box issues and the vet brought up the fact that he was declawed. Declawing inflicts lifelong trauma on the animal.',989);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (345,'IUwqf08-FKU','This woman was born to be a vet. You can just tell. She''s the 1% of Kindergarten girls who''s living the dream! ¿¿¿¿¿',739);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (346,'IUwqf08-FKU','Exotic animals as pets should be illegal. Tigers don''t belong in farms, sugar gliders don''t belong in apartments. Sad to see that this happens still.',3368);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (347,'IUwqf08-FKU','If you decide to brush a cat''s teeth, a fencing mask is highly recommended.',415);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (348,'U48UrDpXGog','Let us know your tech queries using #AskGCNTech ¿',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (349,'U48UrDpXGog','I had a recent fall at work and because I trained myself how to fall off a bike safely, I only had minor bruising on my butt. I did a tuck and roll like when I fall off the bike. Great advise Alex and Ollie.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (350,'U48UrDpXGog','When I got right hooked a few years ago, I only had time to think “this is gonna suck” and then proceeded to roll a ways on the pavement. Fortunately, I came away with ‘only’ bruises and road rash. Nothing got broken, and I think in part it was because I didn’t have a chance to put my hands out. Also, glad I was wearing a helmet!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (351,'U48UrDpXGog','I still have my copy of Eddie Borysewicz''s "Bicycle Road Racing" (1985). In it he discusses practicing tumbling and diving somersaults in a gym to improve your crash response. Unfortunately I haven''t practiced that, but my last inelegant dismount was at low speed, so only some skin lost.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (352,'U48UrDpXGog','#AskGCNTech after two years of running tubes, I finally went tubeless a couple of months ago. I managed to puncture my tyre the other day. Sealant didn’t do the trick nor did a couple of slugs - even tried a patch inside the tyre. The puncture was not on the sidewall and may have been 3mm large. Given the tire had plenty of life left, I am gutted that I may have to discard the tire now. When would you come to a decision that a tubeless tire is KO?',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (353,'U48UrDpXGog','#askgcntech Riding in a strong crosswind the other day, I wondered if a high cadence would give a gyroscope effect and reduce buffeting from the wind.  Presumably from feet and shoes if so. Can Ollie show us the maths please.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (354,'U48UrDpXGog','My last crash (3 yrs ago).  I was on the ground so fast, I had no time to react or prepare for the impact.  But the scar from my collar bone repair looks pretty cool...',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (355,'U48UrDpXGog','Another problem with filling tires with water is that the first bump you hit will probably cause the tire to blow off the rim.  Water is incompressible, unlike air, so it has to go somewhere when the tire volume gets changed due to an impact.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (356,'U48UrDpXGog','#AskGCNTech As a heavier rider, I feel I’m always in the max range of gears, either hardest gear on flat’sh roads or my easiest gear when I see any sustained gradients. I currently run a compact chain set with a 12-30 cassette on the rear. Would I benefit from upping my chain set to give me more usable gears or would this just make my climbing problem even worse due to the worse range at the rear',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (360,'-pTGc7cIBIA','Having shot Canon for 20 years I switched the Nikon in 2016. Love both brands, but prefered the Nikon ergonomics with the dual command dials rather than the Canon methodology of the 4 buttons on the top plate. R5 really improved that but I love the ISOless nature of the Nikon sensors. Canon is getting better in that regard but still behind Nikon and Sony.',81);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (361,'-pTGc7cIBIA','Hey Marques! I know these sound insignificant, but since you rarely update your little dongles/accessories that you carry around and your apps on your home screens, I think it would be interesting to get a little maybe quarterly series where you talk about any changes and what you''d like to see changed/simplified with those work flows. Just an idea!',48);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (362,'-pTGc7cIBIA','@MKBHD I"m a photographer and use the Peak EDC V2.  I''m impressed you got a 16" into the 20L  I''m sure it''s a snug fit and doesn''t leave alot of room for a ipad too.  Wanted to give you a little tip I found on that bag, here goes: The main compartment has a pass through to the top zip area where phones, airpods, etc go.  You just have to fish a cable through the corner.  I do this by unzipping the side compartment enough to fish through the cable.  It makes it so I can leave a pass through USB travel battery charger with folding prongs, that means I plug in all my devices when they''re in the zip area (laptop, phone, tablet and airpods) and they all get charge from the battery AND when I get to the hotel late, I just plug one one cable into the wall outlet and I hear all my devices chime in unison that they are now charging neatly in place.  Not only that when they''re done charging the battery starts charging.  I wake up with everything ready to go.  Hope you enjoy trying this out. :)',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (363,'-pTGc7cIBIA','Would love to see an EDC/daily tech for everyone else in The Studio!',6583);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (364,'-pTGc7cIBIA','Marques''s reaction was genuine here. He was excited to know as what will come out of his bag next ¿',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (366,'-pTGc7cIBIA','You are carrying great tech, and it makes total sense that you are rellying more and more on Apple, their ecosystem is really good. I am an Android user and don''t stick to just one brand but my wife is All-Apple and she really likes how seemless everything is. Cool stuff Marques.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (367,'-pTGc7cIBIA','Hey Marques, can you do an updated “The Ecosystem explained” I think a lot of viewers would appreciate a video not only for Apple side of the ecosystem but also Android, seeing as though a lot of new products are coming out in support for easy use for Androids. Love all your videos btw! ¿',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (368,'_f8Gb-vojoU','I can see that exoskeleton helping people with limited mobility in the future. It''s a marvelous piece of tech. Thanks for giving us a glimpse of things to come!',208);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (369,'_f8Gb-vojoU','the exoskeleton probably wouldn’t be affordable for everyone to use, and may have long term effects, but i think it would be amazing for rehabilitation and other medical related use!',105);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (370,'_f8Gb-vojoU','I''ve got that Azeron keypad. HIGHLY recommend it for all kinds of applications where quickness is ideal, but especially for gaming. Highly highly. You can even find certain models on Amazon usually. I ordered mine from the factory, for the color scheme and one of the newer designs. (the one on this video is the original design, which I''m sure is still just as phenomenal, but my fingers twitch randomly sometimes, so having the buttons above the knuckle could have been a problem.',46);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (371,'_f8Gb-vojoU','The game pad that you highlighted actually is already available. I am a right arm amputee and also a big gamer and was considering buying it but it’s over $200 US and you would still need a mouse. Also I have already become very proficient using a standard controller for gaming already and mostly mostly use an Xbox controller for my PC so I decided it wasn’t worth it. But it’s still a very good design in my opinion and I would love to see how it feels to use irl just not at that price point lol.',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (372,'_f8Gb-vojoU','Cyborg game controller looks pretty neat. I am from from Latvia and that company makes pretty high end gaming gear (expensive too).',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (373,'_f8Gb-vojoU','2:00 can you imagine being able to one day look out a window and determine what the weather is like? the future truly is here',197);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (374,'_f8Gb-vojoU','I will forever appreciate this channel, you''ve helped me and my family a lot, your videos, advice, lessons and funny words are Inspirational and helpful to us. My husband and I have been able to minimal, conscious in spending, saving and investing wisely, I now earn every week. You''re such a blessing to this generation, we all love you',97);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (375,'_f8Gb-vojoU','Wow imagine having the ability to determine the weather simply by looking out the window, what a world we are living in.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (376,'_f8Gb-vojoU','Man, to think one day I might be able to own a dehumidifier and a battery. Wow.',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (377,'_f8Gb-vojoU','Yes, the game pad is incredibly convenient, but incredibly expensive so seemingly lower quality production  than it''s competitors, that being said I would sure love to have one.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (379,'MAeXrShneoQ','When you as an employee are fired from a company and the reasons they are giving you are “poor performance, or lack of culture fit”, trust me when I tell you the real reasons are not disclosed. Been there, done that. Companies lie, HR works for the company and also lies, and a corporation hierarchy matters. When you lawyer up is when they start taking you a bit more seriously.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (380,'MAeXrShneoQ','Great daily blog!!!  You all do a great job picking the most relevant daily headline to cover.  Such a high level discussion in such a short clip.  I watch or listen every day!!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (381,'MAeXrShneoQ','The market cycle still hasn''t met its balance, we keep going round in circles while waiting for that huge blow out on a huge support but in the mean time we could always ignore the market ups and downs and stay fully invested. Big thanks to Lily Alice for helping me earn over 14 btc by implementing her method and following her guide.',51);
