Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (391,'AREK4H8k7Ng','Just a note on the screw driver. Put some "extended" bits with it or a smaller precision screw driver in the set with it.  Its very common for some screws to be deep in a hole and having those small bits into hex end wont go in far enough down the hole to extract screw. I see this allot on Laptops, controllers that kinda thing. Sunk in screws suck.',135);
