Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (394,'AREK4H8k7Ng','I think one of the things I love the most about these intel extreme upgrades is Linus learning and getting angry at his employees for everything about their lives.',35);
