Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (397,'AREK4H8k7Ng','I love his space. It''s messy, full of things that he could throw away if he really went through it all, but it''s a catalog of and container for life as he''s living it rather than just a show piece.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (398,'B0HI0RTZdJw','After seeing the macro pad I was checking out their website and loved all their products. I''ve wanted a product like this for when I stream to make it easier, and this here is just what I need. It''s a great product and I''d love it for my setup.',296);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (399,'B0HI0RTZdJw','Very surprised with this month''s list, considering how every single item in the list feels like it could go with my setup or just seems super cool to me. Usually there''s one or two items that I don''t think I''d personally find useful, but I am 100% adding all these items to my wishlist!',80);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (400,'B0HI0RTZdJw','I absolutely loved the Hoto laser measuring tool. As an engineering student, I am constantly measuring objects and like using various rulers. I would love to own one of these Hoto laser measuring tools for sure! Also, this months list particularly caught my eye, as everything listed seems like something I would want to purchase in the near future.',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (401,'B0HI0RTZdJw','So many great products on this list! These are all incredibly practical too, especially the macropad. The abililty to customize literally every aspect of it is killer.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (402,'B0HI0RTZdJw','The Hoto laser was a pretty good change of pace, loved it. Feels very complementary to the theme of office gadgets! Keep em coming! Ideas: specific under-desk drawers, and other more “furniture” alike stuff that will make your setup noice.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (404,'B0HI0RTZdJw','Just discovered your channel and the series. Going to be watching your older ones today while working. That macro pad is really cool. That would definitely be something I''d pick up and use.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (405,'B0HI0RTZdJw','That macropad looks killer! Been looking for a segue into custom keyboards for a while and that seems like a great place to start. Looks like it would be incredibly useful for both work and personal applications too which is a huge plus. Would love to have one in the near future!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (406,'B0HI0RTZdJw','I’ve actually been looking for macro pads recently and you just upload the very thing I needed! I love that you can customize it to fit your aesthetic, truly a must have for any setup',0);
