Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (412,'Wuq7lS9rljw','Great to see you including a wider variety of stuff in these videos beyond just electronic devices, especially the pharmaceutical industry. If you''re going to include banned medications then the top of the list in your next video should be Thalidomide. What it did was absolutely tragic, it was banned decades ago yet people are still suffering and living with severe disabilities to this day. Thousands of families destroyed and lives lost too.',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (413,'Wuq7lS9rljw','This is such a good video, Arun. The amount of research, locations, and editing that this video needed is enormous. Thank you for doing this ¿¿¿',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (414,'Wuq7lS9rljw','Arun looks so fit now, I''m glad to see him taking care of himself too',2731);
