Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (417,'Wuq7lS9rljw','I now know I like this guy. I at first thought I had some type of prejudicial dislike of him maybe because he was too smooth and that goes against my grain but I love this guy because he does seem to care about things and many of them seem not to be regarding how much money he can make off of a ad for a person it seems as his reviews are sincere and these seem not to have to do with what I''ve seen only from him which is technology I really love the fact that this guy cares about people''s safety and he brings up some safety issues which people should be concerned about if they have children especially with the toys and the baby monitors yeah this guy is getting a big a+ from me.',5);
