Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (430,'o-jUQhCeazQ','I know this isn''t entirely uncommon with authors, but I''ve always loved how much Neil Gaiman feels like a Neil Gaiman character.',3956);
