Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (438,'-ju6y-pHByw','You can tell he''s serious about his craft, but not obnoxious about it. The best you can hope for',4224);
