Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (443,'-ju6y-pHByw','I met a sushi chef back in 1985 who had been living in the USA for thirty years at the time. He claimed to be the inventor of California roll. He said he developed it to warm customers to the concept of sushi. Sort of a beginner’s sushi.',427);
