Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (448,'-VVLmBXHvL8','Really appreciate you taking the time and effort of putting it out there. Look forward to watching more of your great content. In the past two years, assets like Gold 7%, Nasdaq 19%, and S&P 29% have all lagged behind the USD monetary inflation rate (M2 money supply is up 36%) while Bitcoin has appreciated 229% during the same period. <My stock portfolio over the last 2 years is massively down against my bitcoin using Thomas Fuller strategy. In my view Bitcoin has been one of the best holds during this uncertain market. My Bitcoin portfolio have been on a rise although the rates are capricious wiping out some of my profits i still have about 9.14'' btc! worth of crypto assets. I can take a drop down to 20k and still be doing better than my stock portfolio. <I''ve stopped buying most stocks, I''m DCA''ing into Bitcoin, and I''m hoarding cash that will go entirely into Bitcoin if there''s another good drop¿...',16);
