Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (460,'UxjgqBamqDU','Yes, for your sponsor Grover. If you keep renting a product until you reach its retail price, you can keep it forever for a symbolic dollar. Or, if you fall in love with an item before that, you can also pay it off at any point. So the only issue I find with that is why must we have to pay retail for a refurbished  or used item?',0);
