Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (464,'YvZPU-KBCiQ','For those who are curious: Not only is it widely accepted that an asteroid wiped out the dinosaurs, but we also know exactly WHERE the asteroid landed: it''s called the Chicxulub crater. It''s located on the northern coast of the Yucatan Peninsula and has been carbon-dated to have formed in that time period, and it size of the crater certainly looks catastrophic enough.',1234);
