Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (470,'YvZPU-KBCiQ','That was cool. I like that he said Jurassic Park was for entertainment not science. I often hear people complaining that things like Jurassic Park aren''t scientifically accurate. Who cares. I watch that kind of stuff to be entertained. If I want to learn something I''ll watch a documentary which I also do.',391);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (471,'YvZPU-KBCiQ','The fact that birds are technically dinosaurs is a fact that would have blown my mind as a kid. Which is why I try to bring it up with kids as often as I can! Growing up, Plesiosaurus was my favorite “dinosaur”, although it’s technically not a dinosaur. My other favorites are Maiasaura and Parasaurolophus',351);
