Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (837,'Ccc0GvjuqkQ','The problem with this that by focusing on totally different thing rather than better content we, subscribers are paying the price with increasing subscription fee.',207);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (838,'Ccc0GvjuqkQ','Netflix is getting into video games for the same reason Apple is launching a car and Amazon is getting into healthcare. These high high tech company have to constantly keep growing in order to justify their insane valuations, and in many cases their core businesses wont offer enough revenue to satisfy investors growth expectations',534);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (839,'Ccc0GvjuqkQ','Netflix in a lot of trouble now especially as more market competition comes in from other distributors. This move into gaming will not do them any favours.',204);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (840,'Ccc0GvjuqkQ','The reason Netflix is struggling is because they keep losing content, their own content, when it''s good, is constantly neglected, and they keep raising the price without adding commensurate value to justify it. Getting into games demonstrates that they are not recognizing what they''re doing wrong and simply trying to find a new source of revenue instead of fixing their faults. People are getting sick of having the price increased while more and more good content disappears or takes far too long to update. People are used to getting the next season of a series once every year, but many of them are taking 2 to 3 years to release, even before COVID.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (841,'Ccc0GvjuqkQ','When I first got into watching Netflix, there were a lot of low budget but very original and interesting documentaries and TV series on it. However in recent times, I feel like a lot of the diversity in the platform has gone.',53);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (842,'Ccc0GvjuqkQ','This is the problem with these big companies, their core offering starts to fail and they think moving focus elsewhere is the answer instead of making sure their core offering is decent.',412);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (843,'Ccc0GvjuqkQ','I worked in retail for most of my life and the one thing I have never forgotten is the fact that once you lose a customer you are going to play hell trying to get them back regardless of what you do.',65);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (845,'Ccc0GvjuqkQ','Honestly maybe it would have made more sense to commission more games based on their original IPs. Yeah it takes longer to come out, but you’ll get better quality and hopefully better return on investment',87);
