Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (677,'B0ga0OUkb9c','Peribahasa ‘orang tamak selalu rugi’ tu benar. Apa lagi yang tak cukup dengan Jawatan dan Gaji yang besar sebagai Perdana Menteri? Apa yang kurang dalam kehidupan seorang Perdana Menteri? Lebih menyedihkan, seorang muslim, beragama Islam, seorang pemimpin yg sepatutnya jadi teladan tapi berkelakuan sebaliknya. Semalam, beliau buat sumpah laknat, hari ni beliau ke penjara. Sedangkan semua bukti telah ditunjukkan di mahkamah bahawa ternyata beliau melakukan kesalahan, beliau masih berani bersumpah dengan nama Allah. Begitu mudah ucap dan permainkan nama Allah serta agamanya. Cukup ada seorang penyangak Najib di Malaysia ni, jangan kita benarkan dan lahirkan lebih ramai penyangak seperti Najib di masa akan datang. Jangan jadikan Malaysia kotor dan jijik di pndangan negara dunia lain.',99);
