Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1347,'kwuIWZ9wRmw','So I learned when pitchers accidentally hit or almost hit someone, they throw the perfect pitch for a homerun afterwards.',1127);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1348,'kwuIWZ9wRmw','14:42, this is the most painful one on this list if you ask me. Out of all the premature celebrations out there resulting in losses, this one''s just different. The game was over lol. It''s not like someone tripped you up before getting a touchdown. The game is literally over, all you do is hold onto the ball for a couple seconds and that''s it. The Washington Wizards were up by 3 at that point. Even if the apposing team has time to foul you, you hit just 1 free throw and it''s over. Even if you miss both, they have to somehow rebound the ball and go for a full court shot to TIE the game in an impossible amount of time... Long story short, that throw lost them the game after OT lol... Just look at his fellow teammates staring at him in total disbelief afterwards. Gotta be one of the worst throws in sports history.',116);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1349,'kwuIWZ9wRmw','9:10  The game was almost over and was a blowout at that point, (Dallas 52, Buffalo 17) yet check out Don Beebe still giving 100% effort. After the game Bill''s owner Ralph Wilson walked from the owner''s booth to the locker room and thanked Beebe for the play.',271);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1350,'kwuIWZ9wRmw','Being a Packers fan, I remember watching that game against the Seattle Seahawks where Hassleback said they were going to score in OT and when Al Harris picked him off and took it back I remember my family and I was jumping up and down, yelling and going nuts. One of my favorite sports moments ever especially with my favorite team being the ones offering the karma back at Hassleback.',67);
