Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1352,'kwuIWZ9wRmw','Context for Stanton: Fiers hit him in the jaw 4 years prior, breaking it and ending his season. First at-bat against Fiers after he was hit and he gets hit again. Absolutely justified in watching it go.',170);
