Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1355,'kwuIWZ9wRmw','4:40 isn''t even the whole story. The last time Giancarlo Stanton faced Fiers he hit him in the face, ending his season and prompting reconstructive surgery. That''s the reason he (and now many baseball players) wear face flaps on their helmets. The very next time they face off, he hits him again. Even if unintentional, that''s nuts.',65);
