Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (927,'t3L2dLPzvrM','I always adored FFVIII. My older brother gifted me with the strategy guide when I first bought it, so that may have something to do with it lol. That said, if you''re trying to 100% FFVIII on the og north american release, good luck. A strategy guide will not help you get the ribbon',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (928,'t3L2dLPzvrM','The original infamous hurt my soul. I played through the campaign twice on hard to get the platinum only to find out while I was doing cleanup that the stunt master trophy can''t be completed post game. I had all but one stunt, to knock 3 enemies off a roof at once. When you clear out an area enemies no longer spawn in large numbers, therefore there isn''t enough enemies to get the stunt. I didn''t have it in me to start another campaign. The sad part is I had tried the stunt on multiple occasions only for it to glitch and not award the stunt.',15);
