Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (995,'gYvCj3EufhA','I adopted a mindset of delaying my gaming brain by a year. If a game comes out in 2022, I wait until 2023. I get it at its cheapest and usually complete. I have been doing this with every game I buy for the last 5 years and I have saved so much money while enjoying the games much more.',194);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (996,'gYvCj3EufhA','I used to pre-order games to get the “collectible” toy that was sought after. The items got really cheap really fast. Not worth it. They also tell you that there may not be enough copies, that never happened! There was always enough copies!',100);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (999,'gYvCj3EufhA','When I think about the games I played the last few years, I must say, that I almost always enjoyed indie titles alot more than big IPs. So I rather pay 30€ for an indie title, that is really inspiring with fresh new ideas than wasting 60€+ on a broken AAA title without any innovations.',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1000,'gYvCj3EufhA','Great vid, points are spot on, only 4 or 5 years ago, feels like I bought every major release at midnight, and after Cyberpunk, Fallout, No Mans Sky, I’m never buying a day one game again.  My gaming and spending habits have completely changed.  The gaming biz can’t devolve and expect players to keep up the old pace.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1001,'gYvCj3EufhA','I havent bought a game on release for the past 6 years now. The gaming industry has changed for a while now, and its only getting worse. I buy 3~4 games per year at most and usually heavily discounted. Quality multiplayer games are a rarity nowadays, CoD and Battlefield lost their way. Quality single player games are still a thing but are often filled with bugs on release so i wait it out and buy GoTY editions usually and often second hand (gotta love disc edition systems). I refuse to fuel bad descions made by money hungry devs or publishers.',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1003,'gYvCj3EufhA','This video made me a bit sad. Made me realise how the industry has changed, and not for the better. I have young children so can’t game like I used to but when I do have time I find myself increasingly drawn back to older games that I’ve played before but adore, the vast majority of new games just don’t appeal to me. As for the new gen consoles…what’s the point, all they seem to be doing is rereleasing older gen games. Yawn',10);
