Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1078,'2MTmULlJIJE','I''ve been around for every console generation.  I remember thinking during the Genesis/Turbografx era (SNES not out quite yet) what games would be like when I was old, and the kind of specs they would need.  Obviously I had no idea what the specs really meant back then, but I was thinking "256-bit" lol.  (as for the CPU, and 64-bit is all we really need for that)  They have happily progressed faster than I had imagined, looking just as good today, if not better, then I imagined things would look like 20~25 years from now.  The 1990''s and early 2000''s with the massive clock speed increases and the advent of the GPU were the main things that took us to where we are, hardware wise.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1080,'2MTmULlJIJE','I think I''d like more deformable terrain (breaking glass, environments affected by weather systems, world changes that aren''t static and that change etc) and improved methods of moving (like verticality rather than just WASD). It feels like more fidelity comes at the expense of exploring deeper game modes. IMHO.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1082,'2MTmULlJIJE','I actually home every game system dating back to my Atari 2600. I never ever thought games would look this good. I can''t imagine how they will look 20 years from now with how fast technology keeps moving forward.',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1083,'2MTmULlJIJE','I''m over the moon hyped for The Day Before. I hope it delivers in the hype like Elden Ring did. If that''s even possible for developers other than FromSoft.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1084,'2MTmULlJIJE','Most games these days look mind blowing especially when you can remember when gaming pretty much first started with games like pong etc.',55);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1085,'2MTmULlJIJE','I think we’ve reached the point that these devs need to come up with better idea and aí. For decades now they just been able to make games look better. A lot of games are actually worse gameplay wise with stale ideas and dumbed down mechanics than older games.',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1086,'2MTmULlJIJE','These games look insane can''t wait to play some of them great list by the way',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1087,'2MTmULlJIJE','I''m so glad I built a nice high end RTX 3090 pc a year ago. It''s incredible the amount of eye candy 4K gaming treats us with, no wonder it''s the biggest money making entertainment industry on the planet. Thanks for those awesome little previews & nicely presented too, much appreciated¿',3);
