Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1169,'dC7EnOoJRrs','theory: the reason why you saw a second karl might have something to do with abandoned cars like Cristine. Karl is the first abandoned car and over time it withered and due to the desert heat its paint melted all over it making it all covered in blue paint and eventually a bunny accidently glitched in there and died and they''re soul got sucked in creating the first karl which then killed the player and over time the karl became more and more smart and even attained sentience and started converting other cars into karls and karrot and karla were his first ones which had a few problems which is why they are diffrent eventually karl found out about you and how many times you abandoned cristine and the last time you did he converted all of the old ones (he kept on finding new ones not going back and getting them back) and are now mad at you and your stupid sedan. it also explains why he keeps coming back',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1170,'dC7EnOoJRrs','Keep up the great content! Really enjoy it when you play the long drive!',9);
