Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1173,'dC7EnOoJRrs','Try dusting the cobwebs away from Karl with the duster and you might be in for a secret! As they stop from physical objects being touched like seats and items etc!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1174,'dC7EnOoJRrs','There are three types of people in this world. The ones who prefer gaming, the ones who prefer watching videos, and the one who spend their day trying to entertain their subscribers. Thank you, Camodo. You never deceive us. Keep up the good work. ¿¿ (oh and btw you know that you can refill your paint can by pressing “R” on another paint can? Even if the other can is another color it doesn’t matter).',2);
