Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1176,'tN0O_MQkF10','Gotta love Lenovo. Got the Ryzen 5600H version of this laptop with the same 3050 after seeing the positive reviews you guys gave it and I couldn''t have been happier. It was 700€ in Italy at the time. Paired with my Wacom Cintiq and a RAM upgrade it''s been the perfect little gaming and Digital painting set up.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1177,'tN0O_MQkF10','People have been going crazy for the gigabyte G5 KD going for a relativelyaffordable price for an i5 11400H and RTX 3060, would be cool to see you guys buy and review it to see how good it is',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1178,'tN0O_MQkF10','Lenovo always been crazy in the budget gaming laptop market. My first introduction to "PC gaming" was a 1080p lenovo with SLI 750m''s. Was a killer deal too. Back when the 7 series was Nvidia''s newest line. I remember looking up so many videos about its performance in games weeks before I got it. I haven''t gotten anything Lenovo since as I build my own towers now and get much more premium laptops, but I will always appreciate and respect what Lenovo does.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1179,'tN0O_MQkF10','I managed to snag a MSI GF63 thin 10UC with a i5-10500h, RTX 3050, 16gb RAM, 144Hz display, and 512gb NVME storage for 570 euros.',117);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1180,'tN0O_MQkF10','Nice. Definitely a great value.  I still have my old Lenovo 960M 4GB gaming laptop. I never upgraded it from 8gb of ram and that would''ve been an easy move for more performance. Now it doesn''t make sense as I upgraded to an Alienware with a 3080 and 32gb of ram but I still sometimes fire up the Lenovo to see what it can do in 2022.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1181,'tN0O_MQkF10','I just bought this today on best buy for 570 dollars! Love to see your making a video on it',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1182,'tN0O_MQkF10','Recently bought a Lenovo legion laptop for 539 on eBay. 4600h 1650 ti 8gb rams and 512ssd. Never been happier. Lenovo makes the best bang for the buck laptops. Also they aren’t to flashy.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1183,'tN0O_MQkF10','I got an older version of the Ideapad Gaming 3, with a 1650 but with a Ryzen 5600h, and a 512gb ssd. It''s an amazing laptop, but I bough it at the time last year for $750, not a bargain but a well balanced laptop for work and gaming',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1185,'tN0O_MQkF10','This laptop has the 4-core/8-thread i5 11300H, not the 6-core/12-thread 11400H - big difference, and you need to update your video description accordingly. Also, when you took it out of the box, the battery was not dead. Lenovo laptops will not power on for the first time unless the charger is plugged in.',2);
