Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1189,'MepGo2xmVJw','Never thought I''d say this, but I got my PS5 today. It''s absolutely breathtaking.',488);
