Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1191,'MepGo2xmVJw','Truly excellent overview; concise and informative.  I genuinely feel better equipped to make my decision regarding the PlayStation 5 after watching your review.  Appreciate you and your consistently fine work.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1192,'MepGo2xmVJw','Just stumbled upon your channel after successfully ordering a PS5 yesterday through Sony Direct. The anticipation of it getting delivered made me want to watch some unboxings and reviews. I came across your channel and immediately clicked because we have the same last name which is neat haha. I actually really enjoyed your video. It’s informative, offers great insight, and very professional while maintaining a personal creative nuance. Thank you!',98);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1193,'MepGo2xmVJw','I got the controller alone for use on my pc and I''m shocked that it works so natively well, of course none game that I know of uses the trigger gimmick... but the sound/vibration feedback works like a charm! sure it does require some set up but it works!',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1194,'MepGo2xmVJw','I honestly think Marques should start a gaming channel, only so we can appreciate him "enjoying" his tech in the way most people will do. Being very analytical and knowledgeable about tech is a great benefit to those who come to this channel, but there is a slight otherworldliness to seeing some talk about tech in a matter of fact way and not seeing them actually use it in a real world environment and showing that they actually enjoy the thing they are criticising...which to be fair no one with sense would think he doesn''t enjoy his tech but seeing it would be a great addition.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1195,'MepGo2xmVJw','The controller really is the coolest thing about the PS5, Astro’s Playroom is insane with the haptics',1148);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1196,'s2bTQK6vbKI','Can we take a moment appreciate the level of effort Norman put into this video? The research, facts, analysis and narration are top notch. I love the visual aspects like magazines, figures, gone box art and trinkets. Great job Norm!',3371);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1199,'s2bTQK6vbKI','Being an 80’s baby/ 90’s kid, It just feels like a blessing to have experienced all this first hand.',77);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1200,'s2bTQK6vbKI','This is hands down the best Nintendo documentary I have seen in my entire life. Huge video game fan. I''m 44 now and getting those memories back is awesome along with tones of things I didn''t know. Cheers!',115);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1201,'s2bTQK6vbKI','Your documentaries are soooo well written and edited. Thanks for the great content, man!',531);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1202,'s2bTQK6vbKI','I’m in my earlier 40s. I’ve found it difficult to go back and still enjoy many of the games from my youth, but Super Mario World still holds up. I think it will continue to stand the test of time with the ageless gameplay and level design. It’s a masterpiece.',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1204,'s2bTQK6vbKI','First all-nighter I had was with a friend playing Super Mario world. Will never forget it. Seeing the artwork in the instructions book that came along brings back so many memories. Remember how awesome it was when you first discovered the sta rroad?! The top secret area in the Donut ghost house? The music in Vanilla Dome or Valley of Bowser?! Damn it I wanna play now!',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1205,'s2bTQK6vbKI','I''ve been following you since the start. Always top quality and you''ve outdone yourself. Amazing video. Thank you.',14);
