Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1624,'x64iroHxmsc','Quality player is Casemiro & also a DM which we''ve cried out for. The concern with this signing though is how much more motivation will he have to still achieve having won everything multiple times over at Madrid? We are said to pay him an eye-popping 400k a week is what I''ve heard & that''s typical United, one of our biggest problems has been paying insane wages resulting in comfortable, unmotivated players who we then can''t move on when it''s time. As I say, quality player but just seems like one that may help to stabilise us a bit more again but won''t helps us achieve anything substantial. As for Pulisic, I''ve always been quite underwhelmed by him, albeit you can see he does possess good quality. I probably wouldn''t be averse to a loan though, it can''t be any worse than banging our heads against a brickwall hoping Rashford does anything productive every week.',163);
