Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1643,'G8cramghuZ8','This is a good coach. He''s clearly a floor general and knows how to drive results. This is the guy you want you to lead your team, especially if they have been so ill-disciplined like United has for the last few years. If this was basketball, he is the type of point guard you want. He''s got excellent standards and definitely the mindset of a champion.',1046);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1644,'G8cramghuZ8','As a Liverpool fan I have to say that I admire how Ten Hag approached this game, he is great to listen to. Honest and intelligent. Not afraid to leave out some big egos for the greater interest of the team, respect!',601);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1646,'G8cramghuZ8','so refreshing to have a manager who''s not afraid to make big decisions',9348);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1647,'G8cramghuZ8','The tactical position of maguire was class ¿',816);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1649,'G8cramghuZ8','I loved Ten Hag''s comment the other day about he has always had slow starts at every club he managed but he always got the job done. He has total belief in himself & it showed on the pitch last night that the players have belief now too!',327);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1650,'G8cramghuZ8','So now the question becomes, did they raise themselves just because it was Liverpool or has Ten Hag become the first coach in a long time at that club to actually instill an attitude shift in his players.',54);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1651,'90xB3D-UYd4','People are not talking about how much of an effect the altitude had on Leon it’s crazy. Bring that belt home Rocky and defend it at Wembley another W incoming mate ¿¿¿¿',2506);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1653,'90xB3D-UYd4','That “look at me now” gave me chills. It really shows what he has been through to get there. Big congratulations',253);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1654,'90xB3D-UYd4','“Look at me now!” What an iconic speech, the whole thing.',468);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1655,'90xB3D-UYd4','The most amazing thing about this is how Leon shone on the mic. He''s never been regarded as much of a talker, but this might be best post fight interview ever. it''s got it all, cold one liners, tear jerking passion, a roaring crowd and bedlam in the stadium. watched this so many times already.',89);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1656,'90xB3D-UYd4','So many people said Edwards didn''t even deserve the shot. Most underrated, most disrespected fighter in the sport. Casuals with opinions. Baffling. Look at him now! Leon Edwards is the quintessential gray man/ dark horse. He does not train at altitude and EPO dope so the altitude really affected his output throughout the fight. The headkick was well read and calculated. Incredible.',171);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2036,'G18zAn2APsc','Housekeeper here! I really thought these were going to be ridiculous, but a lot of them are actually pretty good tips. Some of them are a little extra, like don’t go to the trouble of blending up dried grapefruit peel and mixing it with baking soda, just make a paste with baking soda, lemon juice, and white vinegar. Also I don’t think flying round while mopping the floors is a hack. Maybe just take off your shoes.',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2037,'G18zAn2APsc','Can someone tell me why they never list the quantities of the ingredients, or how long to let things sit for?',84);
