Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2040,'G18zAn2APsc','These are really great ideas! Please continue these unlike your silly ones recently. Thank you and God bless you!¿',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2041,'7vqnazqmceQ','She’s a natural. This was a great Ted Talk. Truly worth every minute.',1037);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2043,'7vqnazqmceQ','I am 37 and finally realizing that I have to invest in my self and mental health or else it will be my Demise. I have made drastic changes and by sticking to them and not feeling guilty I am definitely looking and feeling better.',849);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2044,'7vqnazqmceQ','"If you dream regardless of age, you will continue to be young."',533);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2045,'7vqnazqmceQ','At a time where we’re being told (especially as women) that you don’t matter after 25 and you should live for a man, or your children:This conversation is so necessary! Well done Bevy! ¿¿',199);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2046,'7vqnazqmceQ','I’m in a transitional phase of my life at 51, and Bevy’s talk was just what I needed!',607);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2047,'7vqnazqmceQ','In the most perfect timing, this came to me. I am certainly at a point in my life where I’m choosing me. I’m rediscovering what I love and advocating for myself and making choices without regret. It’s liberating and as always a journey of unknowns but I am certain that I will live my life and not be miserable!',399);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2048,'7vqnazqmceQ','I’m in a transitional point in life at 50 as I discover what I’m most passionate about…what’s next for me. Bevy’s talk was inspiring and right on time. Cheers to “It gets greater later”!',247);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2050,'7vqnazqmceQ','it’s so inspiring yet very entertaining! I feel I needed to watch this. I’m only 26yo but I’ve felt like my life is about to end because I haven’t had many chances, but lately I’ve realized I need some inner healing and know myself better and I’ve been in that pathway since last year. gonna put those questions in practice to not forget who I’m looking for: myself. ¿¿',93);
