Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2067,'wcUWnCQGET4','for those wondering, the way how honey pot ants get their abdomens so big with fluids, it done by feeding a freshly emerged adult ant tons of food while their exoskeleton is still soft. this allows the gaster to stretch bigger than normal leading to how the ants become so plump. they do this because if a shortage of food comes, the other ants can get it from the ants that store it in their large abdomens called repletes. it really is fascinating thing to see happen.',5551);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2068,'wcUWnCQGET4','As the pinned comment already said, I think this was one of your coolest videos. It had a lot of weird but cool and fascinating clips! I really enjoy watching your content!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2069,'wcUWnCQGET4','The fruit from the cactus is actually pretty decent! It’s been a few years since I’ve last tried it but sometimes it can be kinda tangy if I remember correctly.',3);
