Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2071,'casK0pXZ5sc','In the words of the late Alan Watts. “The meaning of life is just to be alive. It is so plain and so obvious and so simple. And yet, everybody rushes around in a great panic as if it were necessary to achieve something beyond themselves.”',680);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2072,'casK0pXZ5sc','In this day and age, my life has become complicated, especially my social and digital life. I always wondered how to simplify it somehow. Thank you for making this video!',118);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2073,'casK0pXZ5sc','“Very little is needed to make a happy life; it is all within yourself in your way of thinking.” - Marcus Aurelius, Meditations',72);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2075,'casK0pXZ5sc','Perfect Video as always EZ. In today''s day & age, every person needs to remove excess baggage from one''s life and embrace the idea of simplification. Both Sense and Simplicity are the two most significant aspects of our lives!',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2077,'casK0pXZ5sc','I just love how this video is an amalgamation of all the past videos you have produce so far. Thanks again for this wonderful food for the thought Eizelgänger ¿',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2078,'casK0pXZ5sc','Thank you, Einzelganger, for these mentally nutritious videos that you make for us to feed our minds.  Peace.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2079,'casK0pXZ5sc','Good summary!  When I crave something I imagine as realistically as possible that I already have it.  This helps me know if I really want it.',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2080,'casK0pXZ5sc','That last point is really true. It''s not about simplifying all aspects of life just for its own sake. Rather, the point is for a more tranquil life. Thanks for the video.',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2082,'bAD3tHU6Gss','Crazy how this series went from kinda light-heartedly debunking ice cream icing and coke watermelon lifehacks to discussing about actually life-threatening stuff. Thank you Ann, you''re doing amazing work <3',2835);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2083,'bAD3tHU6Gss','They used to *kind of* have a "can I trust this" feature. It was called the dislike count. Not that this ever stopped 5-minute crafts.',732);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2084,'bAD3tHU6Gss','I''ve been vaping on and off for 5 years. Having my "honorary internet mom" sound slightly disappointed in me made me throw everything out and I haven''t touched anything since this video came out. It''s been rough but thank you for making me take the first step in getting healthier!',330);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1762,'LWxUb_dwd-0','I know I love mismatched furniture! One of the ways I’ve been looking to accomplish this is by using slip covers! Amazon has some great ones with a variety of colors and patterns! (And very affordable! ¿)',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1763,'LWxUb_dwd-0','Love your videos Kristen, so brilliantly put together and such a lot of fantastic tips. Thank you very much ¿¿',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1764,'LWxUb_dwd-0','Hi Kristen. In your videos you''ve talked about grounding your furniture by using a large rug which looks great. What if I have carpet? Is there anything I would need to incorporate to make the furniture appear grounded in this situation? ¿',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1765,'LWxUb_dwd-0','I would love some tips to decorate a  small but high ceiling living room! It''s been a struggle to find inspiration!',55);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1766,'LWxUb_dwd-0','Hi, Kristen, I love your design tips. My husband is insisting on getting a recliner sofa. Can I mix them with fabric accent chairs ? And do the furniture in the living room have to be of same height ?',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1767,'LWxUb_dwd-0','Love the advice you give! This is something I need to do in my living room! Nice work!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1768,'LWxUb_dwd-0','Love your contents. Will definitely consider your tips in my room design journey! Thanks a bunch.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1769,'LWxUb_dwd-0','Great video as always.  Loved the TV nestled within the gallery wall. Good idea. Also, I love every opportunity to look at your living room.  You did a fabulous job on that room. One of my favorites .',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1770,'LWxUb_dwd-0','Kristen, you''re like the only YouTuber I constantly watch! I feel like I connect with you in so many ways!',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1771,'VRJzvJ5XPQI','Confidence isn’t “I know they’ll like me”, it’s “I’m okay if they don’t”.',20076);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1772,'VRJzvJ5XPQI','He''s right. I''ve always loved studying the gestures and language of appealing characters and I come across as confident most of the times, to the point where people are surprised when I tell them I have anxieties and various inner struggles like we all do. It''s not about feeling perfect, it''s about knowing you deserve to be where you''re at and accepting that you might feel uncomfortable at times.',332);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1773,'VRJzvJ5XPQI','I think "fake it till you make it" is really important when it comes to confidence. You need to practice it in order for it to start coming naturally. Appearing confident, even when you don''t feel confident, I believe, can prevent confrontation or becoming a victim (in some circumstances).',807);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1774,'VRJzvJ5XPQI','Anyone who has seen an infant stare at someone unselfconsciously, or do almost anything that infants and pre-toddlers do, will understand that we are indeed born confident. I think fear and inhibition are learned, and later have to be un-learned if we are to regain our initial confidence now that we have an intellectual understanding of it.',122);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1775,'VRJzvJ5XPQI','Honestly I feel like confidence comes naturally when you care about something so much that you are no longer sensitive to how people see you and how you appear in front of others. Like Jane Goodall or Colin Powell - I''m a person that has a mission that''s important to me, plus huge experience and knowledge that built me, and I''m proud, and what the world thinks is not my concern.',414);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1776,'VRJzvJ5XPQI','"confidence can be very quiet" - finally someone said it, thank you!',13732);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1777,'VRJzvJ5XPQI','I was born confident and as a little girl I was constantly scolded for being too bold or outspoken. Now I own it again and found joy in life like when I was true to myself.',719);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1778,'VRJzvJ5XPQI','The presenter here delivers his knowledge succinctly. He IS the example of what he is teaching. Thank you for a concise,  no extraneous lesson.  It is has been immensely helpful.',130);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1779,'VRJzvJ5XPQI','I have ADHD so usually it''s hard for me to focus on talks, speeches and so on. But when someone is really good at speaking and confident about what they''re saying, I tend to pay more and even full attention. I paid full attention to this video and even remember what I learned after watching only once. This is my 2nd time here! Just to make sure I don''t forget :)',165);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1780,'VRJzvJ5XPQI','To me confidence means being happy with who you are. Having that inner peace with the person you are.',87);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1781,'4jwUXV4QaTw','This guy''s body language tells me that he is uncomfortable with this interview and that he is withholding information.',54999);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1782,'4jwUXV4QaTw','He’s definitely someone who can make you admit everything just by his personality',1424);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1783,'4jwUXV4QaTw','An important caveat is that when interviewing anyone, you need to establish a “baseline” for their individual body language. Maybe they are naturally more nervous or nervous because of the situation. So you first ask questions you already know answers to to see how they react. Watch how they move when they tell the truth. Figure out their “normal”. Then, you can ask calculated questions and see if there is deviation. You are looking for *clusters* of indicators - not isolated indicators.',515);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1784,'4jwUXV4QaTw','I''m glad that those "signs" he laid out at the beginning were myths. I''ve put so much effort over the years into avoiding showing these signs by accident so I don''t come across as untrustworthy, and when I do them by accident I always felt like I''m somehow maliciously deceiving people or myself without knowing about it. This puts my mind at ease - self-soothing, if you will',347);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1785,'4jwUXV4QaTw','Love that he first mentioned crossing arms and looking away. I cross my arms often to relieve anxiety and I usually tend to look away when being explained something because I''m visually processing information they tell me.',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1786,'4jwUXV4QaTw','god his children must’ve had such a hard time lying to him',101501);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1787,'4jwUXV4QaTw','The guy is giving a simplified summary for total beginners and people think it is an exact account if the methods they use. Agents have spoken with innocent and guilty people, their knew how to account for simple nerves and a guilty person. They know how to establish a baseline to account for individual traits. And most importantly, none of this can be used too convict you. They can''t just say "yep he''s the murderer, he is lying" and throw you in prison. It is just a tool to help then when interrogating so they can have an idea if when they are being lied too, or who they should focus on. They still need to investigate and find actual  PROOFV to convict you. If you didn''t do it, they can''t convict you just because you seemed like you were lying.',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1788,'4jwUXV4QaTw','I remember I was in an argument with a friend if mine and I crossed my arms. She instantly called me out on it and said if I''m being open and honest then why did I cross my arms. Thats a defensive stance. Later I found out that this was meant and a self sooth which I find more realistic. That situation was stressful for me so crossing my arms made sense I do that when I''m anxious or upset',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1789,'4jwUXV4QaTw','This is the most interesting thing I''ve seen in a long time. I can feel this guy''s passion and attention to detail. The way he described seeing pertinent nonverbals jumping out at you as if a caricature when played at double speed was INCREDIBLY perceptive. I''m so intensely interested in this individual and his affinity to human behavior.',40);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1790,'4jwUXV4QaTw','my dad was a Drill Sargent in the Army, he had the ability to read people''s behavior like this..it was unnerving to have him explain my behavior to me',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1791,'ZRjKX1-ilwo','I’m honestly starting to get the impression that being a French woman means putting 100% of your energy into being the sexiest woman in the room but then pretending you don’t try at all',9396);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1793,'ZRjKX1-ilwo','Alexa Chung pretending she''s not incredibly stylish for 15 minutes.',4774);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1794,'ZRjKX1-ilwo','I lived 2 years in Paris and I used to observe a lot in the metro their outfit. I noticed that blue, beige and grey were the colors most used to dress, no patterns, only simple color. So simple and stylish at the same time. It is the opposite of us Italians. We like be noticed by accessories or colors. I prefer the French Style',861);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1795,'ZRjKX1-ilwo','I love what Camielle said about french girls finding what suits them, their body, and what they like and dressing according to that. Not following trends but buying staple pieces that will fit your wardrobe and last a long time. I really love that. Fast fashion has ruined our sense of style. Some people only buy a piece because it''s "trendy" then the trend passes and they forget about that item and throw it out and the cycle continues with the next trend...',491);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1797,'ZRjKX1-ilwo','I bet a lot of French people are rolling their eyes at this.',1884);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1798,'ZRjKX1-ilwo','I love how they are like actual friends; talking over each other, interrupting each other, not listening, the little laughs. I love it',332);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1799,'ZRjKX1-ilwo','she''s so on point with French styles, they don''t follow trends, but stay to the classics with some accents of edginess or accents of new trends, but the root is classic and simple',198);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1800,'ZRjKX1-ilwo','This girl really has an Aussie feel to me. Funny that she’s British/French which you can see in ways but so much of her reminds me of my Australian friends',550);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1802,'v6BmurUpiN0','Always good to hear your thoughtful and logical analysis. I don''t care about bullish or bearish market. Trade a small percentage of your portfolio rather than going in and out every couple weeks trying to time the market trading went smooth for me as I was able to raise over 8.4 BTC when I started at 3 BTC in just few weeks implementing Richard and tips..',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1803,'v6BmurUpiN0','This was a fantastic talk. Its a topic we are all somewhat aware of but we need to dive deeper like this individual. Thank you sir.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1804,'v6BmurUpiN0','Very well put. I love how ted talks are short but convey meaningful messages',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1807,'v6BmurUpiN0','Nicholas Carr described this "scanning vs deep reading" phenomenon in great detail in his 2010 book "The Shallows, What the internet is doing to our brains" and is worth a read for anyone with further interest  (and he provides provocative evidence it changes the mechanism our brain uses to process and store information)',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1808,'v6BmurUpiN0','I always tell my wife, It''s not about how you feel, it''s about how the other person understands what you gonna say. And for God sake, keep it short but clear.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1809,'v6BmurUpiN0','That hit home! I''m so guilty of spending hours writing/answering  emails etc with what I would think makes me sound  strong intelligent and a force to be respected and would read them back to myself  countless times to see how good l looked....l loved this talk and  will TOTALLY  change  now ..K.i.s.s. keep it simple stupid',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1812,'n3kNlFMXslo','This is hands down one of best talks I have heard. Thanks for such a wonderful lesson!',52);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1814,'n3kNlFMXslo','Make yourself a three-category priority list for the coming week: career, relationships, self and there should be 2-3 items in each category, small moments can have great power. you can use your bits of time for bits of joy. Even if we are busy we have time for what matters. (quoting her)',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1816,'n3kNlFMXslo','"We don''t build the lives we want  by saving time. We build the lives we want and time saves itself." ¿',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1817,'n3kNlFMXslo','I''ve had varying work schedules and it was incredibly hard to adjust to night shifts at first mainly because it was hard to find time to hang out with friends and family. This video has taught me that priorities can change. They might take some getting used to, but it showed me that a night job doesn''t have to mean no social life.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1818,'n3kNlFMXslo','" Every minute I spend is my choice " how great is this sentence',202);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1819,'n3kNlFMXslo','I like her approach and It''s partly right but I do believe that the things that we want to do during the week could be postponed for other reasons too and not only because we don''t count them as priorities. For example,  it''s not the same having free time in the morning and having free time at 23:00. The opportunities for doing certain things are less (kids are in bed, shops are closed etc.) Also, when you want to meet other people you need to find some hours in which you are both free and it''s not super easy to happen',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1820,'n3kNlFMXslo','I love this woman''s attitude! She''s funny, captivating and interesting too! For me, step 1 of controlling my time would be to stop watching YouTube though...',2315);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1822,'kARkOdRHaj8','You will continue to suffer if you have an emotional reaction to everything that is said to you.  True power is sitting back and observing things with logic.  True power is restraint.  If words control you that means everyone else can control you.  Breathe, and allow things to pass.',978);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1824,'kARkOdRHaj8','This only works if all people involved are reasonable. If one or more parties can''t be reasoned with, then the problem continues. You can communicate until you''re blue in the face, but if the other person isn''t willing to communicate appropriately, then you''ve hit a brick wall.',505);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1827,'kARkOdRHaj8','Cannot communicate with sociopaths on any reasonable level. People who cannot empathize will never see things from your point of view. Someone who is a sociopathic master manipulator can only be dealt with by affecting what matters most to them, money. Unfortunately, office sociopaths who gaslight daily rarely get reprimanded. They have everyone else in the office convinced they are wonderful and that you are the problem. Best solution is to remove yourself from that environment.',870);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1828,'kARkOdRHaj8','I swear I need this to deal with my whole family ¿',712);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1829,'kARkOdRHaj8','This puts a whole new perspective on the way I think about others actions and my reactions. I can''t change people but I can change the way I think and feel. And also asking questions is another good point, very well said!',61);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1830,'kARkOdRHaj8','Heart attack beautifully explained and to the point ¿¿It’s after all your life which matters, and someone’s behaviour should not make you suffer',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1832,'CyElHdaqkjo','How to raise a successful kid without over parenting? Make sure they understand that life isn''t about high grades and a big bank account. Make sure they understand to grow up kind and compassionate, happy and making others happy.',1926);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1833,'CyElHdaqkjo','My mother used my “successes” as her gauge to show approval and basic humanity. It was never enough for her to show love, only maybe enough to prevent the threats of leaving or avoid hearing that I was a complete failure. Take it from me, don’t push your children towards your goals; it only teaches them that they aren’t good enough to make it on their own. I was “successful” in school and was the first in my family to get a degree, but I was also the most miserable, sad child of all 10 of us kids. Is that success? I know it isn’t.',213);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1834,'CyElHdaqkjo','We are imperfect people trying to raise perfect children. Go figure.',2235);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1835,'CyElHdaqkjo','Lol I’m 14 and I’m already trying to figure out how to raise my future kids correctly¿I just see a lot of my friends suffering because of their parents and I’m like “nope, not gonna be me”. I plan on collecting knowledge throughout my teenage years so when the time comes I’ll hopefully be a good mom.',326);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1836,'CyElHdaqkjo','I''m crying so hard my heart aches because I feel the pressures of the children from narcissistic parents who control their children "too much" and destroy their self confidence.  This speech is a breakthrough.   Thank you.  I love this.',138);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1837,'CyElHdaqkjo','My parents used to be like that. Then, when I got into the perfecte degree in the perfect college, I had a breakdown that left me bedridden for a whole year. They realized what had happened and now they are being absolutely amazing, understanding and encouraging-but-not-overbearing parents to my little brother (and to me as well). I love them so much, and I respect and admire them so much for havig the courage of admitting their own shortcomings and to truly rethink their parenting style to become better for their kids ¿¿',106);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1838,'CyElHdaqkjo','l honestly think that we , adults, are victims of bad parenting. What''s worse is that we are repeating history on our offspring!',682);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1839,'CyElHdaqkjo','The best parenting talk I''ve heard about parenting and the vital importance of having kids to do chores!',343);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1840,'CyElHdaqkjo','My father who passed away in August 28th, 2021, taught me to do chores at home. Laundry, dishwashing, cooking, house cleaning, taking care of my younger brothers. Now my wife is so happy she married me because I do our own chores without complaining, Thanks Pops. Miss you.',158);
