Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1848,'joAOl1CVlpE','I would like to argue that declaring you quit the death game and that the girlfriend can save herself is perhaps the worst way to test the game master in that situation. Yes, figuring out a way to determine why the game master is helping you is a good idea, but if the only reason they''re helping you is because they''re impressed with your selflessness/willingness to risk your life to save hers/they have a connection to the girlfriend, then say goodbye to your main advantage in this game. I''m not sure if there is a good way to definitively figure out their motivations in one declaration/action, but you could run some tests over time to see which actions get rewarded and make more declarations as to your own "motivations" to see if that has any effect, but make them less obvious and less likely to cause the game master to completely abandon you.',287);
