Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1859,'115amzVdV44','Hey, some time ago I got my new ASUS laptop with AMD Radeon. But today I spilled water on it! So I searched up How to fix a water damaged laptop and your video had 50M views, so I clicked on it. And it worked perfectly! I fixed my laptop in 5 minutes without any problems! After doing every steps, I pressed on the power button and it started up without any problems. Thank you master for saving my life, without you I would be dead. Oh and my dad finally came back with the milk!',4);
