Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1871,'La9oLLoI5Rc','I watched this a year ago. It completely changed my life. Got rid of 15 years of depression, loneliness. Lost 15 kilos of weight, got 1200 metres more to my cooper test, turned my company from the gates of bankrupcy into profit, estiblished 3 more companies. Not been sick once after this. Basically addicted myself to the positive.',14917);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1872,'La9oLLoI5Rc','KNOWLEDGE IS POWER, BUT KNOWLEDGE ABOUT YOURSELF IS SELF EMPOWERMENT ¿¿',405);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1873,'La9oLLoI5Rc','When I did cord cutting, meditate in my sleep every night, every morning when I wake up, before or after lunch and as needed, I was able to let go of obsessing over thoughts, anxiety and memories with strong emotions attached. So true what he’s saying. Can’t wait to see how far this goes, I’m just getting started. This is healing, this is what healthy living is.',183);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1874,'La9oLLoI5Rc','I highly suggest listening to this multiple times. Each time I listen to this it hits different my understanding expands.. hope this helps someone…',413);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1875,'La9oLLoI5Rc','The more you know about yourself, the stronger a position you''ll be in to make your life what you want it to be.',5);
