Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1879,'La9oLLoI5Rc','I watch and listen to this message at the moment of writing. I hope this powerful message can change me to live in new world. Not thinking and living in the past!',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1880,'La9oLLoI5Rc','Dr. Joe is absolutely brilliant, life changing. I''ve been doing the meditations for 3 months now every day and can really feel a difference. I was very stressed and suffered from anxiety and this is just beyond amazing. Thank you Joe, thank you thank you thank you, need more people like you on the planet',146);
