Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1883,'0R4Bk73HDLk','i love how in the triangle room game instead of just ignoring the dumbest person in the room they used his imagination and creativity to figure out the solution',113);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1884,'0R4Bk73HDLk','For the platform game, just have each person make a prolonged sound while slowly going and laying down on the platform. That way, you can easily tell if there’s a wall between you and them by whether the sound changes :)',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1885,'0R4Bk73HDLk','21:52 I''m pretty sure that wouldn''t be enough to destroy his plan. If let''s say one of the three people with the wall managed to answer the question correctly, that''s still 2 options eliminated. And with how fast Shirube came up with his  first plan, he had more than enough time to devise a second test to figure which of the remaining two directions was the correct one.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1886,'0R4Bk73HDLk','For the platform game, I think the second go was almost perfect. If he found a way to obscure his hands and ask a loaded question, then it would’ve been foolproof. Like if he kept a coin and hid it somewhere on his person, then asked everyone which hand held the coin. That’s not a perfect solution, but that’s the kind of question I’m thinking of. One where if you choose an obvious answer you know they’re lying, and the only one telling the truth would give you a third answer',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1887,'0R4Bk73HDLk','In the platform game, what if the guy asked the other people to go to the corner of the edge of the platform and reach their hand out so he can grab it. Since there''s only a small opening in the center, they wouldn''t be able to do it, and the distance seems to be close enough for this to work.',1184);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1888,'0R4Bk73HDLk','This guy’s definetly a genius.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1889,'0R4Bk73HDLk','For the spinning platform I have an easier solution, once you see which way is safe to jump, and they put the mask on, put your hand on one of the corners of the platform while facing the safe area, now when the platform rotates count how many turns it has made by feeling with your free hand the position of your hand on the corner being able to count how many rotations made gives you the idea of where you are and where to jump',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1890,'0R4Bk73HDLk','As for the spinning jump game, the voices from the people behind the wall will have less compare to the voice without the wall. With that alone it will be very easy to figure out.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1892,'RpaxxN8jTHo','The best thing I started doing to wake up is to leave my phone on my desk across the room, so I can''t be on my phone before bed and I have to stand up to turn off my alarm. Just forcing myself to stand up in the morning stops me from snoozing my alarm.',351);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1893,'RpaxxN8jTHo','Just so you know, I''m from Brazil and this video saved me. Thank you. Finally the algorithm got the recommendation right!',94);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1894,'RpaxxN8jTHo','I was constantly exhausted no matter how much I ate or slept. It was affecting my job, my workouts at the gym, even my free time. I felt terrible, like I was sick or something. I finally went to the doctor and found out I had an iron deficiency, so my doctor put me on supplements and offered me an infusion and I feel so much better! So it''s definitely worth getting bloodwork done and going to the doctor''s on top of all these great tips :)',141);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1895,'RpaxxN8jTHo','My thing has been the shifting of schedules to match my chronotype. Just.. the violence of waking up at 6h30 was unbearable for me. And when I went to college and picked classes that started at 10 at the earliest, it was a game changer. I am not sleeping more hours (maybe less hours even, because college), but I am never truly tired anymore.',111);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1896,'RpaxxN8jTHo','The early bird and night owl thing totally makes sense. People would have to take turns defending the tribe, so different sleep schedules makes sense.',3049);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1897,'RpaxxN8jTHo','I’m a nurse & I work Night Shift, but even working nights, following these tips is so important for me! Some people think I’m crazy for staying on a night schedule even on my days off, but it’s like you said, it’s so hard on your body to not just stay on one schedule! My blackout curtains, sleep mask, & extended release melatonin are my best friends after a shift & a hot shower!',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1898,'RpaxxN8jTHo','There was one single semester in undergrad that I was able to set my schedule up so that everyday I had a class start at 10:00 a regular lunch break and evening classes that ended by 6. And my dorm happened to be a single with a LOT of windows and natural light. Having a consistent schedule that matched my night owl rhythm and light regulation was the best sleep I ever felt (it was also the most consistent I’ve ever been in the gym since quitting high school sports) Followed by a semester where classes started at either 8:30 or 2pm on alternate days and my worst semester both grade and mental-health wise',48);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1900,'RpaxxN8jTHo','Great advice, all of it! I''m one of those you mentioned near then end, with a medical condition. Sleep isn''t rejuvenating for some, no matter how much we get. Working towards good sleep habits is still helpful, as it regulates our lives and helps us pace what minimal energy we have, so if you''re reading this comment, no matter if you''re chronically ill like I am, or just a tired person without a debilitating illness, practice good sleep habits. Be patient - it''ll help.',11);
