Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1923,'ZJy1ajvMU1k','I know you don''t read your comments Gordon, however I''ve just ''practiced'' making rice and it turned out better than anticipated! 50g of rice and 150ml of cold water and I followed the method you described. You did say 8 to 10 minutes and I gave it 9. The result was extremely satisfactory and I combined it with some leftovers and have had a lunch with no waste. I know how to do the onion as my daughter has already shown me. I''m off out shortly to buy a steel as I usually sharpen my knife on a whetstone, which can be more of a chore than using a steel. I''m 61 and everyday is a schoolday.... I''ve so wanted to master rice:-) Cheers!',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1924,'ZJy1ajvMU1k','Amazing energy, He makes me actually want to cook, his enthusiasm is contagious and this just pasta and simple stuff, can''t imagine the level of passion he exudes on a complicated dish.',6);
