Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1926,'ZJy1ajvMU1k','one of the reasons I like Gordon is he seems genuinely enthusiastic about cooking, and super happy to teach you what he knows. His vibe isn''t ''ooh I''m a fancy chef I know better than you'' it''s ''cooking is fun! let''s do it together! you did something I''ve never tried? How cool!!''',2555);
