Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1951,'m7Jw3a7CpNA','This is one of my favorite blogging videos to film every year ¿  Hope you enjoy & happy blogging!!',77);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1952,'m7Jw3a7CpNA','Love your honesty! I started a blog in college too (Roll Tide) but that was 2009! I was never really consistent until now! Your videos helped me realize how important consistency is ¿¿',49);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1953,'m7Jw3a7CpNA','Thank you so much for sharing all of your tips and tricks! You are seriously such an inspiration. I am currently trying to start my own blog, and it is harder than I thought it would be to juggle school, work and starting a blog . I am so grateful for your content, and everything that you share!',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1954,'m7Jw3a7CpNA','Sophia you are such an inspiration!! Thank you for being radically honest and giving tips that are actually very helpful. I''ve been binging your content and plan on building a blog this year. Cheers to 2022!! Let''s get this bread!',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1955,'m7Jw3a7CpNA','One of my favorite video series, please keep them coming.  You''re such an inspiration to a lot of people.  I''m in the middle of starting and re-starting my blog / social media presence.  My biggest downfall is consistency but hopefully now that my little one is in school I''ll have more time!! Thank you again love love love your blog and videos - they truly motivate me.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1956,'m7Jw3a7CpNA','Watching your videos feels like taking a great course in itself! Thanks Sophia ¿',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1957,'m7Jw3a7CpNA','You are right about Pinterest- I have #60K monthly visitors and only now starting a  blog and looking for advice- and I agree about the classes and also learning from others- are are already successful and implementing their strategies to your blog. Well done! I wish I had had the capability to start a blog- when I was in college #80s girl. TY Sophia- beautiful presentation & easy to understand - your points are well made.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1958,'m7Jw3a7CpNA','Love love your courses BTW!!! I highly recommend anyone to do it if you are on the fence about it. This is our year babes!!  P.S. Sophia I’d love to see more videos about your design biz. <3',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1959,'m7Jw3a7CpNA','The most genuine and real advice about blogging I have found. Seriously so encouraging and straightforward!',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1960,'m7Jw3a7CpNA','If you do not mind me asking, what was your major in college? And did it help you towards your progress in blogging/business?',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1961,'KmOAznOQX-g','Believing that no matter what happens you’re going to be fine anyway is always a great mindset to have',44924);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1962,'KmOAznOQX-g','"You''ll stop worrying that someone will reject you because you''ll never reject yourself."  That is brilliant! Well done!!!',1949);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1964,'KmOAznOQX-g','Realizing that no matter what happens, I''ll be okay, is exactly how I survived my childhood. I used to stress so much then after so many dramatic plot twists, I realized if I survived all that, I will survive whatever else comes my way and that''s when I stopped stressing as much. I hadn''t really connected it with confidence before but I can see the connection now. Interesting. ¿',486);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1966,'KmOAznOQX-g','Practice keeping your word everyday you’ll really gain confidence. Every time you say you’re gonna do something and don’t do it, your self-esteem diminishes no matter how meaningless the task may seem. Take your word very serious.',10485);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1967,'KmOAznOQX-g','One thing this video misses, and probably the one most important thing is that confidence comes from within. You can stand in any way you want, dress as fancy as you like and have enough money to make king Solomon blush, but if inside you’re still insecure the world will see it. Love yourself, know you’re worthy, and never let the outside effect or diminish the inside. Don’t try and be or imitate someone else, be who you are and love it. One thing this video gets right: Know you’re gonna be ok no matter what. ‘Nough said, love to you all xxx',103);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1968,'KmOAznOQX-g','You reach true confidence by letting everything go.',138);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1969,'KmOAznOQX-g','If you spend time getting to know yourself, and learn to love and accept that person then you strengthen the most important relationship of your life, the one you have with yourself. If that relationship is solid then you always have an inner safe haven no matter what is going on around you. That self love and understanding allows you to stay true to yourself in every situation, that is the deepest form of confidence.',76);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1970,'KmOAznOQX-g','This is the most incredible,understandable video on confidence  I''ve came across by far , keep it up honestly .',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1971,'BL4DCEp7blY','This could not have come at a better time!! I''m literally building my first PC THIS WEEK!',5438);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1972,'BL4DCEp7blY','I''ve wanted to build a PC all my life but been too scared of breaking something to try. this week that ended with my first successful build, big thanks to this video!',613);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1973,'BL4DCEp7blY','I have been building custom computers for 25 years and I still found several things in this build guide that I did not know. Nice job LTT.',378);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1974,'BL4DCEp7blY','I''ve also been building computers for about 20 years.  The main reason why these videos are the paramount of PC builders is because he and his friends are entertaining as well as informative. I am always learning.  To be a leader,  one needs a team and one person can''t do it all.  Good jobs guys.',476);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1975,'BL4DCEp7blY','Just a reminder: for older motherboards or cost-cut motherboards, if you have a CPU with iGPU or onboard graphics solution, even if you have a graphics card there is a good chance that it will default to the motherboard''s graphics solution first and you will need to configure the BIOS to use the external graphics for pre-boot display. This has become less common, but is still important to remember.',75);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1976,'BL4DCEp7blY','This is peak LTT. I can imagine how proud the team is putting this together!',1341);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1977,'BL4DCEp7blY','I''ve built plenty of PC''s over the years, I''m not necessarily the target demogrpahic for this. But my goodness this is a fantastic video, I learned plenty in here despite my experience. Great job guys.',139);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1978,'BL4DCEp7blY','Ok wow! This was EXTREMELY helpful! I''m still just in the planning/saving up stage for building my own PC and this whole video was so insightful and made me excited to get started. Thanks guys!',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1979,'BL4DCEp7blY','See, people appreciate the work that goes into creation of such high quality videos! That''s what makes you guys stand out so much',40);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1980,'BL4DCEp7blY','As someone with exactly zero experience with building computers, this was invaluable. I followed along step by step and actually built a working (budget) gaming rig! Thank you all so much for this video.',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1981,'mWQTgSt7GeU','This is very valuable advice. It’s easy to overthink and completely lose track of your end goal. This can be detrimental to your future. Thanks Ali!',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1982,'mWQTgSt7GeU','Future wife?! We''re going to have a "how to have a productive bachelor party/wedding" series soon ¿¿So true that social threats get us all wound up. Viewing things as an experiment takes off a lot of pressure because you''re focusing more on the process than the end result. I like that mental board of advisors thinking. Great video, Ali ¿',423);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1984,'mWQTgSt7GeU','The best way to stop overthinking is understanding that no amount of overthinking will lead to positive results. In fact, all it will do is cause more stress and anxiety for yourself, more likely leading to the problem only getting worse.',93);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1985,'mWQTgSt7GeU','You can''t give up now, it''s just a season. Whatever you are going through. No matter how hard it is... It will pass. Better days are coming ahead ¿¿',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1986,'mWQTgSt7GeU','I’ve been an overthinker my whole life too so it’s really cool to see someone I look up to discuss this and explain how to move through it. I’ve been talking myself through these moments of paralysis but these tips seem much more helpful so thank you! I’ll give them a try ¿¿',69);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1989,'mWQTgSt7GeU','I can’t even imagine you being an overthinker because of how chilled you are (vs me being super neurotic and overthinking everything) so it’s good to hear you talk about this ¿ also future wife, that is so cute ¿¿',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (1990,'mWQTgSt7GeU','Hi just want to say that many times ruminating is emotionally driven… there can be an uncomfortable feeling and our mind jumps in to try to either make us feel better or dwell on that feeling and feed more into it.  So shifting from our mind and into our body sensations can actually be really helpful and grounding and even illuminating.  When we ignore our feelings our body often starts shouting at us to get our attention, so just listening to what our body is saying, acknowledging the feelings and fears, can be very clarifying and soothing.',6);
