Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2001,'lHgw32F_0wQ','Ann, I''m 47 and when I was little my mom would take me to the public library. There was a wonderful woman that would read stories to the children and give the adults time to find what they needed. She would read fantasy books with dragons and fairies, it was such an amazingly positive time in my life. You sound just like her and when you are making something or saving something you give me that same feeling of wonder and joy watching you work your "magic"! This is one of the best channels on all of YouTube, thank you Ann for everything you do!',2458);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2002,'lHgw32F_0wQ','This series gives me confidence that there''s always a way for you to mess up and there''s always a way for you to make it better. So, be hopeful everyone and Thank you Ann ¿',1763);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2003,'lHgw32F_0wQ','One of my favorite cakes my mother ever made started out as a near fail. It was a cheesecake that had cracked down the middle. We had blueberries growing in our yard, so she took a bunch that we''d already picked, cooked them down into a thick jelly, and poured it into the crack. As I recall, she called it "Grand Canyon Blueberry Cheesecake."',914);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2004,'lHgw32F_0wQ','The pool cake was so cute! "Put an appropriate toy depending on what character your child is currently obsessed with", I''m 20 and I would still absolutely love to get a cake like that.',1098);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2006,'lHgw32F_0wQ','just woke up at 6am, nothing like an upload from Ann to start off our Fridays! the effort you put into every single video you make is just *chef''s kiss* easily the most informative and creative baking channel I know (and it goes so far beyond that as you''ve shown time and time again)',768);
