Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2021,'zjsUbMf_t2c','**The movie explains how to kill him** You need to make him be afraid you. What ever he turns into, you need to face that fear and fight back. Once Pennywise realises that you aren''t scared, he will begin to starve because he "feeds" off of fear. Once he starves, and is weakened, you can finish him off for good.',319);
