Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2024,'zjsUbMf_t2c','The reason why Pennywise said fear when he was defeated is not because he will spread more of it. It''s because he is feeling fear. And he let go for 2 reasons. So he can go down to his lair and because he''s in shock',3);
