Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2026,'zjsUbMf_t2c','I''m not entirely sure of how I stumbled upon this channel, but as an avid hunter of movie/comic book lore, this channel is absolutely amazing. Kya is such a legend. The level of passion she demonstrates in these videos is real, and her narration is superb. I am very thankful for the fact that this channel even exists. 5/5, liked and subscribed.',78);
