Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2350,'MN7yfV4UuCI','Great video.  But let me talk about something important, I see many young and old make mistakes that I think should not be.  I believe that everyone, young or old, should have an investment plan that increases their financial returns from three figures to six figures.  The investment can be your retirement plan or future plan, depending on what you want, but what matters most is that you have an investment that is profitable.',247);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2351,'MN7yfV4UuCI','I''m new to crypto currency investment, started with MT5 and I''ve been making losses trading myself. Any advice please?',32);
