Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2355,'oSQkwtUBwx0','Ive been a painting contractor for 35 years, just me and my brother, except for the first few years when the winter was a little tricky we''ve been super busy the whole time. All residential, we have a van , a paint sprayer and a powerwasher  and a bunch of ladders and basic other supplies.  Get good at something nobody wants or has time to do and you''ll always be busy. You must do excellent work as well. All our customers are our sales agents. It has a low overhead. You can expand if you want  with employees but that does make it a bit more complicated',271);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2356,'oSQkwtUBwx0','I knew a guy that had a side business laundromat.  He put his two kids on the payroll while they were in college, essentially his kid''s college bills were tax deductible and the kid''s income was so low they did not have to pay income tax on the income.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2357,'oSQkwtUBwx0','Sir, had you mentioned the profitability in each of these business along with the headaches of maintenance like maximum in dump trucks, additional knowledge required, employees required etc your video would have been excellent. By the way, real estate rental business is the best with adding appreciation. Good luck.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2358,'oSQkwtUBwx0','There is always a risk associated with starting a business - I agree with this! That''s the reality, not all of the businesses are most likely to succeed, but it is always up to us whether to persevere for another day or to just give up. It is important to build a business you are passionate and compassionate to continue every day. Don''t forget to invest in your knowledge and your business'' improvement, rather than on growing profits alone.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2359,'oSQkwtUBwx0','I worked at a large Grocery Store for 4.5 years. Upstairs in the break room they had a soda and two candy/ chip vending machines. They were owned by a local outside company that did a TON of vending machines in this area.. I asked the GM... why not spend a couple grand and SAVE a tone of money, we are a grocery store, WE sell everything in these, and could cut the cost in half and still make a profit. She agreed and walked away.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2360,'oSQkwtUBwx0','Awesome video - thanks for the great information.  I own rentals too and love it..   It takes some time to figure things out, but that''s true of anything.  Keep up the great work and look forward to more videos!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2361,'oSQkwtUBwx0','Well explained sir ¿I am very excited about the prospect of using cryptocurrency, not just as a money equivalent, but using it as a way to earn something as a result of doing some type of work.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2362,'oSQkwtUBwx0','Where I live I have NEVER seen a betting shop close down - one round the corner from me has been open for over 50 years. There''s a constant stream of customers going into these places and even with internet competition they still seem to thrive. Betting shops is where I would strongly consider investing it. Cigarettes is another one, BAT share price just goes up and up. Warren Buffet loves the tobacco industry and who can blame him with those huge profits. Even with all the bad write up about the dangers of smoking people still do it as it''s so highly addictive. Two businesses that just don''t fail - betting shops and cigarettes, they even have a strong link !',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2363,'cIMM4TJMDRI','Love the breakdown. I''ve gradually built my finance and made my first $100k through investing which i''ve used to start my jewellery business, and with what I’ve learned over a decade investing, given enough time, solid investments have the potential to double the initial principal amount, but many investors are instead attracted to the lure of high yields in short periods of time despite the possibility of unattractive losses before even getting out. So the onus is on newbies to beware. Having multiple income streams helped me stay afloat in business when the pandemic broke out.',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2364,'cIMM4TJMDRI','Well explained I appreciate ¿ I can''t wait to get started because people are really making a lot of money from it nowadays',212);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2365,'cIMM4TJMDRI','For someone who has not started their investment journey but done a-lot of research. in this economic climate, am I better to save and enter the market when I see companies at my price points or to invest a % of my savings each month.',213);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2366,'cIMM4TJMDRI','With inflation running at a four-decade high, a Recession is now the ‘most likely outcome for the economy. How can I grow my portfolio to outpace inflation and maintain a successful long-term strategy? I have been reading of investors making about $250k profit in this current crashing market, and I need ideas on how to achieve similar profits.',154);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2367,'cIMM4TJMDRI','Everybody is concerned about the market going down but refusing to take advantage of it. The best decision I ever made in my life was investing in the crypto market. Trust me guys, it really pays a lot! ¿',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2368,'cIMM4TJMDRI','Successful people don''t become that way overnight. What most people see at a glance-wealth, a great career, purpose-is the result of hard work and hustle over time. I pray that anyone who reads this will be successful in life..',162);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2369,'cIMM4TJMDRI','"A business that solves problems will never go out of market." -- This is the best takeaway. Thank you for that lovely conclusion at the end.',2);
