Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2371,'cIMM4TJMDRI','If you are going to start a vending business, giving customers the option to use cards will increase your sales a ton. Fewer people carry cash, especially in small denominations. The customer with larger bills will not use your machines until they break their bill at another retailer. Which will likely have snacks and drinks at their POS for impulse purchases.',64);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2372,'cIMM4TJMDRI','I live in a rural area.  Agriculture is a very high risk business that takes enormous upfront investment.  Yes, food will always be needed, but mother nature is notoriously unreliable and global markets are fickle.  This is the reason large corporate entities are and have taken over the family farm which has brought on the deaths of countless small towns.',43);
