Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2398,'UBZ6Bd0LDjs','Isn''t it just glorified fashion illustration? Essentially these are 3D drawings that''s it :) Actual fashion and the beauty of it is conquering your fashion sketches, conquering your elaborate ideas by overcoming physical obstacles. That is one of the main reason we love fashion. To draw an haute couture dress is somewhat easy, but to make it, is beyond hard. Making a dress is a journey for all the people involved, that is how innovation happens. These animated pieces remind me the 80s licensing craze or something of sort :) It is a great new avenue for fashion houses to bank easy money. It is not the future of fashion, it is just a new market for fashion to expand. Silly gimmicks bringing big buck, that''s about it :)',70);
