Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2088,'bAD3tHU6Gss','Making a separate comment for this: One thing you didn''t mention in the exploding vape part of the video is *counterfeit batteries*. You mentioned faulty batteries, poorly designed vapes, but I think this is a big one that should not be left out. Most people who vape seek out batteries from known reputable brands, however there''s a huge problem of cheap, counterfeit imitations of those batteries being sold under the original brand name *even on places like Amazon*. Amazon have a huge problem with counterfeit products being sold through their website and it has really tarnished their brand in many people''s eyes',303);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2089,'bAD3tHU6Gss','A shame how quickly vapes went from a "better alternative to cigarettes" to "public heath hazard and under scrutiny"',206);
