Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2106,'mrq3iZcvHAw','I''ll remember this for the next time I host brunch for a large group!  There are tons of great tips in here to help get a lot of eggs on the table at the same time.   If you''re only making three or four eggs, this method seems like overkill.  I add a few tablespoons of vinegar to the simmering water and crack one egg at a time into a ramekin so that I can very gently add it to the water.  As long as the eggs are fresh, it works every time.',5);
