Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2111,'K-ssUVyfn5g','If ''Building a Second Brain'' sounds interesting to you and you''d like to know more, you can buy Tiago''s book on Amazon here: https://geni.us/5NI78lZ ¿ (Or take it further and join Tiago''s Building a Second Brain Course - https://go.aliabdaal.com/BASB )',62);
