Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2115,'K-ssUVyfn5g','I am eagerly waiting for Ali''s first TED Talk. It would be amazing...! I wonder what topic he will speak on.',117);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2116,'K-ssUVyfn5g','Having a second brain is no joke. I am currently using notion to perfect this. Great video Ali. Definetly devouring all of the information you are putting out! ¿¿¿',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2117,'K-ssUVyfn5g','Now this is my favourite video! I have been struggling a lot when it comes to handling multiple projects.  Thanks Ali!! You really answered a lot of my questions today!!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2118,'K-ssUVyfn5g','I''m so happy about this book. I''m reading it right now. Am on page 90, and it''s already changing my digital life. Thank you, Tiago Forte ¿¿¿¿',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2120,'K-ssUVyfn5g','Your Book Club series is one of the most useful series on YouTube. I have a commonplace book in Evernote and I''m always amazed at the gems I''ve come across over the years. You spinning around by a hot tub when you were talking about self-care is such a vibe ¿Love the idea of organising ideas according to actionability. Felt called out by "hoarding your ideas" ¿¿Thank you for this breakdown of the book, Ali. Noted as a must read and I also need to work "expressing" my finds.',55);
