Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2132,'r34KwZzUmV8','Sometimes when you are in a dark place, you think that you are buried but you have actually been planted. If you are going through that hard time, just know that I am cheering for you..',1803);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2134,'r34KwZzUmV8','To absorb what one reads, it''s crucial to master concentration. When I started reading in my early youth, my mind would wander before finishing a page. Over time, my concentration improved to a point where I could read dozens of pages without losing my train of thought. Activities like chess, reading and meditation are effective in improving concentration. I know a Buddhist monk who can clear his mind for long periods even when in a noisy environment. It''s a skill that he developed over time with practice and discipline. It''s literally rewired his brain. Schools fail miserably in teaching our youth in the art of self learning.',327);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2135,'r34KwZzUmV8','I was born into a relatively poor family.  Never had the opportunity to go to college.  I became obsessed with the self learning technique right out of high school.  I happened to live in a town that had one of the top 10 business schools in the US.  I would go to the University library and pour over the text books in the order they were taught.  within 18 months I had the knowledge of an MBA.  By the time I was 20 I started my own company and was a millionaire before I turned 40.  It took so long because when a guy with no formal education walks into a bank for a loan they tend to want to laugh at you.  I finally found a banker that would talk to me.  I explained my business model and told him how the current inverted yield curve would effect the time value of the money I would borrow he was floored.',682);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2136,'r34KwZzUmV8','Be a teacher but forever a student. Listening in itself is a lost art. So difficult to run across a good listener. Joe Rogan comes to mind. I really enjoy the interviews he has conducted with Elon as his guest. I don''t necessarily agree with Elon on many things but he seems sincere and takes his time trying to explain his thoughts. What I like about Joe is he gives his guest''s time to speak without interrupting them with his own beliefs ( or agenda like so many on the tell a vision).  Being a good listener takes practice but well worth the effort.',226);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2137,'r34KwZzUmV8','The most important thing for learning, like Musk says, is understanding the fundamentals of whatever it is you want to understand. Always, always, always build a solid foundation and then everything else will make perfect sense.',99);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2138,'r34KwZzUmV8','I love Elon! He makes it cool to be smart! He''s a genius.¿¿¿¿¿',138);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2139,'r34KwZzUmV8','The saying goes “ A jack of all trades is a master of none- but still always better than a master of one” so arguably Elon is a good example, rather than proving it wrong',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2140,'r34KwZzUmV8','As an undergrad, I had to take history, and I''m an math/science person who hates history. On my own, I learned to rearrange stories in my head to make it make sense to me. I would exchange real people with people I knew to relate to the topics. I scores a hundred on about every exam when most were struggling. The nstructor made a comment that it was one person who always scored a hundred. They were like who who because there''s no way. His tests were long. When I told them what I was doing to remember the content, they laughed, but I was like it works. And believe it or not, I still remember most of it and that was 22 years ago.',175);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2141,'hmpBODRtwfw','Hi everyone! As a few of you have pointed out, the map at 9:36 incorrectly shows Taiwan as a part of China. Sorry for the error!',2143);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2142,'hmpBODRtwfw','The loss of knowledge is an issue that preoccupies me. It''s very common to this day, even in regular companies. There are times when something breaks and no one knows how to fix it, because the last guy who knew about it left the company ten years ago.',4831);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2143,'hmpBODRtwfw','As someone who was born in Dhaka and learned about Dhaka Muslin as a kid, seeing the fabric being covered here was a treat to remember. Thanks for shining light on it',663);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2144,'hmpBODRtwfw','I was born in Dhaka and have never even heard of this Muslin. It makes me really sad to think how much of our culture and knowledge was destroyed.',688);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2145,'hmpBODRtwfw','Ah colonialism: Destroy a cotton crop species that is highly valued, replace it with a poor, low-value alternative, eventually re-create the plant, and hold market monopoly for expensive product. Great job!',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2146,'hmpBODRtwfw','I love this! It''s easy to fall into the trap of thinking that people before us were "dumber" because they didn''t have the same kind of modern technology as we do, but they were just as smart working with their own tools at the time, to the point where some of it stumps us supposedly "advanced" modern folk if they didn''t bother to write it down.',5447);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2147,'hmpBODRtwfw','The process of han purple seems to me like it was a byproduct of a different and more broadly useful compound or material being made. For example, I would be curious as to what the bronze smelting processes and practices were like, and if any of those materials were used as a flux to strip impurities out of the molten alloy.',284);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2148,'hmpBODRtwfw','My grandmother had a sari made of Dhaka Muslin. I remember as a kid hugging her and remember how soft it was. I miss her so much.',101);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2149,'hmpBODRtwfw','4:26 The British East India Corporation didn''t just "Muck " with the Indian/Bangladesh textiles, they literally had mercenaries go around cutting off the thumbs of Weavers ,and smashing their looms.  This is called the Deindustrialization of India and south east Asia.  All this information thanks to Shashi Tharoor.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2151,'dZYFO2y9BrM','I LOVE the clarity and speed of your demonstration!!! No wasted words. You are very  friendly, and yet get to the point so well. Love the summary!!!! Presentation is simple yet substantial - which really helps me as I am new to cooking. Thank you so much for the quick and clear video. Everybody doing videos should follow suit.',300);
