Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2155,'dZYFO2y9BrM','Well done! I live in Hawaii and we eat stir fry several times a week!  This is a very concise video and easy to follow!',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2156,'dZYFO2y9BrM','I cooked this last knight with noodles me and my 19 year old grandson loved it he even had a second helping too and even ate all the veggies which he never does thank you so much for sharing this with us I''ll be making this more often yummy ¿',26);
