Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2158,'dZYFO2y9BrM','I ran across this recipe today and I had all of the ingredients already. Made it for dinner tonight. Substituted steak in place of chicken.  OMG!! This hit the spot. I''ve eaten two helpings, ¿. Thanks for sharing this recipe.',15);
