Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2720,'FTFaQWZBqQ8','Instead of constantly clicking to select an element (especially within a group), you can press CMD, hover over the element you want, and click. It will select that element and save you from multiple (and very annoying) clicks. This was a big game changer for me that I learned while using Sketch. Works on Figma too.',614);
