Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2724,'FTFaQWZBqQ8','Great tutorial! And I like how you said it straight - design isn’t a skill that’s perfected overnight. It’s developed by practice and more practice! It’s great to learn from others too. Figma seems to be a great site to start with - it’s free, user-friendly, and supports collaborative work! It’s a great tool for beginners.',43);
