Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2429,'0Q7HCaKq-j4','Hey Nate, thanks for making this video.  I''m a long time sub and love seeing your videos and agree with you about all the ads for courses on YouTube recently.   I''m not going to fault anyone for trying to hustle but I respect that you have maintained your high standards.  Hope all is well and love the ideas!',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2430,'0Q7HCaKq-j4','It’s good to share “ideas”, yet what really matters to have a successful business is THE EXECUTION. And this is something that no single video, not even mine, can teach. It takes experience, trying, learning, never giving up, adapting, ... until you get the right execution strategy. Just leaving a honest opinion here ¿ thank you for the video.',27);
