Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2449,'awnn-bqV_Tw','Love the breakdown. I started my first business from money I made off dividends. With what I’ve learned over a decade investing, given enough time, solid investments have the potential to double the initial principal amount, but many investors are instead attracted to the lure of high yields in short periods of time despite the possibility of unattractive losses before even getting out. So the onus is on newbies to beware. Having multiple income streams helped me stay afloat in business when the pandemic broke out.',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2450,'awnn-bqV_Tw','Successful people don''t become that way overnight. what most people see at a glance-wealth, a great career, purpose-is the result of hard work and hustle over time. I pray that anyone who reads this will be successful in life..',326);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2451,'awnn-bqV_Tw','This was so specific to me. Thanks',130);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2452,'awnn-bqV_Tw','That''s it. I am starting my own website/blog, documenting the upcoming final year in my masters, my thoughts and process of starting my own YouTube channel, and working on my masters thesis. I will also try and get over my perfectionist mentality, and just write something, anything, and improve as I continue on the journey. Thank for another great video, Ali!',387);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2453,'awnn-bqV_Tw','Building wealth involves developing good habits like regularly putting money away in intervals for solid investments. Financial management is a crucial topic that most tend to shy away from, and ends up haunting them in the near future. Putting our time and effort in activities and investments that will yield a profitable return in the future is what we should be aiming for, Success depends on the actions or steps you take to achieve it. "You''re not going to remember those expensive shoes you bought ten years ago, but you will remember every single morning when you look at your bank account that extra 0 in there. I promise, that''s going to be way more fun to look at everyday."',203);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2454,'awnn-bqV_Tw','The ‘offer to work for free’ thing is surprisingly rare but great advice. I took a gamble and emailed a company I covered in my psychology BSc to ask if I could come work for them for free and they gave me a paid gig as a trial. 16 years later and I’m now Managing Director. In all those years not one person has attempted the same thing.',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2456,'awnn-bqV_Tw','Every overnight success was 10 years in the making. But because few build in public, people mistake the highlight reel for the start.',648);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2457,'awnn-bqV_Tw','I’m starting a New business currently this is extremely helpful, thank you Ali!',484);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2458,'aNu000cQZmU','Learn more about our Business Bootcamp, designed to help you attract the right clients and grow your business: https://ftris.me/lwu5bzF',92);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2459,'aNu000cQZmU','Dude don’t stop making these please- this helps people who can’t afford to get this sort of education. I’m grateful! Thank you',1061);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2460,'aNu000cQZmU','This is actually legit foundational business and marketing advice for any business with a service or product. Cheers Chris',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2461,'aNu000cQZmU','Finally- real, practical, logical business advice!!! Thank you! Taking all this information into my next business proposal. Please keep posting these. Serious value in these videos.',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2462,'aNu000cQZmU','Let''s not forget that the biggest payouts in the markets don''t come from great performances but rather it''s great promotions. Stay invested, diversification for streams of incomes is very important And with the right skills and proper understanding of how the market works',54);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2463,'aNu000cQZmU','“The best way to measure your investing success is not by whether you’re beating the market but by whether you’ve put in place a financial plan and a behavioral discipline that are likely to get you where you want to go.”',62);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2464,'aNu000cQZmU','Look man! You folks have changed my life!!! I''ve been struggling to make my design business profitable for almost a decade and because I couldn''t figure it out myself, I''ve been being employed by companies that don''t serve me or my wallet. I''ve been living short of my purpose - and I knew it. I have been watching this channel for 3 weeks and I have already started networking smarter, charging more, being more aggressive with my design style and approach. I feel confident and you, Chris Do, have given me that as a creative. I don''t know if I''ll ever be able to thank you/repay you, but know that you changed a man''s life with what you know. Thank you so much and keep building the FUTUR(e).',228);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2465,'aNu000cQZmU','This was amazing. Thank you Chris! Love the emphasis on value and that the buyer determines it. I learned not to waste time trying to convince someone to see value. You can help them realize the value, but you can’t force them to change what they value -  that’s a losing game.',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2466,'aNu000cQZmU','So glad this made it to Chris'' desired metric! I''m only 15 minutes in and have received massive value from this. Thank you so much Chris. I am still in the beginning stages of getting my photo/video portfolio ready, but this massively changes how I think about pricing and will be extremely beneficial when I start to take on paid work.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2467,'aNu000cQZmU','this guy is one of the best business teachers i''ve ever studied with on Youtube.',146);
