Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2469,'ARoGZIN5oC4','I watch Elon Musk videos to grow back the neurons I lost throughout the day looking at memes',6656);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2470,'ARoGZIN5oC4','“Starting a company is like eating glass and staring into the abyss.” Having started 2 small corner stores myself , this quote is very true .',756);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2471,'ARoGZIN5oC4','For sure the reality business is hard and painful and takes a huge amount of effort if you want to build something great. The best quote I heard was "Nobody is expecting you to do something amazing, but it is amazing when you do something".  The reality is you might not build a multi billion dollar business that is global, but you might build something that brings value, and that is why we get into business to test ourselves our own ability and to be different.  You can only admire what Elon Musk has achieved and the potential of where technology could take us in the future.',191);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2473,'ARoGZIN5oC4','I already lost a lot of money recently trying to pursuit my dreams. It''s frustrating and depressing. But Elon definitely gives me hope and determination. He is a role model for me.',96);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2474,'ARoGZIN5oC4','Great video.  But let me talk about something important, I see many young and old make mistakes that I think should not be.  I believe that everyone, young or old, should have an investment plan that increases their financial returns from three figures to six figures.  The investment can be your retirement plan or future plan, depending on what you want, but what matters most is that you have an investment that is profitable.',486);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2475,'ARoGZIN5oC4','It''s touching to hear Elon talk about wanting to bridge a gap between the genetically unfortunate with intelligence augmentation. My mother has a hereditary severe brain disease that affected her life & disabled her. The impact of her brain health affected my development/life and my brain health. The genetic component also affected my brain health. Currently I''m functionally disabled from it too. It''s a constant chronic hell cycle. It''s comforting to know someone out there as dedicated and capable as Elon Musk is thinking about disadvantaged people like my mother & I.',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2476,'ARoGZIN5oC4','"If your customers love you, your odds of success are dramatically higher." Great stuff.',196);
