Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2548,'SoNu7gNl1I4','High fashion is sometimes very abstract, very elitist, very bizarre and sometimes purely ridiculous. But if you push all of the crazy price tags aside and all the ridiculous celebrity endorsers too, you find artisans, people who study and excel in a craft. They deserve to be highlighted more. Behind that overpriced Chanel bag is a leather/chain/fabric artisan and years of creative thought and passion. Fast fashion is slowly killing our planet (water consumption, landfills, toxic chemical dumped in village waters, people paid pennies etc), haute couture is rare, it’s scarce. I find the luxury scene beyond ridiculous but I love my high end pieces, that have lasted me years and will continue to do so. Behind these fashion shows are artisans, that will always be better than any fast producing machine.',852);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2549,'SoNu7gNl1I4','Imran interviews the most powerful individuals in the fashion industry; but I truly believe he holds just as much influence. This series is exactly what the industry needs in terms of consumers listening and fellow designers/industry professionals taking note. Imran is the projector of those poignant words and as a collective it holds much greater power.',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2550,'SoNu7gNl1I4','Luxury fashion is one of the world''s biggest industries. I think this is a great topic for a Bloomberg series. I would be interested is seeing more of this type of content. I am particularly interested in the recent collaboration between Gucci and Balenciaga, especially now that I know they both come under the Kering umbrella. Other recent collaborations include Versace and Fendi, which could be the subject of another video. The more recent video in this series examines the Chinese market, and how fashion brands are now targeting young Asian consumers.',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2551,'SoNu7gNl1I4','The worst thing to happen to fashion was ‘influencers’ who encourage always wanting the next instead of appreciating the now and the classic. They’re so fickle and encourage everyone else to be the same.',45);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2552,'SoNu7gNl1I4','I love how “luxury” is about preserving the craft and labor of the poor for the rich. Like what really is the point here? Is it the small artisans who get $$ and praise or the fashion “houses” and companies that actually get to design,  exploit labor, and sell for profit? ¿ The definition just isn’t strong enough for me to care.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2553,'SoNu7gNl1I4','I used to love high fashion, but the more I learn about what goes on in the industry the more I feel like pursuing a different career choice, so much nepotism, elitism, and lack of creativity. it’s almost as if you don’t fit within certain enclaves, you’re not welcomed.',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2554,'SoNu7gNl1I4','I love the new sustainability efforts, excited to see new changes!',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2555,'SoNu7gNl1I4','people are really stuck on the price tags and not understanding that couture is only made to order by experts in their fields. that''s what this video is looking at. These pieces are art, and art is different for everyone. just because you don''t like this version of art doesn''t make you better than those who do. I could never afford these pieces but that doesn''t stop me from really appreciating the vision behind it.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2556,'SoNu7gNl1I4','What annoys me the most is that these so called a majority of these high class fashion brands exploit their workers with long hours and little pay even though they are selling products for an extremely high price tag.',288);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2557,'SoNu7gNl1I4','I switched years ago from fashion to reupholstery. So glad I get to reduce, reuse, upcycle. Last of a dying breed. 2% of the world do what we still do.',33);
