Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2599,'ddbb2nPwC-c','Despite the economic downturn, I''m having the best time of my life financially. Earning over $83k in the last 2months with an investment of $19,000. Money can be made even in a bear market. Make the most of it.',101);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2600,'ddbb2nPwC-c','My concern is that with the big players waking up to this business model, they will muscle in easily and squeeze out these little guys, who was doing well, below the radar. Now that the cat is out of the bag, their profitability will experience more headwinds going forward.',170);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2601,'ddbb2nPwC-c','Nothing brings me more satisfaction than efficiency. To think about how all that merchandise is going to be re-sold and not go into a landfill makes me very happy indeed.',295);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2602,'ddbb2nPwC-c','I remember watching a documentary about how the area of West Africa had become a dumping ground for used/unwanted clothes from Europe and the Americas; more specifically the North Americas. I was totally shocked and had no idea about this. Villagers would sometimes travel for several miles on foot, sometimes with their kids, to pick through this clothing waste to sell into their communities and earn money. Most of it just became literal mountains of clothes on the beaches and wherever.',87);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2604,'ddbb2nPwC-c','This is one of the coolest things I''ve noticed recently. When Ollie''s popped up in my hometown selling name-brand goods at a quarter of the original price...I knew liquidation stores would be the way of the future. I love it. It makes me happy seeing these goods find homes instead of ending up as pollution.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2605,'ddbb2nPwC-c','As a person who shops on the clearance aisles at stores, I''m loving this documentary. It''s an industry not many people think of on a large scale but definitely very profitable.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2606,'ddbb2nPwC-c','The only issue is that the majority of customers are re-sellers. So most consumers aren’t getting the discount. But either way it helps the environment which is great.',77);
