Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2628,'odN3ON4ZVOE','This is an amazing story, Most times, it amazes me greatly how I moved from an average lifestyle to earning over $63k per month. Utter shock is the word. I have understood a lot in the past few years to doubt that opportunities are bound in the financial markets. The only thing is to know where to focus.',388);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2629,'odN3ON4ZVOE','I think this is very inspiring! And a big shoutout to anyone who is brave enough to follow their dreams and pursue a career or lifestyle that isn''t ''''the norm'''' ¿',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2630,'odN3ON4ZVOE','When can CBNC actually show someone who created something cool (like a product turned business, an interesting YT channel, maybe they publish their own books, etc.) rather than these woefully unqualified finance “gurus” who add more detriment than value to most of its customers',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2631,'odN3ON4ZVOE','Sick of CNBC only promoting these gurus that seem to have no financial background or successful track record other than selling to other poor people how to be rich. Fake it til you make it.',206);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2632,'odN3ON4ZVOE','“You can afford anything” she says. Reporter asks “what if I want a yacht? Then it changes to “you can afford anything within reason” ¿ imagine a counsellor or coach saying “I’ll help you to achieve your goal, then you pay them for months and they say “not THAT goal because that’s impossible. We don’t set people up to fail by selling promises that sound good.However, good luck to this woman for becoming wealthy and if people choose to buy her services and products, that’s their choice.',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2635,'odN3ON4ZVOE','Investing is so important in Life! SO IMPORTANT! I can''t explain enough the importance of starting early and keeping the course. Love the video and I hope you make more video''s on investing in the future!',109);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2636,'odN3ON4ZVOE','Building wealth involves developing good habits like regularly putting money away in intervals for solid investments. Financial management is a crucial topic that most tend to shy away from, and ends up haunting them in the near future. Putting our time and effort in activities and investments that will yield a profitable return in the future is what we should be aiming for. Success depends on the actions or steps you take to achieve it. "You''re not going to remember those expensive shoes you bought ten years ago, but you will remember every single morning when you look at your bank account that extra 0 in there. I promise, that''s going to be way more fun to look at everyday", I pray that anyone who reads this will be successful in life',159);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2637,'odN3ON4ZVOE','Everyone should become a finance guru. No one will be poor',114);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2638,'On1iHuNBoMA','The market cycle still hasn''t met its balance, we keep going round in circles while waiting for that huge blow out on a huge support but in the mean time we could always ignore the market ups and downs and stay fully invested. Big thanks to Lily Alice for helping me earn over 14 btc by implementing her method and following her guide..',53);
