Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2649,'nXOroUomnjA','Small business be like: a pretty box, pretty filling with an extra and Amazon be like: here’s a brown box take it or leave it.',5493);
