Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2653,'nXOroUomnjA','The detail and thoughtfulness some of these people put into their packaging is just insane. Obviously, whether the product itself is actually good is another matter, but just the sheer creativity, beauty and detail in the presentation would probably make me wanna order from them again even if the product itself wasn''t anything super special. That kind of packaging makes receiving the product an ~experience~, like getting an incredible, delightful present. I would be smiling like crazy and squealing with delight as soon as I open a box like that, would probably make my whole week. These people are so cool and I admire and respect them so much',176);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2654,'nXOroUomnjA','Just gonna add some positivity in the comment section by saying I’m so proud of of these people with their small business. Im personally too afraid to start my own business (not yet at least) but these people just straight up sent it with whatever they got lol. I genuinely wish all of them to do well ¿¿',412);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2655,'nXOroUomnjA','I’m 12 as well and i was inspired to start my own business by these tiktoks, I started painting custom ordered seashells :) I’m so happy with how my business turned out :D all I did to figure out what I was going to sell is I went around my room five times with my eyes closed and what ever my finger landed on I sold and it landed on a seashell and that’s how my business started, I would really recommend starting your own business as a past time! :) it’s also a great way to earn money and allowance as a kid and it’s so fun to do I really enjoy it it can be stressful at times but it’s so worth it :D',250);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2656,'nXOroUomnjA','I feel like small business owners like put their heart and soul into their packages and try to get it shipped in time but they still don''t get appreciated for their hard work',304);
