Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2659,'un50Bs4BvZ8','Extremely helpful!  Great overall video thank you.  I even love how your matched with some of the colors on the slide.  Very co-ordinated.  Just subscribed and will probably be binge watching your videos for the rest of the day.  I know the effort that it takes to produce these tutorials so much appreciated.',82);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2660,'un50Bs4BvZ8','I''m overwhelmed when trying to learn how to use Canva by myself, because there''re tons of functions. Thank you for making this video.  Using Canva is much eas¿er now!',102);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2661,'un50Bs4BvZ8','Wow. ¿¿¿¿¿¿ Just finished your tutorial, it took me somewhere between three and four hours to go through it because I stopped it all the time to try out almost everything you had just presented, in order to remember things better, and while doing so actually discovered a few more things. I also appreciated some of your design ideas which further opened my eyes to the endless possibilities Canva offers. I had already watched a number of other tutorials, some also very well presented, but most are way too short: they just awaken your curiosity but then leave you hanging there, struggling. After having worked through your tutorial, I feel that I hit the ground running, and am now off to your other tutorials to learn more. Having come down with Covid - fortunately not too bad - I still have a few more days of quarantene left that I will use for studying and practising more! ¿',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2662,'un50Bs4BvZ8','This is a great video. Great tips like the ALT, shortcuts, etc besides all the clear explanations for each feature. Love the updated thread as well. Keep up the good work. Thanks for filling the 1.5 hours with very useful information delivering with such speed as well is commendable. Fantastic effort! Kudos to you.',27);
