Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2666,'un50Bs4BvZ8','I cannot thank you enough for this tutorial, really clear explanations and examples.  I have been using Canva Pro for about a month and love it, but this video has blown my mind ¿.   It will take some time to learn about the many different aspects of Canva and I will be referring back to this video often.  Subscribed and looking forward to watching more of your tutorials ¿¿',19);
