Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2681,'Vl0H-qTclOg','By far the best Excel tutorial I have seen for beginners. Complete, basic, to the point and very useful in real life situations. Great course! Thank you, Shad Sluiter, for sharing!',54);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2682,'Vl0H-qTclOg','Your explanations are simple and fluid. You have deconstructed all the difficulty myths related to learning Excel. Hats off and thank you!',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2683,'Vl0H-qTclOg','Thank you so much for this! I had an easy time following the pace of the course. Also, the examples and exercises were great! With 30-60 minutes per day, I could complete the course in 5 days. Good Stuff!',273);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2684,'Vl0H-qTclOg','Most logical and very easy-to-understand course content. His way of explaining is incomparable to anyone in his profession, and the topic is covered vividly and never feels bored. I gained so strong knowledge immensely in a tiny time. Hat off to the professor. You''re the great teacher to me I ever had in this field, sir. Best wishes for your future tutorials and life as well.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2685,'Vl0H-qTclOg','Excellent practical course for someone who knows only the very minimal basics, if that. Well modulated and articulated.  Designed for adult self learners. Easy to follow and it is a  plus that you did not use "techie'' language.  Your presentation style made it easy to follow without distractions. Real life examples are a plus.  Application of knowledge always enhances learning. Looking forward to your next course.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2686,'Vl0H-qTclOg','I''m about 30 minutes in and I gotta admit, you are brilliant at organizing what you want to teach. You''ve managed to organize even zooming in and out at specific intervals to teach all those small aspects of the program. Really cool! I never knew excel was so intuitive either.',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2687,'Vl0H-qTclOg','This was an excellent class, well done in organization, methods and process.  There are lots of tools out there but this class is better because problems are solved as examples are worked out.  In this way it keeps your attention while deepening the learning.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2688,'GZvSYJDk-us','Get the notes and code for this course here: https://github.com/craigsdennis/intro-to-apis-course/blob/master/course-notes.md',552);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2689,'GZvSYJDk-us','One hour into this video, and I have learned more about how to use APIs and Postman than I have with tons of other videos -- COMBINED! I can''t see how video instruction can get better than this. All the money I have spent to learn this and actually understand it, and this video instructor provides the most precise explanation I have seen to date! EXCELLENT WORK!',517);
