Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2972,'ExqpymyUFt4','Thanks for putting the time for this awesome tutorial Tony. Just switched from Nikon to Sony full frame and am extremely happy with it. Can''t wait to start my lens collection soon.',4);
