Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2976,'ExqpymyUFt4','Thank you so very much for this long detailed very accurate tutorial. I''m a professional photographer who just upgraded to the a7r3 and you have just saved me probably a year worth of learning the camera thank you very much love the channel keep up the good work',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2977,'ExqpymyUFt4','You''re amazing! I usually chuck the manual away and freestyle and explore my camera instead- but today!! I sat through 50 minutes of you guiding me and I''ve learned so much! the only reason why I stopped is because it''s getting late and I need to sleep',2);
