Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2754,'eIrMbAQSU34','I watched your python tutorial, the 6 and a half hour one, and made quite a few python projects. I really appreciate the effort you put into these videos, really helpful.',342);
