Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2767,'X48VuDVv0do','Hi Nana, you might want to know that the demo project (MongoDB) no longer works with the latest image. I had to use mongo:3.16, which was the latest version at the time you recorded this video. It might be worth adding a note to your video at 1:19:45 that those following along should use mongo:3.16',43);
