Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2769,'vLnPwxZdW4Y','This guy actually puts in a lot of effort in his tutorials as far as i can infer. I noticed that whenever he accidentally said something wrong for example he said age instead of name, he''ll put the correct word in the background, meaning that he actually gone through the entire video again before publishing to check for errors.',4794);
