Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2773,'vLnPwxZdW4Y','This was one of the few programming videos which i completed fully, thanks to mike for explaining each and every concept crisp and clear. Eagerly excited to start my journey in programming',9);
