Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2775,'vLnPwxZdW4Y','Dude I dont know if you know but this tutorial is one of THE CLEANEST CONCISE on youtube. The way you get to the point and explain well in brief manner makes learning C++ seem intuitive. I know this is just the surface but it is presented in a way that makes it feel breezy and effortless',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2776,'vLnPwxZdW4Y','I love how he teaches multiple coding languages the same, it makes learning them a lot easier and quicker to understand',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2777,'vLnPwxZdW4Y','this is awesome, this is how a tutorial should be! i did not think i could have finished it all the way, and right now im already on 3.5. if i can really make some good use of coding, i will surely [join] i''d love to watch more of your tut.',4);
