Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2780,'xiUTqnI6xk8','i’ve done some SQL database management in a GUI before but learning to do it through a terminal has been awesome. I would love to see a part two going over primary and foreign keys and database relationships. The way you format your videos is great for learning and i love it, thank you so much for the content you put out. here’s hoping for a part 2',49);
