Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2782,'xiUTqnI6xk8','Yes please Chuck, make more videos about SQL. You read my mind: I just started to make a website with flask for python and a sqlite3 or mySQL database. Thanks for the new video!',45);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2783,'xiUTqnI6xk8','19:48 I understand that this is for beginners just starting with sql, but in my opinion you should always delete with unique value (like "id" in this case). Because later you''ll probably have more than one "Jeff". Keep up the good work !',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2784,'xiUTqnI6xk8','Just wanted to add that having strong knowledge of sql and databases in general is extremely helpful for developing queries and detection rules using tools like Splunk (SPL) or Defender (KQL). Great video, please get in the weeds!',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2785,'xiUTqnI6xk8','I was just thinking the other day that I really need to start learning SQL, beyond just using it blindly in applications. Great timing and really great intro for me! Looking forward to the next one!',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2786,'xiUTqnI6xk8','thank you sir, this reminds me of a lesson I didn''t understand in class. but you made me understand about SQL in just 24 minutes with enjoyable explanation ¿',2);
