Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2794,'45csSEotJY8','It''s amazing to me that Guild Wars 1 had such an incredible "tutorial island"- so much so that people spent _YEARS_ min maxing and living in it as a main point of playing said game and never leaving it for the pure enjoyment of it.',104);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2795,'45csSEotJY8','While it is a good idea to seamlessly blend tutorial and initial gameplay, I still have a soft spot for stuff like the Hazard Course in Half-Life, which is an in-universe training grounds for people to get familiar with the HEV Suit, and in turn the game and its mechanics.',63);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2796,'45csSEotJY8','Honestly, I feel like the most important option with a tutorial is the option to skip it entirely (for replaying purposes) and the option to revisit it at any point in the game',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2798,'5x3Hy7zie94','Hey everyone!! Wanted to make a video that we could easily teach you lightroom and get you going, or refer to from time to time as a quick refresher! Love you guys a ton and i honestly hope this helps anyone & everyone out there looking to get better at editing photos! I cant wait to see what you guys can do after this! Feel free to leave any future videos you want to see in the comments, and ill add em to the list!! Have a great sunday!!! - Sawyer',377);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2799,'5x3Hy7zie94','Honestly that was one of the most understandable, intuitive tutorial videos I have ever seen. Many thanks!',1015);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2800,'5x3Hy7zie94','I''ve never really felt comfortable in knowing what I was doing with the tone curve, but this video totally nails it. Great tutorial! So easy to follow. Thank you!',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2801,'5x3Hy7zie94','I love how this is NOT a : "I''ll show you the tools but take my private course to really learn something" kind of video, and I love how you encourage people to learn with differents tools and it''s not like "You do this and that and all done"',35);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2802,'5x3Hy7zie94','Hi Sawyer! Thank you so much for doing this video. I''m six months into my photography business, and finally tackling Lightroom. It seemed super complicated at first, but you truly helped me get over the fear of jumping in.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2803,'5x3Hy7zie94','I could cry! I never make it through a full tutorial, but you have made is so easy and fun to learn! Thank you so much for this video!!!!!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2804,'5x3Hy7zie94','This guy explained it exactly how it needs to be explained! Most people try to do tutorials that seem like they are for professionals, but why would a professional be watching it? Great tutorial!!!',377);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2805,'5x3Hy7zie94','I wish I had watched this earlier before I watched all other work flow tutorials. This is not only a work flow tutorial but also a fundamental guide/manual of the software and explains what works how. I understand lightroom much much better now and I''m excited to apply all of these to my next photo editing. Thank you so much. Best lightroom basic tutorial ever!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2806,'5x3Hy7zie94','This tutorial is amazing! Straight to the point, and great energy! Thank you so much, Sawyer!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2807,'5x3Hy7zie94','Hands down one of the best explanations of basic photo editing in lightroom I have ever seen. Simple, to the point, enlightening. Especially what to do where and why. It  helps you leave the ''basic'' tab more often and with confidence. I have seen many tutorials, but watching this turned on new light switches of understanding. Thanks!',5);
