Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2873,'sNRcVXkZjWM','For anyone else interested, on bedrock edition instead of using pistons to make an opened barrel, if you open it while going into a nether portal, the texture changes to an open barrel',1884);
