Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2878,'FTociictyyE','Not gonna lie, Gordon Ramsay seems like a nice guy teaching us peasants how to cook',5316);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2880,'FTociictyyE','I love how he teaches the right timing to turn the food. I usually end up burning it because I''m afraid of undercooking, so it''s great to get these pro tips.',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2881,'FTociictyyE','I had no idea you had this channel, and are making videos teaching all of us for free.  That’s awesome.  Thank you very much, Mr. Ramsay.',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2882,'FTociictyyE','I''m watching this while I''m sad and honestly he''s kinda wholesome. I feel like if he was teaching his kids how to cook he would teach them in this manner (probably in more advanced recipes since this would be pretty basic to him). He''s just a dude that''s highly passionate about cooking.',281);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2883,'FTociictyyE','even after all these years he''s the most enjoyable chef to watch',2361);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2884,'FTociictyyE','I enjoyed this lesson very much.  I''ve taught music for 37 years and I recognize good teaching.  Loved that you told people to take their time.  This nurturing technique makes me want to cook and learn new recipes.  Thank you for sharing your immense knowledge.',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2885,'FTociictyyE','I''ve learned so much from these videos. I wasn''t a bad cook before, but learning a few tricks in slicing things more effectively has made me actually enjoy cooking.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2886,'FTociictyyE','Thank you Chef Ramsay for sharing your talents with me. This has helped me to be better in the kitchen. Blessings to you and your family!',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2887,'FTociictyyE','what I love about Gordon is he shares everything he learned a lot of chefs keep their secrets but he teaches I love it i have cooked almost everything Gordon has shown I want to personally thank you bc of you my wife loves me more',8);
