Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2908,'NlAxapKT0x8','I love watching and love when you talk about your son. I have 1 child,a son, and the bond between a son and his mom is amazing. He’s 26 now and has his own life and we still love each other so much but cherish him while so young. They grow up so fast.',44);
