Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2919,'nfFQm82IqUc','When I got the beginning parts I just cried. I’ve wanted to play and have loved film score music my entire life and never thought I’d get to a point of being able to play the songs I love so much. I’m 26 and never played the piano but I bought a piano back in June and the  realization that I actually CAN learn this made me emotional. Thank you for your awesome lessons!!',45);
