Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2930,'Ayhct2DylC4','I love that the narrator is particularly enraged at the horrific cheesecake tutorial. Usually the narrator performs with an impersonal, almost inhumane, robot-esque anonymity and objectiveness, but here you start to see their own real personality come through just a bit. Whoever they are, they must be an avid baker to be so enraged by the British woman''s baking faux pas hahaha.',511);
