Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2932,'Ayhct2DylC4','For the fake blood thing, that just had me facepalming so hard.  I used to work at a Haunted House, and we went through SO much fake blood, we just made it with karo (clear corn syrup) and food coloring, sometimes with some grape jelly mixed in, and it worked well, although obviously quite sticky.  Of course you often would hear some teenagers getting yelled at to ''stop eating the fake blood!".',134);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2933,'Ayhct2DylC4','As a person living in the UK I can confirm this is an isolated incident. I just put the biscuits in a ziplock bag and beat the crap out of them with a rolling pin. This lady made me facepalm so bad.',125);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2934,'Ayhct2DylC4','Damn. The cheesecake proved the narrator’s not just a robot capable of occasionally trying out products!!!! He showed actual emotion past making a bad joke followed by “I’ll see myself out” Kay you’ve done us a great service demonstrating genuine emotion in the Be Amazed narrator XD',44);
