Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2937,'Ayhct2DylC4','As a brit we definitely do not cook like her. Cheese cake is one of the first things I was taught to make as a child. No stove or oven needed¿¿¿¿',20);
