Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2941,'d56mG7DezGs','Incredibly video. This was really helpful. Mosh''s tutorials are always so neatly arranged and skips unnecessary contents. Thank u very much for this and hope to see more tutorials. ¿',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2942,'d56mG7DezGs','Mosh, thank you so much for the countless digestible tutorials! I was able to effortlessly learn Python because of your effective teaching style. Would you be able to make a course/playlist for C++? Thanks again!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2943,'d56mG7DezGs','Amazing stuff. I''m curious though on what would be your approach to setup the VSCode debugger having TypeScript installed as a dev dependency instead of a global dependency.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2944,'d56mG7DezGs','you dont need to go to Harvard to learn programming. mosh is the expert on teaching programming than any universities in the world. trust me i am witness. i used to be one of the people who dont understand coding and got lowest grade in university. but i decided to quit college and bought all his full stack courses. now i fall in love with coding and becoming the best on the field. Thanks Mosh!!',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (2945,'d56mG7DezGs','One of the best, perfectly-paced, Typescript tutorials out there. Unfortunate that you don''t use curly braces with your if statements. One of the biggest causes of bugs for new and even experienced JS programmers. Hubris is the only reason not to use them.',5);
