Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3394,'bMXTGGxrQ3A','The Market has been pretty bad until today it decided to surge. Everybody was Practically Crying then. It kept dipping. That''s what you get when you feel you can navigate the process on your own. Big thank to mrs Josphine leela. I''m not bothered with how bad the Market is because my assests are insured due to her advice and I still receive my profits',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3395,'_kGzxVf02M0','If he buys the club, his first job is to get rid and replace people in charge of recruitment at the club. Get people who are experienced and not just former players in that role',167);
