Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3398,'_kGzxVf02M0','Buying a minority stake will change nothing for the fans,the Glazers will still have the power to milk the club for all its worth while investing nothing back,the stadium,training facilities and most importantly squad are all need of a huge makeover and only a new controlling owner can do that.',39);
