Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3401,'_kGzxVf02M0','As JR said he is not "dumb" money. I have been a fan for a long time and remember United when they weren''t winning, I think the fans wanting to oust the Glaziers have a feeling of entitlement. Winning and losing are cyclical, that is something that needs to be accepted.',3);
