Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3403,'_kGzxVf02M0','This puts things to bed IMO, however the fact that Ratcliffe openly made this statement may prompt them into a potential sale. After all, sponsors and partners are starting to have cold feet and that would definitely push them out, especially if as expected our season goes pear shaped.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3405,'mAukJsMg_xI','I''m 54 and my wife and I are VERY worried about our future, gas and food prices rising daily. We have had our savings dwindle with the cost of living into the stratosphere, and we are finding it impossible to replace them. We can get by, but can''t seem to get ahead. My condolences to anyone retiring in this crisis, 30 years nonstop just for a crooked system to take all you worked for.',248);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3406,'mAukJsMg_xI','Thanks for this amazing information !! If you don''t find a means of multiplying money, you will wake up one day to realise that the money you thought you had, has finished. Investment is key, I pray that anyone who reads this will be successful in life',102);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3407,'mAukJsMg_xI','When it comes to investing, people who have a financial plan are more likely to feel prepared to meet their financial goals. Been into this experience since 2016 and now 6 years on extremely pleased with the decision I made. There''s no shortcut to getting rich, but there are smart ways to go about it',56);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3408,'mAukJsMg_xI','There is a perfect storm brewing in America. Inflation, sever drought in the farm belt, the pandemic, food shortages, diesel fuel and heating fuel shortages, baby formula shortage, shortage of and price of available cars, the price of housing. It''s all coming together and could lead to real disaster toward the end of this year.(or sooner).',96);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3411,'mAukJsMg_xI','When it comes to investing, we want our money to grow with the highest rates of return And the lowest risk possible. while there are no shortcuts of getting rich , but there are smart ways to go about it',52);
