Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3217,'5_NdbRUNjoY','The two major nuclear disasters happened because of 1 incompetence (Chernobyl) and 2 natural disaster (Fukushima). As a British citizen I would say, that on the most part, we are very capable of preventing those two things. We’ve wasted 30 years of nuclear understanding and fine tuning in my opinion, let’s get those plants running baby.',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3221,'5_NdbRUNjoY','Nuclear is a great carbon-free base load electricity source. I’d like to see it not as a competition but rather a companion to renewables in the future electrical generation portfolio. On the downside, nuclear is expensive to build and insure, but the actual watts  generated are among the cheapest. There are also concerns about the total available uranium to run the reactors, and it seems like we’ll have enough of it for 50-100 years if we generate 40-50% of the energy from nuclear. On top of that, thorium reactors could be a viable alternative to their uranium counterparts. Another new direction in nuclear is small modular reactors (4th gen) which in theory should be much cheaper to build and run, making initial investment lower. They would also give us greater agility in planning the electrical grid.',42);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3222,'5_NdbRUNjoY','So impressed Marko has made a video regarding energy use in the EU. It is useful to view the data from just a futures point of view, which is how companies plan on future availability.  Way to keep up the good work Marko! BTW - nuclear energy has been overlooked for the last 30 years and needs to come back. It is sad how German and French embraced nuclear energy then pulled back which leaves them open to the crisis now. America should take heed.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3223,'5_NdbRUNjoY','Excellent video, Marko! Things look really bad for now. Just recently it was reported that Germans (among many others, probably) already spend their savings to fight inflation (instead of having their salaries rise to cover it). I don''t want to imagine what will happen in the winter when the energy bills will really increase, or when those savings run out.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3225,'5_NdbRUNjoY','Hi Marko! I''m living in the Germany (not born though) and have been following your podcast because you do good analysis.  Honestly, as a european, I feel quite disappointed by everything. I understand why the administration decided not to invest in nuclear energy after Fukushima accident, but on the other hand I cannot understand how they didn''t invest in other resources, or should I say how the Europe, especially Germany didn''t diversify when it comes to energy suppliers. It''s like you said, they just ignored that fact, even though we already had a couple of years ago possible no delivery situation with Russia.',2);
