Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3434,'vkBWC70edhw','Dude thinks wage increases are the cause of inflation when it has been massively under inflation and people are being payed less value year after year since the 70s. They mass printed, haulted production and services, filled their balance sheets and took on massive amounts of debt. Wage increases are a result of dilution, not the cause.',4);
