Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3436,'vkBWC70edhw','If inflation stay at current level soon or later the bond market will collapse, then following will be the collapse of stock market. There is no other option but to keep tightening money supply until inflation back to sustainable level. This is the effect of 20 years of horrific monetary policy (QE + too much stimulus). The FED added 25 trillions of debt to it balance sheet since 2000 and all the plans to reduce it deficit have failed and in the contrary they continue to increase the deficit each year. They can blame the Ukraine War or COVID that caused inflation but the reality is just poor monetary policy made by the central government over decades. The only question left is how much tightening they can do without causing a hard recession in an already vulnerable economy.',3);
