Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3438,'vkBWC70edhw','Economy''s fine, no cause for concern, just like in 1980, 1990, 2001, 2007, 2020, right?.  The problem is:  the economy is a mess because the money supply and fiscal policy is too loose, but the economy is now dependent on a loose money supply and loose fiscal policy just to function.  So no matter what you do 1) Nothing 2)Tighten  or 3) Loosen, the economy suffers.',1);
