Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3460,'0uYnj1i1EQw','Having money doesn’t necessarily make you happy but not having money will make you miserable',1879);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3461,'0uYnj1i1EQw','Great content in your channel, I’m 53 and my wife and I reached $1M net worth in 2017, five years later it’s $2.4M. Our yearly salary is a little over $100K. We drive older cars, cook at home, eat leftovers, and have 2 in college. We saved for college and our boys help by working. They will graduate debt free.',312);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3462,'0uYnj1i1EQw','Freeing your mind from consumerism is so important. We''re literally trained from young to always want more, to never be satisfied to compare ourselves to our neighbors and what they have. I was always a natural saver, but struggled a bit in not comparing myself to others. It''s still something I work on, but over time have gotten better. It definitely helped that I realized the image others put forward, the majority of the time is financed by debt! That''s not something I''m interested in at all. I hope more people learn this concept and actively practice it. I''ll definitely talk about it on my channel as well.',547);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3464,'0uYnj1i1EQw','1. Pay yourself first · 2. Save for emergencies · 3. Spend less, save more · 4. Lose a habit, gain some savings',514);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3465,'0uYnj1i1EQw','We need to be teaching personal finance in schools and the idea that “enough is enough” needs to spread like wildfire.',220);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3467,'0uYnj1i1EQw','Retiring early is possible but tough, it definitely requires discipline and big sacrifices. It’s not only about saving, the huge step is boosting earning capacity. The stock market and real estate are by far the most profitable my portfolio has experienced.',168);
