Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3666,'ROcNcDiicGI','In my younger years I guided Flyfishing in Alaska. When Looking out the window of the float plane, sometimes I’d see ponds that almost looked like they were boiling. It was natural gas coming up through the permafrost. The Arctic regions of Europe have these same stores of natural gas. They need to utilized as a measure of self sufficiency, energy independent, and security. The idea they haven’t thought of this is crazy.  To rely on countries that harbor governments that brutalize their own citizens is not good business. Did you turn your back on the bully at school? Smiling and being nice is one thing, but being in bed with evil is another.',2);
