Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (3898,'L1myCVUeR4Q','Honestly I appreciate you and your content < Technical Analysis is good but I find It truly baffling that major crypto youtubers just look mostly at pure T.A and completely ignore the bigger narrative of why BTC is pumps/pumped and why the future outlook will be even rosier than it seems. It''s kinda irresponsible to ignore the fact that each ETF launch so far has caused a major dump at the peaks of BTC. We were already on shaky footing with historically low volume and almost pure whale pumps,narrowly avoiding a long-term bear market. More emphasis should be put into day tradiing as it is less affected by the unpredictable nature of the market. I have made over 12 btc from day tradng with Kerry Pickett insights and charts.His been one step ahead of other analysis..',98);
