Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4135,'2ze9mm3tZTA','I really appreciate you covering the colorblind aspect. I have to have grey instead of green and black instead of orange on my cubes because of my color deficiency and it means significantly less choice in cubes. It''s very frustraiting.',303);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4137,'2ze9mm3tZTA','What I find good about stickerless is that you can be almost 100% sure that if you''re buying a stickerless cube, it will turn at least half-decent, while on stickered you may run into unfilleted cubes that require wrist rotations, like the Original Rubik''s series. Of course, you always look closely at what you''re buying, but it just seems like an interesting little detail to think about. :)',72);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4525,'kkOweffr3II','holy guacamole that was amazing. easily one of the best documentaries I''ve ever seen. PLEASE do more about chrss history. It''s what the chess community needs to realize this game isn''t just Magnus and supercomputers finding the best moves, but actual styles of play and players that for so long determined the game',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4526,'kkOweffr3II','Chess clock brief history would be good to have been included in this documentary. How would one classify classical chess against rapid chess without clock? Nevertheless, this is such a good film. Finally, a chess film that has filled the void!',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4528,'kkOweffr3II','Chess is, and forever will be, a timeless endearing game that will forever captivate the human mind. Long may it reign in thousands of years to come!',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4529,'kkOweffr3II','Such a fascinating game and really the only game I have ever gotten so interested in. The ELO system is inspiring because it gives you a goal',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4531,'kkOweffr3II','This is amazing! *I love documentaries and Chess. And they came together on my birthday.* Lucky me ¿¿¿¿',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4532,'kkOweffr3II','this is by no means a history of chess, just a history of chess world champions. there is a lot more that is more general and more interesting than who exactly beat whom in how many games',3);
