Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4546,'mcivL8u176Y','Fun fact about the monkey: there''s a chess variant called Congo which has a piece also called monkey with the exact same movement, except it captures the pieces it jumps over (so they can only be of the opposite color) instead of the last one',262);
