Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4549,'mcivL8u176Y','i love this new update, it implements a rework for basically every card and a new middle piece a jail system which is very cool and adds incetives to protect and keep alive the monkey since he can save the king, giving him a great passive buff also the fish queens that even now are fake is still a great advantage to have and i personally like more that way and the new rook with his flying abilities making a great way to protect other pieces and more gameplay variety and finally a little edit to the color of the chess board who i agree the reasoning for, tho is probably harder to get a blueish board than a black and white one but is not a big issue and after mentioning all of that i will give to this update a 14/10, amazing work',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4550,'mcivL8u176Y','I can’t wait to see someone try to make this playable in Tabletop Simulator. As a 3D artist, I’ll even go as far as to start modeling the pieces themselves when I have time lol',6);
