Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4558,'6IegDENuxU4','I can''t claim that I understand everything in this video but I now understand the importance of choosing an opening and a defense to master as a beginner in order to get a deeper understanding of how to progress in my learning. This video is exactly what I (and probably all beginners) need. Knowing how to know. Good pedagogy.',477);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4559,'6IegDENuxU4','I recently finished watching the queens gambit on Netflix and It''s made me want to re enter the chess world. I was first introduced to chess when I was 9 years old but unfortunately my focus the next few years was on school..I''ve now almost graduated college and I discovered this channel and I''ve binged many of the videos. Great work and thank you for teaching chess!',329);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4560,'6IegDENuxU4','I''m rated 1800-2000 in puzzles/tactics....and only 1200-1300 in games.  I always am getting caught in terrible positions and find myself blundering often and/or in terrible positions.  You are pumping out some solid content my man! ¿   this video hit home for me and I''m hopeful after some opening study, I can begin to correct my mistakes and find myself in better positions.  Thank u ¿  great vid',6);
