Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4566,'UApgiHQKemk','Thank you sir for this video and the others I have used it today after watching your video and it works well. Smashing the like. God bless you in Jesus Name. I hope you safe there in your country.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4567,'UApgiHQKemk','Nh4 attacks the Queen. Qe5 or Qd5 looses the Queen after Nf6+. Game over!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4568,'UApgiHQKemk','Solution to mid-video puzzle - White again plays Nf6 ch. If ... Ke7 or ... Kd8, Nh5 dis ch picks up at least the Exchange, possibly a whole rook depending on where Black''s king goes. If ... Kf8, Bh6 wins the Exchange as well.',0);
