Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4584,'p5kFz_RdhPQ','What chemistry among these commentators, what learning and fun for us lower-rated amateurs!  Congrats, David, on your Olympiad medal!  Way to show the flag of England.  Hope you can still do commentary now and then if you join the chess tour and, if you join,  may your skills take you to 2800.  God Bless.',0);
