Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4588,'p5kFz_RdhPQ','I followed the Olympiad and was floored by David''s performance.  There were over 180 teams, each with around 5 players,  so there must have been  800-900 (if not more) players in the Open division.  Not one of them played more successfully than David Howell.  Moreover, his efforts went a long way towards giving England a top 15 finish.   Congratulations David Howell.  I was very happy for you.',5);
