Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4596,'mhhJFWsAHlo','Thank you for another enjoyable recap. You seem moderately exhausted and mildly disheartened, but the fact of the matter is you kept it close against an experienced ~2600 GM. That bodes well for the future if you decide to make a harder push for GM at some point. Good luck in your remaining rounds!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4597,'mhhJFWsAHlo','I got a stalemate trap over the board once. It was against a 1700 rated player and he was living on a +30 increment, it was a little more elaborate than your one, I had to sacrifice the queen but he had no way to stop it, and I got so excited I lost the ability to speak   for the next 30 min and I was just thinking about you all the time, so thank you for that 1/2 point, Eric',7);
