Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4613,'OCSbzArwB10','I have been a beginner for 30 yrs. I am professional beginner. Beginner Master. Expert in finding win for my opponent',17162);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4614,'OCSbzArwB10','Believe it or not I’m getting a bit emotional watching this. I was fascinated by chess as a kid, but I was useless at it and got discouraged. My dad tried to teach me, but that mostly involved a lot of yelling, swearing, and tears. This is the first time I’ve seen someone explain the game with such clarity, enthusiasm, patience, and obvious love for the game. At 32, hopefully this is the beginning of a new chess journey for me. Thankyou so much.',2759);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4615,'OCSbzArwB10','Finally a video that has explained the concept of chess PROPERLY for beginners. I have tried to learn for years and could not find anyone who had the ability to explain this to me. Thank you so much GothamChess ¿',152);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4616,'OCSbzArwB10','I haven''t played for years...needed a refresher. Thank you Levi, for a very informative and entertaining instructional video. You are a natural and easy-going teacher /entertainer. Hello from Australia!',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4617,'OCSbzArwB10','You have an awesome way of keeping a total newbie engaged and not feeling totally lost! Thank you! Looking forward to getting started.',45);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4618,'OCSbzArwB10','Very helpful! I learned how the pieces moved decades ago as a kid, but I never learned concepts like piece vision, protecting pieces, tactics vs strategies, etc. I taught myself a bit of these through playing, but I have many holes in my understanding.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4619,'OCSbzArwB10','I have huge anxiety, Starting to play with other people, started off marking huge mistakes, but I''m making fewer mistakes and learning what to do instead of what I did start off,  really improved !',46);
