Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4250,'c-UYuy7ttFg','I was at a trampoline park and after I was done jumping I decided to play some arcade games. I won 500 tickets from one game and got my first rubiks cube from there. It was really bad at maneuvering and would cause so much friction. So I decided to try and move it really fast back and forth and it literally blew into pieces in the middle of the parking lot and scattered everywhere mid-day with spectators around. Safe to say I could never get it back together. I ended up buying several speed cubes and I’m able to solve all of them.',0);
