Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4265,'AuYVJWN-A2c','I’m 68 years old and was challenged by my son to solve the cube. He tried to show me for weeks but I couldn’t do it. Tried other demos and nothing. I watched your video and it all clicked. Solved it in two days , now I can do it without watching. Thank you for being a great instructor!! I’m working on a faster time now. I can do it in about 6 minutes.',109);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4266,'AuYVJWN-A2c','I’ve tried so many tutorials and this video was the only one that was able to teach me how to solve it! You explain everything so thoroughly and in a way that’s easy to understand… you should make a tutorial for the 4x4!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4267,'AuYVJWN-A2c','This tutorial is AMAZING! I was a bit confused at the end when finishing off, but I eventually solved it hours later. I can''t believe it only took 2 days for me to solve! That''s really amazing for a beginner. I really expected it to take WEEKS, but it was only 2 days!',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4268,'AuYVJWN-A2c','Thank you so much for this video! All of the other tutorials were a bit harder to follow, but your video was followable and all of the steps were easy and organised. Once again, thank you so much!¿',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4269,'AuYVJWN-A2c','You are a fabulous teacher.  No ego, showing off or any of the things that discourage new cubers.  So clear and user friendly.  I am an older person who has cubed for 15 years. I solve many cubes, cuboids, odd shaped magic cubes, and supercubes and these often require the basic moves you teach here.  So while this is very beginner it is also very useful for advanced complex cubes that can''t be solved with advanced algs,  A pleasure!! I will show this video to a young neighbor whom I just gave a 3x3 and she is very excited about it.  I feel she''d do well with your great teaching style!!',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4270,'AuYVJWN-A2c','I have been trying to solve a Rubik’s cube for a year and your video has made me very confident around Rubik’s cubes. Thank you for making this video!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4271,'AuYVJWN-A2c','I solved my first Rubik’s cube after watching this video! Thank you for simplifying the process and being a great teacher ¿¿',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4272,'AuYVJWN-A2c','Fantastic tutorial! Much better than the others I watched. It''s not lengthy and simply explained. Time frames are much appreciated. The only thing I did not enjoy in the tutorial is the last layer part bc the algorithm was not taught in the intro and I messed it up due to the lack of practice. On a side note, I liked when you voiced the algorithm sequence not just showed.',2);
