Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4363,'l8nAhqoo_sE','It wouldn’t be that difficult to fix the Rubik’s Brand, smaller core, smoother edges, and the corners in the pieces could be rounded for more corner cutting',620);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4364,'l8nAhqoo_sE','J Perm once brought up that Rubik''s brand doesn''t really corner twist or pop. For non-speedcubers who wouldn''t know how to fix those issues in a way that keeps the cube solvable, it''s more important cube design makes these things impossible than it is important for cubes to be fast.',164);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4365,'l8nAhqoo_sE','I recently got myself the "impossible cube" that you showed at the end there. Regular Rubik''s brand and it both popped and had stickers fall off right out of the box. I believe they either don''t give a shit because they''re still the largest or they''re incompetent.',40);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4366,'l8nAhqoo_sE','I think its also built the way it is to prevent the cube from popping and corner twists.  You have to keep in mind its the OG cube meant for people that don''t understand the puzzle and if anything like that were to happen then the puzzle is therefore "broken" to them',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4367,'l8nAhqoo_sE','I have a Rubik''s cube that''s almost 20 years old. I got into cubing recently and bought a MeiLong as soon as I got some disposable pennies. I always assumed that it turns this horrible at least in part because of its age. But seeing how your brand new cube turns exactly like mine now I wish I could get my hands on a new one just to see if there is any difference.',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4368,'l8nAhqoo_sE','My friends are going to a speed cubing comp next week so they wanted to get me into it too. Currently have a broken thumb and a rubiks brand cube. My best time is 3:45.56. I learned how to solve it 3 days ago and I’m currently dreaming of how fast I can get my time up to if I had a working cube and thumb :)',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4369,'l8nAhqoo_sE','I have only had a Rubik''s cube for the entirety of my speed cubing journey. I''m finally going to get a good speed cube, but my best time on a regular cube is 40 seconds. It can be improved, I''m sure!',1);
