Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4430,'5s5BSfHKauw','You may never see this comment but if you do I just want to say thank you and all the other YouTube cubers for inspiring me to become a cuber and I found my love for cubing I learned to solve 2x2 to 5x5, the Rubik impossible, and this very morning I got my first sub minute on my 3x3 at solve time of 56 seconds and next week I be taking on the 3x3 mirror cube and I''m so grateful to the cubing community who is nothing but kind and supportive, I can''t wait to see what the cubing community has next in store for me and it''s been nearly 3 months since i began my cubing hobby and I wish you, jperm, Z3 cubing all the best and every other cubing YouTuber I hope to some day be able to become a speed cuber and explore more cubes but thanks for inspiring me and bringing such amazing content to YouTube all the best wishes to such kind people like you and all fellow cuber YouTubers I truly found what I''m good at and what I love to do.',31);
