Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4471,'xHWuoy4yJGo','Emil''s perspective is a classic example of the fallacy of zero sum thinking, where shallow thinkers believe that when one side wins the other necessarily losses.  Of course, when it comes to things like chess, this kind of thinking is completely erroneous, and on the contrary when one side "wins" both sides win - what is good for one aspect of chess is (broadly speaking) good for chess as a whole.  We should be doing everything possible to broaden chess''s appeal, garner additional exposure and grow its global popularity, and online chess obviously plays an enormous role in that process.  What is good for online chess is also good for OTB chess.  FIDE (and other large bureaucratic institutions) will hopefully eventually recognize and embrace this too.',9);
