Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4486,'GLpYQCCcZ6w','I think the point Gotham is making, especially with the Ruy Lopez/ Sicilian, is that openings of that caliber require such precision and accurate play that unless you''re willing to really spend a lot of time with minute details and study, you''re going to play them wrong. Even if you win games with them, it''ll be in spite of your opening, not because of it (generally speaking). He''s clearly talking about beginner/ intermediate caliber players, chess purists can relax.',828);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4487,'GLpYQCCcZ6w','Just wanna point out something interesting: 12:28 the Alapin variation of the Sicilian Defence with c3 and d4 is the EXACT reverse of the main line variation of the English Opening with c6-d5. Both of them are bad for the one playing against them. Please, LISTEN to this man and take some of his advice to heart.',206);
