Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4690,'PBTy3TqWmgk','The main reason I like Alex is because she is genuinely interested in people and pays attention to them when they speak, tell stories, etc. Very rare nowadays IMO.',213);
