Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4693,'PBTy3TqWmgk','What a turnaround!  Plus: this was a particularly good video because she sort of interviewed him about his life''s experience with chess!  So it''s a trash talk game....with an interview!  Alex is juggling three things during this video!  Liked the written commentary tips as well.',70);
