Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4702,'SXrKRA_KZ5k','That "fake training" tip has given me an epiphany about everything I do in life. Thank you Levy.',766);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4703,'SXrKRA_KZ5k','I started at 255 in April and I played so badly that my friends made me a laughing stock whenever I play together with them. I decided to subscribe to your channel, put some effort to study openings (I pick solely London for white and either KID or Scandi for black), and in 2 months I went up to 500. I stagnated between 600-700 until August, so I decided to learn more from you, consequently I start winning and 0-blunder games started to be a habit around November. In December I reached 900 and after now I am finally at the 4-digit mark. Thank you Levy! You''re such a great teacher!',770);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4704,'SXrKRA_KZ5k','"Local sight" is a common mistake (at least for me at fast time controls). You focus your attention on a specific area of the board and just forget that (far beyond) a long range piece is defending a square you judge unprotected.',217);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4706,'SXrKRA_KZ5k','Dude the fake training tip really does apply to everything. I’ve been practicing life drawing every day but just mindlessly putting marks on paper without internalizing new concepts. No wonder why I haven’t improved in quite a while. Thanks for opening my eyes Gotham!',224);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4707,'SXrKRA_KZ5k','I’ve started late in life at 58, and I’ve been paying for a year now. I decided to get better after I got so angry during lock down playing with my husband, that I felt sooo silly. Then Watching your videos, over and over made a big difference and In the last couple of months I’ve had some pretty amazing breakthrough! So thank you!',360);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4708,'SXrKRA_KZ5k','This was more than a chess lesson.  This was a life lesson.  Thank you, Levy!',153);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4709,'SXrKRA_KZ5k','This video is EXACTLY what the doctor ordered for me. I am guilty of ALL of these. I''m overly "fake trained" on puzzles, with an overconfidence and overinflated (2000-2100) puzzle rating. But in online games, I''m getting my ass handed to me by 1200 players, because of ALL these mistakes!!! Time to do a major reset! I made a post it cheat sheet on these 7 mistakes and will keep it in front of me as I play future online games. Time to get back to completing all the opening courses I have on Chessable! Thanks Levi!',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4710,'CS3RauXJzBA','She really said, “Good thing my sister is not here” ¿¿¿ the dad said “She’ll lose too” ¿¿ what a savage',18892);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4711,'CS3RauXJzBA','I lost in four moves to my 5 year old son  once. I felt very humbled, and a bit foolish. He was beaming with triumph at having defeated his dad at chess.',664);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4712,'CS3RauXJzBA','Dear Andrea, I was thoroughly impressed by your welcoming, warm attitude and your gracious and warm attitude when you lost. I think that the way you played and engaged young Kai will stay with him for the rest of his life. You may not be (at this time) the number one chess player in the world, but I think you''re doing something far more important: you''re winning the hearts of these children and that is a gift that will stay with them for life. Thank you for sharing.',268);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4714,'CS3RauXJzBA','What a wonderful  young lady you are to work with children! And , a big CONGRATULATIONS to the young man! He was SO happy  while playing.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4716,'CS3RauXJzBA','This is just a simple, respectful game of chess and I love it. That kid is great, I support him!',4);
