Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4724,'-dqb6xchBuI','2:07:13 "OMG!! ... Why?!?!"   We were treated to David''s rare voice of emphatic, unequivocal, disapproval for Duda''s breach of David''s most cherished endgame-principle, "Do Not Rush"!!  ¿¿  3:09:58 Rook endgames!!',6);
