Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4731,'_9Ly6jx2uz8','We love Jerry''s videos. His analysis is excellent. Jerry, we hope you will review some of the games at this year''s Candidates Tournament.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4732,'_9Ly6jx2uz8','I really liked the way the game was described. Each move was analyzed with possible options, giving the viewer opportunity to see how Fischer developed his strategy. Some commentators are too fast, too slick. This was much better.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4733,'_9Ly6jx2uz8','Jerry, your videos are some of the most instructive on the internet. My top 3 favorite Youtubers are you, Gotham and Daniel Naroditsky. Gotham teaches you how to understand broad, overarching concepts like a master. Daniel teaches you how to understand the fine details like a master. And you teach us how to realize what master-level thinking even looks like. Seriously. I studied tactics and positional chess for years and couldn''t advance past 1200. But your Beginner to GM series totally revolutionized the way I looked at the board. I gained more in the 2 years since I watched those videos than I did in my previous 5+ years of serious chess study.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4734,'_9Ly6jx2uz8','What a beautiful game! I’ve never seen this before. One of the many reasons Bobby Fischer may have been the greatest player ever',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4735,'_9Ly6jx2uz8','I think I''m speaking in name of every one here when I say: we need more videos, Jerry. We love your videos.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4736,'_9Ly6jx2uz8','Hey, Jerry. Been watching you for more than 14 years now and I pretty much owe you my accent. Thanks for the chess analysis and English that you have taught me during this huge period of time. And I really would like to see your face while listening to you. Please keep it in your mind. You are excellent . Take care. ¿¿',98);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4737,'_9Ly6jx2uz8','I''m certainly not a good chess player. I think your narration was perfect. It gave me insights as to what the great players are thinking. It''s the best chess video I''ve seen. Thanx.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4738,'_9Ly6jx2uz8','Quality over quantity. Watching your powerful, well thought analysis always shows me, you''re on another level. Thanks for your effort!',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4739,'_9Ly6jx2uz8','I was just thinking yesterday “man it’s been a while since jerry uploaded”. Always a joy to see you uploading, especially the analysis vids!',5);
