Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4762,'BkC1xEZn-6o','That''s my cousin. Always had a kind heart and always loved chess while we were goofing around as kids I would watch that boy read chess books and wash grown men. I''m so proud of you man.',1404);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4763,'BkC1xEZn-6o','She said Danny plays an "aggressive style" but actually, if you look, he is quite positional. Loves the two bishops and throws in an h4 to throw off his opponent. He tries to make make very tiny advantages that eventually point at your king. I simply love his playing style!',581);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4764,'BkC1xEZn-6o','Im so impressed by Danny’s ability to delay castles in both games. He seems very aware of the positional advantages that he can take by delaying.',410);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4765,'BkC1xEZn-6o','Anna, love the videos.  2 suggestions: 1) it''d be awesome if you could show the clock somehow?. Maybe a digital clock that can be synchronized to the video?  2) If you or opponent resign, a 30 second explanation of why it was "resigns" at the end would be awesome.  In this case, I saw your B on a5 was hanging and white''s rook defending their e2 bishop.  But it''s not always super easy for us to figure out.',445);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4766,'BkC1xEZn-6o','Anna took two losses in a row and was laughing and having fun with a strong player. It''s amazing to watch two pros go neck and neck at each other like this. Thank you so much!',177);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4767,'BkC1xEZn-6o','Other than an amazing player, Danny seems really modest and kind. I wish I was living anywhere near these kinds of Parks. I love how it''s nice weather, people casually walking by and stop to spectate the game. It kind of restores my faith in this world',307);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4768,'BkC1xEZn-6o','Gotta love chess…How does a random dude in the park casually crush a FM with a lifetime of training and world famous GM parents? She earns my respect for posting this!',379);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4769,'BkC1xEZn-6o','Need a Danny YouTube. His play style would be really fun to watch consistently',294);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4770,'Rk4bAofG8xE','Also interesting for curious people, Pragg has been called as Grunfeld Slayer by GM Howell – as he has won 100% of his games as white against it.',355);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4771,'Rk4bAofG8xE','Pragg is becoming my favorite chess player. Still love Chucky''s games but pragg is putting in that work and making magic happen on the board.',140);
