Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4813,'Jc3TgOaC_5Q','We keep saying "It''s the Magnus effect" (not talking about basketballs and dams here....) but would be interesting to test this. In an esport I follow, (Age of Empires 2) one player (TheViper) was so dominant for so long that a streamer (T90Official) came up with the idea of an event he called Hidden Cup where everyone''s identities were hidden and only revealed at the end. Each player was given a name to play under so nobody knew who was who. Was a really interesting concept, as there were awesome games and so much speculation over who was who. They''ve repeated the format 4 times now, which says something about how loved it is. But with chess being an online thing now, this kind of event is very possible and I think would be fascinating. Would Magnus still win? (TheViper did, so proved that theory wrong at least for him!)',249);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4817,'Jc3TgOaC_5Q','Imagine being an Grand Master who does not lose any games, and also being an GM that loses in 10 moves.',261);
