Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4852,'Od3gG13tyf8','Spasky was arguably even more impressive by being a grandmaster of kindness.',2524);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4853,'Od3gG13tyf8','I remember watching an interview with Fischer and he mentioned how during matches even the wrong lighting would throw him off. Definitely seems like he might have had sensory issues that weren’t well understood at the time.',2930);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4854,'Od3gG13tyf8','Spasky was honestly the mvp of the story with giving into Fischers demands to ensure he got a fair shot to prove his title even though he was being pressured to win at all costs by the soviet union, just because he respected him. Plus even though Fischer went off grid for like twenty years, Spasky was willing to go out of his way to play with him again. Then to try and personally protest for his release from prison and even ask to stay in his cell to play chess with him, just because he respected his skill so much.',3317);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4857,'Od3gG13tyf8','The light sensitivity and erratic behavior are symptoms of a person "on the spectrum". It is not uncommon for people like this to prefer lamps to ceiling lights as the glare is annoying to them. Lashing out comes from difficulty communicating, feeling different and knowing you are different, it is easy to believe that you are being mocked and lacking the skills to compete it is easier to flee than fight. Fishers mental health was probably not caused by chess but the pressure that came to surround him due to his success at chess. While playing he probably felt safe, knowing the rules, knowing everyone had to obey them and that he would not be mocked for some social faux pas he didn''t understand or care about.',79);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4859,'Od3gG13tyf8','My dad tried to teach me chess, I was only 10, he was 52. I picked up the moves of the pieces easily. Halfway through our first game he said “Do you have a strategy or are you just making moves at random?” I said “Making moves at random.” He boxed up the pieces and that was that. I later turned out to be a terrific poker player ¿',4194);
