Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4865,'t8IVLOM1fXI','First of all, as someone that has played chess for close to 20 years (on and off), I am impressed with the results that Michelle made in a short time. Chess is a game that you have to play for months at the very least to become good at. It takes time to recognize patterns and then feel comfortable enough playing against someone else that has also been playing for a while. You did great Michelle :)',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4866,'t8IVLOM1fXI','Thank you so much for reaching out early in 2021, I am so thrilled we got to start this journey and everything it became. Congratulations on a spectacular episode, cheers to us all hating chess together!',23009);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4868,'t8IVLOM1fXI','I''m officially addicted to rewatching this shit over and over. I think Michelle really put her finger on the main problem with chess: because it''s so much tied to our perception of intelligence, not being good enough makes you feel dumb and embarrassed rather than just treating it as another skill to learn. Once you get over this barrier in your head, it becomes fun',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4869,'t8IVLOM1fXI','Anna and her "It''s Castlemania!!" had me at the edge of my seat cheering. Lovely to have someone so supportive and excited for you in your corner',68);
