Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4880,'-Mv5KqtuVrc','Thanks James. Really informative for an older beginner like me (I''m 59). I always fail because the young players are so fast at assessing positions and adapting. Now I can have a system - hopefully I''ll feel less disoriented ¿.',0);
