Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4914,'9Q9z1cDxo50','Finally !!! The front facing camera moving to the horizontal position. ¿ Now if only they would carry this over to the pro models. That’s when I would buy one as I do zoom and teams calls and the current iPad setup is totally frustrating.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4915,'9Q9z1cDxo50','This is crazy! Finally a new event! Oh yeah! I hope for the iPad 10th gen and of course iPhone 14!!! I need to make a video about it on my channel too.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4916,'9Q9z1cDxo50','I used to own a Time Machine (well, actually a Time Capsule) but the drive in it failed. I would love to see Apple bring back a modern version of that device. The Pro watch is attractive (I’m still rocking a 6) and forget about *any* new iPhone until they have USB-C/Thunderbolt 4.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4917,'9Q9z1cDxo50','Will wait one more year for the universal connectivity of USB-C and the better battery life and speed of the 3nm processor.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4918,'9Q9z1cDxo50','I''m buying iPhone 14 Pro Max and Apple watch 8 plus newest Airpods Pro, been saving ages! Cheers dude. Won''t the Pro Max come with 16 out of the box though? ¿¿¿¿¿',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4919,'9Q9z1cDxo50','Thanks for the informative video! I have an iPhone 13 Pro and probably gonna stick with it for maybe 3-4 years ¿',12);
