Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4922,'pv5v20md5Sk','It seems way more likely to me that the invite is actually referring to astrophotography. The iPhone has improved a LOT in the last few years at low-light photography, especially if you''re using a tripod. Plus, if there''s going to be a 48mp camera sensor, that''ll be amazingly helpful for nighttime shots. I''m about as confident about that as Sam is about it being satellite connectivity ¿',24);
