Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4925,'pv5v20md5Sk','Astrophotography? Can it finally take pictures of the moon, like my DSLR? I love your channel nd podcast and can''t wait for the 14 pro max!',75);
