Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4941,'eqOWtZHQV3I','When it comes to Apple the key to the hints they give is not to overthink it and I’m pretty sure this is related to the newer bigger camera that’s gonna be on the phones that will take beautiful pictures of the night sky. If there’s one thing I’ve learned about Apple in the past 10 years is that they aren’t that deep.',92);
