Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4957,'ByVAo54hYeQ','I am ready for September 7! Hopefully iOS 16 and watchOS now will come out on Monday the 12th. That would be a good release date. I find it funny that iPadOS will be delayed a month. That is very strange. It seems like Apple would just wait until stage manager got fixed and release it with a subsequent update like iPadOS 16.1 or 16.0.1.',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (4958,'ByVAo54hYeQ','Was really hoping the airpods would have some sort of hearing loss/hearing aid abilities. There is a stigma (and $$$$ pricing on real hearing aids) whereas most "headphones & phone" combos have far more processing and programming abilities to the nerfed offerings from hearing aid manufacturers. It would be a massive market to tap into and takeover for whichever phone maker does it first.',0);
