Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5001,'cqwpLa7eN54','I know I’m in the minority, but I love my 13 Mini, will be keeping that until it can’t go anymore, or some huge leap in tech comes. Also, got a titanium Apple Watch 7 at launch and will be keeping that until we get a HUGE leap in battery tech.',157);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5225,'JVh6j5LvLzE','Tienes Razon Apple Tv, tiene excelentes series (tuve seis meses gratis), aunque debo decir que la serpientes essex, no me termina de convecer, y hablando de Gary Oldman y de espias, no se si has podido ver Tinker Tailor Soldier Spy, en HBO,(el topo), de Tomas Alfredson, con la siempre genial fotografia de Hoyte van Hoytema y banda sonora de Alberto Iglesias, es maravillosa para los que nos gustan las novelas de espias lejos del sobresaturado James Bond',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5226,'JVh6j5LvLzE','Si aparece Gary oldman es garantía de buenas actuaciones ¿¿¿',60);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5227,'JVh6j5LvLzE','¡Saludos! Suena muy bien, pero para ésta si tendré que esperar, no estoy suscrito a esa plataforma jaja. Ahora que lo pienso quizá estaría padre que nos recomendaras cuál es el servicio de streaming más completo o el que más vale la pena, porque pagarlos todos si es una lana jajaja. Abrazo.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5228,'JVh6j5LvLzE','Líder ayer ví the Golden rush de Charlie chapín  me pareció magnífica a pesar de que es de 1925  nose si algún día nos puedes regalar un vídeo hablando de este cine mudo.muchars gracias por tu contenido saludos',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5229,'JVh6j5LvLzE','Apple TV+ es una JOYA de servicio con contenido de primerísimo nivel; Planeta Prehistórico, Now and Then, Ted Lasso, Blackbird, Five Days at Memorial, Malas Hermanas, See, Todo el Dinero, Severance, Teherán… hasta el Show de Snoopy son producciones de gran nivel, con elencos e historias impactantes, guiones originales, actuaciones magistrales, y tramas muy bien desarrolladas. Creo que junto a HBO Max son, en este momento, las únicas dos plataformas de Streaming que valen la pena.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5231,'xf2DPY3vGto','I think usb-c is another huge win for Android. being able to charge everything from laptop to phone to speaker with the same cable is game changing',24316);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5232,'xf2DPY3vGto','I have been an Android user for 10 plus years and especially with Samsung devices the OS system has drastically improved. I went from a Galaxy s10e to the s22 ultra when it came out and it seems like it took a few updates to really get the full potential from the new chip. I would get the occasional hiccups but I might be able to reason that the covid pandemic kind of slow development down just like it has with a lot of other things but other than that seems like my phone is getting better and better with each monthly update.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5235,'xf2DPY3vGto','When I switched from the iPhone 7 to the Galaxy S lineup. My primary reason was the flexibility of the software but in particular the way it handled files of multiple types, it’s so practical to do things on Android that if you had an iPhone would be a hassle to do them and would make you want a Laptop or desktop for. That being said, I still own an iPad that I use a lot, and wouldn’t exchange for any other tablet.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5236,'xf2DPY3vGto','I''m surprised by the environmental score going to Apple. Apple phones while made from recycled materials are made in such a way that makes repairs very difficult compared to most Android phones. One could argue that Apple''s poor repairability contributes more to e-waste than Androids. Surprised that didn''t get a mention.',3837);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5237,'xf2DPY3vGto','Android has air drop..it''s called "nearby share" FaceTime is just video calling',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5238,'xf2DPY3vGto','I absolutely love watching you guys converse about technology.  Great video!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5239,'xf2DPY3vGto','Andriod has alot of features that you might not use everyday but when you need it they are always there whereas with iphone you basically just can''t do what you want. I was on the fence of switching to iphone but when I learned more about ios I think I''m good with my andriod device. The splitscreen feature is useful to me I can basically have anything playing on youtuber while using maps(I used to listen to lectures while driving which is a game changer specially when you''re short on time) whereas with iphone I can''t do that. Also, MKBHD is using an andriod phone while complementing iphone which just goes to what they actually prefer to use even tho they have multiple options to choose from.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5240,'9xpri0BLLio','I’m starting to realize that people have learned how to have a career by making content that revolves around bad assumptions … and then make more content responding to those bad assumptions with other bad assumptions.',37);
