Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5243,'9xpri0BLLio','I really hope they give us a purple 14 pro that looks like the renders. It really looks good. Still Apple could surprise us.',2);
