Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5249,'9xpri0BLLio','I love the camera bump as a guy who loves luxury this just adds another luxurious look to the iPhone along with those protruding Camera bumps, Samsung is copying it jt can’t be bad ¿ most importantly it means higher quality cameras and durability with thickness its the best selling phone in the world right now for a reason Aesthetics do matter a lot. Anyone complaining well there are other options except you know they use less premium materials than Apple currently.',0);
