Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5252,'Dm_x7ypFwgo','It’s smart to keep the always on display on the 14 series and newer because battery life would likely take a big hit on a phone that only drops to 10Hz (13 Series). 1 Hz is probably best case to keep battery life up to the standard. My issue with the 14 Pro series is that the Pro Max will get a smaller battery this year. I’m a yearly upgrade person but I won’t be upgrading if the battery capacity is smaller this year. I’ll wait until the 15 Pro Max.',7);
