Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5271,'zDiC8KexSRM','Im not fanboying or anything, Me myself as an android user more specifically “Samsung” i see this as impossible , they are on a different level, people buy there products without even regretting or thinking about it , and if this new pi phone ever blew up it wont last nor have the experience the apple/samsung team have provided.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5272,'zDiC8KexSRM','If this is true I couldn''t possibly be happier! But I''ve been hearing about this phone for a LOOOOOOOOOOOONG damn time and have yet to see it actually coming to production, much less available to buy. I HATE Apple with a violent passion!!! I''m not the least bit fond of Samsung, because they seem like they just want to be their own version of Apple. I''ve been a longtime LG fan and had them for many years, but they gave up, so NOW would be an excellent time to release this beast! PLEASE make it happen!',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5273,'zDiC8KexSRM','Phone are no longer compared by speed but by their features and use cases. Many mobile apps won''t port and develop an app if no one uses them. Look at Instagram, they still don''t have an iPad version. If he proposes a plan that entises both potential customers and developers then it should work. I highly doubt he''ll venture to the mobile market and build another os from the ground up. Both apple and Android has a massive library.',8);
