Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5275,'zDiC8KexSRM','Tesla has finally unveiled their Tesla Pi Phone and it is a beauty! The phone comes with a 6.39-inch AMOLED display, 12GB of RAM, and 1TB of storage. It runs on Tesla’s own operating system, Tesla OS. The best part? The price tag! Tesla is selling the Pi Phone for only £799 in the UK!',13);
