Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5278,'zDiC8KexSRM','I can’t wait for the new Tesla phone.  When is it going out to market?',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5279,'zDiC8KexSRM','LOL no one is dropping iPhones because it ‘broke their email system’. It might attract android users who LOVE a hardware spec or screen folding feature regardless of how it’s going to be used. OOOH more camera megapixel and RAM that makes 0 difference in reality.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5281,'uWJE4LtfHvQ','Not happy about the live wallpaper removal but hope that the dynamic wallpaper has room for growth and more will come with that. So far I’m enjoying the ios 16 beta.  It’s buggy that’s for sure but its still a good update.  Using on both a XR and 12  both run pretty smooth. Little hiccups here and there but nothing major.',672);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5282,'uWJE4LtfHvQ','I was so sad they removed “Live Wallpapers” in the way we previously knew, being able to tap and hold for the animation… I wish we had access to the ones that animate when going to the Homescreen and the old ones ¿',1025);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5283,'uWJE4LtfHvQ','In the music app I really like the slider for both volume and lyrics as opposed to the bubble.. It seems to show the relative percentage better to me …I do like the new slider effect  in iOS 16',320);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5284,'uWJE4LtfHvQ','I hope we can "lock" the lockscreen. I dont want to accidentally long press the screen (which i often do believe it or not) and change the wallpaper lol',95);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5285,'uWJE4LtfHvQ','This is my first time even seeing IOS 16. Looks so different and I always love new updates. This is a huge update that unlocks many new features but kinda sad they took other great features',75);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5286,'uWJE4LtfHvQ','I like the new volume and scrubbing slider in music, seems like it’ll be much more responsive and easier to grab. Since the past few iOS versions it’s very irritating when it doesn’t register you’re grabbing the slider for volume, especially on the Lock Screen in iOS 14 & 15',168);
