Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5290,'HOaxJU_xCiE','Não faz sentido, de fato, trocar o 13 pelo 14. Eu to muito tentado a pegar um 14 max por que gosto de tela grande e meu iPhone atual é um 11 de 256 que ainda me atende tranquilo mas quero passar para frente. A unica coisa que reclamo é que a Apple poderia pelo menos colocar tela 90hz nos iPhones normais, 60hz sem flutuação na taxa de atualização consome mais bateria, seria um negocio legal, mas parece que eles querem é que a galera toda vá no pro.',30);
