Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5044,'N1kjLnSv6Wg','I am very excited to see what happens now that Johnny has moved on to something else. It took some getting used to but I really like watchOS along with iOS and iPadOS. Sometimes I think Apple keeps a certain product like the iPhone X or Apple Watch Series 3 supported way too long. One thing that forces you to get a new Apple Watch is when the battery starts malfunctioning. That has happened to me twice. I have the same Apple TV that you were talking about that needs to be discontinued. I have not had any issues with it so I have no reason to complain except I do believe they need a new high definition Apple TV. My TV does not support 4K. When Apple stops supporting this particular TV model, I will definitely upgrade. Although my new TV has AppleTV built into the App Store, I cannot find the ESPN or MLB applications and I have not found a Visio App Store.',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5045,'N1kjLnSv6Wg','The Apple we have now is much larger than the Apple Steve inherited after they nearly died. I don’t think they have too many products but I agree about them dragging along some models like the watch and TV HD. Apple’s current path is bringing new customers to the Mac that would have stayed on Windows. Simple functionality can mean having the ports a laptop needs and great battery life.',8);
