Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5082,'QbVQuA25GDQ','I have a question regarding "Price Drops". The video mentions the iPhone 12 and 13. Does the price drop only apply to the normal models, or to the entire 12/13 (Pro and Pro Max) lineup? If so, will you only get these models for the reduced price from Apple or also from other retailers, for example Amazon?',16);
