Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5090,'emANU6ca7D4','Make sure you add a payment type so you can give more money to Apple, that makes getting ''important'' updates a lot easier. It''s all part of that Apple ''user experience''. Then you don''t have to ''look at'' anything, you''ll just see a front-facing update that doesn''t take a back seat to Apple greed.',2);
