Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5098,'emANU6ca7D4','If updates only fixed security flaws then updates would be a good thing with no downside consequences. But that''s rarely, if ever, the case. Updates can change the appearance, features and smooth operation of applications,  and even slow down your phone.',19);
