Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5110,'Byb2W8hTbik','Those slick Apple product videos haven''t been the same without Jony saying "Alyoumineeum..."',735);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5111,'Byb2W8hTbik','I wholeheartedly recommend that you read the new book “After Steve”. (The audiobook is great, too!). It discusses the dynamic between Jony, Tim and Steve - and Jony’s frustrations after Steve passed. I think you’d enjoy it!',71);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5112,'Byb2W8hTbik','While I like the clean lines of square/boxy design.. however every time I hold my old iPhone 12 Pro, I actually really miss those curved edges, it''s WAYYY more comfortable to hold than my 13 Pro.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5113,'Byb2W8hTbik','i think the end of the endless pursuit for thinness and design, i.e. form over function represents the lifting of a burden on apple''s legendary branding. apple''s prioritization on performance and functionality is going to be a great thing to see!',436);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5114,'Byb2W8hTbik','I normally never comment, but I can’t help on commenting on this video. This video is incredibly well done! It is so different to the usual tech videos. Also it is really well researched. Thank you for your work, Sara!',163);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5115,'Byb2W8hTbik','It''s strange, I was literally thinking about this just the other day and how many people actively avoid getting a MacBook between 2016-19 on the used market. So glad they''ve gone back to functionality. I just hope they can sort their ''oh so strange'' pricing points! (an upgraded Air m2 costs almost the same as the M1 Pro... like what?).',61);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5116,'Byb2W8hTbik','In my opinion the greatness of Apples design language came from the combination of Ive and Jobs - they kind  of needed each other as sparring partners. The post jobs era lacked a lot of innovative design ideas …',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5118,'Byb2W8hTbik','2016-2019 was arguably Apple’s…not worse but unpleasant years for hardware and software. For example, iOS 11 (2017) was pure trash. Control center for iOS 10 was…hit or miss because you had to swipe in order to get to media controls but as apple transitioned into 2020 with the redesigned MacBook, flat edge iPhone, apple silicone, etc. Apple is doing much better. Software is much better too. Not to mention, Apple is bringing back COLORS to their products. No more space gray, gold and silver. We have blue iPhones, red, green purple, sierra blue, midnight green, pink, so many beautiful colors. Red Apple Watch, blue Apple Watch, blue AirPods max, pink and green. Apple is so much (arguably) better now. Ive was good for his time but 2019 onward, we see and are experiencing a new apple for the better',63);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5119,'Byb2W8hTbik','As a long time Apple fan….your video was spot on and fair. All those Apple products you thought were awful, really were awful. :) I share your optimism for a new Apple era where we get a better balance between performance, function, size/weight, and design.',83);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5120,'mrA6g8HjDks','I love the fact that they are creating the max version in pro and non pro. I feel like it’s tough to find the pro max models in recent years in the color and storage size if you don’t preorder on launch day. There’s probably a large market of people who just want the large screen but are not as focused on all the extra features so I’m wondering if that’s apples reasoning for it.',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5121,'mrA6g8HjDks','Love the 13 Pro Max for photo and video. I''m hoping iOS 16 will bring improvements in processing - better skin tones generally.',63);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5122,'mrA6g8HjDks','Love the 13 Pro Max for photo and video. I''m hoping iOS 16 will bring improvements in processing - better skin tones generally.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5123,'mrA6g8HjDks','Hoping to upgrade my iPhone 8 to an iPhone 13 mini once these come out. Apparently I’m one of the few users that prefers the small phone.',288);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5124,'mrA6g8HjDks','I love how Apple is now just always playing catch up with Samsung. Samsung first had like 4 or 5 models of each flagship phone, whereas Apple just had 2, the small one and the big one, now they have 4 different models. Samsung decided to go with a hole punch in the screen for the selfie camera, and Apple decided to screw everyone with that ugly cutout at the top, now they''re going with a hole punch.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5125,'mrA6g8HjDks','Why am I always let down by these releases. Apple (and basically all companies now) are really bending us all over and going raw',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5126,'mrA6g8HjDks','Still very disappointing that the Mini has been deleted from the roster. There are still many users who prefer the smaller phone. Maybe in the future Apple will once again offer the smaller phone.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5127,'mrA6g8HjDks','I have the 12pro max and literally only getting the IP14 Pro model because I’m tired of the max size.  So really nothing on the 14 pro model that wows me.  But really at this point in yearly iPhones, we are past the wow must have moments.  So this 14 pro model will be the first iphone that I will keep for years and not upgrade until it breaks and have to get new phone',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5128,'mrA6g8HjDks','The rumour about titanium coming to the iPhone 14 Pro models was a old rumour. The latest rumours don’t mention titanium at all.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5130,'N3odbO3RlTU','What Apple Product are you most EXCITED to see in September?',108);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5131,'N3odbO3RlTU','This is the first year I’m getting a Pro Max version so I’m pumped for that, but I’m also very intrigued by an Apple Watch Pro. I’ve always had an Apple Watch and I want to see what a Pro model has to offer.',137);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5132,'N3odbO3RlTU','Hugely excited for the new re-designed Apple Watch. I had high hopes last year, however, I was a bit disappointed when we didn''t get a fresh new design. hopefully all the rumours are true for this year - and if so, I''ll definitely be picking up the new Apple Watch!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5133,'N3odbO3RlTU','I’m getting the iPad Pro next week! This year I really got into the Apple ecosystem after using android and windows my whole life. Super happy about making the move and I can’t wait to see what this event brings us including with OS updates!',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5134,'N3odbO3RlTU','I might be tempted with a watch upgrade however I’m waiting for the mixed reality headset reveal and saving my money for the predicted steep price -knowing Apple they will tempt us with new features only available in their newest phone, macs and watches compatible with the headset.  Very exciting and very pricey!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5135,'N3odbO3RlTU','I am excited to see just how they change the budget iPad and how the screen will look :) and what the new watch will look like! September can''t come soon enough! Great video like always ¿',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5136,'N3odbO3RlTU','I''m interested in buying the Apple Watch Pro. It would be my first Apple Watch, and hopefully the battery life on the Pro is significantly improved from the regular model.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5137,'N3odbO3RlTU','I’m excited for an Apple Watch redesign myself. Currently still rocking my Apple Watch series 4, but likely due for an upgrade sooner than later. Otherwise, all I’m really missing from my Apple setup at the moment is a MacBook… ;)',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5138,'N3odbO3RlTU','I really love the iPhone Pro Max models !! I’m sure that Apple know what they are doing (;',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5139,'N3odbO3RlTU','I will definitely be upgrading to a 14 Pro Max from my 13 Pro. I’ve had every iPhone from the 3GS and up, and also three iterations of the Apple Watch. Apple Watch Series 8 will also be in the EDC as well!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5140,'4FIMPFdROsc','Thank you for a well done video.  I am certainly anxiously awaiting the model 8, both for the added functions and most of all improved battery life. A pro model at 50mm (in my view) is just too large.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5141,'4FIMPFdROsc','I''d like to see them implement a wider bluetooth range for the watch to phone connectivity and also a wider range for cellular. the reception of booth have stayed the same other the different series. that''s what i want most. they can keep the same look, just needs better utilization.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5142,'4FIMPFdROsc','My personal opinion: great product. Great design, great features but it doesn’t have the “wow” factor that ekg had. I wish it had another hardware upgrade other than core temperature for me to be convinced to buy it this year. Perhaps if they added, something with mental health, more connectivity with your home, wallet or something, perhaps.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5143,'4FIMPFdROsc','I am excited! I’m anxious to see what Apple officials have to say in September. Honestly, I really like the Apple Watch SE model. I really don’t see any use for all of those fancy sensors that Apple talks about. I’m not sure how reliable they are. Next time I go to my primary care physician, I will definitely ask her what she thinks of the Apple Watch. I’m not sure if she’s even noticed it when I have gone to her before.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5144,'4FIMPFdROsc','I’d get the Pro all day long….a bigger display would be amazing!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5145,'4FIMPFdROsc','Awesome!  I''m waiting for the Pro version 50mm.  And hoping for longer battery life.  Battery life was why I sold my Series 7 after a few months.  Coming off a 3--5 day FitBit, it just didn''t offer enough value to me with the need to always charge during the day.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5146,'4FIMPFdROsc','My biggest problem so far with my 6 has been that the sensors don’t read over the tattoo on my left wrist so I have to wear it on my right. On my left wrist, quite a few features don’t work. If they fix this in 8 I will by the biggest best model that they have!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5147,'4FIMPFdROsc','Love apple I am looking forward to seeing the new 8 especially the larger model',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5149,'4FIMPFdROsc','The only thing interesting for me would be the possibility for international roaming. Actually I cannot have it on the 7, but it seems that it is possible with Samsung watches…how come?',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5150,'WfVF-Ec4naQ','Nothing beats the amazing intros that the team makes in these videos',24299);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5151,'WfVF-Ec4naQ','Another cool thing missed in the review is how you can have the album cover of the track that is currently playing replace the wallpaper on the lock screen. Just tap the mini album cover.',472);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5152,'WfVF-Ec4naQ','So much to look forward to here!! I’m especially excited about the webcam + top-down option and the live objects, but everything else you shared with us here sounds just as amazing',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5153,'WfVF-Ec4naQ','I love customization in lockscreen and that alone makes iOS 16 a little better than previous versions. And to know that it cannot cover my precious wallpaper which I mostly edit myself is a good addition! Dragging those photos in messages is really cool and satisfying!',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5155,'WfVF-Ec4naQ','This is one of the most interesting iOS updates in a while. Actually kinda looking forward for this one.',2959);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5156,'WfVF-Ec4naQ','The only thing exiting about iOS 15 for me was sharing your screen over FaceTime. I used that a whole lot, but this iOS update brings so much to the table, and the Lock Screen customization has been something I’m suprised didn’t get added earlier',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5158,'WfVF-Ec4naQ','100% the most stable beta I’ve ever done on an apple product. Think this is going to be one of the smoothest releases ever. My biggest complaint is the UI for a lot of logins in safari. Not sure what it is but it just looks ugly and like stuff doesn’t fit right. I’m sure there is some kind of setting I can tweak, but LOVE the weather Lock Screen and matching wallpaper if looks really clean! The layout of settings is a lot better also, even though inevitably when they rearrange settings it takes a while to find everything, but it is much more intuitively than previous “improvements”.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5159,'WfVF-Ec4naQ','Love it. Animations, everything, kudos for you and your team for making such amazing content! :)',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5161,'xXzX0ZMMRX8','Thanks dude.  Your leak theories are very practical.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5162,'xXzX0ZMMRX8','I think they keep home button models because kids and older people actually like it better.  It''s so much more simple to do a button press than remember 19 swipe gestures.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5163,'xXzX0ZMMRX8','I actually started using an iPad for the first time exactly one year ago. and yep. I finally get it. It is THE go to device for consuming content.',192);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5164,'xXzX0ZMMRX8','"Oh. My. God. Apple is FINALLY! increasing the price of the base iPad and keeping the large bezels on the top and bottom to make sure it is ugly and everyone knows you couldn''t afford the iPad Air. This is ABSOLUTELY AMAZING!!!!!" - Max Tech',197);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5167,'xXzX0ZMMRX8','Honestly the homebutton isn’t that bad considering every iPad other than the Pro still uses TouchID, so the button on the front could be more practical than the power button on the top like Air and the Mini have.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5169,'xXzX0ZMMRX8','I was looking forward to the new base iPad but a new design with a home button feels like a really odd decision considering it’ll be sticking around for many years to come. Might look for a 2018 pro or 2020 air instead now.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5170,'ug_ArwfWoAo','Man, really appreciate the comments and support around this video.  I sat on this story for so long, it feels great to get it out. One thing I ask is, don''t evaluate any other content creators through the lens of this story.  Everyone has their own experiences, these are just mine.',1214);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5171,'ug_ArwfWoAo','Pretty bananas but entirely unsurprising. I’ve heard from multiple friends about my blacklisted status without ever having spoken to anyone at Apple ever.',1916);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5172,'ug_ArwfWoAo','Did you get another phone call after THIS video went live? ¿',72);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5173,'ug_ArwfWoAo','Now you know why iJustine always gets stuff because she just smiles and tells you how great the device is.',931);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5174,'ug_ArwfWoAo','We appreciate the transparency and honesty. It’s very unfortunate when these companies think they have more control than they actually do.',285);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5175,'ug_ArwfWoAo','Yep - this is exactly how Apple picks winners and losers. Those they hand pick get early devices, lots of traffic, and the corresponding revenue (along with great SEO/recommendation positions for future placements). There''s tremendous value in access to them and Apple knows it. Most of this goes undisclosed by those whom Apple picks for review units and access.',89);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5177,'ug_ArwfWoAo','You know you are fair an unbiased when a company throws a tantrum because you were being honest.',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5178,'ug_ArwfWoAo','I''m not really surprised at how you were treated. Apple likes to control the narrative. Always has. I''m glad you shared this story. Makes you more trustworthy, in my opinion.',1635);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5179,'ug_ArwfWoAo','I bet apple will be calling you about this video now too. Keep up the good content and don''t let these companies bully you into doing what they want! that is why we love you!',148);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5180,'IQgSWzAMp9o','I worked with Apple as a tech advisor focusing on software-related issues and general usage in Asia-Pacific,mainly Australia and New Zealand customers. Apple has "Bounty" for anyone that may crack and report vulnerability. If there''s issues like this, we can submit a report and escalate it to Senior Engineers that make some time to resolve or find solution.',94);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5181,'IQgSWzAMp9o','Funny how apple hasn’t alerted me via their internal system yet and that I had to randomly come across this alert. I am so over huge updates for apps I never use but cannot delete, and the data being used in the background for ‘uninstalled’ apps. But it is likely I was hacked two or so weeks ago, I couldn’t find any information from apole to help me understand what was happening. I have no more room to update on my macbook or ipad, my new iphone is extremely frustrating and seems to have. Nothing like the convenient features of android phones, methinks I am done being a slave to their gaslighting.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5182,'IQgSWzAMp9o','This guy lowkey said "You are not vulnerable to this attack and shouldn''t need to worry about because you are useless."',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5183,'IQgSWzAMp9o','I would be more worried, that most apps today are collecting crazy amounts of personal data and nobody is allowed to talk about that.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5184,'IQgSWzAMp9o','Apple''s major security flaws happened so many times. On the other hand, Android seems to have none in this past few months. Does this mean Android security is much stable than IOS?',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5185,'IQgSWzAMp9o','Glad to see updates that protect other people against hackers. ¿¿¿',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5186,'IQgSWzAMp9o','Glad to see updates that protect other people against hackers.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5189,'IQgSWzAMp9o','As an Apple employee, do update your software. Trust me!! I get quite the few security calls with hackers who are accessing devices.',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5190,'z2SVnlVxWMM','Mini series was a engineering masterpiece. Super compact and handy. Shame that they discontinued',60);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5191,'z2SVnlVxWMM','When I close my eyes I hear MaxTech. I''m looking forward to seeing what the new iPhone 14''s 48mp camera can do, but with rumors of a periscope zoom coming next year, I''m not sure if I''ll hold off or not. Also looking forward to seeing if there will be an M2 Macbook refresh announcement in October. I ordered a  BTO 16" M1 Pro,  but if the M2s will be out within a few months or so, I might cancel it. I have until the 24th to decide. ¿',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5192,'z2SVnlVxWMM','In order to save the economy, everyone must go out and buy a $1500 folding phone and sign up for 10 streaming services. Get a $6 coffee every morning in your new ev, throw away all your perfectly good hd tv’s and buy bigger 8k tv’s… that’s really what these companies want',129);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5193,'z2SVnlVxWMM','They should have also given always on display to the regular models since it is already such a old feature that is just coming to apple. Hopefully they do it for the next year models.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5194,'z2SVnlVxWMM','Looking forward to the 14 pro max. The camera sounds really impressive!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5195,'z2SVnlVxWMM','Not too big a change this time. I will hope in the next three years Apple will give us something new and extremely exciting to use!',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5197,'z2SVnlVxWMM','If the Apple Watch 8 Pro has a glucose monitoring system 100% getting it, as a diabetic this is a game changer for me! I probably won’t grade my current 12 pro Max, unless there is another type of game changer for me!',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5198,'z2SVnlVxWMM','Apple''s really taking some hints from the Apple watch with this new IOS 16  home and lock screen and always on display.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5199,'z2SVnlVxWMM','I’m going to upgrade to the iPhone 14 Pro Max because my phone, 7 plus, will be joining Apple’s Legacy phones.  Plus, I like the two holes vs the notch but I’ll keep waiting for a whole screen w/o holes to upgrade to at a later date.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5200,'7rUAVcWQjso','I imagine teachers telling everyone that there is a test tomorrow, and to bring a pair of prescription glasses with them, as she will collect smartglasses before the test.',1961);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5201,'7rUAVcWQjso','If these can replace prescription glasses forever, I’m already sold! I am curious however, if the vision correction stops once the battery dies? Or if it still works even on a dead batters. That would be a very important point to make on the release.',409);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5202,'7rUAVcWQjso','i hope they put a colourblind filter in these too. that would be amazing',694);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5203,'7rUAVcWQjso','As always multiple companies rush to launch the product but we all know that it won’t be a viable thing until Apple does it',109);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5204,'7rUAVcWQjso','Wasn’t sure I’d be convinced about these, but the idea of no longer need prescription glasses is very tempting lol we will see',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5205,'7rUAVcWQjso','Remember when Apple used to keep cool things secret until they were ready to launch? They really know how to make exciting products seem ordinary. Bring Steve back from the dead',105);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5206,'7rUAVcWQjso','I love how they always show their renders of these glasses to be impossible within and yet displaying so much content, complete fantasy with today''s Tech. If people are expecting anything remotely close to what they''re showing there is going to be a lot of disappointment.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5208,'7rUAVcWQjso','Being visually impaired, this looks really awesome & epic to me. That price is great too.',104);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5209,'7rUAVcWQjso','i hope they’ll release one with thinner or transparent frames since thick and darker colored ones won’t suit me! the idea of not having to prescribe new glasses every year sold me out. looking forward to it!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5210,'oVofe7dZ5Cg','Thank you for your videos mate,its normal to see so many investors panic amid a worsening bearish market but it is also important to note that the market situation is nothing new in the crypto world. Several factors are driving negative sentiment in the stock and crypto markets right now including inflation, a shaky stock market, rising interest rates, and recession fears. As a result, bitcoin has dropped significantly from its all-time high, breaking below several key technical levels. As a crypto investor, the current situation might seem bleak. However, there are several tried and tested expert-suggested investment strategies that can help you accumulate the current crypto storm, in few weeks of implementing trading with accurate signals directly from Mr Aaron Casey, I have been able to accumulate over 11 btc despite the current state of the market.',112);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5211,'oVofe7dZ5Cg','This post is so valuable and so honest. I am very grateful for this content, I have been making losses trying to make profit trading. I thought trading demo account is just like trading the real market... can anyone help me out or at least advise me on what to do?',224);
