Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5224,'JVh6j5LvLzE','Apple TV+ dijo este año voy con todo, en lo personal desde The Afterparty ha lanzando excelentes series en diferentes géneros y siempre con calidad. Para mi, es la plataforma que ha tenido mayores sorpresas en el 2022: The Afterparty, Shining Girls, The Essex Serpent, Black Bird, Pachinko, Severance… y recientemente estoy viendo Five Days at Memorial bastante interesante. Agregaría también que Slow Horses ya tiene grabada su segunda temporada y que están confirmadas 4, que conforman los libros en los que está basada la serie. ¡Saludos líder!',22);
