Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5660,'IZCfP13twxk','I''m surprised that Google have such aggressive deadlines, considering them not having any noticeable new products the past few years, in addition to the closure of many of their products',106);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5661,'IZCfP13twxk','Google''s culture is not as toxic as you make it out to be, especially when you compare it to other high stress paying industries. The politics, long work hours, cutthroat environment will applies across every job. The work life balance is amazing. Here in NY, I''ve never met anyone who went past 45 hours a week and once or twice on call. Call me bias if you want, coming from Finance and accounting where I put in 16 hour days sitting in a cubicle and where I have to pay for my own food, I''d gladly take Google''s work environment anyday. New York''s google cafeteria food tastes way better than the lunch that I buy. Yes, the job is stressful, but there is always going to be stress in life one way or another, and I would gladly be stressed working at google.',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5662,'IZCfP13twxk','That’s exactly what I’m always saying. They try to make the workplace so great, that employees want to spend their life there. WHO benefits? The company ¿',40);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5663,'IZCfP13twxk','I learned the hard way that chasing money is a fool’s race. A healthy work environment that you can actually stand to be in is priceless!!',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5664,'IZCfP13twxk','I think that google is just trying to stay competitive with other tech companies. It’s probably very difficult for them to allow people to advance in the company when you are always working with amazing talent and hard working people.  And regarding the perk dilemma to keep you working. You can drive your own vehicle. Not eat dinner at google and also they offer fully remote positions. I think the problem is employees, especially new ones, see the progress and dedication of other employees and work tirelessly in hopes of matching that same progress. Thus the burnout dilemma.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5665,'IZCfP13twxk','I don''t know really. What do you people expect at workplace which pays you 10K a month (minimum salary). To just chill and play games :) Of course it''s going to be stressful and hard.',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5667,'IZCfP13twxk','The dark side of Google is still brighter than many others'' best offerings. What you are saying is true, accurate, and necessary. Let''s put that in context. I get paid to work hard comfortably making a substantial salary and the downside is I can either create my own company, work for one of my co-workers who create a company or stay where I am getting paid a strong salary. There are many companies who wish they had those problems to offer. They have the same demands, wants, and expectations but few if any of the benefits. Google''s dark side is 6am in the morning dark. You do not even need a flashlight.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5668,'IZCfP13twxk','Worker retention is one of the best indicators of a good workplace.  Ivy league schools like Harvard, Princeton, and Yale have very high retention rates (97-99%).   For employers it''s Airlines, Banks, and Telecom companies.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5669,'IZCfP13twxk','DON''T LET ANYONE DECEIVE YOU. First hand experience...Google is by far the best place to work among all the FAANG or tech companies...not everyone resides in California just incase of commute and nobody will force you to stay behind work hour. As an adult I eat 2 times a day, brunch and dinner. All my friends either work for Google, Facebook, Amazon, Netflix, Microsoft, Apple, LinkedIn, Nutanix.  We always discuss life work balance.  Google is the best place to work on the surface of the earth (my opinion). People leave their jobs because of bad mangers and high expectations that leads to burn out. That''s why we have hybrid and remote (work from home).',6);
