Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5301,'NO49tLohULQ','I’m a major Apple fan but the iPhone 12 is so good I can’t see a reason to upgrade any time soon. I’ll probably just wait til the 16 or 17 and replace the battery when it’s time',57);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5302,'NO49tLohULQ','I''ve had both iPhone and Android and one of the key factors of me deciding to stay with iPhone was that you can always rely on them to put their newest iOS on every device. The only company that can use iOS is also Apple, so there''s not 5 different companies doing their own thing and its up to you to figure out which Android device is best. Additionally, Apple may be "late to the party" with certain things, but when they finally come out with a new product or feature you know it''s going to work significantly better than the competition. Apple may be more costly, but I''d rather pay more and have a good experience than to have a phone that is unreliable and save money that would probably get wasted on something anyway.',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5303,'NO49tLohULQ','I''ve always been with Android until earlier this year and made the plunge and got the Apple iPhone 13 Pro Max. I doubt I will ever go back to Android now. This phone is absolutely amazing.  Does more and has more power than I''ve ever seen. Does that mean I''ll get a watch or a Mac too?  No.  I''m happy with my Lenovo Laptop etc... I kind of want to get an iPad yet I''ve been going back and forth in my mind all week which to get. Go with Apple or Samsung.  Right now I''m still using Fire HD from Amazon. And I''d like more functionality out of a tablet and performance than what Amazon offers.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5304,'NO49tLohULQ','I just transitioned to Apple late last year for being an android fan for almost 10 years. I used to mock their features. And as I grow older and matured, I realized that solutions of Apple tends to be more on sustainable and long-term. Their products tend to be like the durables/home appliances that is made to last and not be replaced. I just want to highlight the part on your video where Samsung is mocking Apple for “same design” practice, and I think, they are doing that now too because there is a benefit from it. No wonder, there are lot of trends apple had made over the the smartphone/PC world. :)',6);
