Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5309,'NO49tLohULQ','I like the ecosystem and operating system upgrades that are predictable. I tried android and it was too much of a circus, menus not intuitive. But, I agree Apple does not need to care. I have 4 unresolved case numbers regarding my Air 4 and lots of diagnostics sent in, advisors promised me a response and resolution, but NOTHING, after all that. There are lots of unresolved bug fixes besides mine. If a low percent of customers have a specific problem, they won’t put time into fixing. Instead, we get a bunch of new fluff with system updates (like the new iOS 16 for iPad), that 90% of us will probably never use. Still, I won’t go back to android.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5310,'Qz6vN8Hp8_o','About 15 years ago or more, I remember people saying how Apple was way more secure than PC. Back then I said "don''t count on it". Everything has a target on on it.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5311,'Qz6vN8Hp8_o','Auto update has a 1-4 week delay, by Apple’s own admission. So checking for updates manually is important if you want timely updates.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5314,'Qz6vN8Hp8_o','It''s not the first major apple security flaw. They had one before where if you started a group call with two other phones and answered on one of them the other phone would join automatically without the person even doing anything, so all you needed was 2 phones and someones phone number to use their phones camera and audio.',3);
