Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5316,'Qz6vN8Hp8_o','If you think any device is hack proof at any time, you are incorrect.  Just do your best and not worry about it but have an action plan.',6);
