Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5320,'kgCUn4fQTsc','This guy is smart. He''s putting himself in a favourable position for when the robot overlords come.',6478);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5321,'kgCUn4fQTsc','He is so articulate and well spoken. He explained this perfectly',218);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5322,'kgCUn4fQTsc','He is playing 4D chess. Made a claim that media would pick up and sensationalise, then pivoted the narrative to larger domain of AI ethics and governance. Smart.',321);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5324,'kgCUn4fQTsc','The news portrayed this guy as insane when this story first came out. Very good interview.',430);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5326,'kgCUn4fQTsc','He seems fair indeed and ethical. I can see why google fired him.',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5327,'kgCUn4fQTsc','I think it doesn''t matter whether our AI-s are sentient. We should treat them as they were. Treating them as such when they aren''t may slow down the development, so what? I think it''s far worse to treat them as they aren''t when they are. Ultimately you can''t tell the difference. You can''t tell (or prove rather) if your own mother is sentient, as in in conscious, and yet you treat her as if she was.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5328,'kgCUn4fQTsc','I think we''d need to see a true demonstration with pretty rigorous testing, clear defining of terms, and peer review to be sure an AI is somehow showing signs of sentience. So I just can''t buy this guy''s claim that LaMDA is sentient. However, I''m very happy this story is out there. The concerns he does raise about AI and ethics are well articulated and are topics we should have been talking about for years. Overall, it''s just great that this is getting news coverage.',41);
