Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5351,'Z-pT0XDYvDM','Google is proof that giving people what they need increases productivity, rather than make them lazy.',1963);
