Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5353,'Z-pT0XDYvDM','It''s genius to allow them 20% of their time to focus on side projects.  The thing is that Google owns that project if they do it on Google time.  So they get people working on what actually interests them, and they also get to keep the reward from that.',172);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5354,'Z-pT0XDYvDM','I''ve been looking at a fair number of videos for high profile corporate headquarters and it''s really fascinating to see how varied the different cultures are. Like not necessarily better or worse, just different. This is by far the most "fun" of the bunch, for sure!',59);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5355,'Z-pT0XDYvDM','The thing they don’t tell you is that this approach to their campus massively increases productivity, particularly for programmers. All those activities allow people to walk away from their work and let their brain work subconsciously. All the other stuff provided is to attract some of the best employees in the world, just like how any top college spends a bunch of money on athletic facilities to help nudge top athletes to their programs.',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5356,'Z-pT0XDYvDM','I asked a Google employee to list the stuffs Google gives them for free. He replied, "It''s easier to list the stuffs Google doesn''t give you."',790);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5358,'Z-pT0XDYvDM','One of the most cited studies indicates that overall, Google receives over 2 million resumes per year, and 1 out of every 130 applicants receive a job offer. To compare, Harvard University accepts 1 out of 14 applicants for their incoming freshman class. It is literally 10 times harder to get into Google than Harvard',37);
