Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5390,'IwUZrxaX1A0','This is such an emotional experience. To know what it feels like to have your life in danger was terrifying. Our dinosaur dying at the end to show that we all meet the end of life sooner or later was very smart writing. The giant boulder chasing the dinosaur, representing the death he was running from was perfectly done. The dinosaur running faster after witnessing the deaths of his pterodactyl friends shows how the dinosaur felt.  The monochrome background also works in to express the traumatization that the poor rex experienced.',52);
