Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5453,'U3DNz5asasA','I''m still using my old Pixel 3 and was thinking about buying the pixel 6 when it came out, but it didn''t really impress me that much... Looking forward to the Pixel 7 release! Hope it will live up to my expectations! It''s a shame that Google removed the fingerprint sensor on the back of the phone that the old pixels had, really liked that feature.',79);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5454,'U3DNz5asasA','After watching Google IO I could see myself switching fully over to the google/pixel ecosystem. Google is creating a nice little apple rival with all this new stuff coming out over the next year or so, If the watch is close to Apple Watch and the tablet connects seamlessly similar to iPad and my iPhone, I might just make the jump.',256);
