Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5491,'UWe4aMPAyvc','You guys don’t know how lucky you are to be American and be able to choose jobs and reject  six figure salaries. I’m from Zimbabwe and getting a job is a miracle. Like seriously, I hope you appreciate how lucky you are¿¿¿',2368);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5492,'UWe4aMPAyvc','imagine getting so good at your craft that you can reject such offers instead of celebrating that you''ve gotten such an offer. Goals man, Goals',885);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5493,'UWe4aMPAyvc','I can’t imagine working at Google just trying to do your job and have a normal life and having to deal with guys who have YouTube channels and are TikTok influencers as your coworkers',440);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5494,'UWe4aMPAyvc','To the doubters out there. It takes tremendous effort to be so skilled that you can reject offers this lucrative so don''t judge this based on your experience just because you''re still new and haven''t seen shit yet.  I''m Only six months into learning but I already realize this field is so f wide and the needed skills just to be a Jr developer are increasing daily. Props to you my dude ¿.',166);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5496,'UWe4aMPAyvc','I love how he has worked for YEARS at Microsoft but they still had him do a technical interview for insane leetcode questions ¿¿¿',248);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5497,'UWe4aMPAyvc','But you’re so amazing',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5499,'UWe4aMPAyvc','I think for most of the big tech companies, it is well known that you need to have competing offers in order to get higher offer. For Google, there are actual conditions on how the comp team can offer you what package under what conditions. My recruiter told me very clear about these at the beginning. It is not that they tried to lowball you. Giving them the screenshot of your competing offer is pretty common.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5500,'njiSn2aaS88','My old dog Spike. He was been dead for 5 years.  But I found an old satellite image of an area (public park) where I always would take him on walks. When I zoomed in, I knew it was him and me walking. RIP Spike! Miss you my brother!',5284);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5501,'njiSn2aaS88','This would be much better if you added WHERE these items are found, coordinates would be nice or addresses for urban sites. How can I decide what I think it is if I don''t know where it is?',319);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5502,'njiSn2aaS88','Would be great to have a list of the actual locations! I wouldn''t mind checking them myself.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5504,'njiSn2aaS88','My 6 year old son wanted me to inform everyone that the number 2 video was an elasmosaurus, you''re welcome. ¿¿¿',1808);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5505,'njiSn2aaS88','how can the satellite know so accurately the GPS location of the area it''s taking a photo of. That sounds very impressive considering tiny one inch nudge shifts it by tens of miles.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5507,'njiSn2aaS88','The image of the airplane grave yard doesn''t make me sad, I actually find it to be quite the incredible image. All I can think about is all the people and places these planes have seen, and how despite having all flown their own ways, they all find there own resting place here. It''s an image containing millions of stories.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5508,'njiSn2aaS88','I was just scanning through google Earth one day, got to China, zooming in and out. I got to a lake that looked like the shape of Italy upside down, I then slowly went west of that lake and came across what looked like a small shack, just about 10 feet from the shack was a Jason Vorhees mask about the same size as the shack. I went to save the coordinates when I accidentally hit the mouse and lost it. I have tried to find it when I  have time to search... I will find it again I hope and post it.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5509,'njiSn2aaS88','I live in my Dad''s old house. He passed about 5 years back. After he got his work done everyday, he''d sit out in his garage and have "cocktails" with his neighbor at his workbench. If you go to street view on Google maps and look towards my house, there he is sitting at his workbench, looking out at the street, drinking a Miller Lite. Freaked me out the first time I saw it, but now I think it''s kinda cool.',832);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5510,'mp5WovpgGH4','The story behind Nagoro village, from what I remember, is that it was populated by mainly elderly people, as all the younger residents left to find work in the bigger cities. This artist was one of the residents, and she would make the dolls in honor of the residents after they passed on, so that they could live on in a way.',147);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5511,'mp5WovpgGH4','The title makes me think of a time my mum was checking google maps and she found a bucket over the car camera ¿ For a while she wasn’t able too see anything but a bucket. we joked about it for days and days after, and while in the car on ¿bucket street¿, I joked that if we put a phone out the window, a random bucket would be put on it ¿',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5512,'mp5WovpgGH4','Ok fun fact! I believe you can look on Google maps or somewhere and see where the Google maps truck is going. So on the pigeon people one I heard about this, I bunch of friends put on bird masks and when the Google maps person came and therefore u have these beautiful but very funny creations.',3);
