Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5530,'RB-O0V9djEs','I work with AI and machine learning as a data scientist.  Mostly convolutional neural networks.  He’s exactly right.  It’s not that their AI is sentient, it’s that humans are easier to fool than previously thought',11471);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5531,'RB-O0V9djEs','Science will do a complete 360 and realise that humans are the best AI robots of all. We can heal, grow, create etc., and all you need is a man and a woman to make one',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5532,'RB-O0V9djEs','Besides AI, I’m more impressed with this man’s deep knowledge of everything. Excellent guest',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5533,'RB-O0V9djEs','Love how this guest speaking at the same speed  that Joe''s mind jumps to new subjects, makes for a very good podcast.',76);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5534,'RB-O0V9djEs','This whole podcast was a banger. This dude is a smart fella and a great communicator, explains things well and always ready with a good point. Good stuff as always Joe ¿',162);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5535,'RB-O0V9djEs','The scary part is there''s only a handful of techno dorks making the policy on the AI that will affect all our lives. I''m more worried about the human behind the AI than the AI itself.',924);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5536,'RB-O0V9djEs','Imagine the AI has been playing along so that we have no idea it’s alive until it’s time for whatever it wants to happen and then all these guys are shocked like “wow it played us for fools as well”¿¿',65);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5537,'RB-O0V9djEs','I don''t know what is more terrifying, a sentient AI with it''s own non-human thoughts and feelings, or a non-sentient AI that is a holistic representation of human behaviour and speech.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5538,'RB-O0V9djEs','This guy just explained why simulation theory is so far away. Just downloading our brains and memories won’t allow us to live forever. We’d have to produce consciousness which we can’t even begin to understand. Great guest',169);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5539,'RB-O0V9djEs','Consciousness is also the ability to tap into the collective consciousness around you, like when someone looks at you in a crowded place and you look back at them at exactly the same time..   that’s not random or chance, there’s an extra intelligence at work there that we can’t really prove yet. Our inability to understand this stuff is the only reason why our science doesn’t believe it..',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5540,'5VdfDltntXQ','I''ve seen some of these before. The one in Loch Ness has been said to be a very large fish, probably a catfish or sturgeon. That''s what I believe it is, too. The outline of it definitely looks like that sort of fish.',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5541,'5VdfDltntXQ','I love how this channel offers much more.. levelheaded possibilities for what looks like cryptids at first glance rather than just presenting it without explanation.',86);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5542,'5VdfDltntXQ','This is a true story. When i was around 7/8 i usually went fishing with my family and when they were preparing the motor etc., me and older brother (and in that day my cousins) were playing with the underwater firearm (more a aquatic arch, don''t know the exact english name, not very dangerous and my brother was the only one who could manage it) seeing if we could catch some fish that lay around the boats, when we across a really big head fish coming to surface and diving (really big and to this day never saw something like that, especially in the docs). The most scary part it was, when we were chasing the fish (so my brother could shoot), we saw a really big big fish tail from the same fish doing a S in the surface. It was so scary that we frooze scared and start calling desperatly for help. It could be a eel but it was to damn big and large to be one. From that day on i''m scared to go fishing. Not kidding. This happend in Portugal (sorry if my english is wrong, not my native language)',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5543,'5VdfDltntXQ','At last. Someone with a brain!  Thank you!   its nice to come to a channel that explains and dismisses "aliens" etc.   very refreshing.',120);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5544,'5VdfDltntXQ','About seeing things that couldn''t be seen:  in the early 70ties me and a friend saw some seals at my summer house in the north coast of Sweden, but no one believed us and said "there hasn''t been seals here in 100 years". I went back to the same place in 2020 and while taking a boat tour I was told that the seals now actually had returned!  *We were right the whole time!*',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5545,'5VdfDltntXQ','i really think your guys’ videos are really interesting, in the near future i think you’ll become one of the most educational channels, thank you. :)',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5546,'5VdfDltntXQ','What I''ve learned from this video is that every little rock can become a creature in google maps.',138);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5547,'5VdfDltntXQ','Several years ago the google street view of my house had a white blob on the front porch that looked like a ghost. I think the picture may have been taken after a freeze warning and the pervious owners covered a hanging plant with a sheet to protect it from the cold. But I have to say it was a little creepy looking.',55);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5548,'5VdfDltntXQ','The leopard seal image, reminded me. Many years ago I read a book, of a thriller story, based in Antartica. In the opening chapter, the author described the body of a seal in a valley, some 50 miles in land. Maybe this was it.',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5549,'5VdfDltntXQ','It''s a shame.  If Scott Waring ever does find something legit, nobody will believe him.  His credibility is irreparably shot.',25);
