Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5583,'6GU91yejwTo','DARPA was working on cloaking technology when my dad was in his 20’s so an invisible plane isn’t far out of the question. People are quick to write off the stuff you’d see in movies or games but don’t realize it’s stuff we’ve legitimately been working on and they just don’t know about it.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5584,'6GU91yejwTo','The real Mystery is how on earth did these two girls both do a story on ''Secret Bunker'' or ''The Bunker'', not only that, but then put it on the very same show??  The most important mystery of all though, is Why don''t they watch there own video content before its aired? Something Google Earth cant even reveal.',7);
