Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5588,'6GU91yejwTo','too mercury. hahaha Maybe too murky. BTW, I think its funny when people think that ET craft need a landing strip like our planes use. They dont need to build speed to gain lift, they can travel through the fabric of space and time, I think they can manage to take off and land without a strip.',15);
