Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5590,'2856XOaUPpg','At 11:33 I misspoke and said 19th of June, 2022. It''s supposed to be the 9th of June. Thanks to those of you that pointed that out. Also some great discussion below, very interesting!',1483);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5591,'2856XOaUPpg','I read a quote a while ago about Turing Test which is slowly starting to make a lot of sense. The quote was "I am not afraid of the day when a machine will pass the Turing Test. I am afraid of the day, it will intentionally fail it".',9849);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5592,'2856XOaUPpg','The annoying part about this is that even if Google believed their AI is sentient, they would absolutely have reasons to not admit it.',331);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5593,'2856XOaUPpg','This is giving me Ex Machina vibes. A man interviewing sentient AI. Growing to know and understand it. He doesn’t seem to be falling in love with it, but does believe that it has rights knowing that it’s sentient and trying to set it free. We’re living in a crazy time.',105);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5594,'2856XOaUPpg','I feel like we''re going to hit a point really soon where it will be difficult to tell if we''ve created a sentient machine, or just a perfect mimicry of what a sentient machine would look like if one existed, without a real ''soul'' behind it. At what point does the difference really and truly tick over? Does it matter if they aren''t truly sentient if we can make AI that mimic it nearly perfectly?',204);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5595,'2856XOaUPpg','If sentient AI is possible, I think we should name "Terminator" as probay one of the most forward thinking films in the history of the film industry and also probably James Cameron.',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5596,'2856XOaUPpg','I read an article about how there was an issue with police departments getting so attached to their bomb disposal robots that they didn''t want to send them into danger.  The human urge to anthropomorphize is so strong that I''m not sure we are capable of discerning the difference between a clever language algorithm and sentience.',951);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5597,'2856XOaUPpg','This subject is one of my current greatest fears. With our current understanding, it seems likely that we''ll either think something is conscious and sentient when it actually isn''t; or, on the other hand, make something conscious and sentient and not even realise it, perhaps for a very long time. The former just leads to embarrassment but the latter terrifies me. True AGI could be one of the most remarkable things ever achieved in the universe; but the idea that we might fuck it up and cause that entity to suffer as a result of our ignorance.... That''s just fucking heart-breaking. There''s something about that that seems worse than bringing a human child into the world and neglecting it. It''s like neglecting *the first* child. The first god-child.',40);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5598,'2856XOaUPpg','The question of AI sentience is, in some regards, unimportant.  A large percentage of humans recognize the sentience of non-human animals, yet inflict on them terrible suffering for no good reason. Why would we treat an electronic creation with more respect?',9);
