Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12435,'sIcJtXLMnRQ','For "Practice Test 3: Calculator, #25 | Volume Word Problems" I''m seeing an easier way to find D without using the calculator. Volume of the cylinder is 250pi and volume of the two cones is 250pi/3. Total volume is 4/3(250pi) or 1000pi/3. pi is > 3 so the answer has to be bigger than 1000. D is the only answer bigger than 1000. Thanks for these awesome explanations!',11);
