Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10829,'25BkVBgFD9Y','Life hits hard. It hits everybody again and again, like tides against the shore. Get up. Another wave is coming, but thats just fine because you are strong. Get up. I know you fell down before, and that''s just fine. Get up. You''re going to keep falling down, of course you are, that''s all the more reason to get up again, because that''s what you''re made of. You are not being measured by how tall you can stand, but by how many times you can get up before you give up. Run until your legs give out, swim until you drown, climb until you fall, life is short. Endure the agony that comes because it can''t last. Why not see just how far you can go? I believe in you. Im running too. Im climbing too. Im swimming until I can''t anymore. I refuse to drown. Stay here with me, be my brother, be my sister. We will fight for each other.',492);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10830,'25BkVBgFD9Y','Dealing with cancer, And these tunes take me totally out of the dark hopeless area and bring creativity and peace. Thanks to you And to all the lo fi lovers with a kind heart. Love you all.',156);
