Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10832,'25BkVBgFD9Y','Honestly been a horrid year. Looking at the comment section for the first time and listening to some relaxing music really cures the bad vibes. Love ya all in this comment section and love to have found a channel like this with such a good community ¿',60);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10833,'25BkVBgFD9Y','I used to listen to lo-fi because i was depressed. I got rid of depression but i still listen to lo-fi because it makes me go to a whole different dimension.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10834,'25BkVBgFD9Y','This mix attacks my bad mojo to non existent almost instantly. There is almost nothing more rewarding than feeling a good vibe to just chill easing into relaxation',17);
