Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9107,'RFPUbb3GYEc','Domino''s India used to do twisties (twistie bread - they used to be these long braided dough with garlic butter and oregano seasoning brushed on top) long time back. They were an off menu item and the cheapest thing at Domino''s. These teiesties were decentralized and being a broke college student, the twisties helped me a lot!',595);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9109,'RFPUbb3GYEc','I have wanted to visit India forever to experience authentic Indian food. It’s my favorite cuisine. But based on these videos, I’m almost tempted to go just to try the Indianized version of our crappy American fast food that I never eat in the states!  The curiosity is kind of killing me now. ¿',153);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9110,'RFPUbb3GYEc','Domino''s India have deteriorated a lot over the years, their cheese burst doesn''t burst anymore, stuffed garlic bread doesn''t have cheese in it, and most importantly they don''t use "cheese" anymore, it''s all veg-oil based cheese substitute. Even their customer care and store staffs are not as good as before. I used to love Domino''s before but now it''s a nightmare.',4887);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9111,'RFPUbb3GYEc','I''ve been living in India for almost 10 years now and prefer its pizzas much over the Western menu. I still remember my first year in India seeing a big domino''s ad where they''d advertise two new pizzas with ''exotic'' vegetables, the exotic vegetables being broccoli and zuccini. goes to show that exotic is very much a question of perspective ;)',407);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9112,'RFPUbb3GYEc','FYI,we also have Garlic Breadsticks, Stuffed Garlic Bread,Cheese Dominator(1 pound of mozzarella cheese melted on the pizza),5 cheese pizza(1 out of those 4 cheeses is a Ghost Pepper flavoured cheese),Paratha Pizza,Red Velvet Lava Cake and Butterscotch Mousse Cake,which is the most heavenly thing available on the whole Domino''s menu but it''s also true that these items are region specific that''s why it is there in Kolkata,West Bengal but not in Bangalore',300);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9113,'RFPUbb3GYEc','Loving this series. We get such boring Dominos pizzas here in the U.K.! The US pizzas looked good the Indian ones were interesting to see. I’d really like to try that apple dip and cinnamon sugar dough dessert from the US and the Indian chocolate lava cake looked yummy.',121);
