Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9128,'eLeYCwv0j9Q','When I lived in Japan about 17 years ago, MacDonald''s had a burger called the McGrand. It had a creamy Dijon mustard sauce and a thick beef patty along with lettuce, tomatoes, and so on. It was so good that I still think about it occasionally. I was really disappointed when I moved back to Canada and it wasn''t on the menu here.',462);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9129,'eLeYCwv0j9Q','The Japanese packaging is cute. I’m also surprised Mcfloats aren’t a thing here. But the ice cream machines are always down, so maybe that’s a factor.',187);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9131,'eLeYCwv0j9Q','Coming from a person who’s from Hawaii, I’m surprised we don’t have some of the Hawaiian stuff that Japan has lol. As for the US side, missed the chance to add the Hawaii breakfasts.',25);
