Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9143,'FqNEx17crMI','Well, i grew up sleeping on bed lined with strawmat, eating on the ground ( culture thing), eating bugs because we didn’t get meat that often. And my generation was consider the lucky one because we got much more than previous ones. These foods look just fine for me, good variety.',30);
