Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9150,'E4YUyRxRVus','I had a professor from India and every time the department would order catering he would complain about the vegetarian option with good reason, it looked nowhere near as good as the vegetarian option in India.',1382);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9151,'E4YUyRxRVus','Food insider hit the jackpot with Nikhil as the host for Indian food. He does a really good job. I have one request and that is that you don''t waste food by throwing it out after taking just one bite and instead cut off a piece from where you took the bite and offer it to someone who doesn''t have food, it''ll make that person''s day and you wouldn''t lose a thing.',796);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9153,'E4YUyRxRVus','I remember getting in line for a subway at Delhi int airport. there was a line of say 6 people of which, 4 were non-indians. I was getting late and the line seemed huge. I was also wondering why so many foreigners were eating vegetarian, then one of them got in the front and the cashier told him that the non-veg line was on the other side and then they looked up and spotted that they were standing in the vegetarian line. The entire queue moved and I got my sub in time for my flight. Fun times!',148);
