Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10096,'eaYcRrZkFbI','38:48 A sequel that deserves - and gets - a wonderful reaction from Mish & Ellie. The final half hour of this is a real emotional wringer no matter what – but it’s especially intense and all the more adrenalin-filled, if like Mish & Ellie, you’ve seen the first film already.',21);
