Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10099,'eaYcRrZkFbI','It''s really cool to compare the leap in cinematography when it comes to filming the action with the fighters. In the 80s it was amazing, but now it looks pretty calm, and the shots in this movie taken from inside and outside the planes are amazing.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10100,'eaYcRrZkFbI','30:54 The numbers on the screen that were climbing was G-Force (G stands for gravity). 2 G''s is 2x gravity. 7 G''s is 7x gravity, etc. He pulled over 10 G''s which means at that one particular moment he weighed 10x his body weight. The same goes for the aircraft. What he was saying to maverick was that he "put so much stress on the aircraft that it bent the frame itself" making it un-airworthy since you would have to replace everything anyway.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10101,'eaYcRrZkFbI','I''ve been waiting for this one since you did the first. I''m so conflicted. I spent most of my life using Top Gun as an example that not all great movies need a sequel, then the bastards made one, and then they added insult to injury by making it so fucking good lol.',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10103,'eaYcRrZkFbI','Ellie loves Goose a lot. Few times Goose was shown through flashbacks or mentioned, she was emotional.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10104,'eaYcRrZkFbI','One of the best movies ive ever seen! Honestly i wasn''t even a big fan of the first top gun so i had no expectations with this one but it blew me away!',13);
