Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10988,'9QJ9zE4X1o8','I saw a silver fox once. I was four-wheeling with my grandpa while he was out moose hunting. And it ran right in front of us, and it didn’t even seem scared. They are absolutely gorgeous in person, pictures don’t do them justice ¿',428);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10990,'9QJ9zE4X1o8','I''ve seen a completely white peacock at a fair once. It was beautiful and very friendly! We weren''t allowed to touch him but they would walk around in an area and be very comfortable around people',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10991,'9QJ9zE4X1o8','Once there was a fox near my house (we live in almost in the middle of a large town) my mom managed to record it, but when we checked on our chickens one of them was gone, we later found her hiding under our side porch. (The chicken that went missing was a polish chicken and I named them Dawn)',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10992,'9QJ9zE4X1o8','One time me and my family went to a bird sanctuary in Florida while on vacation and saw one of the the only leucistic screech owls in the world. His name was Luna and he was nine years old, about six years older than screech owls live in the wild.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10993,'9QJ9zE4X1o8','A note to the channel: all peacocks are male.  Females are peahens.  Saying  "the male peacock" is like saying "the female cow."',2109);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10994,'9QJ9zE4X1o8','I''ve seen a blue lobster at an aquarium once. Pretty neat and very different from a standard lobster.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10995,'9QJ9zE4X1o8','I''ve seen three of those bi-cardinals and I never knew it was rare, my grandma told me that it was because of the weather.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10996,'9QJ9zE4X1o8','7:47 I actually might have found a new species of cockroach yesterday. It looks like a Smokeybrown Cockroach but it is small, has a completely black thorax, and is really fat and has really tiny antennae. If anyone knows this species, please tell me or maybe it''s a new species I discovered?',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10997,'9QJ9zE4X1o8','Albino snakes are probably one of the most common snake morphs seen in captive bred individuals. They’re not hard to come by at all. Also, all the snakes you showed had black eyes. Albinos have red eyes, so none of those snakes were actually albino. Most albino snakes I’ve seen aren’t pure white either, they often have some yellow on them as well (see albino Burmese pythons, hognose snakes, and checkered garter snakes, to name a few).',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10999,'pb-j3svRQLI','The music is so relaxing and seeing all of these amazing beings has made my day a whole lot better. We certainly do need to protect all of them, because Earth would be terrible without any of them being around. Thank you for this video.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11000,'pb-j3svRQLI','Oh WOW great sounds and impressive pictures ¿ so great to just switch off, relax and escape from everyday life. Should really be done regularly. Thank you - great work and all the best ¿¿¿¿¿',7);
