Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9201,'DutQbEPqaNk','Welcome Nikhil! Can’t wait to learn more from you about all that delicious Indian fast food ¿',3000);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9203,'DutQbEPqaNk','"Choco mud pie" "Mousse cake" These two are so common across all the Indian fast food chains. Domino''s has these, burger king has these even Macdonald''s India have these (or if not, one of these are bound to be there)',50);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9204,'DutQbEPqaNk','You should check out Kenya''s KFC,¿¿¿¿¿ its wild.¿¿ We have a bucket with 9,12,15,18 and 21pcs, chicken wraps called twisters, my fav is the spicy rice bowl, hash brown burgers, Nyama nyama burgers which is a burger without buns(buns are chicken pieces instead). Chicken nuggets, krushers which is a milkshake with crushed cookies I like mine with oreos, Box master and crunch master which is like a shawarma and lastly KFC chicken salad....I almost forgot the double crusher burger with 2 pieces of chicken ¿¿¿¿. I''m now hungry ¿',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9205,'DutQbEPqaNk','I love this Nikhil guy. More of him please.¿',17);
