Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9208,'-7hzaGya86g','Having dinner and watching Mikey after a busy college day. I was just wondering why do I like these asian groceries stores videos so much! It''s amazing the variety of pre made meals and frozen food they have! Everything look so good and Mikey said some of them are like eating from a restaurant. Impressive really!',55);
