Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9210,'-7hzaGya86g','"That''s like eating out of a restaurant" that''s because restaurants freeze their foods like their "fresh" pasta too haha It''s good to see a video that''s more down to earth than the constant expensive places',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9211,'-7hzaGya86g','Ive ALWAYS wanted to try this in Asia but havent gotten the chance to since i started doing this after the pandemic… but next chance I get I’m going for sure and doing a whole day there!! ¿¿ thanks for even more inspiration Mike!!! You’re the best ¿¿',25);
