Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9213,'-7hzaGya86g','I found those churro chips in a local H Mart, and they are seriously addicting. Had to stop myself before eating the whole bag right after opening it.',85);
