Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10117,'OOmBqTAp1TU','I liked that they showed Daemon crying at The Funeral, they took great effort to show how Antagonistic he is, but then showed us he clearly loves his family.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10118,'OOmBqTAp1TU','As a fan of GRRM. And reading all materials associated with this story. I must agree with George. Dameon Targaryen is my favorite characters within these histories. Definitely top two. #I ride with Dameon. Lololol. Get ready for a ride.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10120,'OOmBqTAp1TU','24:30 To answer you ladies, my sister was a military nurse and in her studies, the first cesarean goes way back to switzerland in the 1500s, and believed to be the way Julius Cesar was born, hence the name, then the first one came to the US in the 1700s, but they were brutal and often resulted in death for both mother and child and a last ditch effort, until 1794, Jesse Bennett dedicated himself to perfect it, and his students made the practice normal all over the world and by 1938 c-sections were normal and a way of life.',13);
