Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10149,'hRx-sgGRnfA','Spider-Man: No Way Home and Top Gun: Maverick both brought back the moviegoing experience in huge droves as both films became one of the first films to gross over $1 billion worldwide at the box office since the pandemic began. Also, Tom Cruise and Paramount made the right decision delaying this for two years because it''s a film that''s made for the big screen and everyone knows that.',42);
