Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11039,'uLYgyR_lBS4','It was around the summer of 1974 when a friend and I went to the Fresno Zoo. As we approached the hippo area we could see one in the water. We watched it for a little while then started to walk away when suddenly this little baby hippo head broke the surface of the water. Needless to say, we were captivated by this tiny baby hippo that was frolicking in the water around its mother. We could hardly tear our eyes away from the delightful sight. Later that night  the local news show had a report about the new baby hippo that had just been born at the Zoo that day. That baby hippo was one of the most adorable baby animals I''ve ever seen!',56);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11040,'uLYgyR_lBS4','I couldn''t stop smiling throughout the entire video and my heart just glowed with an aura of golden love! Thank you so much for making our day brighter by showing all these adorable little darlings. If I could, I''d adopt one of each. I hope that we humans will                                                                                                                                                                                                  work together to save all these species and treat them with love. I am so grateful that I was blessed with 7 kitties and one dog throughout my life, they were truly a gift from God! Many good wishes to you and all viewers.',17);
