Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10185,'F81Bz6A4P20','Targaryans have prophetic dreams, Called Dragon Dreams, However as Maester Aemon said "I see them in my dreams, Sam. I see a red star bleeding in the sky. I still remember red. I see their shadows on the snow, hear the crack of leathern wings, feel their hot breath. My brothers dreamed of dragons too, and their dreams killed them, every one." The grief and glory of house Targaryen',125);
