Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10188,'F81Bz6A4P20','Important to note there’s 10 adult dragons under targ control, but there’s also unhatched and juvenile dragons and also some wild dragons just chilling on dragon stone. So in total there should be around 17 alive in this period.',57);
