Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10191,'F81Bz6A4P20','Targaryans have a history of putting a lot of stock in their dreams. The only reasons the house survived the doom of Valyria is because one of them had a dream it would happen and they packed up and went to Dragonstone. Even in Game of Thrones Dany had a dream about stepping into the fire that hatched her eggs. That''s why she did it. This is the problem with watching this show and criticizing certain characters without having any book context at all.',58);
