Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10199,'y3KQzBnB7-U','Me dio risa cuando estaban hablando y riéndose antes de que Dimash abriera la boca y emitiera el primer sonido! Se quedaron mudos! Esta es la capacidad que tiene Dimash de cautivar al público, sin decir una sola palabra! Es maravilloso, esta es una composición de Igor Krutoy especialmente para Dimash, no tiene letra para que las personas de cualquier credo puedan disfrutarla, y vaya que lo logra! Gracias por su sincera admiración al magnifico Dimash! ¿¿¿¿¿¿¿¿¿¿¿¿¿¿¿',65);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10200,'y3KQzBnB7-U','This vocalise of "Ave Maria" was composed by Igor Krutoy especially for Dimash.  It goes without saying that this newest version of the traditional song(s) is almost beyond belief in its simplicity and power.  Nobody can pull off a vocalise as well as Dimash, the greatest vocalist I have ever heard in my 80+ years on this planet, and I''ve heard some really great singers along the way, and in every genre ever conceived.  What a blessing to experience this voice, this incomparable talent.  btw: Very nice reaction.',51);
