Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10203,'y3KQzBnB7-U','UNBELIEVABLE recently filmed in Germany titled "The Innovators" featuring 5 young adults from around the world, who have turned their industries on their heads and impacted them forever. Opens with "Dimash Qudaibergen at 28, is changing the face of today''s music worldwide, widely considered a music and business genius.." sole head and decision maker of his production company, it''s state of the art on a campus of studios, stage, warehouses, conference and creative centers, and administration buildings, and produces every aspect of his career in house from films, videos, albums to concerts, tickets, sales and distribution of merchandise, PR, marketing, administration, legal and more. Surrounds himself with world class  talent in every field,  hands on and laser focused. The only operation of it''s kind globally. No air date yet.',50);
