Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11068,'7_4oZm31UhU','9:00 for those who don''t know...the "giant megalodon" is simply just a normal and harmless whale shark. You can tell by the white spots covering its back and its round head. Though I am a believer of Megs still existing, it''s very clear from the gate way that this find, isn''t as rare or "mega" as they think.',35);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11069,'7_4oZm31UhU','Also I think what you call "shapeshifter is a newly discovered type of squid, the lights are possible for a sea creature as we see deep water has lights, well it''s no underwater electricity but it''s something!',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11070,'7_4oZm31UhU','For the megalodon vs whale, I think that the creature that just scooped up the whale it NOT a shark. It doesn''t seem like a normal attack of a shark',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11071,'7_4oZm31UhU','I wasn''t there, and I''m not a marine biologist, but the possible "megalodon" at 9:00 is clearly a whale shark.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11072,'7_4oZm31UhU','Pretty sure the "Shape Shifter" was a new species of deep sea Squid.  There are various squids that have wedded tentacles, such as the vampire squid. Also the ''Ghost Squid'' is a Magnapinna Squid no doubts about it. It doesn''t any different from any Maganapinna Squid I''ve ever seen. Their nick name is Bigfin for a reason.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11073,'7_4oZm31UhU','The so-called “turtle snake” @10:24 is a hoax. The only thing real was the (blurred out) fish guts, the rest was said most likely to be cardboard and/or papier-mâché.',5);
