Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11098,'u9X5SQCDnio','That dog that stopped the truck for its owner who was having a seizure is nothing short of incredible.',4694);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11099,'u9X5SQCDnio','You know we’ve fallen short as a species when animals have to remind us how to show unconditional love for one another',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11100,'u9X5SQCDnio','That stray dog helping that lady had me in tears. He is a keeper. I wish he finds himself the family he deserves. That dog right there was a real life hero¿¿ protected a complete stranger as if his own master¿',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11101,'u9X5SQCDnio','It warms my heart to see animals trying to save other animals, even a small fish, where a human would have left it to die. Animals are so much smarter than we think, they know things even we do not. Animals care way more than humans do. They are not greedy but only take what they need and help others to survive, even ones that are not of its own kind. That is the true way to live in this world. Animals deserve so much more kindness than we give them. Next time you see a animal, give it the respect and kindness it deserves.',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11102,'u9X5SQCDnio','In my experience pets have demonstrated more humanity than humans ever did. Love the vid!  :)',81);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11103,'u9X5SQCDnio','The cats helping the disabled dog is a one in a million that no one would believe if it was not filmed',3916);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11104,'u9X5SQCDnio','I fell out of tree once when I was young, and it knocked the wind out of me really bad. My German Shepard ran up and grabbed my shirt and started pulling me to my back porch. He was a good boy!',23);
