Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9291,'nUZCE40n2zg','As a uk citizen for 13 or 14 years, the curry sauce with the fish and chips is definitely traditional, my entire family loves it',89);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9292,'nUZCE40n2zg','It''s really good to see Nick helping out small chefs like Gordon Ramsey. The community appreciates it, Nick!',16262);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9293,'nUZCE40n2zg','Thank you for supporting small businesses in these hard times you rock!',19);
