Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9295,'nUZCE40n2zg','The mashup of different pop all mixed together is called “swamp water.” Long time ago it was specifically Coke and orange pop but has transformed to refer to basically a mix of different pops of random assortment. It actually works well and is a go to for when I want something fun and youthful.',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9296,'zNXctUnHp5A','Hey Mark, I really love all of your videos but this whole Spain series is definitely your greatest work as of today in my opinion. I actually built my holiday around some of the spots you visited during this trip. Keep up the great work. You really inspire a lot of people. Cheers¿',149);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9297,'zNXctUnHp5A','Mark, you are the reason I will be putting Spain as a place to visit and eat at after this amazing food tour you have done this far. Every place you have showed us on your tour looks just absolutely amazing and stunning. The ambiance and the energy of these chefs is just outstanding. Also the quality of the ingredients and the recipes they have shared with you is just mouth watering. Spain is now on my bucket list thank you for showing your experience there. I am excited to see what is next!',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9299,'zNXctUnHp5A','What I Love about Italy & Spain is the simplicity of preparing their food, allowing the natural taste of the food to shine through. In America we overcook, over prepare our food! The freshness of this food makes you feel like you never had true prepared food. Mark, this is what sharing food is really about! In your own words "Wow!!! Can''t help but to appreciate you & your show!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9300,'zNXctUnHp5A','Hands down Gabriella is one of, if not, the best tour guide in Mark''s channel! She knows everything not just about the food but also the city of San Sebastian!',81);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9301,'zNXctUnHp5A','Would love to travel the  ¿ and eat food like Mark. His love for food and the culture and stories behind the dishes, absolutely beautiful',70);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9302,'zNXctUnHp5A','The genius of Mark’s videos is his ability to take deep dives into countries and truly convey his experience.  After seeing James Blick here I got hooked on his Vlog just like I how I found Joel’s and JLJ’s vlog.  Don’t change anything Mark.  Don’t go cable, network or public television…just keep doing what you do!',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9303,'zNXctUnHp5A','I''m so glad to see reviews on food from Spain. I never knew anything about Spanish food ''besides for western world Spanish food  like Mexico  to Brazil. I never was even interested i looking at Spain as a food destination and now its definitely on my food bucket list . So glad I''ve saved all the videos so if I ever go I can look book and plan a trip . Thanks Mark and Jeff.  And a big thanks to all of your guides on this trip. Im sure alot of these places would never be found easily.',4);
