Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11994,'F1H7k_O_Cis','Hi! I’ve been kind of in a state of stupor since the 2022 school year ended. I’m a rising high school sophomore and this video got me EXTREMELY motivated !! The SAT is still relatively far in the future for me, but I wanted to prepare ahead of time. I will keep all your tips in mind! I wanted to thank you for getting me motivated again :D good luck in your studies !!!',118);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11995,'F1H7k_O_Cis','I''m giving the SAT on the Oct 1, I loved this video, gonna implement that into my schedule and I shall update this comment when I get my score :)',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11996,'F1H7k_O_Cis','Hey, thank u for making this video! I''m going to be in the 10th grade this fall and I''m thinking about taking the SAT in 11th grade(spring 2024). I''m foreign and you really motivated me to start getting ready for the exam so I succeed and  fulfill my dream of attending a university in the USA:)',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11997,'F1H7k_O_Cis','I got pen and paper and made a note of everything you said and pasted it on my wall. this was such a good video. I''m aiming for at least a 1400',201);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11998,'F1H7k_O_Cis','hey this a great video!! it gives a great overview of studying for the sat, the best video i''ve seen. your editing is awesome too!! i liked the fast pace. anyway thanks for making this!! <33',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11999,'F1H7k_O_Cis','Were you studying for the SAT while you had school? if so then how much time did you study everyday for the sat? compared to your school hw?  thank u sm xoxo',3);
