Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12003,'2RJ9vI-_G5k','Thanks for sharing! The “study like it’s your last test” even though you’re taking it twice is an interesting approach. I get the value in it but I actually say the opposite to my students because they get so stressed out. I tell them not to worry and just relax in there because they can always take it again! Also the focus on the math first I like - I’ll actually have them only do one portion of the test with me for the whole month or two and then take the test and then do the other portion for a whole month or two to SuperScore',1);
