Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10276,'numY1SB5i3A','It is true that we didn''t hear Daemon said "The Heir For A Day" and his account might be true after all when he said we each mourn our own ways. We are only told via Otto''s report, and we know they despised each other. The labeling could be interpreted in either good or bad way. Just like the title "The Queen Who Never Was" could be considered a mockery but also it could mean you acknowledge that she should be the queen. Maybe Daemon is indeed honoring his dead nephew. One thing is for sure though, i think his love for his brother is genuine, however rogue his ways are. He knows his brother is weak and he sees Otto Hightower for what he is, he really wanted to protect his brother from crows that''s waiting for a feast. He''s definitely going to be a grey character and they tend to be the most interesting.',55);
