Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9419,'1SHtfzBrrT4','That movie theater butter flavor is thanks to something called “butter salt” (brand name Flavicol).  The compounds that give butter it’s buttery taste can be made artificially (or extracted from actual butter), then mixed with salt as a powder.  This is then mixed with oil, and that’s what movie theaters use.  You should dry age with the pure Flavicol powder — I bet that’d be incredible',261);
