Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10354,'tRp_obvGCyM','I love the original Tamil movie. The Tamil version solidified Vijay Sethupathy as my favorite actor. The whole concept of setting up the story in the Vikram Vetal backdrop was so unique. The climax fight- Vedha has a ''come what may''/ unhinged/ chaotic attitude- and the crazy banter between Vikram and Vedha during the fight .. it was absolutely fresh to look at... Personally I love both Saif and Hrithik. I really don''t want to compare VJS and Hrithik. I''ll be honest, I was skeptical about the remake. But the teaser does look promising. I love Hrithik''s attempt at being the unhinged ''Vedha''. Except for the accent, as you rightly pointed out, the teaser does look promising. Even though the bgm is very good, I was just hearing the bgm from the original in my head! I do miss it... I really really really hope and pray this movie does well...',102);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10355,'tRp_obvGCyM','There''s this eccentricity in Hrithik''s eyes that tells me he''ll do full justice to this role. He has his own unique style, and won''t be just mimicking Vijay Sethupathy. I have faith in this movie because of the makers, really looking forward to it. People just have to approach it with an open mind, rather than being so negative even before the release.',164);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10356,'tRp_obvGCyM','The only thing that''s exciting me in this film is Hrithik''s portrayal of a gray shaded character. Hrithik Roshan mostly cuz the guy is just so good but in these kind of roles, it always just fascinates me to watch one of my favorite actors to perform.',509);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11236,'aoU_voPfm2I','I have video footage of a elk ripping the front of my brother in laws pick up truck apart. He was pissed of at my brother in law because he made the sound of a male. That thing was 200 yards away when he did that and let me tell you I felt like I barely made into the truck in time that was only 15 feet from us. I''ve never seen such power in real life, it was insane. That was on Vancouver Island just for your info.',0);
