Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11240,'wX78iKhInsc','I often watch this Ted Talk when needing extra encouragement as a home educator. May you Rest In Peace, Sir Ken Robinson. Thank you for sharing your wisdom.',1563);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11241,'wX78iKhInsc','The sad thing is this was posted 7 years ago and nothing has changed in the school system.',1192);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11244,'wX78iKhInsc','It wasn''t until I left school that I discovered how interesting learning can be - including what in school I found tedious.',2403);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11245,'wX78iKhInsc','This man made more sense in 20 minutes than a whole ''committee'' in years and years of ''planning'' and ''execution''.',546);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11246,'wX78iKhInsc','This is why field trips are soooo good. They create an atmosphere of curiosity and learning. Its sad how in high school we get much less.',455);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11247,'wX78iKhInsc','And that is why I have learnt much more on YouTube than in school.',638);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11248,'wX78iKhInsc','Gran vídeo.  Pero permítanme hablar de algo importante, veo que muchos jóvenes y viejos cometen errores que creo que no deberían ser.  Creo que todos, jóvenes o mayores, deberían tener un plan de inversión que aumente su rendimiento financiero de tres cifras a seis cifras.  La inversión puede ser tu plan de jubilación o plan de futuro, según lo que quieras, pero lo más importante es que tengas una inversión que sea rentable.',209);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11249,'S294zRodS_4','You forgot the most important function of school:  To make children hate learning.',140);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11250,'S294zRodS_4','I hope you all realize the incredible scope of possibilities and opportunities you introduce to young people today. For the most part I think you do, and I appreciate all the commitment and energy which shows in the outcome. Every time I think of Crash Course, and the whole insights and enlightenment genre of YouTube for that matter, I think of "For Want of a Nail". And, I wonder what I''d be doing now if the possibilities you introduce to viewers with such comparative ease in this time, would''ve been around in the 70''s. Thank you.',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11251,'S294zRodS_4','This channel is getting me through university',156);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11252,'S294zRodS_4','Thank you Crash Coarse Team, for continuing to give fun and thoughtful educational material for us all!',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11253,'S294zRodS_4','I love that as  part of additional recourses for our sociology class we have these videos. It is also funny how our teacher is always warning us that it''s focused a lot on american context. :D Which is true, because from this video it looks like USA has one of the best educational systems, which is deffinetly not true. Here in the Czech Republic compulsory school attendance functions since 1774. Also our entire educational system is free and there is no religon in most schools (public or private). Of course there are many countries that have worse educational system than USA, but I don''t think you have the best one. But it''s just my opinion, so please don''t come at me... :D',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11256,'S294zRodS_4','Pleaseeee do these for UK sociological structures because most of your videos have helped my alevels so far and are incredibly helpful',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11257,'S294zRodS_4','There needs to be more focus in school on "how to think" and less on "WHAT to think". Most kids learn how to memorize material and pass tests, but only certain kids verse themselves well enough to approach extra credit problems that weren''t covered in class and actually require thought.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11259,'rhgwIhB58PA','Interesting. My learning style is: slow.',47921);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11260,'rhgwIhB58PA','My grade 8 science project, back in the late 80''s, was on learning styles. My teacher was shocked and surprised when I submitted my project idea. All my subjects were my classmates. Over a span of a couple weeks I tested their comprehension of certain short stories, pictures, and videos; through visual, audio, and reading. When the science fair day came, my booth wasn''t the most popular with any of the other kids, but with all the school teachers and parents... they loved it. I remember the results of my project was inconclusive because I tested each student individually with each individual method of learning. No one method of learning is better than another, but combining multiple methods of learning is where results would be seen. But I ran out of time to combine methods of learning before the project was due.',2220);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11261,'rhgwIhB58PA','I worked as a high school teacher for thirty years. Over the years it gradually dawned on me that the many educational theories, which were forced on us were based on absolutely nothing but unproven theory. Learning style was just one of many. Nearly every year a new style or theory would be introduced. Nobody ever rigorously challenged these theories (presented as facts) demanding evidence and proof. Ever. Yet if you did not adapt your teaching to incorporate these unproven styles you would be judged to be a failing teacher. So you had no choice. At least whilst being observed!! I became quite cynical in the end because I realised the new methods were invented and then promoted by people just trying to further their career with something for their CV. And each method would last a year or two before going out of fashion and being replaced by a new one. God forbid anyone would actually just leave the teachers to use their own experience, education and intelligence.',362);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11262,'rhgwIhB58PA','I had an excellent, and very intense mathematical statistics professor for whom varying teaching style *WAS* his teaching style. I recall, one day for an hour long lecture, he came in and wrote notes and provided examples and proofs, and he never said a single word. In another day, he switched his handwriting to beautiful, perfect cursive. He was a bizarre teacher, but pushed me to the absolute limit. Great prof!',115);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11264,'rhgwIhB58PA','i''m a pressure learner, i only learn school material when there''s severe stress and doubts about my future imposed on me',27272);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11265,'rhgwIhB58PA','People learn easier when they are interested and is enjoying to know a topic. Also, if you understand schooling, as the obligation of attend to school and have satisfying grades, and education, as acquire knowledge through studying for self interest, it will not only be clearer that we learn only what we want to know, but also, that several government regulations on schools around the globe is actually, making people dumber.',764);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9439,'X1EA8vgu7xs','My grandmother told me this story: We''re from the Philippines, and during the end of WWII during and at the exit of the Japanese occupation, the US military started to air drop supplies to the civilians including food. One of my grandmother''s neighbors, a young boy, picked up a can of corned beef and ate it straight from opening the box of supplies. He dropped dead moments after. At the time my grandmother thought he died from choking to death, but later realized it must have been refeeding syndrome.',887);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9440,'X1EA8vgu7xs','I just feel the need to say as someone diagnosed with Anorexia Nervosa I appreciate you Mat for bringing light to the dangers and science of them',510);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9441,'X1EA8vgu7xs','Slight correction: Pretty sure Gordan didn''t know MrBeast was fasting until he literally started cooking for him. He probably would not have even started cooking if he knew. By the time he started, he definitely has the pride of a chef to have his target audience enjoy his food.',4964);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9442,'X1EA8vgu7xs','13:15 just a quick correction there. Jimmy did do it for the content, but he stated in the comments it was also because he has Crohns disease, which means he has a nasty amount of gut inflammation. He wanted to know if fasting would help with the inflammation.',124);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9443,'X1EA8vgu7xs','I was in a pretty bad accident when I was younger, spent about 3 weeks in ICU hooked up to a nutrients IV and could only drink water with a straw while stuck in bed. I still remember the first time I tried to eat solid food after that. It was a little microwave Kraft Dinner cup. I took one bite and immediately was hit with a wave of nausea to the point and nearly vomited right there in my hospital bed. I haven''t really been able to eat plain KD since then :/',140);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9444,'X1EA8vgu7xs','This is probably my favourite food theory video to date. This information could save lives of people who fast, whether voluntarily or not. As someone who has unfortunately been in a position of not being able to acquire food, I really appreciate this information. There had been times in which I went a few days without food, only to try and stuff myself. I only ever felt sick, and knowing it''s my body''s natural response is a huge perspective change.',8);
