Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9475,'oybXTcj_0fM','Looks great!  The bakery where I work makes blueberry cornmeal muffins - for dairy we use sour cream rather than milk/buttermilk and we also add a little lemon zest and vanilla, but otherwise very similar!  Someone has maybe already commented this, but we also toss the blueberries with one reserved cup (for a recipe of this size probably a couple teaspoons or a tablespoon would be perfect) of the dry ingredients before mixing them in to keep them from sinking.  Blueberries and cornmeal make a great combo!',98);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9476,'oybXTcj_0fM','You can try coating the berries with flour before you mix them in. The flour coating on them slows down how fast they fall to the bottom of the pan. The same goes for things like chocolate chips.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9477,'oybXTcj_0fM','It''s a common trick in a lot of baking circles, to toss the fresh fruit with a little bit of flour, before stirring in the fruit to your baked item. So for a pound of blueberries, perhaps toss them together with about two tablespoons of flour, which should keep them suspended in the batter as it bakes.',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9478,'oybXTcj_0fM','I’m upset about other things in my life, and I’m still confident that I would love these (and not complain about blueberry placement)',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9479,'oybXTcj_0fM','Perfect timing! We have two blueberry bushes that give us about 2 gallons of blueberries every summer, tomorrow the picking begins and will continue for at least two weeks, can''t wait to try this recipe!',14);
