Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9482,'oybXTcj_0fM','I call the sweet style cornbread "breakfast cornbread" cause when it''s paired with a glass of milk or cup of coffee it makes a great breakfast. I''m gonna try adding blueberries to my next batch.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9483,'oybXTcj_0fM','Looks delicious!  I''ve got a recipe for strawberry cornmeal cake, and I add the strawberries last and gently swirl them into the batter that''s already in the pan to keep them suspended in-cake.  That being said, I also love cobbler so I don''t have a problem with Blue Bottom cornbread either!',21);
