Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12056,'OCOlne56VYc','This gives me so much more confidence. I love the way you easily break it down in a way and quickly explain it all. Really needed this',85);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12057,'OCOlne56VYc','I wish I would''ve looked for this video a lot sooner. The SAT is tomorrow for me.',573);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12058,'OCOlne56VYc','I took mine in March and I’m not happy with my score so I’m retaking in in 2 weeks, June.  This video has been an amazing help. Just finished the first one and about to move on to the next one. Great video and fantastic explanation.',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12059,'OCOlne56VYc','You did a great job! SAT Math is not easy, I wish it was easier for students to beat it! Good luck guys!',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12060,'OCOlne56VYc','You know, I am always extremely stressed out during the SAT so my mind gets cluttered because I''m thinking of all the things it could be asking, but the fact that this is all just summarized so well honestly helps me out big time for my SAT happening next year! Thank you for the help! :D',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12061,'OCOlne56VYc','I was stuck at 500''s for past 2 months and after watching your and John''s videos-obviously with some practice-I''m in 600''s that too literally in a week.Jazak Allah khair Huzaifa !',16);
