Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12067,'yBCAv_NzzPQ','to everyone watching this video: it works. All math that you will see on the exam is reviewed in this video. My score went up 150 points after watching this video. I''m taking the SAT this Saturday to shoot for the 1500s, but I just wanted to say that this is an amazing video and it really is comprehensive!!! Good use of your time to watch this 2 days before your test date and do at least one practice test :)',55);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12069,'yBCAv_NzzPQ','Graduated 24 years ago, when a SAT or ACT was not required. Now, I''m looking at going to college and have to take the SAT or ACT (after 24 years!!!). Thank you. It helps to find a crash course! Still very nervous but this helps!',132);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12070,'yBCAv_NzzPQ','You did a great job explaining! Nothing is easy on Math SAT! A question could be 5 sentences long and your heart just drops! Anyone who takes SAT is a Hero! Press on, guys!',50);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12071,'yBCAv_NzzPQ','to each and every one of you struggling about your sat, i hope you all get a good scores',2804);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12073,'K0tyWm7nso0','Rensselaer Polytechnic is such a gem of a school, it''s a shame it wasn''t even mentioned on this list. After graduating my oldest went to Microsoft and my second went to Amazon, both for Software Engineers. My third has his foot in the door for JNJ for Chem Eng. They were average kids that got an incredible education as proven by their technical interviews. I think you really need to mention RPI in more of your videos. <3',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12074,'K0tyWm7nso0','i’ve been watching since freshmen year, heading into my senior year now. i self studied with many tips from here and got a 1500 today! thank you!!',50);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12075,'K0tyWm7nso0','Thanks for sharing! I am really glad you put this video in the context of what schools the student is looking to apply to, since SAT scores are all relative. Since I score a 1500+, it blows my mind to think about being in the top 99%. I think the part about scores being inflated because schools don''t have to report bad test scores since students aren''t submitting bad tests scores makes sense. However, I do tell my students that submitting scores is beneficial to them if they can because the U.S. World News Report requires a school to report at least 50% of its students'' scores in order for them to remain competitive in the rankings. Thus, more elite schools will take more students with scores than without to maintain their coveted spots!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12076,'K0tyWm7nso0','Hi Brooke! I''ve been watching your videos for a while and was able to score a 1560 as a junior! My subscores are both 780, which is causing me a dilemma because I want to go into engineering/CS. My total score is at the 75th percentile or higher for almost every school I''m applying to, but my math is at the lower end for my intended major some places. Should I retake to get a 790 or 800 or will it not make much difference?',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12077,'K0tyWm7nso0','Hey Brooke, would a 1520 superscored SAT, made from a 1490 (780M / 710E) and a 1450 (710M / 740E) be looked down upon by schools that have 1520 right at the bottom of the middle 50%? Would raw 1520 be a considerable improvement?',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12078,'K0tyWm7nso0','HI! I´m an international student. Do you think I have to take SAT and submit my test scores? How important is that for a class of 2028? Especially if I want to get into a good university.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12080,'K0tyWm7nso0','What if you have a big divide? My daughter has a math score under 600 but a verbal score over 700 for a 1320. She also has an unweighted 4.0 in AP and IB courses, 5s on both AP tests she took so far and a 7 on her first IB test.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12081,'K0tyWm7nso0','What''s the reasoning behind not going test optional if you score in the 25th percentile? Wouldn''t it make more sense to submit only if you''re in the median score range?',5);
