Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12096,'WjVVwMGJ9S8','Half the comments on this video are “lol you guys think the SAT is hard wait til you learn about (insert random country’s standardized test)”. The discussion surrounding this video shouldn’t be “mine is harder and therefore better”, it should be about how bad standardized testing is and how it really isn’t a measure of intelligence, just of taking the test.',1885);
