Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10361,'tRp_obvGCyM','In orginal movie and trailer specifically, both Vikram and Vedha were projected to be equals. Given equal screen time, dialogues and actions. But here I believe Hrithik is being pushed more than Saif and that''s what bugs me..',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10362,'tRp_obvGCyM','I''ve just recently watched the original but I''ve to say that this teaser actually looks really good. I''m not going to compare it to the original as original will always be original but I''ve high hopes from this film because it''s the same duo who directed the original one. Personally, I don''t have any problems from a remake and I don''t think remaking something is a crime. The remake, however, has to be good. If it doesn''t justify the acting of the original actors then it''s a crime otherwise if it''s a remake like Kabir Singh (which is a really good remake) then I don''t have any problems and I feel this remake will be genuinely good',100);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10363,'tRp_obvGCyM','I like how they made Hrithik a bit devilish instead of Vedha being the calm guy like in the original. I feel like VJS''s Vedha is how Mohanlal would''ve played Vedha and Hrithik''s version is how Mammootty would''ve played the role.',31);
