Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10411,'xuQPAGkNR0g','The real amazing thing about Ems first few lines is that he was finishing Young MA’s rhyme scheme that she started way back in her verse. She rhymes Quavo, facial, Lay Lo, Wayne mode, drake mode, rake mode, paid so, gang mode, pain go, flame go, etc (it’s out of order I know) and then Em comes in “Game O(ever), Thanos” and finished it. The man is a monster but that was nothing but respect to Young MA for holding the rhyme scheme out that long, which I think was something she did to pay homage to Em cause that’s his style. Fire song.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11266,'rhgwIhB58PA','I''m a teacher in New Zealand and VARK was covered in my teaching degree 17 years ago. We did questionaires to determine the order of our preferences, but we were told to try and cover all these aspects in our teaching, ie try and give the children a verbal aspect, and an auditory aspect, and a reading aspect, and a kinaesthetic aspect. That sounds more like the multi-modal approach you described. I remember I came home very excited about it and suggested to my wife that she do the questionnaire as well. She looked at it and said "I don''t want to read all that, can''t you read it to me?"',151);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11267,'rhgwIhB58PA','I feel like the "learning styles" myth has ultimately HELPED teaching, though.  It''s encouraged teachers to be more multimodal in their TEACHING style in order to (in their minds) reach a wider variety of learners.  Even if the hypothesis was wrong, it''s ultimately created a stronger teaching style.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11268,'rhgwIhB58PA','Twenty years ago I gave a small talk about VARK to my fellow educators. The key point in my plenary was that learning styles are not separate, but complement each other in a holistic manner. Over 47 years I have found many ''keys'' to assisting students to learn : humour, comfort (having eaten, slept well, etc.) pause frequently to review points, question your own knowledge openly and invite students to do the same as they learn. I loved teaching and was only persuaded to finish when the paperwork before AND after took more time than the educating.',85);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11269,'HndV87XpkWg','I''m glad I live in the age of the internet. I learn every day. I''ve never stopped being a student.',1840);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11270,'HndV87XpkWg','It''s official. I''m opening a school like this if I''m rich when I''m older. Or maybe even if I''m poor. I really don''t care, I just want a school like this.',98);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11271,'HndV87XpkWg','I personally believe children and students should be taught to think for themselves. They should learn to debate, solve problems and be encouraged',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11272,'HndV87XpkWg','This video speaks to my soul! I''m training to be a teacher at the moment and it''s not what I imagined. I don''t feel like it''s what I should do with my life but this video has revived me slightly and reminded me that this was/is my vision and not to be bogged down by the current system. Awesome videos!',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11273,'HndV87XpkWg','Every single one of these videos is perfectly made, with amazing points. Everything is so well thought out! These videos make the world a better place.',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11274,'HndV87XpkWg','I am a teacher. I love my job and I need to tell you this is happening in schools. It is pushed for students to learn and understand life problems. We call it the "hidden curriculum". It is what teachers facilitate in their classrooms. Teachers put students in many situations and help guide them in appropriate ways. Or guidance about finding themselves and their interests. Or understanding money (which is definitely in the curriculum). You are correct it is NOT as blatant as this example and I wish it were more but your next video I would love to see your solution to this problem. The education system knows this is where we want to go. They just don''t know how.',353);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11275,'HndV87XpkWg','It''s official. I''m opening a school like this if I''m rich when I''m older. Or maybe even if I''m poor. I really don''t care, I just want a school like this.',81);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11276,'HndV87XpkWg','Great video. I look forward to teaching my children these valuable lessons if the current curriculum doesn''t go over these important subjects.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11277,'HndV87XpkWg','Schools definitely needs to teach the various biases and fallacies. Funny thing about them is that by simply knowing, people will commit much less of them. This is one of the purest example of "knowledge is power" and most certainly belongs in a curriculum.',60);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11280,'XlnspY2wOVw','I think we can all agree the schools need to incorporate financial education  all throughout high school.',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11281,'XlnspY2wOVw','So we found that the problem wasn’t the education system per se but the circumstances that children grew up in. And rather than even entertain the possibility that an inequitable socioeconomic foundation was to blame, it was easier to say “kids aren’t learning because there’s something wrong with the books, teachers, and schools.” I love how simple it is to explain so many crappy circumstances through the lens of cognitive dissonance. Now we’ve graduated to blaming lack of homeownership on people being too indebted as opposed to a dearth of housing options in the places where people actually want to live (or more accurately a dearth of places with housing where people actually want to live.)',60);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11282,'XlnspY2wOVw','I dropped out of high school when i was held back in 11th grade, and got my GED at 2 weeks before my 19th birthday, the GED tests were way easier than end of the year tests in regular school',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11283,'XlnspY2wOVw','What most people don''t understand is that basic education is 80% culture. You can''t just write a list of things to learn, you need to design an engaging environment for people to receive information and play out tests. You also need to include the parents of children to make them understand and play in key of the curriculum.',125);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11284,'XlnspY2wOVw','I''ve taught the A-levels (UK) and the Florida/Michigan curriculum at international schools. The US has a lot less focus than the UK. Americans are confused about what "raising standards" really entails. Foreign curriculum pushes students to master a smaller set of skills with smaller textbooks and more essay writing whereas the US focuses on a wider range of concepts with superficial multiple choice polling. Often this leads to foreign students having mastery and being well spoken about foundational concepts while American students win trivia night but can''t really explain why the know something.',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11285,'XlnspY2wOVw','education is used to separate and maintain the social classes in the States. Rich only chooses the private to avoid public broken system',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11286,'XlnspY2wOVw','Schools need to push to hold back students instead of pushing them to a level out of their league until they give up. The students that are showing much slower growth need to be put into an alternative career/life focused school/classes/program.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11287,'XlnspY2wOVw','Let''s perform it on a positive note. The culture and ecology have to be healthy for starters. Schools have to be safe and secure. It has to be supportive of learning curve for the students. The student must take extreme ownership of the curricula. The subject matters must be based on science. Learning methods must be evidence-based. (Yes, I''m a seasoned STEM teacher by the way).',6);
