Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12097,'WjVVwMGJ9S8','all these people commenting "i''m poor and i got a 1300 by studying a lot" ¿¿¿¿¿¿¿¿¿¿ we are talking about that poor people on average are less likely to get a great score, not that it''s impossible! There is a difference between inequality in general and a specific success story',1942);
