Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12100,'WjVVwMGJ9S8','First thing i learned after spending $800 on my ACT prep, was that the ACT measures how good you are at taking the test/a test under a time constraint. "Even people who get 35 or 36 dont actually know the answer, they just know what for sure is NOT the answer. " -My tutor',280);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12101,'WjVVwMGJ9S8','When I was in high school, I took all general courses and got a "22" on the ACT (average). I am now in medical school at the 64th percentile of my class, all of which were honor/AP students with 30+ ACT scores and straight A''s in high school. National testing doesn''t look at one of the most important factors in people: Determination and resilience.',333);
