Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12105,'PIGkcF-H1Ho','Before I get into my comment I would like to say thank you, I really appreciate that fact that you take the time out of your own day making these incredible useful TikTok s and YouTube videos so people can study even though your not making anything off of it. Back to the point, id like to say thank you because right now I’m a freshman and I didn’t really have a motivation to study for the act but when I was scrolling through tik tok I saw a video with a really hard math problem but you made it seem really easy like I could do it in a minute so after that I did more research and found out how important the act really is so I’ve been studying with your YouTube and tiktok videos along with other things on the side, i still have 2 years before I have to take it but your videos are so entertaining they make me want to learn and get better at math.',1169);
