Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12116,'jZrHzU1orc8','The biggest problem for me right now is that I’m working during the day, I try to study from 7-8:30 am but then I have to catch the bus to go to work at 10, and then I work until 4, but get home at 5. Then I have to walk my dog/eat dinner and can only start studying at 9 again. But I wake up at 6 so it’s so hard to find time',3);
