Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12122,'5Q538rYLdvg','A girl in my school just got accepted into Yale with a full ride scholarship. She deserves it and I''m so proud of her!',5521);
