Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12125,'5Q538rYLdvg','I just graduated from law school and attended Washington U in St. Louis for my undergrad. It is so interesting seeing all of these people a few years behind me talk about stats, scores, and extracurriculars. Yale and other elite schools can really and truly set you up for life. But just remember, if your scores aren’t this amazing or you don’t get into your dream school, you still have a wonderful life ahead of you. I’ve taken classes at community college, public universities and private universities, and your education really is what you make of it. College is only a few years out of the rest of your life, and I wish in high school I had known that and spent more time making memories and less time worried about my GPA. Just my two cents, and amazing that all of these students are so accomplished at such young ages!',981);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12126,'5Q538rYLdvg','hey queen! girl you have done it again. constantly raising the bar for us all and doing it flawlessly. i’d say i’m surprised but i know who you are. i’ve seen it up close and personal. girl you make me so proud¿¿',1166);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12128,'5Q538rYLdvg','As fun as these videos are, I do want to give a certain amount of warning to HS students. Just because you have the grades, scores, letters of rec, essays, and extracurriculars doesn’t mean you’ll be accepted into these schools. I was denied to all of my colleges despite having a 3.8/4.23, a 1490, and being on a nationally recognised robotics and rocketry team. I even did robotics research in HS at a university, applied to the university, and then was denied from that university. So much of it is just an arbitrary lottery, it’s hard to truly know.',93);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12129,'5Q538rYLdvg','2:56 and 3:19, having a 44 IB predicted score is way more impressive than getting a 4.0 gpa, we have a monster on our hands',1694);
