Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10443,'ttHU25alu8A','This is really an amazing animated video that creates goosebumps and fills every Indian''s heart with pride, joy and sadness as well. The creator mentioned the name Assam but I want to add more names of freedom fighters, who are from Assam and equally contributed. Foremost name is Kanaklata Baruah, just a 17 years old girl and she took bullet while hoisting Indian flag and died on the spot. Other freedom fighters are Gopinath Bordoloi, Jyoti Prasad Agarwala, Maniram Dewan, Kushal Konwar, Hem Barua (Tyagbir), Bhogeswari Phukanani. Other prominent freedom struggle unsung heroes from Northeast India are Major Paona Brajabashi, Bir Tikendrajit Singh, Rani Gaidinliu (13 years old Naga girl), Haipou Jadonang, U Tirot Sing Syiemlieh, Moje Riba, U Kiang Nangbah, Pa Togan Sangma. And the list of names doesn''t stop here, there are many more. ¿¿¿¿¿¿¿¿¿¿¿¿¿¿¿¿¿¿',12);
