Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11300,'y3fm6wNzK70','I''m amazed how the people behind this channel make such attractive fun animation while turning what could''ve been hours of lectures and studying into a 5-10 minute video',292);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11301,'y3fm6wNzK70','While working on my Masters in Education, one faculty member told me that in his opinion, our schools were designed to babysit our kids so the parents can work.',134);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11302,'y3fm6wNzK70','I find it utterly interesting and a bit paradoxical to see Dewey''s progressive ideas presented through a short and well made lecture which utilizes state of the art instructional design. It really tells us that the art form of lecturing is rather timeless..',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11303,'y3fm6wNzK70','I am studying John Dewey''s Philosophy. This video really makes me understand more clear on his principles, such attractive fun animation and clear explanation!',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11304,'y3fm6wNzK70','I''ve been studying with the traditional academia style from my chidhood and I think this was one of the reasons of my deep unhappiness everytime I had to go to the school, and I agree the system can be totally useless when it comes to study died things in only books and not providing experiential oportunities to learn for children. Its a very serious matter that I hope will dramatically change very soon. I adapted to the system and became succesful in the studies but I can tell not in life. Sharing my experience, all the best to you guys',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11305,'y3fm6wNzK70','When I went to school in the sixties, there was one program, one track, and it all revolved around completing workbooks, memorizing facts and spewing them back in exams, and in addition being judged on academic performance (if memorizing and spewing dates and other facts counts as performance), we were given a grade for "citizenship." A good grade in citizenship meant you didn''t give the teachers any trouble: you had learned to go along to get along. A bad grade meant you were Trouble, and got a lot of negative attention from the vice principal. I spent most of school, particularly middle school, in terror of making someone mad, or being different. It was a hateful experience.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11308,'y3fm6wNzK70','Thank you for this shirt video, it really helps me trying to get through Dewey''s texts! I am writing my pedagogy vision, which is influenced by Dewey!',0);
