Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11320,'T-JVpKku5SI','"An education that prepares learners for life after school" I would really love to see this. In my country, we are trained to seek jobs, so may graduates are frustrated by the education system. Most of them end up studying by staying in school all their lives as a defense mechanism. Our education needs to teach the mind, heart and hands for us to be a bit more successful.',22);
