Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11339,'ovxXYMsz37g','Just so we''re clear, army drill sergeants aren''t allowed to do a lot of this stuff in most countries. Sleep deprivation and injuries kills actual learning regardless how determined everyone is.',670);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11340,'ovxXYMsz37g','I used to work for those online tutoring companies. They wanted native English speakers and promised you $16 but would dock your pay for things like yawning on screen. The pace was insane. I was fired for not smiling enough. The burnout rate was very, very high, especially because you had to get up at about 4 am to do it if you lived in America. The kids would be really young - the youngest I tutored was 3, too young to understand anything at all - and be in pajamas and finishing up their dinner, so like the last thing they wanted to do was stare at a computer and learn English, especially because the age range seemed to be 5-7-year-olds. Sometimes they would pick up the laptop they were on and just run around the room with it and the parents would give us bad marks for not keeping their child engaged enough. It was a really horrible job for both companies I worked for.',340);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11341,'ovxXYMsz37g','In Kenya, I experienced the same. The KCSE is the one exam that can make or break your life. I slept for 5 hours a day. Lessons from 5 am to 8 pm. It was stressful. The pressure from parents and society is sometimes too much. I am glad it is all gone',410);
