Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12131,'5Q538rYLdvg','I like watching these videos cuz they do be inspiring me to continue my college education. In highscool I was a 2.0 gpa student. Barely putting the effort to muster a C. My only way getting into college was soccer but eventually I quit due to mental health. I was really depressed and didn’t have any motivation for anything. Had no friends no job and overall I was in a bad state in hs. I just turned 20 now back in community college trying to get a degree eventually gonna transfer. But yeah would’ve wished i had better guidance and wished I could go back and change that so I wouldn’t have made it harder on myself. I didn’t even go to prom no football game nothing and overall had no social life. Starting to change now How I am now and it’s honestly making me a better person and happier. Seeing you guys so happy at Yale is motivation and brings me joy. You guys are very smart and I also admire your hard work you put in and the sacrifice.',341);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12133,'f_S5png6OhY','Super useful! I wish I had this when I was doing SATs. <3',815);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12134,'f_S5png6OhY','I got a score of 1170 when I took the practise test offered by Khan academy , with a 570 on maths and 600 on english . In my defense , It was my first attempt and I wasn''t really expecting it to be this long . I found your video helpfull and hope you make more sat related content.',126);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12135,'f_S5png6OhY','This was so informative. I''m in ICSE board, and in 8th grade, and I know that might sound a little early to start doing all of this, but frankly, I''ve been freaking out about my entire future a lot (let''s just not get into that) and your video helped assuage some of my worries. Thanks so much, <3',189);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12137,'f_S5png6OhY','I''m not taking the SATs but still sat through the entire thing. I''m a Master''s student stuck in India waiting to get back to the US. It just feels good to watch your videos. As weird as it may sound, your videos are helping me stay hopeful',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12138,'f_S5png6OhY','Thank you so much for this video! It was so informative and really helped someone like me who isn’t be familiar with these type of exams. Could you also make a video about essays and how to write an impactful one to get into Harvard?',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12139,'f_S5png6OhY','6:24 update: idk if all indian schools are doing this but CBSE has introduced CCT (Critical and Creative Thinking) where all subject teachers give students CCT based on the subject. This also comes in boards. For me, only one teacher is constantly giving us work meanwhile other teachers aren''t very consistent. So, there''s a website where you can access CCT questions on all subjects so you can train yourself.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12140,'f_S5png6OhY','Hey Avanti, you’re really helpful to a lot of people including me. Thanks!',76);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12143,'7zjPapUDRMg','Brooke''s videos have helped me get great scores on the SAT and ACT, including a 750 reading and writing! I''m sure these scores have helped me get in to UF with a scholarship, especially since I go to a big high school with limited course offerings. Thank you Brooke, and GO GATORS!',23);
