Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12157,'k1VOUvAjUDo','Jehovah, I pray that everyone watching this VERY helpful vid scores a 1500+ on the upcoming SAT. amen!!!!',4987);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12158,'k1VOUvAjUDo','I got a 1590 on my SAT using strategies similar to the ones you recommend, so this guy is legit y’all. If you get anything out of this, it’s to take the time to fully understand the passage!! The only caution I’d have with your strategies is to avoid any sort of generalizing as you did with finding the word that fits in context. While that is the case most of the time, I’ve seen collegeboard switch it up before. (they’re rude like that) You’re killing it tho; keep up the good content!',897);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12159,'k1VOUvAjUDo','him answering 52 questions in 8 minutes: me still on question 1 after 8 minutes:',9222);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12160,'k1VOUvAjUDo','Bro, you are actually a god. I just took the SAT today and it went so well. The only thing I did from my previous attempt in August is try using your strategy and my performance magically improved. I swear I’ve spent so much time trying to improve; I practiced over 3000 questions, read prep books, and studied under tutoring, yet my score decreased every attempt through the past year. However, you were the only one who was able to help me (only other channel is Supertutor TV ) Also, this happened to be the last SAT I could ever take since I’m a senior. Just wanted to say thank you so much!!',1025);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12161,'k1VOUvAjUDo','I answered 52 questions in 1 minute. I got all of them wrong though.',11041);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12162,'KXF9u9iZRM8','You’re honestly the best SAT resource that I’ve seen in a while. Like I have learned so much from just these couple of videos, compared to watching SAT tips from other bigger channels! Thank you for all the help and I really love your style of videos! P.S you’re gonna blow up soon I just know it, cuz these videos are actually really informative!',329);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12163,'KXF9u9iZRM8','I''ve got my test tomorrow, thank you SO MUCH. You know one of those times when the teachers teach you stuff but then your friend just explains it briefly and easily and you understand just better than the 1 hour looong session. That''s exactly how I felt. Anyways thanks again and wish me luck!',342);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12164,'KXF9u9iZRM8','bro you didn''t even just get  a 1600, you got every single question right. That''s crazy',782);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12165,'KXF9u9iZRM8','WHOS TAKING IT TOMORROW LESSS GET IT. Btw Anna you''re a great human being.',892);
