Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12167,'KXF9u9iZRM8','I''m just gonna be real with you. If a question says delete the underlined portion as one of the choices, 9/10 times deleting is the best option. I never see them put that choice but it doesn''t fit',71);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12168,'KXF9u9iZRM8','Thank you so much. You are helping thousands of people by uploading advice on how to be a smart test taker and using common sense to your advantage. The main thing about the SAT is staying calm and knowing what to do. You are helping a lot with both of those',41);
