Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10467,'ZYAiyoKVl78','I was so excited when you announced that the Watchers of the Bar were returning for House of the Dragon, I''m thrilled that the first reaction episode is already out!!! It''s been so long since we got to see you guys all together again, thank you for bringing this back! Much love from Oregon <3',393);
