Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11342,'ovxXYMsz37g','My god... this actually gives me an understanding of why there are so many international students from China who board at my school, especially students in my year (year 12). To get an education which is actually constructive and without the burden of social status being dictated by marks etc. I''ll have to replay this video when ever I start to complain about my education being hard because it is NOTHING compared to THIS.',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11343,'ovxXYMsz37g','I''m 17 this year and am studying in an international high school in Shenzhen, China. I was in public school until high school; I''m grateful my parents provided me the opportunity to leave that stressful system. But I heard from my former classmates who are in the system that in recent years, the pressure on that system has been declining, but I can''t be assured because I''m no longer in that system. Recalling my dark days in that system, I''ve always hated it because there was a lot of transcribing homework and memorizing poems and passages. When you fail to remember them, teachers will punish you by transcribing the poems and passages several times. I understand the reason why our government has such a system because we have such a vast population, and I do think it''s relatively fair even though its fairness is declining, especially when this double reduction policy came down.',250);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11346,'ovxXYMsz37g','Education has become  competitive for parents, to make their  children  worthy in this world to competent other for their  future, It''s not only happening  in China in other fast growing  cities.  It''s  better  to divide  studies  according  to grade , rather pressure  the kid at early  age......nowadays  parents  are feeding  kids with  vitamins  and many nutrients to improve their brain function,  but they didn''t  think the world  most top renowned scientists never had this facilities.',105);
