Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11362,'q5JWp47z4bY','Stocks wavered Thursday as traders awaited Friday’s July jobs report, which will give the latest snapshot on the labor market and the health of the economy. With inflation currently at about 10%, my primary concern is how to grow my reserve of $300k which has been sitting duck since forever with zero to no gains, sure I''m all in on the long term game, but with my savings are lying waste to inflation and my portfolio losing gains everyday, I need a remedy asap.',256);
