Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11375,'zDZFcDGpL4U','I certainly remember being much better at being creative when I was younger, but now that I''m a freshman in High School, I''ve noticed that I''m much worse at the whole creativity thing. Now, the problem is, I''m being praised. Why? I am great at finding the one answer. I can take tests very well, but am typically not the best at projects. Math is my best subject, English is my worst, where you typically have to write creative essays. I want to be an engineer, so at my school, we have an elective called pre-engineering. It''s one of the closest classes to an actual job that''s available at my school. And I''m not the best at it. Sure I can do the math required, but coming up with ideas for better designs is hard. I feel that this shows that my education is doing the opposite of preparing me for the future. It''s telling me that there''s one answer, which is never the case in engineering. I hope that soon enough we can have an education overhaul, and realize that we need to change education.',345);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11377,'zDZFcDGpL4U','I watch this every now and then for inspiration. Love the kids and profession, if not necessarily the ''system''.',64);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11378,'zDZFcDGpL4U','I now have a whole new appreciation for having learned history at school and having had some great teachers and lecturers once I got to University. With history, there''s never only one true answer for every question you ask because everyone views the world differently, from culture to culture, religion to religion, even between generations, which is why history gets revised so much to answer the questions that each era asks. You''re free to come up with any ideas of your own so long as you have the evidence to back it up.',1);
