Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12182,'kOC2QswhrXM','Learn more in less time through my 6 hour SAT Math Course for a PERFECT SCORE (use code "FIRST100" for a serious discount): https://sso.teachable.com/secure/1178789/checkout/3687263/sat-math-crash-course-to-a-perfect',11);
