Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12184,'kOC2QswhrXM','Good luck on your SATs. For those of you that are nervous, just remember that once you get into college, this test will not matter anymore, so don''t treat it as life defining or anything.',150);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12185,'kOC2QswhrXM','Now THIS is a real SAT guide. All of the points you made are very realistic and factual. I''m taking mine in October, and I was afraid the way I was studying was wrong, but you confirmed to me that I was studying right. Thank you so much!',41);
