Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12192,'PJRhPrLJ4Oo','I did extremely well on the SAT. I went to a great college where I met my current lovely wife. Soon I reached my PhD in physics. I got a job as a professor at Harvard university, and at around 37 years and of age I had my first child, a gorgeous baby girl. Later on I earned my most prized achievement, the Nobel Prize, for figuring out how to manifest the theoretical push of gravity into an accessible fuel source. Boy, how I love Sims...',2479);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12193,'PJRhPrLJ4Oo','I got a 1500 on my SATs, I went to a community college, got my associates, transferred to a 4 year college, did super well there, went to School of Medicine at UW, and I''m almost done with my residency.',2203);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12194,'PJRhPrLJ4Oo','How the hell you get 2200 out 2400 and end up working at buzzfeed',1189);
