Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12196,'PJRhPrLJ4Oo','No talking during the exam, you all failed',2778);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12197,'PJRhPrLJ4Oo','Don''t stress about it?, you have the pressure of scoring in the 90th percentile and not doing the worst out of all your friends. Your family is counting on you to get a scholarship and go to a top school. It''s highly competitive (you''re competing not only with kids in your state but students in all 50 states. And this is basically the test of your life(other than the grad school exams *MCAT*)that determines community college or top university and the difference towards getting more money  towards your pay check. Sure don''t stress about it...',122);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12198,'PJRhPrLJ4Oo','This is the entire problem with the SAT system, it''s not about the knowledge it''s the tricks in taking the exam. Things like SAT prepping and all other things should not be encourage when taking it. In real statistics term, the results you get from taking the test are false because you''ve practice to jacked up your score.',774);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12199,'PJRhPrLJ4Oo','They got high scores... I got a 1800, and I thought I did good.',560);
