Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12207,'vnF2zqwI8oY','Who here is taking the SATs on March 13?  I’m going to save this for the day before ¿¿ update: the test wasn’t that bad I think I was pretty confident but definitely need more practice on math!! The videos helped a lot and I’ll try to watch more!',507);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12208,'vnF2zqwI8oY','When I grow up and have enough money to support myself I am going to make sure reimburse you for how much you have helped me out throughout all of highschool. I started off with a 640 on math when I took the August 2020 SAT. I started to watch your vides and I improved to a 730 on the December 2020 SAT. Aiming for a 750+ this time around and I am so confident because of all the practice materials you have provided to us for free. From the bottom of my heart I thank you so much.',116);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12209,'vnF2zqwI8oY','I just felt such a rush of emotions and just appreciation for you as soon as you told me about the time stamps. The dedication and commitment you have to providing us with the best chance to succeed is truly admiring. Thank you. ¿ ¿',12);
