Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10584,'tgn4zTkXdzA','If you see this comment, I want to thank you for living with me on the same planet. You are not alone in this world. I hope this comment can make at least one person a little bit happy. This is all I want and wish good health to you',302);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10585,'tgn4zTkXdzA','Thank you lo-fi community for being so pure and kind. I''m in a very difficult space in my life right now and I really hope that things turn around. Whenever I feel afraid, I come here to listen to beautiful music like this and read the comments. It''s the only place on the internet that makes me believe that everything will be okay. If you''re reading this, know that everything will be okay. You matter in this world and don''t let anyone or anything break your spirit. It''s going to be okay.',57);
