Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11380,'VxoXfpr6spc','In bedrock, sometimes portals are just that hard to find, I remember blowing up a stronghold for like an hour, then finally finding the portal',548);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11381,'VxoXfpr6spc','I love the way he makes everything heroic, as if it''s in an old tale. At least everything after the stronghold.',240);
