Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11383,'VxoXfpr6spc','This guy is so poetic while he’s exploring this foreign port of Minecraft, it’s so fun to watch! He speaks with such enthusiasm like one of those audiobook narrators that read books out loud to you, I really admire that.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11384,'VxoXfpr6spc','The lesson we learned today: NEVER mess with Bedrock Edition Bosses',6417);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11385,'VxoXfpr6spc','After reading a few comments I would like to clarify that in bedrock both now and at the time of this video portal rooms are kind of bugged and will spawn disconnected from the stronghold, there will be no hallways connecting to it and are usually just behind a few block thick wall or even up to several blocks away',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11386,'VxoXfpr6spc','I’ve gotten really good at speedrunning education edition after I saw a lot of my friends do it! My best is 34:28 I think that’s really good',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11387,'VxoXfpr6spc','I love how he makes the speedrun feel so alive',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11388,'VxoXfpr6spc','Just in case  you didn''t know, bedrock edition has a chance of not having a portal room. this makes it really hard for speedrunners to use bedrock because if they get to the strong hold in just 10 minutes, it might not even have a portal room...',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11389,'2Yt6raj-S1M','"No-one has ever changed the world by doing what the world has told them to do." Powerful words, I live by that.',8972);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11390,'2Yt6raj-S1M','Fact: We learn more on the internet, from travelling and meeting people than we have at school.',8132);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11391,'2Yt6raj-S1M','I used to write so well and elaborate descriptions were super easy, my pen flowed on paper like butter. But ever since my teacher screamed at me for exceeding the word limit in the exam I got so discouraged that I gave up on writing and now I can''t even write a simple essay. School really does kill creativity. Don''t let that happen to you.',5066);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11393,'2Yt6raj-S1M','This is extremely true. One example: My brother is amazing at art. He''s super talented, but he keeps getting Cs and Ds in art because he doesn''t do what hes told. He challenges the teachers. There are people in his class who jave absolutely no skill, but get higher grades because the do exactly what they are told and don''t think outside the box. The teachers are literally trying in limit children creativity  *in an art room*',572);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11398,'2Yt6raj-S1M','I loved my 7th and 8th grade math teacher, his goal was to make the class love math. He said he loved when people failed, and he also only checked homework because the school system made him. He did the best he was allowed to, and this goes to show that you shouldn''t blame the teachers, you shouldn''t blame the people who designed the school system [around 150 years ago], you should blame the people who *keep* the school system the same, never changing it to suite modern needs more. Modern schools are near identical to ones over 150 years ago, which were designed to mass produce factory workers. Let that sink in.',154);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11399,'ZDAdi6ZLktc','It''s true, education is a never-ending process. I feel formal education doesn''t teach you to learn from your failures, but rather punish you.',81);
