Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11401,'ZDAdi6ZLktc','Education is discipline. If you know its important although you just have to go through with it, you’ll definitely go places. On the other hand... there are many who think they wont learn a thing there. These are the people who can’t work except dreaming about doing the next big thing, because of their lack of discipline.',10);
