Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11409,'PAlgOvXOewM','As a 33 year veteran teacher, I suggest that you talk to teachers about their working conditions. The disrespect has infected the classrooms. Teachers are being verbally and physically attacked by students and even parents on a daily basis. A lot of this stems from mental health issues, yet nothing is ever done about it.',308);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11410,'PAlgOvXOewM','Low wages, harassment,  bullying, KARENs, lack of security, respect, paperwork, working conditions, pay, safety, updated and fact based books, etc. Plus who the heck wants to worry about being murdered at their job, not having security taken seriously by those in charge( this will NEVER happen at are school) attitude.',174);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11411,'PAlgOvXOewM','It''s hardly surprising. Even in rich districts teachers are underpaid, undervalued, and overworked. They are expected to take on more responsibilities every year with fewer and fewer resources, all while administrators ignore their pleas and parents treat them like overqualified babysitters. My wife quit teaching several years ago. She was working 6-7 days a week and spending hundreds of dollars a month on supplies just to keep her classroom running, and the school gave her absolutely no support with unruly students.',129);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11412,'PAlgOvXOewM','Respect for teachers is not just about the salary -- although an increase in salary is sorely needed. Teacher pay has always been lower than other professions with the same education and experience. It''s also about respect for the profession. Student behavior, in my view, can be linked to the disrespect for teachers they''re seeing parents, administrators, and politicians demonstrate. Hiring a person trained as a soldier to teach is VERY disrespectful to the profession. As a teacher, I don''t feel qualified to do the job of a soldier; i respect the profession too much. The "anybody can teach" attitude is not only insulting, it''s ignorant.',74);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11413,'PAlgOvXOewM','Who wants to get shot in the classroom while trying to protect these disrespectful students who cuss you out on a daily basis?!?',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11414,'PAlgOvXOewM','I was raised in a teaching family when the profession was respected and teacher strikes unheard of.  Fast forward to a major university where teaching majors walk away from the profession after their first classroom experiences.  Why would any sane person want to be in a job when they are disrespected or not trusted so much?',62);
