Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12215,'i-jFcw-lGho','Just want to put it out there that you don’t need to buy the prep book to access the eight official SAT practice tests! They are available online on the College Board website and free for you to download and print! Also Khan Academy allows you to take those tests on your computer (or just input your answers) and they will score it for you and give you practice recommendations!',103);
