Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10623,'l98w9OSKVNA','It’s midnight again and the deadline is looming! Luckily there is a brand new compilation album “12 Am. Study Session”, and with the help of 26 enchanting new beats from various talented artists around the world, the task at hand feels a lot smoother. Join Lofi Girl in her study - and finish that project together tonight.',1963);
