Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10633,'TURbeWK2wwg','It’s that time of the night again, when everyone is asleep, except for a selected few who are still studying, vibing, and thinking about life. “4 A.M Study Session” is a beautiful collection of soft beats by a multitude of talented artists from around the world. It’s getting late so best to grab a pair of your favourite headphones - and let the relaxing sounds of lofi slowly take over ¿',9054);
