Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11415,'PAlgOvXOewM','When parents start teaching basic morals, respect and integrity you''ll see more teachers wanting to be in the same classroom. Until such time I doubt we''ll see a rise with educators...',65);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11416,'PAlgOvXOewM','A lot of comments, virtually no one citing the elephant in the room:  systemic racist school funding based upon property taxes.  Other countries INSIST that every school district be funded the same.  These countries are consistently rated at the top in worldwide education surveys and results.  BTW, these countries also fully fund health care and mental health too!',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11418,'PAlgOvXOewM','So it turns out that if you underpay and undervalue teachers, nobody wants to be a teacher. Huh, go figure.',81);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11419,'I0dKGM_B3ys','BERNIE.  THANK YOU FOR GIVING THE PROPER VOICE TO THIS CRITICAL ISSUE.   BIDEN THREW A BONE.  MUCH MORE HELP FOR REGULAR PEOPLE IS NEEDED.  SYSTEMIC CHANGE IS NEEDED IN THE EDUCATIONAL DEBT INDUSTRY.',57);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11421,'I0dKGM_B3ys','The cost of education in this country is crazy. If we want to have an educated workforce we need more affordable education.',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11422,'I0dKGM_B3ys','Here we are in the 20th Century, in the USA, and education is a luxury. Something is very wrong with this picture. Thank you, Bernie, for your deft combination of common sense and wisdom!',64);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11423,'I0dKGM_B3ys','Stop funding wars and start funding education and health care. Its taxpayer money. Let we the people vote on how to spend it.',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11424,'I0dKGM_B3ys','It''s outrageous that union organizers are excluded from the debt forgiveness program.  Sounds like something the Republicans and corporate Dems would have agreed to include in the bill.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11425,'I0dKGM_B3ys','Bravo Bernie, a good argument for education and training is you will need less of the welfare state, not more.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11427,'I0dKGM_B3ys','Incredible!  We have to starve the narcissists of people to do business with, Bernie.  Thank you Bernie, for getting our "weak" voices out there with complaints that we can VIEW PUBLICALLY so we know we are not alone, that there are people both in our shoes and also those willing to help from their care for us and our problems.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11428,'I0dKGM_B3ys','¿¿Bernie for president 2024 ¿¿¿¿',70);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11429,'BvbxH9PFcSI','I’m 67 years old and have lived my entire life in Mississippi.  #43 is a huge win in that every time I have observed state rankings regarding quality of life issues we are nearly always #50.   The reason we have come up in the rankings is that my daughter is a teacher in the Mississippi public school system, and she raised Mississippi’s ranking seven points by herself!  I am very proud!',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11430,'BvbxH9PFcSI','Number 5 is not too shabby.  But near DC more resources are given to NOVA(northern VA) while in rural counties and SOVA (southern VA) teachers sometimes use their own money to buy school supplies.  Still when my daughter was in highschool (SOVA) they sent educators from different states to see how we did so much with so little.  Respect for our teachers.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11431,'BvbxH9PFcSI','As someone who''s from MD and lives in PA - Pennsylvania came higher than I expected and Maryland was lower. Baltimore probably dragged Maryland down, but PA is a surprise. That''s because Pennsylvania schools are funded through a system called "school taxes", where each of the 500 school districts (spread across 67 counties) levy their own property taxes to fund their schools. That''s why someone living next door to you can be paying twice as much in taxes to go to a school half as good. This system has been known to disproportionately affect rural and urban school districts and tip in favor of school districts in suburban communities, or those in the Poconos where they have resorts that people own condos at.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11433,'BvbxH9PFcSI','Just moved my family from NY to VA and although NY is one level higher in Education what we gained as a family with piece of mind among everything else is priceless!! Great ¿¿ Video Briggs',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11435,'BvbxH9PFcSI','I grew up in Mass and the schools were excellent.  That said my kids go to school in Los Angeles and there are some great public schools here. My daughter went to a French immersion public school in Glendale, CA. I felt like she got a pretty amazing and unique education.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11436,'BvbxH9PFcSI','The closest I got to college was watching the professor on Gilligan''s Island. That must put me a few points ahead.',49);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11437,'BvbxH9PFcSI','I''m from CA and I find this super surprising. While overall our stats suck, when you look at the exceptions, the smart kids here astound me. At Dimanomd Bar I knew this kid who was talking calc 1 as a Sophmore in high school. I also met this Taiwanese girl who was taking data structures and algorithms at 16 and recently got into UC Berkeley. I think while overall our stays suck, our top scholars here can top other scholars. After all, the UC system has some of the most prestigious Universities according to US News',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11438,'BvbxH9PFcSI','would have been nice to see what per student funding was per state as well.  See which states are getting a return for their dollar, or correlation between and funding and results.',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11441,'JggwEgBFm3o','My son is a senior in high school this year. He says he might choose community college but doesn''t want a 4 year university. Trade school is fine too. I think he just doesn''t know what he wants to do with his life yet and that''s okay. I went to college and spent 12 years paying it off just to decide later that social work was not for me. I don''t understand why kids have to rush into a lifelong career when they haven''t even had the opportunity to live life yet. I want my child to explore different career paths before he chooses one. I''m in no rush to kick him out. All I ask is that he works or goes to school. I don''t want him to be out on his own until he has money saved in the bank and a stable job. I want him to know how to budget and manage his finances properly. I don''t want him to struggle living paycheck to paycheck trying to make ends meet. He can go to college anytime if he chooses to do so. There''s no age limit.',531);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11443,'JggwEgBFm3o','I find this so awesome. I hope these colleges are FORCED to significantly drop their prices. They sucked American students dry. Crippled an entire generation of millennials from being homeowners and ever building financial security. Now it''s finally coming to a head and it''s long overdue. I hope students find great jobs and stay out of debt.',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11444,'JggwEgBFm3o','I started my career in the food industry as a shelf stocker at a grocery store. Then was promoted to Merchandiser then to a Buyer. A vendor later asked me to join them doing sales. Fast forward to today I’m 36, still doing sales but now in the seafood industry, and make about $150k gross annually. Not bad for someone that didn’t go to college. Find what you’re good at and work hard at it. College isn’t for everyone.',98);
