Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (10667,'5STrZB6sm00','Dreamhop Music is honestly the soundtrack to my life. I listen to a different selection of mixes everyday and it’s a perfect background accompaniment for when I’m cooking, doing housework, working, playing with my toddler or just enjoying a cuppa tea and relaxing for a bit. My little boy wakes from his naps everyday to see Dreamhop Music playing on the TV and it lets him wake up so calmly and gently! We love the characters too and make up many little stories about them together. Thank you so much for being such a calming presence in my life, and to all the amazing artists too. Can’t wait to learn the backstory of your characters and if ever you release any soft toys or merch, you’ll definitely have a customer over here! Thank you from me and my 3 year old ¿¿',41);
