Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11446,'JggwEgBFm3o','They are smart to opt out. I''ve been going to school my entire life. I''m 48 and enjoy learning. There is no difference between high school and community colleges. There is also no guarantee you will find work with a degree. Just because you have a degree doesn''t mean your work is good. Professors will rarely tell you if your portfolio is good because they don''t care. The institution they work for already have their money. Technical colleges used to be different but they too are falling into the hands of CEO executives who think they know how to run a college. Colleges also don''t let teachers teach. The price of education is NOT worth it. You get a better education from the University of Youtube, which most teachers use to teach.',75);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11447,'JggwEgBFm3o','when education becomes a business instead of a right, this is what happens.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11448,'JggwEgBFm3o','Well, let''s consider this most nations give FREE college to their citizens here in the U.S. however we charge them to attend colleges that would make our nation more educated and more adept at high-skilled jobs. It''s almost like we want our population to suffer while we are going threw an economic crisis, but hey let''s ignore that completely right...',159);
