Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11459,'j0uw7Xc0fLk','If you allow young people to be inquisitive, creative and self-reliant, they will educate themselves throughout their adult lives. Childhood should be seen as a sacred phase of development and education as a means of the individual to empower themselves, as and when they choose to; not a punishment to be inflicted upon the unwilling until they are ready to enter the ranks of workers, bureaucrats and managers.',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11460,'j0uw7Xc0fLk','Is no one gonna point out that Russell''s a way better moderator than 99% of journalists and academics that interview him nowadays?',612);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11461,'j0uw7Xc0fLk','Russel Brand did a really good job here.   He made the interview light and enjoyable, and at the same time probed Yuval to go deeper into his ideas than I''ve seen him go in other interviews.',607);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11462,'j0uw7Xc0fLk','It seems to me that the purpose of life is to contribute to Society, and do good things. And the purpose of education is to learn how to interpret and understand the World. Students need to learn the "language" of the World. They need a good, solid, understanding of the basics. Then they can adapt to anything, and be better prepared to contribute.',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11463,'j0uw7Xc0fLk','Oh how I love Russell Brand. Listen to him praise the students for the quality of their questions. He is such a great example of raising each other up!',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11464,'j0uw7Xc0fLk','"You know philosophers are very very patent people,they can argue for thousands of years about some ethical dilemma without resolution."¿¿¿',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11465,'j0uw7Xc0fLk','To become a self-guided learner: start with Plato''s dialogues on education. How do you know what you need to know, until after you''ve learned it? How can you tell what is true? These were considered crucial questions then, that needed urgent answers.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (11466,'j0uw7Xc0fLk','Thanks for this. It''s so relevant and I heard some excellent questions and I liked the way they were answered and how sometimes Brand translated or summed up Harari''s answers. It made things even more clear and focussed than the talks and interviews I had watched and read in the past little while. The audience was fabulous and asked the best questions ever.',18);
