Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12366,'0X1_WUKvrno','To the highschoolers who are prepping and studying for the SAT, study hard and try your best. Don’t beat yourself up if you dont end up getting a perfect or high score. Im a third year in college and I wish I could go back in time to tell myself the same advice',109);
