Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12368,'0X1_WUKvrno','I see a lot of people worried about the sat in the comments and, first of all congrats on your score jasmin that is an incredible achievement, however I just want others to know that the sat and college admission isn''t all in life so don''t stress much about please, I know someone that got a 1040 and he went to UC Santa Barbara, it''s more important to worry about your being and your mental health, the sat made me lose one of my best friends after he went insane trying to get a perfect score. Sometimes being smart just doesn''t come naturally, but its not all that there is to life. If you read all the way thank you!! And remember self-care is key!!!',164);
