Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9938,'c1aKaQu6LRE','Candy, if you are experiencing vaginal bleeding after menopause, it is not normal.  It could be a sign of, among other things, endometrial/uterine or cervical cancer.  Get to the doctor NOW.  It could also be a sign of less serious things like fibroids, polyps, hormonal imbalances.',30);
