Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12385,'9W69Q3M9thY','It really is scarier than the real test. Why? Because I have to score my test and my parents can see them instantly instead of a big break to emotionally fortify yourself for the scores.',206);
