Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12392,'1xHy_imdXdc','The first 100 people to fill out this SAT Course form will get a 25% off of my SAT Math Course going live this February 2022! 2.5 years of straight genius SAT math knowledge compiled into 5-6 hours of content that will set you up for a perfect sat math score! Be sure to fill out the form ASAP as I expect it to be full very quick! https://forms.gle/Gz6NNw4J9nAYCKuA9',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12394,'1xHy_imdXdc','Literally gonna cry. My SAT is tomorrow and I’m FREAKING OUT. I’m usually better at reading. I got a 650 on the practice. I got a 440 on the math- y’all PRAY FOR ME LMAO',275);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12395,'1xHy_imdXdc','Thank you for this! Taking the March SAT and these tips were just what I needed!',96);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12396,'1xHy_imdXdc','just study early. do practice questions and understand the structural similarities between the questions. my biggest regret was not studying for it. i got a 1190. luckily, i get automatically accepted into UCF as a top 10 knight so we chillin',86);
