Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12401,'1xHy_imdXdc','I love how the first thing this guy says is a study regime and here I am, 2 days before the SAT having studied for maybe like 20 minutes, watching this shit',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12403,'TQWhk-eXLXc','Also remember: If you got a good SAT score but want a better chance at earning merit scholarships & grants, apply to some schools that accept lower SAT scores than you have. You have a much better chance at earning great merit scholarships vs at top schools where you''ll be competing with a lot more people with similar scores. That''s what I did and I''ll be graduating debt-free from my university! Save that money for grad school or buying a house.',312);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12404,'TQWhk-eXLXc','I got a 1460 (790 Math + 670 English) and I got into Duke. My gf didn''t submit her SAT score, and she got into Harvard. Scores are a small part of the application, maybe smaller than we think.',109);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12405,'TQWhk-eXLXc','I got an 1190 on my SAT, applied test optional, and still got into one of the “excellent” schools. DON’T STRESS. Your score is not everything, especially If you have good extracurriculars or an interesting story.',143);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12406,'TQWhk-eXLXc','You forgot the 1601+ score range. It''s the only score Squidward Community College accepts. Anything below that is a fail.',507);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12407,'TQWhk-eXLXc','I’m a sophomore going to be a junior, and I took the SAT early and got 1380; 770 on math and 610 in English. Luckily, I do want to major in comp sci, so hopefully Purdue is a viable option for early admission',17);
