Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12432,'sIcJtXLMnRQ','This video is super helpful! A fantastic sequel to this would be 46 easiest SAT math problems because the easy ones show up more often, and you can still get them wrong if you use the wrong approach. I am not looking to get a perfect score. So, my goal is to focus on getting the easy/medium ones correct and salvage some of the more difficult ones. However, I know I am not the only one who is frustrated with getting ''easy'' problems incorrect on the SAT. Therefore, this would be an excellent video for those looking to be in the 600-700 range for the math section, rather than 700-800.',54);
