Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5683,'4VIZirQzWss','Pixel 7 might be the one for me. I want a somewhat compact phone that doesn’t feel like a brick.',339);
