Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5700,'EqboAI-Vk-U','This video is full of emotions, encouragement, and hope. Can we have a longer version of it?',3394);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5701,'EqboAI-Vk-U','I lost everything this year. My house, my relationship of five years, my two dogs… this really struck all the right chords in my heart. Everyday I’m trying to come back stronger. To everyone struggling, you have all the love I can possibly muster. Don’t give up.',2987);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5702,'EqboAI-Vk-U','I love these year in search videos! Hopefully, the 2022 year in search will show us moving ahead in more ways than one. In the meantime, remember all we can control is ourselves and we need to realize that we are more alike than different. May everyone have a happy new year, even the ones I disagree with.',577);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5703,'EqboAI-Vk-U','2021 definitely took a toll on my mental health. It has been a continuous journey to learn healthy coping mechanisms, talking to professionals and just letting myself feel the things I feel',408);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5704,'EqboAI-Vk-U','I''m so glad I found and watched that video! This is some next level stuff right here. I never would have been able to afford to travel as much as I did without Mighty ¿ Travels ¿ Premium.',273);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5705,'EqboAI-Vk-U','There''s been a lot of ups and downs in 2021, let''s keep our fingers crossed that 2022 will hopefully improve for the ones who went through tough times. Have a happy new year!',412);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5706,'EqboAI-Vk-U','I want to give the whole world a huge hug . We have been through a lot and lost so much but we are still strong together and I feel like we are more and more connected now than ever . I wish everyone the best  and let''s have a meaningful year ahead.',262);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5707,'EqboAI-Vk-U','This has been a year of enormous change for me. I moved to be close to family, I literally moved 3 times before I got into my house, I felt isolated in some ways and closer to my daughter and family in others. I’ve been stressed, sad, happy, lonely, excited, worried, and confused. I’m turning 79 in a week. I’m alone this week. I hope 2022 is better.',176);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5708,'EqboAI-Vk-U','Muito bom! Me emocionei. Um abraço a todas as pessoas do mundo.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5710,'X7vVP7F3-wM','Sundar is the most humblest CEO I''ve ever seen. Btw great interview.',1349);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5712,'X7vVP7F3-wM','That was a terrific interview. And Justine, your positive, wholesome energy is infectious. I don''t think Sundar would have said ''subscribe, like & comment'' at the end of the interview unprompted the way he did here with any other YouTuber. I think you made him feel super at ease, and he obviously felt your enthusiasm and optimism for the future of tech. Well done!',104);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5713,'X7vVP7F3-wM','This was so awesome and fun! As a person of Indian descent, it''s amazing to see our people at the head of these tech companies (Google, Microsoft) making such a positive impact.',49);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5714,'X7vVP7F3-wM','Meeting this guy is one of the things I want to do in my life.',79);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5715,'X7vVP7F3-wM','Sundar seems like such a down to earth and nice guy compared to most other CEOs of large companies.',1507);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5717,'X7vVP7F3-wM','Both were great. Sundar comes across as a very pleasant and humble CEO. Service oriented. Good and interesting interview.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5718,'X7vVP7F3-wM','Incredible interview, When I watch Sundar''s interviews, I feel how simple and down-to earth person he is and inspirational.   Justine you are awesome. When I watch your videos I feel energetic, and with Sundar''s interview, I get more motivated and interesting in what I am doing. Thanks!',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5719,'X7vVP7F3-wM','A brilliant conversation!! Thanks Justine for the great interview. Great job!!',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5720,'dCPHGwW9SOk','I''m loving reading the comments on this video - some of you genuinely excited, some of you genuinely terrified... and some of you a bit of both! It''s interesting that we''ve had the language processing side for a while, but when we put it in a physical form like a roaming robot, it really shifts our perceptions of the technology ¿',55);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5721,'dCPHGwW9SOk','I like that it looks like a totally original robot- like it''s not trying mimic any existing animal or human frame.',133);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5722,'dCPHGwW9SOk','Exciting, terrifying all in one.   Always interested in seeing advances in robotics.',45);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5723,'dCPHGwW9SOk','more than anything else, i''m excited for robots to help the planet: grow food more efficiently (and with fewer toxins), help sort waste streams for a more sustainable system, clean polluted areas, plant trees, etc.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5724,'dCPHGwW9SOk','I would expect Spot to have this kind on versatility within five years. It can already open doors, turn knows, flip switches. A hurdle is how to limit natural language responsiveness. You REALLY don''t want the robot to think you want it to put a bottle of ketchup in the microwave and zap it for five minutes',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5725,'dCPHGwW9SOk','For some reason I thought Google had abandoned robotics ambitions. Super cool to see they still have these products in the works :)',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5726,'dCPHGwW9SOk','If Google ported their software to the Boston Dynamic robots, we’d have something great.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5727,'dCPHGwW9SOk','I think in the future that companies will have to manufacture robot friendly appliances like robot friendly refrigerators that will have doors that will be able to open.  And dish washers and clothes washers as well maybe even coffee makers that will allow a robot to just dock up to it and get multiple cups of coffee if need be.',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5728,'dCPHGwW9SOk','Always interesting to see how advanced we are through these robots, also a little terrifying',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5729,'dCPHGwW9SOk','It is exciting to see this technology evolve! But early days and, well, all these robots look a little freaky… ¿',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6373,'olTClLF9JuQ','Actually the ancient native American used large hunting tools. The mammoth and large animals thousands of years later the native Americans use smaller size spears, bows and arrows. Many different tribes lived in other places. The Ojibwe once lived in far eastern Canada and the Navaho came from western Canada. The sioux Dakota- Lakota creation stories are original from the black hills SD there still old curve paintings in the the black hills caves.',9);
