Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6375,'xuCn8ux2gbs','This is one of the best videos YouTube has to offer. I come back to it every year or so and it is still amazing.',1522);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6376,'xuCn8ux2gbs','You know the videos good when 6 years later the sense of humour is still relevant',356);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6378,'xuCn8ux2gbs','I could work continuously for two years straight and NOT invent something as clever and enjoyable as this.  All praise to the one who could!',212);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6379,'xuCn8ux2gbs','I literally can''t miss any second or I''ll miss an entire civilization',10706);
