Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6382,'xuCn8ux2gbs','Rewatching this after a few years and I am now convinced the writers of "Everything, Everywhere, All At Once" saw the first 30 seconds of this YouTube video and thought to themselves "this should be a movie!"',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6384,'pX7F-Hxvr80','Honestly Captain Kidd just seems like a guy who desperately wanted to climb the social ladder, but his failure as a privateer and the pressure from his crew made him an unwilling pirate',89);
