Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6386,'pX7F-Hxvr80','Kidd, Avery, Teach, Jack, Bonnie, Reid, Roberts. The Greatest of Pirates. They may have done some awful things, but something about their rebellion is inspiring, and for better or worse their legacy is immortal.',196);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6388,'pX7F-Hxvr80','How disappointing, Captain Kidd being one of only 4 pirates I could name, had a very short and minor career compared to other pirates',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6389,'pX7F-Hxvr80','this has quickly become one of my favorite history channels, thank you for the wide variety of high quality docs you''re providing for free. i have a curiositystream subscription and your channel has a better variety & quality than most of the docs in their history subsection. maybe i''ll have to check out history hit instead when i can afford it.',7);
