Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6392,'pX7F-Hxvr80','I must say, this was the best pirate documentary I have ever seen.  Well done, Sir.  WELL done.¿',20);
