Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6396,'uC8TK7GH85o','Went to Edinburgh Castle in Scotland. If you go inside you can see the actual standards flown by Napoleon that were captured by scottish units of the British army at Waterloo. The actual Flag.',202);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6397,'uC8TK7GH85o','For those who have seen and remembered Napoleon as a military man,a generale,an emperor,a historical figure,my sympathies are with them.But whoever has read and remembered Napoleon as a Philosopher........... ¿. ¿.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6398,'uC8TK7GH85o','For people who want to read about Bonaparte there is a couple books by David Chandler in English that are out of print but if you can find them they are the best books on Napoleonic ere ¿',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6399,'uC8TK7GH85o','He was a genius and an amazing human being that achieved more than almost anyone that ever lived !',67);
