Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6406,'gzse_FxSmqU','More history on History please. The last few months of this channel uploading quality content shows in the enthusiasm and likes the videos get. Please start producing more good content like this and less reality tv, there is a market for actual history shows if they well made.',208);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6407,'gzse_FxSmqU','I own this entire series.  One of the best History Channel produced in my opinion.  Peter Weller did an awesome job with it.',72);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6408,'gzse_FxSmqU','I lived in a motel for a while as a kid and it was episodes like these that captured my imagination and led to a life of loving history and studying it in university, history channel please bring this back',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6409,'gzse_FxSmqU','Respect to History channel for putting these out for free, while others hoard their old content and charge for it. Y’all some all right people.',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6410,'gzse_FxSmqU','Ah the golden age of History Channel when they actually aired history stuff....not some crappy reality show.',471);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6411,'gzse_FxSmqU','I remember when the History Channel had shows about History.  I miss that.',445);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6412,'gzse_FxSmqU','This programme inspired me to go to Greece for the first time... I saw Athens, Nauplion, Epidaurus, Mycenae and Delphoi. It was wonderful. Greece, like the other countries that I visited during my Eurotrip, made me appreciate the greatness of Western Civilisation and encouraged me to defend it.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6413,'gzse_FxSmqU','One of my all time favorites shows along with Modern Marvels from a long gone era in the history of History Channel. Shame it went downhill with all their “reality” programming, Alien conspiracies,  Pawn and swamp idiots.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6414,'Q-mAWItV2q0','Phew. Glad to have this one finally finished. I''m finally off to Ireland next week for a much anticipated journey into the islands incredible history as well as insights into my own family history. Of course many videos will follow!  Video wise there are so many ridiculously epic projects in the works. This one on Akkad is a mere taste of what is to come in terms of the Bronze Age world! Don''t forget to subscribe if you enjoy the content and leave a comment telling me what you''d like to see covered next. It all helps the algorithm gods to help the channel. Thanks all! See you on the next one. Right.. Back to work..',1128);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6415,'Q-mAWItV2q0','Putting up the name cards whenever you mention or remention people (or say ‘he’) is an underrated genius move. It’s so easy to keep track thanks to it. Wish other documentaries would do that!',1704);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6416,'Q-mAWItV2q0','The fact that you have single-handedly researched recorded edited and produced this documentary is astounding! I happen to know the amount of work that''s involved in something like that, usually it''s a team of a handful or even tens of people.',396);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7056,'TdJxY4w9XKY','Thank you for making Literature Reviews so much less daunting! I have roughly 24 hours to complete a 1,500-word literature review and I have been feeling so down, staring at my blank word document, having no idea where to start. As a first-year, mature aged student who hasn''t done any sort of higher education for the past 10 years, I can''t tell you how helpful this has been.  I finally feel as though I MIGHT be able to finish it by the deadline! And then start on another 2,300-word Literature Review due roughly a week later ¿',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7057,'TdJxY4w9XKY','You are the professor a student imagines getting in University. Thankyou for your support',97);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7058,'TdJxY4w9XKY','I have been months and months searching on u tube .....no one has explained  professionally like this professor  ,,,,,,that''s the high quality  way of teaching ¿thanks alot',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7059,'TdJxY4w9XKY','I watched this in my bachelor''s degree, and liked the video. Now pursuing my Master''s degree and come here again to remember all of these tips, helpful again second time, i wish i can give you more than one likes, thank you so much for clear, quick, precise explanation.',65);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7060,'Vc_Yu_61Ymg','Download your FREE Writing Starter Kit here! https://www.mysmartstudent.com/UAW-Optin ¿ P.S. Don’t forget to join the Smart Student Facebook community! ¿ http://www.facebook.com/groups/communitysmartstudent',42);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7061,'Vc_Yu_61Ymg','I can not imagine how much time you have spent making this video.  Really appreciate your effort for breaking down such a complex mater into these easy, followable steps!',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7063,'Vc_Yu_61Ymg','Chelsea, I''m a teacher, and I have to confess that I was waiting for you to miss a detail I would have to pause and explain to students. It didn''t happen! Your videos are excellent.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7064,'Vc_Yu_61Ymg','Thank you so much for this video. You have explained clearly in 23 minutes what my lecturers have failed 2 years straight, well some anyway but yeah, thank you so much.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7065,'Vc_Yu_61Ymg','This was very well done. I feel confident in my ability to complete this now. I have never done a lit review before but now I feel like I have. Thank you!',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7066,'Vc_Yu_61Ymg','I have never been this energized and excited before writing a lit review...Thank you for such an informative video.',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7067,'Vc_Yu_61Ymg','The exact thing that we were waiting for! Especially the part with data search. Thanks for your explanation!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7068,'Vc_Yu_61Ymg','Chelsea Seburn you''ve saved my life!  Working on my thesis for my master''s in climate justice and this has taken my overwhelm down about 501869701991038568000000 notches.  Thank you so so so much!  Heading to your other videos now to continue getting a handle on my research',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7069,'Vc_Yu_61Ymg','Thank you, thank you, thank you, and God bless you!!!  I am writing a literature review of technology in nursing and did not realize how much my annotated bibliography and literature matrix would help in putting it all together.  You gave great examples for structure of the intro, body, and conclusion and useful points of transition.  Also, now I realize that I can write my paper as a thematic literature review.  Absolutely brilliant!!!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7070,'zIYC6zG265E','dude this is driving me crazy instead of travelling the world and having fun i''m here struggling to write a literature review',2663);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7073,'zIYC6zG265E','Great video! In my experience as an academic writing teacher, literature review is one of the things many students struggle with.',242);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7074,'zIYC6zG265E','Learnt more from this video than I have from my lecturer the last 2 months, thank you ¿',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7075,'zIYC6zG265E','Thank you for putting this into such a short, succinct video. Currently have nine days to complete my UG Diss and this has really helped! ¿',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7076,'zIYC6zG265E','I just started my literature review from today and I was in hyper panic mode until I heard from you -it''s just simple and not to panic, made me calm down. Thank you.',138);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7077,'zIYC6zG265E','The literature review has always been a pain in the head. Especially that we are now in a pandemic, students (such as I) have problems in collecting the necessary number of sources. Thanks, Ms! I enjoyed the video. And thank you for being a big help to those who are struggling.',72);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7078,'zIYC6zG265E','This video has superb clarity. But sometimes the simple things become the most overwhelming. It is correct that we can break a literature review down to structural components. But the modern students who I teach (there are 500 on my university of York dissertation module), are faced and burdened with limitless access to knowledge, and the fields of literature become endless. The student has to navigate a constant tension between chaos and order. I find examples help, so students can see the limits and horizons before them. My students asked me to post examples up, so this is what I did on my channel, it was originally intended for my own students, but there are now there for all to see. Good luck everyone - Dr Mark Egan',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7079,'zIYC6zG265E','So well done! This would''ve been helpful for me to have found a month ago BUT it is super helpful for my editing :)',1);
