Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7084,'kvXU3vzHq8E','I''m a foreign teenager, I enjoy watching your videos a lot, especially the ones about literature. It''s so easy to understand every word and the meaning of every sentence, I''m extremely happy that I discovered you. Could you make a video about Edgar Allan Poe? I just started reading his stories and want to know more about him. Of course I''ll read the biography in my language but you make some very interesting points, which is the reason I ask you for it. Thank you.',160);
