Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7089,'kvXU3vzHq8E','I couldn''t have more love for this essayist and for this author, who woke me up for good when I was just a kid in Junior High. I share his devotion to language and the free and organic use of it, and of the wisdom of the ordinary people all over the world.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7090,'IskEx0tgoo4','Admittedly silly to subject Milton and Shakespeare to a kind of competition but, this is well worth your time and effort. The  benefit of having talented professional actors reading the small bits of their works takes this endeavor  far beyond the typical classroom experience. Truly enjoyable and enlightening.',186);
