Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5731,'0eKVizvYSUQ','Google should offer users the opportunity to give a personal rating for the returned pages for a specific search query. On the basis of this, the search engine could then be well adapted and greatly improved both on an individual level and in general.',10);
