Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5735,'0eKVizvYSUQ','So I decided to Google myself the other day, not because of my ego but I heard that there’s a possibility that the company I applied for Googles their employees often. The first thing that comes up when you search my name is the place I volunteered for almost 4 years and a college campus that I didn’t attend. Does anybody have a similar problem? And if so how do you fix this?',1);
