Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5737,'0eKVizvYSUQ','I''m a web developer and I think Google''s algorithm is amazing, it''s so fast and smart. I dream of being able to work at Google one day.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5738,'0eKVizvYSUQ','Very useful, thank you.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5741,'CE0EB5bXj14','The worst part is that those private pictures between the doctor and parent were actually looked at by other people BECAUSE of police investigation. By their actions, they turned it into what they claimed it was.',4106);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5742,'CE0EB5bXj14','If you''re not doing anything wrong, you definitively have something to fear. It''s not paranoia when they''re actively looking for something to accuse you of.',432);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5743,'CE0EB5bXj14','Friend had a similar issue, military historian who had spent years researching in various archives, so naturally his google drive had hundreds of period photos including weapons and often confronting scenes of warfare etc Google locked him out citing said images as evidence of potential terrorism/hatecrime activity. He was thankfully able to get his account and contents restored, but it was a close run thing as Google only give you a window of a few weeks before they delete it',108);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5744,'CE0EB5bXj14','If everything you''ve ever said or done can be accessed, taken completely without context and used against you with zero accountability then absolutely everybody has a LOT to hide.',76);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5745,'CE0EB5bXj14','This is terrifying. Imagine getting reported and registered as a predator, because an algorithm from some big tech company has decided, that something like this or maybe even family pictures from the beach are CP.',49);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5746,'CE0EB5bXj14','The “why do you care if you don’t have anything to hide?” mentality is how we get awful privacy violations like The Patriot Act',4001);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5747,'CE0EB5bXj14','Big tech having zero accountability has led to unbelievable levels of evil',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5749,'CE0EB5bXj14','I''m not convinced that opting out of Google''s security "features" does anything. I''ve noticed with its phone tracking system that if I turn it off for a month and then turn it back on the next month, I can go back in time and see the tracking from the previous month, when it was off. I think that they still track you, and the only thing the toggle does is determine whether or not the user can see it, and I believe this is also the case for other security features. For this and other reasons, I''ve been working on weaning myself off of Google services for the last year or so.',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5751,'N8ULG4rr5KA','There''s also been cases where someone follows their GPS into flooded underpasses and drowned. It was night, they were unfamiliar with the area & the water rose really fast. Locals kinda know where to stay clear of when it starts raining hard, but it''s hard to navigate at night when visibility is already terrible.',2357);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5752,'N8ULG4rr5KA','A slightly lighthearted story, but one time me and my roommate were driving in an unfamiliar area (somewhere outside Sydney, Australia) and google maps told us to take a small backroad. It looked fine and it was paved and everything, and it was significantly shorter than the alternative route. Only our plans were thwarted, because shortly after turning onto that road we came to a tractor, and it was moving really really slowly in front of us. We couldn’t turn around either because the road was too narrow and there was a metal fence on one side and a steep hill on the other. We literally just had to slowly drive behind this tractor for almost the entire length of the road, and it took about an hour.',2016);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5753,'N8ULG4rr5KA','My husband and I have relied on GPS to take us on long road trips. There have been several occasions where we would ''nope'' out of a tiny road in the middle of nowhere when we requested a gas station from the GPS. It''s gotten to the point that we only stop at gas stations along the highways because we''ve seen too many scary movies. I remember one time it told us the gas station was up ahead and all that was around us was miles of corn. Freaky!',1353);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5754,'N8ULG4rr5KA','I think it''s safe to say that before trusting in systems like Google Maps, one must research the routes those systems suggest you take before going on your adventure, especially if those routes are longer than the comfort zone of your own city. For example, before I go on a long drive to a destination I have never been to before, I always check the routes on Google Maps by zooming in for both satellite view and map view. Then figure out if those routes are safe to take or better to take a longer one. It''s unfortunate these two groups of people went through what they did. So it''s a lesson for everyone to be mindful before setting out to unknown territory. Like my husband''s parents, they always have a large jug of water in their car, along with a week''s worth of rations, First Aid Kit, blankets, flares, etc, even though they rarely go off the beaten path.',1980);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5755,'N8ULG4rr5KA','Just a tip, if your maps leads you away from national roads or highway, or if you just not sure about the road, ask the locals. They will often warns you if the road is dangerous and sometimes even suggesting you better route. Its advisable to stop at nearest rest area or local shops before entering remote routes.',636);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5756,'N8ULG4rr5KA','My uncle put up a sign outside of our family farm that says "your GPS is wrong" because he kept getting strangers following faulty GPS directions and ending up there. I''ve also been in the car when a GPS directed the wrong way down one-way streets or down non-existent roads. They''re useful, but you have to apply some critical thinking when using them, because they are AI with an emphasis on the A.',284);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5757,'N8ULG4rr5KA','Even just the beginning of the story has me stressed out- Death Valley is incredibly scary, and if you go off the path you''re basically guaranteed to get in serious trouble',909);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5758,'N8ULG4rr5KA','I could not imagine that mother having to continue to fight for her life with her sons body nearby. Absolutely heartbreaking.',338);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5759,'N8ULG4rr5KA','google maps should put warnings on potentially dangerous roads, just like how they do on private roads.',327);
