Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6417,'Q-mAWItV2q0','Another outstanding production! This is the sort of thing that should be promoted on YouTube, not the rubbish that always seems to get all the views. What you accomplish virtually singlehandedly is astounding, putting to shame projects with large crews and budgets. Take a long vacation, you''ve more than earned one for the massive effort this took.',98);
