Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6450,'-Jsj7K6E0Fg','I’m impressed that the nature of plant roots changed so much! Today plant roots are considered to stabilize soil and reduce erosion. I have NEVER before heard of plants increasing erosion. Seems an unsound hypothesis.',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6451,'-Jsj7K6E0Fg','With all of the extinction events that went on, I''m wondering if the galaxy we circulate may have some bearing upon a certain point of the galaxy? Could there be a time corrilation between extiction events and a certain passage point of the galaxy? Do galaxies suffer widespead extiction events on their solar systems when the Supermassive black hole turns quazar?',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6452,'-Jsj7K6E0Fg','The Vredefort Crater in South Africa is 190 miles wide as opposed to the 110  miles of the Chicxulub Crater.  The latter impact ended the dinosaurs 66 million years ago.  Vredefort was 2000 million years ago.  One can scarcely imagine what happened.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6453,'-Jsj7K6E0Fg','Excellent explanations of earth’s past & where we are now. New rock type made of plastic says it all for modern human life.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6454,'-Jsj7K6E0Fg','This is one of the most interesting documentaries I have ever viewed; also one the most frightening.  I like the explanations of the past extinctions & when, not all the facts are not in, it is really made clear with some educated guesses.',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6455,'-Jsj7K6E0Fg','….why wasn’t the great oxidation event included on this list? The worst extinction event that killed off close to all prior anaerobic microscopic forms of life.',117);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6457,'-Jsj7K6E0Fg','Very interesting! Well done!',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6458,'-Jsj7K6E0Fg','Yeah, we are most definitely going to inevitably be our own downfall.  We may have the tools and technology to weather some disasters, but we depend so much on the infrastructures we have set up, to the point where most people probably wouldn''t know what to do without wi-fi and cellular data, let alone weather catastrophic effects on our food sources and supply chains.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6461,'ZBDLEROHj9E','An interesting footnote from history. After the conference in Tehran in 1943, it was decided that the Allies would start delivering aid to the Yugoslav partisans and that aid to the Yugoslav monarchists would be stopped. When, after the conference, one of the British members of the delegation told Churchill that he had sold Yugoslavia to the communists, Churchill asked him: "will you live in Yugoslavia after the war?" The delegate replied that he wouldn''t, to which Churchill added: "I won''t either, so why bother?"',1110);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6462,'ZBDLEROHj9E','“He attempted to take British somaliland which went pretty well. He then attempted to take Egypt which went less well. Then he attempted to take Greece which went really badly. Churchill began to describe Italy as Europe’s soft underbelly.”',907);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6466,'ZBDLEROHj9E','Great video as usual. I''m surprised there was no mention of the Churchill-Stalin agreement which gave Britain 90% influence in Greece after the war',267);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6468,'ZBDLEROHj9E','Im a Greek and this stuff isnt even taught in school, even though it affected the rest of our history in the 20th century... Thank you very much for your efforts!',97);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7091,'IskEx0tgoo4','The two scholars are amazing!! And the actors are sublime!! I''ve never felt so happy in my life, yet so jealous of those in that conference room!! I''ve been clapping and cheering and crying all at once. WOW. Thank you!',40);
