Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7097,'IskEx0tgoo4','Imagine the RSC, with all its talented actors, producing an audio-book recording/dramatisation of Paradise Lost. Oh, bliss!',46);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7098,'IskEx0tgoo4','A very important thing is left out I think. Shakespeare was aiming for a wide range of accessibility so that he could pay his bills. He wrote for the ignorant barbarous "ground- ling" and for the intellectual as well. Milton actually says in the opening invocation of book 7 of Paradise Lost "Still govern thou my song, Urania, and fit audience find, though few!". He''s pretty aware that he wont be liked by a great number of people but wants to "soar above th'' Aonian mount" anyhow.',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7099,'IskEx0tgoo4','Lady Macbeth was stunning. Absolutely stunning. Her acting was on another level. That’s passion for the work on an almost transcendental level; she BECAME that character. MAN. Goosebumps.',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7100,'MS4jk5kavy4','I''d just like to point out that Odysseus'' sleeping around was necessary for his survival. If a powerful goddess like Circe or Calypso wants to have sex with you, you don''t have much choice. If you reject them, it could spell doom for you, or your loved ones. Horny gods punishing mortals for denying them sex is a recurring theme throughout Classical Mythology.',848);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7103,'MS4jk5kavy4','This is me wondering if anybody else just watches these for pleasure and not to get out of reading for a class.......',5283);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7104,'MS4jk5kavy4','Please don''t ever stop making literature videos, because we don''t have English literature in high school in where I live and I want to study it so bad, even if my English is really not good',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7105,'MS4jk5kavy4','I always loved the Odyssey; both in High School English and the movie. To me it was one of the ultimate journey epics. Like LotR, it''s just a very very long journey with a penultimate goal of returning home, but with fun little adventures and trials along the way.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7106,'MS4jk5kavy4','So even Odysseus, who is wise enough to be praised by Athena for his wisdom, loses himself in war. Does that say something about our attraction to war?',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7108,'MS4jk5kavy4','For an interesting read, some people may want to check out The Penelopiad by Margaret Atwood. It''s a novel that was later turned into a play and tells the story of Penelope in Ithaca while Odysseus was gone. It''s an interesting contemporary view of a classical text.',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7110,'TpE8TiN8HyY','I love that quote about literature being forced critical thinking that cannot be Googled. I hope this is where the world is going soon. Into a place of books and curious reading, rather than simply Googling and having things fed to you.',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7111,'TpE8TiN8HyY','Thank you so much for this - I''m finally following my heart and transferring to a major in English Literature, coming from a biology major. At times I get anxiety about it, wondering how what I am learning will be useful, aside from the fact that I love it. This is just what I needed to hear.',13);
