Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7113,'TpE8TiN8HyY','Dear Denielle, Thanks so much for your speed in which you remind me of preparing Cambridge C1- English Exam. I failed it a couple of times. However, I never have lost my perseverance to do the exam over and over again. As a financial analyst, With reference to the return of investment, time spent, this is my worst deal. However, When it comes to understanding humanities, becoming comfortable with ambiguity, and making me a rounded person, the answer to this valuable investment is definitely "yes". Well appreciated.',3);
