Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7133,'UI9I2p71ct0','Magical realism is not from Colombia because the term is European in concoction. However, when European writers viewed the way Latin American writers wrote they saw it as realism with a splash of "magical". They viewed these stories through a lens of exotification, without realising that it''s ALL real and that it''s a description of the absurdities found in Latin American societies. If we think about what exotification is, it''s about seeing what''s mundane or normalized in one society and treating it as special or unique because one is not used to it. It''s very much about ignorance and how what we don''t understand can often appear magical. As a result, how these authors chose to tell the story is what mattered. This is why magical realism, in my opinion, does not exist. It''s a term created in ignorance and perhaps the literary term itself is the most magical part about the whole genre.',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7134,'UI9I2p71ct0','I read a magical realism text for the first time in a magazine. It told the story of three dragons who were adopted by a couple. they raised them as if they were human. The way the author narrated the passage of their age, in childhood, adolescence and even adulthood is comical and fantastic at the same time. Dragons fight, mess, do drugs, get married, divorce and die.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7135,'UI9I2p71ct0','You forgot the most important and influential book of Latin American Magical Realism, the corner stone: Pedro Paramo by Mexican Juan Rulfo. Latin American writers influenced Salman Rushdie, et al. BTW, Garcia Marquez is a Nobel Prize laureate.',8);
