Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5779,'cdZZpaB2kDM','I used to be self-conscious about my stuttering problem, but seeing Elon comfortable in his skin and achieve the success he has is truly inspiring. My favorite talk of his to date.',8598);
