Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5781,'cdZZpaB2kDM','Great conversation. I have a lot of admiration for you Elon. You are extraordinarily brilliant man. Planet Earth is lucky to have you. I admire your passion and dedication to solve problems. Thank you for your humanism. Your son  is cute ¿¿¿¿¿¿',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5782,'cdZZpaB2kDM','I love to listen to Elon he''s just amazing so very smart.',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5783,'cdZZpaB2kDM','Definitely a unique human kind! There isn’t  many like him out there! My hope is as people listen to him every time he speak out they can open their hearts to be more care of what we do it today to sets the difference on the next generations after the us.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5784,'qtulf_yrzR0','I had to come on here and TESTIFY!!! This video helped me to ROCK my recent job interview. They asked me pretty much all of these questions. I practiced answering these questions before my interview. They called me back 10 mins after my interview and OFFERED ME THE JOB!! They said they were VERY IMPRESSED! So THANK YOU!!!! Life changing!!',1349);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5786,'qtulf_yrzR0','I couldn’t wait to come back here and say this but I LANDED THE JOB! Your tips in this video along with all the content you post helps so many of us jobseekers! Thank you for all you do, and for anyone on the job search, don’t give up, believe in yourself and trust Gods timing in every circumstance! ¿¿',119);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5787,'qtulf_yrzR0','I had an interview last Wednesday and did amazing. On Friday, they offered me the job and it''s everything I prayed for!!¿ Your tips are undeniably helpful!! You are awesome',82);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5789,'qtulf_yrzR0','I watched your videos the night before my interview, and I got the job. I just turned 40, I’ve been a stay at home mom for 16 years. To say I’m rusty is an understatement. Your videos helped me so much. I told “stories” and I asked a lot of questions at the end and the conversation just kept going and I think that sealed the deal for me. Thank you so much.',197);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5792,'qtulf_yrzR0','I lost my job of 13 years in early Aug. I had two interviews with two different companies, I got an offer from both. Your videos really helped me prepare, I was so nervous after not doing an interview in 13 years. I was thrown some curve balls in one of the interviews but just doing some prep work made it so much easier to respond effectively. Thanks so much for the content!',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5793,'qtulf_yrzR0','Madeline thank you soo much for your tips! I watched all of your videos and implemented your advice into my interviews. Today I was officially hired as an HR coordinator for a startup. I have 0 experience in HR and am transitioning from a career in healthcare to HR. I think your advice really helped make me shine thank you ¿',78);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5795,'fr-mwiyhZAo','Hey brother, I confirm to you that I did get my dream job, after hours of practice and commitment, the competition was tough, the interview processes were long but with your work and videos, I beat them all and I''ve landed my dream job.. Thanks alot. Super excited..All I can do now is spread the word about your work..Many Thanks Richard and Joshua Brown',1464);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5796,'fr-mwiyhZAo','I''ve practiced the 21 interview questions over and over again before sitting for two interviews for two separate companies and was offered the job by both of them!! I now have to decide which company is best to start my career :) THANK YOU RICHARD!!',576);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5797,'fr-mwiyhZAo','Hi Richard. I''m happy to say, I went through a recruitment process with one of the biggest companies in the country. Your tutorials helped me through every step. I GOT THE JOB. Thank you sir, and God bless you.',152);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5798,'fr-mwiyhZAo','First time in my life that I had to prepare for an Interview. I’m 44 in a very competitive industry. It felt like my last chance. Between you , (and other content creators ) I passed 3 hard interviews back to back and got the job. Thank you and everything you do.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5799,'fr-mwiyhZAo','Just wanted to thank you, Richard, for your great instructional videos which I''m happy to say helped me to land a great job amidst a lot of competition. Even with 15+ years in HR having done hundreds of interviews, I still found your content very helpful and insightful. Your videos also helped me to feel relaxed, prepared and confident. I happily paid your modest fee on your website as a token of my appreciation. Thanks again!',67);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5800,'fr-mwiyhZAo','Dear Richard, I would like to say a huge thank you for your awesome videos! You have helped me to pass 3 stages of the Interview Process, and I got the job! My Team Leader told me that I was the best at the interview. No wonder, I was so well prepared thanks to you! All the blessings to you and please continue your great work! I am recommending your channel to all my job-seeking friends (as I once received recommendation to watch your tutorials from my US friend). Love from Poland! <3',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6469,'ZBDLEROHj9E','The Truman Doctrine was part of a speech written to garner American support for fighting communist forces in Greece. There was worry that there would be minimal support for fighting in Greece, hence why the speech was so strong, but inevitably it worked a lot better than anyone had expected.',116);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6470,'s3YTfhJmh1I','Can you imagine not having direct sunlight for a year and having no idea why, even wondering if the sun would shine the same ever again? Terrifying',2117);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6471,'s3YTfhJmh1I','536 AD is the estimated timeframe that the Krakatoa volcano experienced an extremely massive eruption that caused a column of smoke, ash, and debris 13 miles high.  So much material was ejected into the atmosphere that it shrouded the Earth causing temperature drops and ensuing human suffering. Krakatoa would erupt massively again around 1200 and the most recent climate-changing eruption was in the 1880s. The 1880s eruption was estimated to be equivalent to 160 megatons, the Tsar Bomba was a measly 57 megatons in comparison.',534);
