Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6475,'s3YTfhJmh1I','You know I find this fact somewhat reassuring, if we can survive a year like that then perhaps the human race is more resilient that we think.',94);
