Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6505,'IV3dnLzthDA','“ you will observe with concern how long a useful truth may be known and exist before it is generally received and practiced on” will now be my favorite quote. It’s sad how often ppl prove Benjamin Franklins words true, he would probably be very disappointed with the ignorance and misinformation we’re surrounded by',44);
