Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6518,'0GbJ3dciyO4','Thank you for mentioning the Siddis. They were an interesting African people who came to India as slaves with Islamic invaders. Despite their enslaved condition, some managed to rise above their station and became rulers of kingdoms in many parts of India. One of the most famous Siddi ruler was Malik Ambar.',22);
