Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7136,'UI9I2p71ct0','I thoroughly enjoyed this and I''m glad I already had a solid enough concept of Magical Realism; yet this made me aware that culturally it made such a political impact. My debut book "Just a Little Broken" I like to think is in the same vein as the genre. It allows a significant amount of freedom in storytelling, especially within a reality-based land. I appreciate all the information and nuances packed into these videos.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7137,'UI9I2p71ct0','I feel like reading Rushdie''s "Midnight''s children" again now. Thankyou for the profound explanation. Cheers ¿',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7139,'UI9I2p71ct0','Excellent explanation. I completely agree with your explanation of magic realism and also the idea that it is a post colonial resistance against Eurocentrism, but I think its scope is even bigger. One aspect of magic realism is politically ideological, that is the postcolonial stuff. Another aspect is challenging the constricted mentality created by strict adherence to materialistic/scientific determinism. This aspect is more philosophical, and not just ethical like the ideological aspect but also epistemological or maybe even metaphysical i.e. it may draw our attention to fundamental questions about the nature of reality and the likes. This is just my personal opinion.',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7140,'KkAnKGuX7fs','Girl you saving me! Making this so simple and understandable',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7141,'KkAnKGuX7fs','Thank you so much for this clear explanation! I read the whole section in my textbook but I was still so lost',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7142,'KkAnKGuX7fs','Thank you, your videos are informative, to the point, and super useful!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7143,'KkAnKGuX7fs','You are a great presenter. I think it is great to have an example to support your video. My students have been encouraging me to include more and more examples, some even say this is the best way they learn, through seeing the good and bad of other students dissertations. My channel was originally set up for my classes, but now I want all to access, we need to me one big supportive community regarding help with academic skills that lead to student success - Dr M D Egan',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7145,'KkAnKGuX7fs','You have no idea how you''ve helped me throughout my research project with your articles and videos. Thank you.',2);
