Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7150,'CJmNsmS1mlY','Me actually pausing the video to go get a cup of warm tea xD',62);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7152,'CJmNsmS1mlY','Why I read and what book I read depends on my mood or my aims. Sometimes I read for a bit of escapism. Other times it’s to learn. Sometimes it’s both. I love it when a book teaches you something that you never realised or expected, and it stays with you and even changes your way of thinking.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7153,'CJmNsmS1mlY','Emma, you have the best non-book channel book channel on YT!',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7156,'CJmNsmS1mlY','I had forgotten about what it feels like reading a good book, since it''s been awhile- I haven''t taken a English class this semester. But your thoughts made me remember. All the reasons you talked about reinvigorates my curiosity to think about the human experience, question the beliefs/mindsets I currently have, and, well, to study literature!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7157,'CJmNsmS1mlY','I read mostly non fiction books on random topics that interest me. Currently  reading a book on artists and architects. Since lockdown been watching a lot of documentaries on artists and galleries. So I got a book on the topic unfortunately it’s about 700 pages. Which almost put me off but out of pride I couldn’t give up. Only to become fascinated by how all these buildings that were built for people, are no longer there. So who do these objects serve? This book was written in 2017 with an international look as  these creators (to encapsulate both artists and architects). In a series of interviews have to explain their method. Some are coy but those willing to share open up this view of how they see the world in relation to the notion of space. If I understood correctly each creator seeks to capture and reflect this moment in time for future generations to understand their time.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7158,'CJmNsmS1mlY','When you read a novel, how much do you focus on the text vs the background of the author? For instance, one of my favorite books is The Master and Margarita by Mikhail Bulgakov. If you read it by itself, it is such an interesting novel, however, learning the history of its writing in the background of Stalin''s Russia makes it even more interesting. How much time should we dedicate to looking beyond the four corners, if at all?',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7159,'CJmNsmS1mlY','I usually pick up a book for two reasons, either because I like to see what it would be like to live in a different reality (and that is why I read a lot of fantasy and horror) or because I want to know how it is like to live and think as a certain person or in a certain place and time (for that is when I go to classics and more international literature). Also I totally agree with the "people should read classics" thing, it''s so cool when you read a classic and finally get this book that keeps being referenced everywhere and you understand why that book has been read for generations.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7160,'rnHvO5aRXq0','Thank you for this video. I''m currently curating my documents and this is helping me search based off of the keywords.',3);
