Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7168,'rnHvO5aRXq0','Firstly, screening the literature is THE most important aspect of a systematic review, and for any other types. So,not teaching students how to use Ovid, Medline, Cochrane, tec. and only relying on PubMed is certainly the worst start up. You miss such a large number of studies that whatever conclusion you try to draw will be biased, and therefore unreliable.',0);
