Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5801,'fr-mwiyhZAo','Richard, I watched your videos and studied my notes over two weeks for two rounds of interviews. I was just hired as a first time supervisor. Feedback that I recieved was that I was very well prepared. I had zero direction before watching your terrific videos which really helped me get organized. I am now prepared to take responsibility for my own professional development . Thank you so much.  Do you have videos to help new managers hire new employees that will be successful?',11);
