Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5803,'fr-mwiyhZAo','I’d like to confirm that i’ve been watching your videos, studying these interview questions for the past 3 days. I went into my interview today nervous & knowing that my interviewer was extremely difficult and extremely particular with who and what she wants. I was asked none of these questions but instead given the job on the spot. But i want to say thank you so much for making these videos i played it day and night. While driving and while i sleep even in the showers. It didn’t help much with the interview but i’m more confident than i ever was now.',75);
