Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5806,'YRvf00NooN8','What an amazing interview.  Elon''s faith in the future  of humanity is inspiring and his closng words of advice are gold...if we want a great future we must do our part and make it happen.  My gratitude to all involved.',25);
