Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5815,'zWaV_PTlCxk','I never knew much about Lady Gaga, I thought she was way over the top, but this wonderful interview showed me how wrong I was. She touched me deeply with her comments about sexual abuse and how we put it in a box and shut it so we can continue living, until something triggers the memory and the box explodes wide open. That is EXACTLY how it happens and only a survivor like myself knows it.',1709);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5816,'zWaV_PTlCxk','Stephen Colbert looks a lot more serious interviewing her when he’s usually always sarcastic or funny. He seems to respect her as an artist and her talent. Love it!',604);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5817,'zWaV_PTlCxk','I’ve never really been a fan . But, she’s changed my mind . How lovable is she',1261);
