Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5819,'zWaV_PTlCxk','So intelligent, humble, and articulate. What a wonderful human',1257);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5820,'zWaV_PTlCxk','Anyone who couldn’t see her beauty behind all her crazy costumes in the beginning of her career were always missing out. It’s actually a shame that so many people just judged her for being “over the top” when she first started out. She was gorgeous then and she is gorgeous now',433);
