Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5824,'KCm6JVtoRdo','Get the ANSWERS to all of the interview questions in this video >>> https://passmyinterview.com/21-great-answers-to-tough-interview-questions/',621);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5825,'KCm6JVtoRdo','I passed the interview! I got offered my dream job as an interior designer, your videos have been a massive help. Thank you!',3208);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5826,'KCm6JVtoRdo','I was offered the position! I kept receiving rejection. I wasn’t sure if it was due to my lack of experience (career change) or my interviewing skills. I literally binged watched Richard’s videos, wrote down my answers, and PRACTICED. So thankful to have come across these videos ¿¿',636);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5827,'KCm6JVtoRdo','Hi Richard, just came to say thank you from the bottom of our hearts. My husband and I were applying for new positions (I applied for a lead/managerial role, and my husband for a senior commercial/pricing). Both of us watched A LOT of your videos, took note of the answers, modified to suit us and practiced. We felt confident and equipped going into the interviews and we both got the jobs we wanted!! We are thankful to come across your videos. They are so helpful and thank you for all of your hard work in making such great contents.',135);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5828,'KCm6JVtoRdo','I usually never comment, but this guy is AMAZING! I just did 4 different interviews and i got hired in all of them. I used his tricks and the way he express myself helped me to answer the questions accurately. THANK YOU VERY MUCH',304);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5829,'KCm6JVtoRdo','This video is so helpful and helped me pass my Master Trainer interview. Richard, your processes and steps are so concise and have given me so much confidence in the interview space. This video is AMAZING and so are all the others.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5830,'KCm6JVtoRdo','Richard is so confident he doesn’t apply for jobs. Jobs apply for him',2355);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5831,'KCm6JVtoRdo','I recently decided to change paths and pursue a career when the lockdown was instigated. I studied for months, achieved everything I needed to, and started having my first formal Interviews. I failed 7 of them... with a little progress each time but it wasn''t until I found this video that I have officially secured a job! Thank you very much. I used some of these answers in this video with slight variations in order to make the right impression. You are very good at what you do and have earned my subscription sir! I will be back for more advice in a couple of years as I plan to continue my studies and move my way up into a higher-paying position. Appreciate what you do! keep up the good work! :)',62);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5832,'KCm6JVtoRdo','Thank you, Richard for your interview tips. I participated in 3 interviews and I got all three, including my dream job. it''s amazing how your tips are applied in real terms and successful',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5834,'GIABy89py5A','You can see the pain in his face when he’s not joking. Divorce is hard and so painful and to have people turn their backs on you compounds it. I wish him well.',266);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5835,'GIABy89py5A','This is honestly such a sad interview. Prayers for Kenya, Gary, & the children ¿ no family breaking up is easy, especially after 23 years. You can see the pain in his face.',279);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5837,'GIABy89py5A','Can really see that he''s going through it ,especially as it relates to his kids. I hope they show him some grace and rekindle their relationship. All the best Gary.',116);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6523,'UUNFQNiU2GM','The aliens in Florence just wanted to watch the game and threw out glitter as a celebration. They were probably hella disappointed when they canceled the game. They were just trying to turn up.',64);
