Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6530,'_i54q6j3rtc','You have no idea how much youtubers like us look up to you. Thanks for bringing back the incredible content, we love it!',831);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6532,'_i54q6j3rtc','Just wanted to pop in and say that I think that this video showcases a highly qualitative understanding of Swedish and Scandinavian history that I really wasn''t expecting to see come out of a non-Swedish source outside of academia. Very nicely done man.',211);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6534,'_i54q6j3rtc','Fun fact. The Hanseatic league had such a big inpact on the city Bergen (here wrongly called Bryggen, Bryggen is Just a tiny area of the city) that the local beer in Bergen is to this day called Hansa and there is a historical hotell placed at Bryggen called the Hanseatic hotell. (The building is from the 1500s).',55);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6535,'_i54q6j3rtc','Love our viking brothers that rulled us during Kyivenrus, grets from Ukraine :)',238);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6537,'_i54q6j3rtc','When you break it down, trading and raiding are mostly the same thing. Just the currency changes. In the former, you get gold, silver, precious metals, gemstones and other goods. In the latter you get an axe to the skull, sword to the gullet, mace to the brain and other physically distressing items. The Vikings were essentially very motivated buyers.',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6538,'_i54q6j3rtc','As a Swede in very greatful for the time and effort you put into this video that is dedicated to us. Thank you very much, as always this was a great video with great quality.',67);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6539,'_i54q6j3rtc','11:00 Serfdom never took off? It never took off because it was made illegal by Magnus Ladulås about a centruy before this. The nobles tried passing their serfs of as slaves to circumvent the law so Magnus'' son rolled his eyes and made slavery illegal too.',157);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6540,'XueMKFSbVcA','Watch new episodes of History’s Greatest Mysteries: Solved, a History digital series, here: https://histv.co/HGMS',49);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6541,'XueMKFSbVcA','When looking for the lost tribes, don''t expect to find them all in one place. It was prophesied in Deut. 28 that they would be scattered to all four corners of the earth. You found some traces of them that ended up becoming the Cherokee, but others of them became vikings, others still went to Asia, specifically Japan, and others still went into Africa.',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6542,'XueMKFSbVcA','If you want to know the truth about these artifacts and how awesome the ancient Israelites came to the USA before the time of Christ, read the four book series by Stephen M Collins about the Lost tribes of Israel. He spent over 10 years researching this issue and had access to an ancient private Library. They are worth reading.',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6543,'XueMKFSbVcA','As a Geologist, I would suggest having an expert in ancient Hebrew writing look at photos of the stones.',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6544,'XueMKFSbVcA','I love the work you do and these show make me imagine what we don’t know could be true!',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6545,'XueMKFSbVcA','From my ancestor''s folklore:   The Lost Tribes of Judah & Dan  came to  North America prior to the Vikings (possibly on Phoenician Ships).  Some of The Lost Tribe People went with Vikings to Scandinavia and Denmark.   The  Iroquois,  The Mohawk,  The ManDan and The Cherokee  were said to have evolved from these lost tribes.   I am Cherokee, my family history has always been in the Southeastern United States and I have  Hebrew, Israelite (Jew) DNA - Tribe of Judah (as do most Cherokees).',75);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6546,'XueMKFSbVcA','Scott, thank you for presenting information that compels people to think and challenge the status quo. even though its impossible to PROVE any of the information, you have to step back and think and consider  that he may be on to something here.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6547,'XueMKFSbVcA','Scott, I''m becoming a skeptic of your show. It''s interesting but not much gets solved, and some of it is pretty far fetched. You didn''t even convince the guy at the lab on this one. You do need skeptics on your show just to give a counter argument instead of people who just agree. There could be logical reasons that your show is not presenting that may counter what you show.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6548,'XueMKFSbVcA','Scott, you make good entertaining shows that titillate the imagination, but you are anything but objective, and are always seeking the grandiose explanation. You know this is seldom the case. Templars, lost tribes, bigfoot. C''mon, dude.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6562,'_aEJIUnxcrc','I and every Indian Alive will never forget the story of bravery of the 21 sikhs.proud to be a indian',217);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6564,'_aEJIUnxcrc','If you want to learn more about the 21 Sikhs, Yarnhub had done a great job of animating the battle.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6565,'_aEJIUnxcrc','In ww2, A dentist in the pacific was working as a surgeon when 5,000 Japanese soldiers attacked his position. He told the wounded to retreat and he held the base until he died. His body was surrounded by 91 dead bodies of the Japanese.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6566,'_aEJIUnxcrc','Love the Spartans, it was my main reason for wanting to join marines. In my eyes I thought they had this warrior spirit that''s just not seen that much in the modern era.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6567,'_aEJIUnxcrc','Infographics show needs to do a video specifically on the battle of saraghari it was an INSANE battle. Salute to the brave Sikhs who chose to fight to their deaths.',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6569,'_aEJIUnxcrc','Battle of Saragrahi is needed to be covered by Infographics; Such an inspiring and motivational last stand',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6570,'Vx0xhwzdLl8','And now on my way to become a doctor , valuable education , food every night , nice clothes , a clean house , nice environment, and a nice school !! My ancestors walked so I can run !! Give all my respect and salute to them, Thank you !!',7787);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6571,'Vx0xhwzdLl8','I have nothing but respect for my ancestors, thank you so much for all that you have endured and I love you for that. I can honestly say that I''m so glad that I was born in 1981 because there is no way in heaven or in hell that I would be alive as soon as when I was Born into slavery. I''d have been a dead girl a long time ago but God seemed fit for me to be born in 1981. I''m just glad that the world has changed today of course there is some slavery around the world still in 20 22 and may God bless the rest of us that is here in this world..... Black people we have to do better making our ancestors proud of us...',194);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6572,'Vx0xhwzdLl8','My dad always said, "Until everyone is free, we are all slaves."  Powerful words.',781);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6573,'Vx0xhwzdLl8','I''m Irish I learned all about history from my mom when I was 16, she told all about the slave trade and the holocaust, I would feel very sad that any human could do that to another human, she told us never forget these atrocities because the evil people on this planet would do the same again if they got away with it.',302);
