Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7182,'2IUZWZX4OGI','Writing my first literature review in a college research paper and this video was a lifesaver. Thank you for clearly explaining the topic and helping me to feel more confident about my paper!',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7183,'2IUZWZX4OGI','David, you are the BEST on YouTube in explaining concepts relating to education coursework. You explain everything so simple which everyone with diferent learning levels can understand. Keep up the good work!!! You are the BEST!!!',59);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7184,'2IUZWZX4OGI','My teacher could not explain what a literature review was clearly no matter how many times I asked him. Thank you David!',75);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7185,'2IUZWZX4OGI','Greetings Mr. Taylor, I want to thank you for your tutorial on what a literature review is. My first paper as a doctoral student was rejected because I and several of my fellow classmates came into the program writing in the form of a narrative. Your pin-hole concept nailed it on the head. I used it throughout my Ed.S curriculum and can''t wait to apply it to my candidacy cognates. Thank you so much.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7186,'2IUZWZX4OGI','OMG I wish my professors were as down to earth and clear as you are! You''ve made this so easy to understand, and I appreciate it! I probably speak for every student that see your videos...thank you.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7187,'2IUZWZX4OGI','I remember the first time I watched this vid last year when I was in second year ''cause I had to do a lit review (for the first time!). Now I''m coming back just to update myself before I start another lit review - this one for my final year dissertation. Your video still wins hands down. ',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7188,'2IUZWZX4OGI','You are a great teacher, this video really helped me breakdown the concept and have a better understanding of the topic.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7189,'2IUZWZX4OGI','What a great and simple explanation.  You have helped a ton!  Thank you!',4);
