Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7193,'jKL2pdRmwc4','Thanks a lot for this wonderful lecture. I really liked it and desperately need it. I am looking forward for more wonderful classes like this.',0);
