Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (8551,'tATTLWTfoaY','Ive been watching ASMR for years and Ive never had these kind of affects. Omg thank you so much. ¿',62);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (8552,'tATTLWTfoaY','Yes pleaseee right as I opened YouTube to fall asleep, literal perfect timing!! I don’t know if I’ve ever been this early haha, thank you for another super tingly video !',45);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (8553,'tATTLWTfoaY','Hope your nights have been well people. I know I personally struggle alot daily with anxiety and such, but it''s always best to find something that calms you down at the end of the day. I hope those of you watching this for maybe your anxiety or insomnia find the necessary peace you need tonight. Struggle is just another path towards a new destination and you will meet the end eventually. From one challenge to another we keep growing. Anyhow, this message goes out to everyone. I hope you are all doing well and are safe somewhere tonight. Sleep well ¿',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (8554,'tATTLWTfoaY','Hi! Love your ASMR and creativity ¿¿',24);
