Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5838,'GIABy89py5A','It’s annoying because they’re lowkey dragging him & he’s still protecting his family. Props to him, idk if I could deal with the backhanded energy.',102);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5839,'GIABy89py5A','I agree with Gary at the end. It''s tough being a dad when you have no good examples. Living through the same thing, have a 20-year-old and a 9-year-old. And doing the best I can. My father wasn''t really there, stepdad was so so but not the best father skills. And really had no other man in my life to get guidance from as a father. We do the best for our kids and that''s all we can do.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5840,'GIABy89py5A','I truly admire Gary on how he chooses his words wisely when interviewed. Even when the interviewer pushed questions Gary didn’t want to answer, Gary stuck to his morals without visibly showing anger. Wish Gary all the Blessings bestowed upon him!',54);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5841,'GIABy89py5A','As a person whom has experienced divorce myself I completely understand. When the feelings are gone...you on roommate level....it''s run its course. I had to move on and find my own happiness. Living in internal misery daily just to make another person happy isn''t LIFE! Prayers for Gary and his entire family. Especially prayers for restoration with his children ¿¿ ¿¿',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5842,'GIABy89py5A','Divorce is a death of a family, and the steps of grieving are the same until hopefully, acceptance, resolve.  A lot of us love you, Gary, and yours.  The happy ending to this story is not over yet.  Trust.',54);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5843,'GIABy89py5A','Gary does what most people do including me, turning his pain into jokes… sending Love and healing energy to him and his family¿',89);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5845,'yBtMwyQFXwA','Thank you so much!! I’ve failed so many interviews and after practicing for my recent one using the lessons in these series, I’ve got the job offer on the same day! Good luck to everyone!',564);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5846,'yBtMwyQFXwA','Hey Rachel, thank you for posting these videos. I am an international medical graduate who applied for residency training here in the USA. I got interviews from different hospitals but I could not make a difference. As English is not my native language, I stumbled during the interview. I was not lucky enough to secure a spot. As the USA is the world leader in the field of medicine, I will apply again to achieve my goal of training here. I started searching for tips on YouTube and came across your channel. I want to improve my English speaking and communication skills. God bless The United States of America.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5847,'yBtMwyQFXwA','Testimonial: I would like to thank you in public that I got approved at my job interview, after watching your videos and being able to prepare for this challenge. Thank you for your support ! Congratulations for your job !!!',89);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5850,'yBtMwyQFXwA','I got the job offer yesterday. Thank you Rachel ¿¿ Last time and this time, I watched your interview videos to prepare and I got the job offer for both times. Last time was my tax internship, and this time is tax associate position.',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5851,'yBtMwyQFXwA','Eu amo esse canal, é muito fácil para aprender e entender.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5853,'yBtMwyQFXwA','Hello Instr. Rachel. I thank you for your great and very good information you provide us for job interview that I really needed. I failed last time in job interview and I wanted to attend a course on it. Many thanks once again Instr. Rachel and all the best.',1);
