Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5865,'wexzvClUcUk','I remember watching your interview tips a night prior to my interview for a competitive position, I am happy to let you know that I got the offer. Thank you so much, and how can I donate in support of your good job.',4271);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5866,'wexzvClUcUk','Hi Richard, I have been failing my job interviews for a long time now until recently I decided to do something about it. I started watching your videos for weeks, start practicing, and getting more confident in my performance as time went by. Today finally and happily can say that I satisfactorily passed my last 3 jobs interviews, no more nervous, no more sweat, no more blank brain, I was able to articulate clear and concise responses and got a job offer from a company that I want to work for.  The way you talk gave me strength, confidence, and positive energy. Thank you very much.',349);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5867,'wexzvClUcUk','I watched your videos a night before my interview. The role was supposed to be an intern role, but after engaging my examiners, they unanimously decided to offer me a full-time professional Civil Engineer role. I''ve recommended your method and videos to my colleagues and they''re all getting desired results. Thank you very much ¿',372);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5869,'wexzvClUcUk','This Man literally got me a job.  Anyone who wants to crack an interview should follow this channel.  You are doing a great job Richard.  Thanks for everything.',313);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5870,'wexzvClUcUk','I watched lots and lots of your videos as I prepared for my interview, I''m glad to let you know that out of 17 people for an experienced role I was the only one they picked and offer the job. I want to say a big thank you Mr Richard! may God continue to bless you for the work you do.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5873,'wexzvClUcUk','Hi Richard, I used this video to help me pass my interview along with some of your others regarding NHS values. I managed to get a conditional job offer, and I feel it was the introduction that set the tone and creating a positive image. With their body language and reactions I knew I was going to do well. I couldn''t have done it without your videos. Thank you so much!',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5874,'3L4m5ZMzf3A','i love zane lowe, just how genuine he is with harry, listening, not interrupting him, and just respects him so much.',15595);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5875,'3L4m5ZMzf3A','This is therapy. His voice, the setting, the sounds, videography, is all so peaceful and this truly made my day.',3711);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5876,'3L4m5ZMzf3A','I never really noticed this anxiety he has surrounding staying successful and creating content. I hope he knows that we love him for who he is not just the content he creates. Thats the real life force behind his success. Yeah his music is fantastic but its him as a person that makes us feel the way we do. Thats timeless.',2261);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5877,'3L4m5ZMzf3A','When Zane said “from a fan’s point of view, watching you be on that stage, it is very special to be in that crowd” I’ve never felt like someone has said something so true before.',1739);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6574,'Vx0xhwzdLl8','How amazing to hear a 101 years old grandpa speak with such sanity and good memory.i hope he’s still alive the story needs to be passed to every generation to come .',133);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6575,'Vx0xhwzdLl8','It takes an absolute "monster" to treat other human beings like that.',1731);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6577,'Vx0xhwzdLl8','I cried literally through the whole video. Slavery is a subject that focuses my energy into anger and sadness. But, I’m learning to refocus that for my good, using the past to fuel my future.',102);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6578,'Vx0xhwzdLl8','I bought my first piece of land this year, and I cried. This is why. I grew up not realizing I would be able to even own a house. I’m grateful I can push my family a little further economically then my parents did, and that is the gift/ message I want to leave behind to my kids.',42);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6579,'Vx0xhwzdLl8','I''ve never watched the movie, but the book 12 Years a Slave was so descript and disturbing! Although there were times I had to put the book down, I really like how it brought much more light to the tortures and horrendous practices performed by the YT man AND the YT woman. Textbooks in high school never went into the details of physical and mental punishments. All I was ever taught about was whippings, beatings, and a little about the rapings. But there was so much more that only an inhumane brute could think of doing. Solomon Northup described them a lot as demoniac, being possessed with an evil spirit, and soulless #seedofesau',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6583,'ExvEIOWB-H0','Oh boy I sure love being a Monk in Lindosfarne at 793',2217);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6584,'ExvEIOWB-H0','I love vikings, because they gave us Bluetooth',3025);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6586,'ExvEIOWB-H0','When you go in one succession from a king called "Bloodaxe" to one called "The Good," you''re either getting better or totally screwed.',563);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6587,'ExvEIOWB-H0','"Was ruled by a man called Gorm the Old. Gorm being old, died in 958" had me laughing',557);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6588,'ExvEIOWB-H0','It is always interesting to see which names get translated, and which just gets anglicized. Harald Bluetooth fx is Harald Blåtand originally, but gets translated, while Harald Hardråde gets changed to Hardrada instead of translated to Harald "Hard ruler"',447);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6589,'ExvEIOWB-H0','If there''s one thing to take away from the viking age it''s that everyone had better nicknames.',112);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6590,'bwQwSBlaHxQ','it''s almost like ancient cultures were made up of actual people who in many cases knew exactly what they were doing even if they didn''t understand the mechanics behind it.',87);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6591,'bwQwSBlaHxQ','Absolute History, may I make a recommendation? How about a video on ancient people learning to cook?',76);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6592,'bwQwSBlaHxQ','Interesting information about how settling down created inequalities in the access to food and the dawn of big food companies, but there''s nothing about cooking. So, how did ancient people learn how to cook? I''m still waiting to find out.',50);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6593,'bwQwSBlaHxQ','Misleading title :  more about transition from hunting and gathering to herding and agriculture, increase from small scale fishing to industrial scale, some mention of fish farming and aquaculture . Nothing about how people learned to cook their food.',50);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6594,'bwQwSBlaHxQ','interesting is our cultures change a lot through the generations, but food never changes much. Like most of the ancient Greek and Roman delicacies can still be found in Turkish cuisine. Think about the first bread was a pancake baked on a fire hot stone. flat bread is still made all around the world ¿',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6595,'bwQwSBlaHxQ','Read _Catching Fire: How Cooking Made Us Human_ for the answer to how it started and what it meant to us as a species',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6596,'bwQwSBlaHxQ','the roman cuisine had a taste for flavored wine made from cooking down red wine with figs dates raisins added sometimes thyme or rosewater. The residue from this process was sometimes used "defruitum" a thick syrup  for a chicken marinade a real delicacy back than. some roman merchant had a store in Palmyra making this date syrup still a product in Iran and Syria today ¿',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6597,'bwQwSBlaHxQ','Great video, just not sure the title is really fitting...subject matter is a bit different',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6598,'bwQwSBlaHxQ','Since people have been using fire and cooking food since we were hominids, that is such a very long time ago I sincerely doubt we will ever learn how people learned to cook.... But this is still a super interesting video',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6599,'bwQwSBlaHxQ','I was wondering to myself last week while cooking. Thank you ¿¿',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6600,'kkOweffr3II','This is brilliantly done - congrats :)',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6601,'kkOweffr3II','I''m beginning to understand chess is really like an ocean in complexity. There''s place of brashness, boldness, creativity, fear, light touch, nimbleness, anger, bluffs. It is a beautiful game, rich with stunningly creative ideas and tactics. It has stood the test of time because each generation realizes in greater depth than the previous one, how many more things are possible in a game, how far ahead can pieces support each other, how deep and far-seeing ideas can be, and how rich a battlefield it is to display the full range of human cleverness and emotions.',72);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6602,'kkOweffr3II','holy guacamole that was amazing. easily one of the best documentaries I''ve ever seen. PLEASE do more about chrss history. It''s what the chess community needs to realize this game isn''t just Magnus and supercomputers finding the best moves, but actual styles of play and players that for so long determined the game',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6603,'kkOweffr3II','Chess clock brief history would be good to have been included in this documentary. How would one classify classical chess against rapid chess without clock? Nevertheless, this is such a good film. Finally, a chess film that has filled the void!',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6605,'kkOweffr3II','Chess is, and forever will be, a timeless endearing game that will forever captivate the human mind. Long may it reign in thousands of years to come!',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6606,'kkOweffr3II','Such a fascinating game and really the only game I have ever gotten so interested in. The ELO system is inspiring because it gives you a goal',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6608,'kkOweffr3II','This is amazing! *I love documentaries and Chess. And they came together on my birthday.* Lucky me ¿¿¿¿',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6609,'kkOweffr3II','this is by no means a history of chess, just a history of chess world champions. there is a lot more that is more general and more interesting than who exactly beat whom in how many games',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6611,'putm_kpZW4Y','I live in Volgograd(Stalingrad). All the veterans I saw said that this battle was a real hell.  when the asphalt is repaired or the pipeline is replaced, the remains of soldiers are still found in the ground, and 70 years have passed...',5049);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6612,'putm_kpZW4Y','My (Ukrainian) gran fought at Stalingrad on the Soviet side. She had to decode messages to be sent to headquarters in Moscow. Whilst in service, she personally witnessed the surrender of General von Paulus. She also told me that most of the prisoners she saw there were Romanians and Italians as opposed to Germans. God bless her soul: she left us back in 2017 and would be 100 next August.',2097);
