Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9058,'T4NOt727wqI','I''m Chinese-Australian, and I started thinking about what my ideal comfort food would be when I started watching this video. It turned out that I had a very similar experience with the Chinese lady in this video as well. My parents sometimes made congee with cabbage and chicken in the morning and it was the best meal I could ever have wanted. I also requested this when I was sick and also when I got braces on (because I could only eat soft foods). It really shows just how nice this mixture of rice and water really is.',169);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9059,'T4NOt727wqI','My comfort food is maggi..being an indian I literally grew up eating it..you can just eat it anytime..every indian loves it',217);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9060,'T4NOt727wqI','I''m Filipino and my favorite comfort food is called Bananacue, It''s basically Banana covered with crunchy caramel but typically we don''t use just normal Bananas, we use a kind of Banana called Sabah and its like Banana but bigger and a little bit firmer. Typically served on a stick but it''s up to you on how you want it served.',74);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9061,'T4NOt727wqI','I’m Mongol  and my favorite comfort food is the blood of my enemies.',5821);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9063,'T4NOt727wqI','I don''t know why everyone is disliking the British one, for me I think comfort foods means that you can have it all the time whether you''re happy, sad, tired exhausted or energetic. Personally, I don''t even like bread and toast but for him it might be his comfort food which he can have it all the time whenever he wants to, without even thinking about the preparations to make for a grand food. xx',486);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9065,'T4NOt727wqI','A fellow Mexican here and I have two different comfort foods. For when I want something sweet I go with arroz con leche because its good for any time of the day and can be eaten cold or hot which means it''s good for literally any time of the year. And my other comfort food is definitely pozole it is just so good and warm and it gives me memories of all the parties I went to when I was a child.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9066,'CKnGXZxK7zs','Does anyone else watches these videos as a torture challenge while you''re hungry as hell?',1688);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9067,'CKnGXZxK7zs','As a native Chicagoan I can safely say Portillos is pretty great. The Italian beef and their crinkle fries are both so so good! However as someone who visits Missouri yearly you can never say no to Lions Choice. It puts Arbys to shame with real roast beef, gotta get it with Swiss and au jus with a fountain IBC root beer! It doesn’t get much better than that!',91);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9068,'CKnGXZxK7zs','I loved your list! really well put together. having lived in WA, and born in Oregon I can attest that both restraunts are very important to us',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9069,'CKnGXZxK7zs','As a Native Idahoan, I can attest to the fact that Boise Fry Company is AMAZING!!! They have a buffalo burger that is divine and I prefer the purple, yam, or sweet potato with Fry sauce and blueberry ketchup.',17);
