Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5881,'3L4m5ZMzf3A','it''s kind of strange. listening to an 28 year old man with this old soul. never heard a more reflected, grounded artist talking with this softness and vulnerability in his voice and face, showing that we are all just humans. i think he knows the deepest depths and the highest highs.',117);
