Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5886,'kayOhGRcNt4','If you’re reading this, you’re going to get the job. This video is extremely helpful! I definitely incorporated some of the techniques for my interview and I got the job. Thank you so much for this helpful information ¿',2305);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5888,'kayOhGRcNt4','Guys always remember every interviewer wants to hire you, that''s why you''re there. So just dont give them any reason to change their mind. Good luck everybody you''re gonna do great.',1250);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5889,'kayOhGRcNt4','For those watching this video cause they got an interview coming up soon, good luck y''all',2565);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5891,'kayOhGRcNt4','I love how supportive everyone is on here. Good luck with your interviews!',669);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5892,'kayOhGRcNt4','I agree with this video however, it depends on your delivery. No employer wants to hire a robot….they want someone who has personality, relatability, and open mindedness. Therefore when they ask me to tell them something about myself, I always include something personal that pertains to the job I’m applying for. It creates more of a human connection…and it’s always worked for me. ¿',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5894,'wIjK-6Do6lg','It''s truly amazing that we hire people based on their conversation skills alone. A resume and educational background should be weighted more. Socially akward introverts who know a lot about their career always lose to bubbly extroverts that know nothing.',5410);
