Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5900,'wIjK-6Do6lg','I applied for a job the day after recognizing sexual assault in my recent past, during the interview the interviewers asked me what was something difficult recently that I’ve faced in my life and how did I overcome it, I was very much in a vulnerable state of mind and couldn’t help but to talk about the freshest thing on my mind, the sexual assault… I cringe very hard thinking back on it, but I did get the job and it’s an amazing job',83);
