Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5925,'-JNjsOX0N0c','This video brought me back to my last IELTS speaking test. I didn''t do as well as I was expected. Wish I had seen this video earlier back then. Thank you Rachel, I really enjoy learning through your videos.',51);
