Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5930,'-JNjsOX0N0c','Thank you again Rachael !   Interviews are always a challenge.  I have often contemplated how I should behave while being interviewed.  It seems that the most successful interview experiences for myself have been ones where I remained relaxed but alert, and most important,  just be myself  .  If you are acting, it will tell on you and be unfavorable.  The person you are talking to is not God, just another person.  Keep that in mind during the interview process.  Always be respectful and honest.  I always enjoy listening to you Rachel no matter what you talk about because your diction is near perfect.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5931,'-JNjsOX0N0c','Esse vídeo ficou muito bom. Tempo, quantidade de palavras e tipo de conversa.',4);
