Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6613,'putm_kpZW4Y','One of the soviet veterans of Stalingrad was Vladimir Pikalov, the general that in 1986 drove a truck up to the Chernobyl reactor to measure the radiation level and survived into old age.',539);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6614,'putm_kpZW4Y','Stalingrad is the embodiment of “I’m not trapped in here with you, you’re trapped in here with me”',1582);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6616,'putm_kpZW4Y','The Germans really did hand the Soviets a beachhead fortress in this city. With all the bombed rubble it only became more of a nightmare to advance into.',4421);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6617,'putm_kpZW4Y','A couple of my distant German family members were at Stalingrad, and are still there as far as I know. None of the family know when or where they died exactly, but there are Oak trees planted on the family land as a memorial. I only learnt this while looking through family history, trying to learn more about my roots. They were barely in their 20''s, conscripted and sent to fight. I''m now older than they were, and I couldn''t imagine going through that sort of living hell. I understand they were on the ''wrong'' side, and I absolutely respect the Russians for defending their homeland, but whenever I hear the word Stalingrad, it makes me think of those guys. War is a waste, so much potential in humanity just thrown away at the whims of the people in power.',192);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6619,'putm_kpZW4Y','My grandfather fought on the german side from the beginning to the bitter end of this battle, then spent months working inside a gulag as a miner, finally escaping few days before his unit was signed for execution. He never wanted to talk much about the war, only few stories about his comrades and struggle for survival, I guess he felt ashamed for all the suffering nazis brought to this world. I remember the day I asked him about it, he didn''t say anything, my grandmother took me on a side and told me to never ask him about a Stalingrad.',238);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6620,'lGKomk6NwmE','If you are interested in submitting videos or other content to be featured on Season 2 of The Proof Is Out There, head to https://www.history.com/shows/the-proof-is-out-there/articles/do-you-have-the-proof to agree to our Terms and Conditions and submit your content via our Submission Page.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6621,'lGKomk6NwmE','Any entertainment channel you watch will never tell you any of the real bad stuff they are doing. They will give you some small nuggets of truth but never tell you what''s really going on',428);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6623,'lGKomk6NwmE','I remember reading an article about   an apartment building that kept making people sick and they suspected mold but couldn''t find any, it turned out that the air conditioning ducts were making a high pitch frequency sound that was making people sick.',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6624,'lGKomk6NwmE','I guess I''m a true conspiracy theorist, because I don''t think anyone that would actually know if any of these things existed would tell the truth, and those that don''t know for sure are only expressing an opinion.',99);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6625,'lGKomk6NwmE','You guys are hilarious. Thanks for clearing all those situations up in the favor of the US Gov’t doing no wrong in any scenario lol',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6627,'lGKomk6NwmE','I''ve been a shortwave listener and Ham Radio operator many years. Number stations are a practical way of sending coded messages to agents throughout the world.  If an agent enters a foreign country, it''s not hard to purchase a shortwave radio, set up a long  piece of wire and tune in a frequency at a pre-planned UTC time.  The agent has the key - hears and writes down the numbers, breaks the code with the key and destroys the message.  Back in 2001, number stations were going crazy across all bands day and night.  Something was going on.',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6628,'lGKomk6NwmE','I love how after all the investigation, no conclusion is reached.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6629,'lGKomk6NwmE','I am 63 years old and as a kid I always thought that buzzing was coming from the tubes that ran the radio. Who would have thought. I can say that has been going on a long, long time.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6630,'B2-aQ26Sk48','I think the worst year to be born is 1901. You would of been involved in two World Wars, Spanish Influenza and The Great Depression all before you turn 45',7394);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6631,'B2-aQ26Sk48','I''ve always gotten a little confused when people classified 2020 as the worst year to be alive in. There are so many past years that didn''t have as much technology to go off of like we did during the pandemic. Like at least we had stuff to do locked in our homes :/',583);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6632,'B2-aQ26Sk48','No matter how bad things seem, NOW remains one of the best times to have ever lived on Earth. Even simple things like being able to poop in a toilet, wash your hands, roof over your head, no concern for your life or next meal.... is an absolute luxury in comparison to all the generations before us',211);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6633,'B2-aQ26Sk48','As an Indian it was heart wrenching to watch what happened to the Native American tribes of America. My heart goes out to the survivors.',151);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6634,'B2-aQ26Sk48','In 2020 I had depression. I felt as if the world was ending and everyone was just so cruel. I lost my will to live. I wish I had this video then. People in history would''ve done anything to live as peacefully as we do today. Watching this video helped me feel genuinely thankful that I was born in this time period. Thank you for this video. For once I actually feel lucky to be alive.',124);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6635,'B2-aQ26Sk48','2020 wouldn’t have been so bad if everyone had respect for one another',7724);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6636,'B2-aQ26Sk48','Though reminding ourselves of the horrific times in the past might console us to get through this pandemic, you can''t deny that the definition of ''catastrophic'' is different for everyone. The inequalities are huge. The rosy picture you showed is probably in developed nations. People have lost jobs, lives, dignity, even democracies. Each time period has its own set of limitations and challenges, ours is different.',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6637,'B2-aQ26Sk48','The fact that we enjoy watching these historical videos and also understand them better than at school is amazing',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6639,'B2-aQ26Sk48','You know, I''m glad I live in the here and now. When I was 11, I got a very aggressive case of scoliosis that would have killed me the very year I''d gotten it if I hadn''t had major surgery. I hate to imagine just how many people have died from this condition and many others throughout history.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6640,'SK6OoHWI_W4','Am I the only one, or does anyone else enjoy how he dives straight into his content? No preamble, no monologue; almost instant startup!',935);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6641,'SK6OoHWI_W4','A few weeks ago I driving my car and decided to listen to a classical cd I had in my car in the player. It was Beethoven''s 9th. I listened for a few minutes and decided to go to the radio instead. So I pressed the radio button but it didn''t seem to work because it was still Beethoven''s 9th. After several minutes of punching that button, I discovered that it had worked perfectly! The radio and the cd were both playing Beethovens'' 9th! But the part that stunned me most was that they were at the very same place in the piece! I could shift back and forth and not miss a thing! Freaky!',321);
