Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5939,'HMQlA-TIAsk','Nossa, gostei muito do vídeo de hoje. Principalmente por terem colocado o glossário ao final. Muito bom mesmo! ¿¿¿¿¿¿¿',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5940,'HMQlA-TIAsk','Wow, great narration and ease to understand. Concise statement and help us to apply it. Thank you very much for this short video. God bless. Hopefully I can make it by tomorrow. ¿¿',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5942,'HMQlA-TIAsk','This video was excellent and gave me a lot of useful tips to prepare myself to an interview, thank you so much!',23);
