Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5945,'5v-wyR5emRw','If you have come here , it means tomorrow is your interview.',20356);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5946,'5v-wyR5emRw','I used Dan’s exact script. I wrote everything down and practiced for a few days before my interview and when it came I nailed it! I could see it in the interviewer’s eyes. Once I ended by asking ‘is this along the lines of what you’re looking for?’, it was game over. Got offered the job less than 24 hours later and higher salary than what I expected. Thank you Dan! You taught a man to fish.',135);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5947,'5v-wyR5emRw','I used this script exactly the way Sifu worded it. Many of my interviewers commented on this and they appreciated the clarity and conciseness I offered them with this one answer. And it was because of following his advice, I am able to sign my job offer letter as we speak. Thank you so much, Sifu. You are more impactful than you think.',1046);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5948,'5v-wyR5emRw','This was the first question that I was asked on my first interview, I jotted down what you said and added a few sentences, I got my second interview, I browsed again on your videos to prep and 2 days later I was offered the position! Thank you so much!!!!',374);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5949,'5v-wyR5emRw','Earlier this week, I was called for an interview. Due to scheduling issues, I had my interview the very next day via Zoom (barely 15 hours prior notice). I used this video as well as his other interview videos to prepare. This was the first time I felt confident in responding to "tell me about yourself." The interviewer even told me "very nice" after I said my spiel as outlined in the video (I didn''t end with the question because I''m not THAT confident ¿). At the conclusion of the interview, they told me I wouldn''t know a decision until 2 weeks later, but they ended up offering me the position two DAYS later. Thank God I found this video!! I''m extremely grateful ¿',265);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5951,'5v-wyR5emRw','Thank you Dan Lok. Since I used this script of yours, I received positive responses from the interviews I had. Now I enjoy collecting and choosing which employer I''ll invest my time and skills. This video and your script so powerful. Uplifted me to proceed in my search when I was on the verge of quitting.',58);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5952,'5v-wyR5emRw','Hello Dan,  great informative video. I have been learning a lot with your channel videos. This information gave me so much clarity, I tend to get very nervous on interviews. These videos have been very useful to me, for which I strongly recommend him and will take Dan especially into account in my future consultations. Thanks a lot for such good stuff.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5953,'5v-wyR5emRw','A few years ago it hit me that job interviewing is like a first date and working is like being in a relationship in a sense. Thinking of it that way I began to realize the error of my ways. This is an excellent video. Thank you so much. I cannot tell you how many good job opportunities I messed up when I was younger just on the “tell me about yourself” question.',80);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5954,'M69NaqGLfwI','There is now literally no excuse for Disney not to have him back as Phil in the live action Hercules - he’s basically issued a come and get me call here ¿',569);
