Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6642,'SK6OoHWI_W4','This is a little less crazy then some other people, but me and one of my closest friends met in the 9th grade. One weekend we both were going to our grandparents houses, and we found out that way that we were only a half a street away from each other. Another crazy aspect was that my mother and her father had both grown up in those houses, and had attended the same elementary, middle, and high school exactly 10 years apart. He had also seen my mother''s house being built. Kind of crazy!',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6643,'SK6OoHWI_W4','I had a weird thing happening to me. I met a boy near a swimming pool and he said that his parents wanted to go to a random place in Italy. 3 years later i saw him again at that random place in Italy',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6644,'SK6OoHWI_W4','My grandparents both immigrated from Ireland separately and had met and married in the USA. They discovered that they were both from Cork Ireland. They then discovered that they had grown up a street apart but had never met.',330);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6645,'SK6OoHWI_W4','I learned more about history here than my 1 hour worth of history class',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6646,'SK6OoHWI_W4','There are a couple of other big names that died at 27. Pretty crazy. Was fun to watch. Great video',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6647,'SK6OoHWI_W4','A guy I used to know at school got hit by the same car in the same place twice, almost exactly 5 years apart',45);
