Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6661,'bf-SUOCqbrI','Fun note: in 1918, British General Edmund Allenby found himself in the same situation as Thutmose III, and having read Breasted''s translation of the story,  tried the exact same "middle path" trick as Thutmose, and it worked again, 3400 years later!',2292);
