Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (8825,'7efofMxwwr0','This is the struggles you face when you broadcast yourself doing illegal activity on the biggest video sharing platform in the world. Yet you still go on, you still show your adventures and brighten people''s days. You don''t scream at us to smash like or subscribe, you don''t ask for anything, you just do this because your passion is fascinating and you wanna show the world a side of it most may never think of wanting to venture into.',984);
