Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5985,'rqNvJd5ORKo','Mark, thank you for the content that you bring us, it makes me appreciate how I was raised by my parents and will be forever grateful for their sacrifices.',458);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5986,'rqNvJd5ORKo','I am the softest bleeding heart you''ll ever find, but when I hear about this guy killing and maiming innocent people who were just going to work, I really don''t give a shit that he has PTSD. I have zero sympathy. It''s one thing to beat up some guy who''s in the racket, but it''s another thing entirely when a guy who needs to pay the rent goes to work and gets shot by some tough guy yokel. Fuck that. .',331);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5987,'rqNvJd5ORKo','This is an excellent interview. It gives hope for anyone who wishes to change their lives. Thank you to John for being so honest. I wish him  luck on his road to redemption.',112);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5988,'rqNvJd5ORKo','What a roller coaster of emotions hearing your story. I’m amazed at who you have become and at your journey. What happened in your past is certainly horrific however, your passion for being better and perpetuating positivity is all we can hope for from all people in society. There might be hope for this world¿¿¿',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5989,'rqNvJd5ORKo','I love when a natural story teller is interviewed. Sometimes,  Mark will ask one question and an uninterrupted retelling of a life follows. I  so quickly became mesmerized in this tale of the streets, that I cannot even remember if an opening question was presented. This is a beautiful thing.  Thank you, Mark and John, for sharing.',394);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5990,'rqNvJd5ORKo','Wow, this whole interview was done in one take with no interruption. Captivating stuff,  thanks Mark.',240);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (5991,'rqNvJd5ORKo','I must thank you for sharing this John, I had my nephew who was leading down the wrong path watch this as well. He looked up to so many of the  wrong "street guys" in the neighborhood who seemed to continue this life. He watched and listened, read your  books and came to the best conclusion that living to learn is better than not living at all, thank you sir.',54);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6005,'VBFvRLyvDqU','The whole fight was like a movie. All his life''s hardships led to that moment, father''s murder, migrating to a roughest part of a different country, getting in trouble growing up, 3 years of harassment ( 3 peice and soda), almost losing that title shot opportunity on the last round against Diaz, fighting the main boss in Usman, the commentators being 100% sure that he''ll lose, his coaches screaming "don''t feel sorry for yourself", down to the final round, everyone sure he is not winning it, and.........¿boom¿headshot. The whole arena cheered and  blew the roof off. What a story!!!',757);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6006,'VBFvRLyvDqU','“Little old Leon came in with one shot and head kicked him” savage yet humble line ¿¿¿',89);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6007,'VBFvRLyvDqU','This is beyond fighting, beyond the championship. This was great for the world, for society. What Leon did shows you sometimes you are at your lowest in life and you may want to give up, but you keep going and make the impossible happen. Thank you Leon!',158);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6008,'VBFvRLyvDqU','I can honestly say I have never felt so connected and part of a UFC World Title winner in the decades I have been watching MMA. His story and personality just draws you in and to be a part of it as a fan and spectator, truly living one of the greatest moments in MMA history.',103);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6009,'VBFvRLyvDqU','This man right here had just accomplished the IMPOSSIBLE. While everyone was chasing clout and jumping on bandwagons for the past couple of years, Leon has always remained true to himself and his values and it has definitely PAID OFF. CONGRATULATIONS LEON¿',1866);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6010,'VBFvRLyvDqU','3 days after this all unfolded and I''m still searching for interviews with Leon and highlights of the fight and the post fight interview. Speaks volumes of how special that moment was. Long time UFC fan, and this is right up there for me.',249);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6011,'VBFvRLyvDqU','The world needs more people like Leon. Great interview!',368);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6012,'VBFvRLyvDqU','When Leon was talking about his mom and how he made her proud and cried.... the feels... I love this guy..',548);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6013,'VBFvRLyvDqU','Such raw emotion from Leon. You can see how much all of this means to him. All that hard work and sacrifice is coming out.',52);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6015,'Gm0VRaAqcOs','Hello Richard! I don’t usually make YouTube comments but now I feel like I should. Before knowing this channel I was failing every single one of my interviews. After your videos and content I started passing them and I got 2 job offers. Thank you so much for your service. It was life changing for me. ¿',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6017,'Gm0VRaAqcOs','You’re interview packet that I purchased from your website helped me study for a interview I had on Friday. I got the job! I start in January. Your material was worth the money.',233);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6018,'Gm0VRaAqcOs','Wonderfully structured answers for common questions. Thank you for sharing your knowledge with us. Fingers crossed to all applicants and good luck with the interviews :) I have a few myself :)',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6019,'Gm0VRaAqcOs','Thank you so much for your videos. Had an interview today at 1pm and got the job an hour ago. I binged watched like 5 of your videos prior to the interview. Before describing myself in 3 words, I said thank you for this opportunity ¿ and the interviewer smiled. I was like yes! aha ¿',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6020,'Gm0VRaAqcOs','I had my interview today and it went well after listening to your video yesterday. She asked several questions that you addressed. Thank you for your help. ¿¿',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6021,'Gm0VRaAqcOs','Hi Richard, I just want to thank you for putting these videos out.  I watched and studied them.  I  picked up many Tips and words to use in my interview.  I received a job offer with a major airline.  I am so glad that I put in the time and effort to study your videos.  I thank you for putting them out there.  Please keep up the great work.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6023,'Gm0VRaAqcOs','Hey Richard, I am happy to say I got my foot in the door of a new industry that I love all thanks to you and your tips!',35);
