Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6686,'j1hkwWi1YxM','As someone with ADHD, I''m just happy I wasn''t alive in those times. I have a feeling that I might have ended up in one just because I was hard to handle at school seeing how I had a teacher throw an eraser at me in Kindergarten. While I still think we have a long way to go to be able to not make mental illness so taboo. We have also come a long way but I''m worried we''ll step backward if we''re not careful.',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6688,'j1hkwWi1YxM','Alot of these “crazy” patients were undiagnosed with Autism and other developmental related disorders. Fortunately behavior analyst came it and took care of the unwanted “insane” people. It really is a sad story how these “doctors” would not want to treat any of them.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6689,'j1hkwWi1YxM','My sis got sent to a mental facility one time when she had a breakdown. One of the employees there made fun of the cuts on her arms… In addition to this, another person there got a hold of a razor and slit her wrists and everyone had to witness. They were treated just as much like prisoners then as previous asylums, our system hasn’t changed much at all unfortunately.',42);
