Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6694,'h3E_32JEjtw','Well just yesterday we had a brawl involving 25 people in broad daylight and infront of the police station and today one guy was shot in the back and we had a hit and run. Just before I saw your video I was saying to myself ''It''s becoming like the Wild West lately''. Yup there''s been an upscale of violence.',155);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6695,'h3E_32JEjtw','Speaking of lawmen who turned to crime, Henry Plummer was Sheriff of Bannack, Montana for around a year (1863-1864) and led a band of road agents called the Innocents.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6696,'h3E_32JEjtw','"1 in 200 chance of becoming a homicide victim in the US 2015", is not even close to correct. How, was that recorded and no one thought "hmm that seems high".  First two things you will find when you google is, chances of being murdered in United States in any given year is about 1 in 18,989. In 2015 specifically there was about 5.54 fatalities per every 100,000 people',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6697,'h3E_32JEjtw','I''d like to hear about the time period involving Gaius Augustus Caesar. From about the Battle of Actium, to about the next 10 years. And how he went from Princeps to Augustus, and ushered in The Roman Empire.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6699,'h3E_32JEjtw','I''m Native American, Apache and my great grandma born in 1899 would tell me of what her parents, grandparents, aunties, uncles etc.,would tell her and what she remembered of the old West. Amazing stuff !!!',117);
