Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6701,'RsO9CiC57Mw','Yeah, I believe this Augustus guy came with a rule book, a new law prohibiting bro power because two of his youthful male servants where conspiring against him. That of his old age the boys where untouchable a common problem with bro power. ¿   Augustus can be the only one ruler and most powerful.',4);
