Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6710,'BRXE6R8FYw4','Umm. I think somebody forgot King Leopold ll of Belgium. The man bled the Congo so badly, that once it gained independence nobody remembered how to farm crops, let alone run a country',42);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6711,'BRXE6R8FYw4','You have to look at actual history before judging a leader evil. Vlad Tepes was retaliating for what was done to his country, he is rightly judged a hero.',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6712,'BRXE6R8FYw4','In the case of King John, I''ve always found it funny that he was so bad at his job that an entire country had to completely restructure their government because of him.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6713,'BRXE6R8FYw4','King John had the Magna Carta annulled just a few days after he signed it. Its importance was not emphasized until at least 2 or so centuries after his death.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6714,'BRXE6R8FYw4','There were atrocious kings but a lot of atrocities amongst commoners too.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6715,'BRXE6R8FYw4','You all should probably research Vlad the Impaler a bit more. While he was definitely a brutal ruler he was also considered to be an excellent one, a military genius, and Romanian hero.',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6716,'BRXE6R8FYw4','You put our national hero Vlad Tepes on your stupid list of evil kings ? Vlad was a hero who fought for his people and country against the ottoman empire ! He was betrayed by the nobles and spend 12 years in prison in modern day Hungary! Yes his methods were cruel but he never punished innocent people !',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6718,'BRXE6R8FYw4','Your take on the Habsburgs is wildly inaccurate.  They didn''t rule over the Holy Roman Empire, they reigned, due to the hundreds of independent principalities, marquisates, archbishoprics, free cities and electors. Not even the Emperor Charles V could break this political logjam.  The later empire was enlightened by current European standards, and I''m not saying this because I''m a fan of theirs. I''m not - but let''s be accurate, shall we?',5);
