Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7474,'WQkl1utfHVM','I think more than anything the meme stock phenomenon is a protest against the vitriol exhibited towards the retail investor. With that said, I do and like having a small portion of my portfolio reserved for speculation, having made some good money off of picks like AMC and BBBY. It’s small enough where it doesn’t hurt my long term investment goals and strategy, and large enough to “have fun” with. As long as you don’t put more down than you’re willing to lose and fully acknowledge it’s a casino, have fun with it. Just be safe, set your stop limits, and take profit as you go. (Not financial advice, just how I conduct myself)',3);
