Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9070,'CKnGXZxK7zs','I was born and raised in Anchorage, and I can all but guarantee you that while Tommy''s is at-best pretty standard, it''s an absolute tourist trap and has been since I was born (in 1993). Go to Long Branch Saloon for burgers, and if you want a more "Alaskan experience" try to go for a salmon quesadilla from Salmon Express during Saturday Market. My recommendation is to order it spicy but even getting a regular is going to be excellent even if you''re not big on seafood.',36);
