Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9077,'wNCPgIVz15c','This is a different Pakistan that media shows me. Thanks best ever food review show for showing us the real Pakistan and its peaceful people. Sending love from the Philippines!!!!',923);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9078,'wNCPgIVz15c','This was the absolute best! Some genuine laughs, some dark humor...this is what close minded people need to see- your videos in general. Shutting down all stereotypes, learning & gapping culters-bring us all together..Even in some failures. Love this stuff ya guys ¿¿',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9079,'wNCPgIVz15c','I officially have made Pakistan my Number 2 food destination after Uzbekistan....thank you Sonny for keeping us entertained and learned always.....',181);
