Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9081,'wNCPgIVz15c','Im a carnivore so Pakistan is the place for me for the meat. Everything looked so good and the host were awesome. Sonny does a great job of bringing the food and culture of Pakistan and its people to the forefront. Was interesting and very informative to watch. Lots of fun too. Great video',69);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9082,'wNCPgIVz15c','That mountain town is one of the most beautiful places I’ve ever seen . The buildings , the scenery, the food, the health of the people. Incredible . I’m jealous . That life style seems so simple and fulfilling.',409);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9083,'wNCPgIVz15c','The Hunza Valley part was absolutely beautiful…. Simple untouched by anything from the outside world…. Gorgeous simple people, scenic beauty and fabulous hosts….. fantastic fantastic vlog…. Amazing presentation of a hidden culture',8);
