Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9087,'Wxdj970RM7M','As a European who loves Italian-style pizza, one of my culinary dreams is to travel to New York to try their pizza, but also to Chicago to try the deep dish. One awesome thing about the USA being so big and so diverse is that you can find literally every type of cuisine there, both genuine and Americanized.',212);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9088,'Wxdj970RM7M','I know I’m late on this video but it’s absolutely criminal that Tennessee’s signature food wasn’t Nashville hot chicken considering how big it’s gotten.',263);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9089,'Wxdj970RM7M','I''m from MD and can confirm our love of blue crabs, albeit most people I know would rather get a dozen steamed crabs and pick it themselves than get a crabcake just because picking crabs on the bay is a fun nostalgic activity.  I suppose crab cakes are usually preferred by tourists/people who want to stay clean/''civilized'' meals haha. Seriously though, if you come to MD in the summer, go to Cantlers or Mike''s crab house near the bay bridge, you wont be dissapointed',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9090,'Wxdj970RM7M','As someone who grew up in New Jersey, I do love salt water taffy.  But sub sandwiches are the real iconic food from NJ.  The term "submarine sandwich" was coined in my hometown of Paterson by an Italian immigrant (thanks Wikipedia).  White House Subs in Atlantic City is one of the Jersey Shore''s oldest sub shops, and of course the Jersey Mike''s chain started from in Pt. Pleasant.   (Yes, your local deli probably makes a better sandwich. But JM''s subs are at least far superior to Subway...)',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9091,'Wxdj970RM7M','I''m from Tennessee and frankly I''m quite disappointed y''all put Memphis Ribs over Nashville Hot Chicken. It''s literally our staple food at this point considering how big Hot Chicken has gotten.',3150);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9092,'Wxdj970RM7M','Born and raised in SC. Never had a low country boil. I thought it''d be shrimp and grits. It doesn''t look bad, but probably something you''d find more on the coast (specifically Charleston) than inner state. And I''ve noticed NC is more known for their vinegar based sauce¿ than their tomato based (used to work for a BBQ restaurant, so that''s just my experience from out-of-towners).',12);
