Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (9095,'Wxdj970RM7M','Our family moved to WA State from MN back in 1977 after nearly 10 years of living there.  I was only 2 years old.  But, grew up on tater tot casserole.  I was told it was one of the many recipes my mom took with her from MN.  And, so it explains it as a MN favorite food.',2);
