Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6045,'IV30jAw7dxA','After failing about 10 interviews, I was desperate and depressed. Yours were some of the last interview tips videos I watched out of countless ones. You make successful interviewing easy to digest, understand, but most importantly, PUT INTO ACTION! Thanks to you I’ve officially broken into the accounting/finance industry!',708);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6046,'IV30jAw7dxA','I am literally going to comment on every video you have and I’m going to send you an email to personally thank you, this video literally changed my life and changed how I will approach interviews going forward. I had a big interview with a big company that was four hours long with four different people in one day. Me already having my stories written down in the STAR method, making sure I said I in everything and having my stats on how I helped my previous Company gave me the confidence I needed to answer any questions that they needed. I was also able to dissect my stories to answer other questions that they needed this method is so bullet proof. I received a call yesterday that I got the job and I’m so happy I cannot thank you enough.',1095);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6047,'IV30jAw7dxA','I GOT THE JOB!!! Thank you so much.',2363);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6048,'IV30jAw7dxA','My wife and I watched dozens of your videos during her job search. Thanks to your hard work and insights, she landed her dream job — and nearly doubled her salary. Your videos changed our lives. Thank you, thank you, THANK YOU!',92);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6049,'IV30jAw7dxA','I used your toolbox to nail my interview, I used your follow up email to get the ball moving on a response (and got a job offer an hour after sending it) and now I used your "Salary Expectations" video to negotiate a higher salary. I''m beyond greatful! thank you!',360);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6050,'IV30jAw7dxA','I got the job!!!! I went through a grueling 3-round interview process and made the switch to a new industry into a position I am beyond excited about. I was watching your videos and applying ALL your tips continually throughout my interview process. Thank you!!!',42);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6051,'IV30jAw7dxA','Went without a job for over a year. Put in a lot of applications and got some interviews, but would not end up getting hired. Watched some of your videos over the past 2 weeks and now landed a job offer with almost +$20K than my previous job. Thank you SO MUCH!',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6052,'IV30jAw7dxA','Thank you! This is probably the best career advise I''ve ever heard and I''m 54. I have an interview on Tuesday for my dream job which is a field that I have limited experience in. I do have a lot of career success stories, but I''ve never written them down and I tend to draw a blank when I''m nervous. I look forward to listening to more of your videos and checking out your website.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6053,'IV30jAw7dxA','I got accepted into radiology school! I had a 33% of getting in and I nailed that interview because of you;) forever thankful for you and your resources',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6054,'9FSSu8Ix0PA','If you''re looking for FREE interview strategies that will help you overcome your nervousness, check out my Interview Strategy Workshop here: http://www.lindaraynier.com/signup',65);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6057,'9FSSu8Ix0PA','I''m in HR and do recruiting, and I myself am nervous during interviews and it''s hilarious! That''s why when I''m interviewing others, I just wish I could tell them hey, it''s fine, you''re doing great! And when I''m interviewing, I wish I could just listen to my own words of advice!',909);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6058,'9FSSu8Ix0PA','I tried these tips and many other interview questions that you taught i was offered a job the same day thank you so much you are life saver I have been unemployed for a long time and after 8 unsuccessful interviews my 9th interview was successful and landed me my first job thanks to you.. God bless you ¿¿¿¿',584);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6059,'9FSSu8Ix0PA','I think over time, as you get more experience and have done quite a few interviews, you''ll just naturally start to feel more relaxed. Another thing I like to think about before an interview that calms me down a bit is that it''s not the end of the world if you don''t get the job. You''ll still be ok, there''ll be another place.',368);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6062,'9FSSu8Ix0PA','Love these tips! Being confident in interviews is so hard. Mainly because we are so hard on ourselves and the stakes are high! The #1 tip about being comfortable in the space is HUGE. Being present helps you get out of your head and stop any spiraling before it starts. Visualizing beforehand was mentioned, but it can be a total game changer. By visualizing yourself answering the questions and killing it in the interview, your brain will be trained for that scenario.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6063,'9FSSu8Ix0PA','One thing that I advise my clients is focusing on gratitude. That psychologically hacks your brain so that you think about the positives and the negative noise falls to the backdrop.',193);
