Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6074,'rXZMlyR1Fbw','Great lesson! Thank you! One of the things that has made me succeed at interviews is answering at a relaxed pace and honestly as much as possible. Of course a well-nourished resume helps enormously, but speaking with humility and truthfully about yourself is a remarkable addition.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6075,'rXZMlyR1Fbw','This lesson was very useful for me, thank you so much Anne Marie. I’m currently looking for a job as an architect in DC and this lesson brought me an overview of what can I expect. Thanks again. Since approximately one year ago I’ve been watching your videos. These really have helped me a lot to improve my English skills. ¿¿¿',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6730,'gEl4A0G3poQ','Watch all new episodes of The Proof Is Out There, returning soon, and stay up to date on all of your favorite The HISTORY Channel shows at http://history.com/schedule.',43);
