Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6733,'gEl4A0G3poQ','Mom and grandma had an experience in the 70’s with a bright LED circle as she explained the size of the home. Mom said it shot bright lights on them for a minute or so and shot off like a bullet without any sound. The next day grandma led us to the field behind the house with a huge round burnt spot. ¿¿¿',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6734,'gEl4A0G3poQ','Good Show!  I used to listen to coast to coast radio, and head a eye witness explain that the grey appeared right in front of him while walk through long park alone in Seattle Washington. He said the Grey just stood there and grew a armor suit right out of its skin, and when it covered its face it had the giant tear drop eyes always seen, he said the grey had more humanoid eyes like ours until the suit covered it.',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6735,'gEl4A0G3poQ','These "experts" ok,not an alien..but the reasons they give to prove it''s not an alien are ridiculous.',57);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6736,'gEl4A0G3poQ','Ok but.... What happened to the rest of the footage in the first video? Something that easily could have been a puppet or prop being controlled from behind, we don''t see it go further into the room or exit back through the doorway?',116);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6737,'gEl4A0G3poQ','I''ve twice seen UFOs. Both times with my mum & bro. First time in Melbourne Australia in 1965 was on way to school we & many others saw heaps, perhaps 15 or 20 bright tiny star looking UFOs weaving in out from each other. 2nd 1970 in Adelaide Oz all 3 of us caught thru our loungeroom window at dusk a very bright spinning light which burst into a bigger light before vanishing.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6738,'gEl4A0G3poQ','The one thing I HATE about these shows and the people in them is that they state their own hypothesis or that of others but state them as fact not as what they are hypothesis! Opinion or at most very well educated guesses! The ONLY way to claim those cave paintings are one thing beyond a shadow of a doubt would be to talk to the actual creators of the images! Shame on them for lying.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6739,'gEl4A0G3poQ','Loved the host of this clip, he did a great job narrating and has a solid narration voice. 10/10',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6740,'O4ju5QDfqCM','The Maritime Disaster that was the sinking of the Titanic in 1912 lives on in memory still in the 21st Century. How remarkable is that really? One of the startling facts for me is that it sank in just under three hours with a loss of 1500 people. It must have been terrifying especially as it happened in the dark. One of the most eerie things I''ve ever watched is when scientists finally found the wreck, a great distance from where they thought it would be, they were in a mini sub and the bulk of the ship just loomed out of the darkness, it was truly weird.  I don''t like deep water in fact terra firma for me thank you. Great video Neil, see you tomorrow.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6741,'O4ju5QDfqCM','Seeing the 1911 menu of The Titanic and learning about the Chefs gives us a little glimpse into such a significant historical moment. Thank you Neil, and of course the rest of the video is amazing. Looking forward to watching your segment tomorrow!',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6742,'O4ju5QDfqCM','I don’t know about the rumor that we didn’t know who Boy George was at all in the US. Actually we all fell in love with him! A true singer and flamboyant personality!',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6743,'O4ju5QDfqCM','I remember Johnny Ray in “There’s No Business Like Show Business” with Ethel Merman, Dan Dailey, Donald O’Conner, Marilyn Monroe, Mitzi Gaynor and Hugh O’Brien. I loved that movie. They really knew how to make movies in those days.',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6745,'O4ju5QDfqCM','I was watching a detective story from the 1990’s and found myself thinking “why don’t they get out their mobile phone?”. Of course, I then recalled they didn’t actually have them, then. The younger generations must really find old shows difficult to relate to - much more so than we did. There were far fewer significant lifestyle changes between 1940 and 1980 than between 1980 and 2022, I feel.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6746,'O4ju5QDfqCM','Now, I am going to be singing “karma chameleon” in my sleep tonight!  LOL',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6747,'O4ju5QDfqCM','Really  love Boy George- such a great musician and interesting person.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6748,'O4ju5QDfqCM','My sisters and I loved Boy George and we still do! ¿ He is STILL a star in our eyes! ¿ ¿',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6749,'O4ju5QDfqCM','So many people who had so many dreams that died when the Titanic sank. Such a tragedy. It is fascinating reading about the Titanic and the decadence on the ship. One of my boys was a huge fan of Boy George. Thanks for this review of "This Day".',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6751,'j4kI2h3iotA','My 10th grade US history teacher announced to us that we would be taking a pop quiz that was worth 50% of our grade, and told us we had to get every answer right, otherwise, we failed. She handed us the "literacy tests" and said we had 10 minutes to complete it. Beside our understandable confusion as to what this had to do with history, we all failed, terribly. That''s when she came out and told us that had we been black over 100 years ago, none of us would have been able to vote in the south, and told us these were the literacy tests the curriculum told her to teach us about. She is still my favorite teacher to this day, because she had such an amazing way of personalizing historic events to us.',13116);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6752,'j4kI2h3iotA','You hit the nail on the head with the feeling guilty for being white thing. I think that’s why so many people are afraid to open their eyes to racism because they just think “well I’m not gonna be guilty for being white!” when in reality you don’t need to feel any guilt as long as you’re not racist, you just need to acknowledge that it’s there and has been there. Very informative video',1116);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6754,'j4kI2h3iotA','As a 16-year old who recently learned about the WW2 era and de-segregation, I could tell something was wrong but obviously didn''t know what since I wasn''t taught anything else. This video really helped set things straight for me, and you put it so clearly even a kid can understand. Thank you for making this video, more people need to see this.',640);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6755,'j4kI2h3iotA','Thank you for your comprehensive analysis with included sources (and narrations!), and wrapping it up with a call to action. This is what the internet is about. ',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6756,'j4kI2h3iotA','I usually skip anything to do with slavery because as a black man it’s exhausting. But this was so well done and factual I watched the entire thing. The fact it’s done by a white male is even more satisfying because no one can claim bias or prejudice. This was enjoyable and much appreciated. Thank you',3588);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6757,'j4kI2h3iotA','Thank you for  your  history listen, As a 77yr old Black American, educated  BA degree  and a US  Veteran, I was unable to express why my life goal was to live abroad, I''m FREE AT LAST, I''m an EXPAT  in Mexico,',111);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7531,'XuUoGFEkutk','LOVE that you did this. Not a lot of home decor/DIY content creators show the small yet important things like how to make a bed look like it came out of a magazine, so really appreciate you doing that!! More small/simple yet so important things, please! Much love.',421);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7532,'XuUoGFEkutk','Nice beds.  If you like the bed sheets to look crisp, like they were just ironed, make the bed and then lightly mist spray the sheets (including the pillowcases) with plain water, using a standard spray bottle.  This works on cotton sheets, which will stretch out as the mist of water dries out.  It is a luxury hotel trick.  The sheets will look pristine, especially white sheets.',281);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7533,'XuUoGFEkutk','I LOVE this descriptive talk-through format of the video. For us less design-inclined mortals, it is incredibly insightful to hear your breakdown of the reasoning and choices! :)',132);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7534,'XuUoGFEkutk','Oh Drew! I loved all of these stylings, but felt that the 3rd one just tied in all of the colors of your room, especially the dark paneling. And the 4th one added a soft warmth & great texture. Would you PLEASE do a similar video for window treatments? Styling different curtains patterns & colors,  with the rods, etc? I would love to see all the different ways you would style a window¿.',81);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7536,'XuUoGFEkutk','Flat sheet always goes “face down” so that when you open the bed to get in, you see the pattern (top and bottom) and you are getting “into” the pattern.  These are all so gorgeous!',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7537,'XuUoGFEkutk','id watch 5 more of these. bed styling is so interesting to me, would love a part 2!',20);
