Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6107,'B_LmCruLjis','Thank you so much, Don! I watched this video numerous times and studied your teachings like crazy, and I could tell by the employer''s facial expressions that he was very impressed by my instantaneous responses and research into the company, and I was pretty much offered the position on the spot! 7/38/55!!!!!!!',138);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6109,'B_LmCruLjis','I just want to share that these tips helped me land my dream job. Fresh out of college as an engineer, I did great during a phone interview, but poorly in a face-to-face invterview for a fortune 500 company. I just didn''t have pre-planned topics to answer some questions with and came off as unprepared and inexperienced. I didn''t get the job then. 5 years later,  I wanted to redeem myself. This was a once in a lifetime job opportunity for me so I didn''t want to miss my chance. I had a 30 minute interview with the executive director of engineering and was able to hit on all of my strengths clearly and concisely. I nailed it. I started by highlighting key aspects of the job posting, and then I thought about all of these interview questions and practiced my responses daily until they came out naturally. It landed me the job!',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6112,'B_LmCruLjis','Big corporate management interview coming up tomorrow and this was so helpful! As someone who has a  bit of mileage, I had an idea of the direction I wanted to go but this really solidified and guided me! This was amazing and so are you! Thank you thank you!!! ¿¿¿',10);
