Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6125,'pdZ6rEpfjzM','It’s amazing how you can see some people’s souls come alive when they are given a chance to share their story where there’s no judgement, just a genuine desire to allow them to speak their truth.',114);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6126,'pdZ6rEpfjzM','Spent the first seven years of my career teaching Florencia 13 gangbangers in Huntington Park, Ca. They were middle  schoolers and spent the better part of the day trying to keep their pants up. But as tough as they wanted you to believe they were, most of them were just babies trying to fit in. Then I moved to a high school and stayed in touch with two who went in different directions. One is now a Highway Patrol officer. The other was murdered by his cousin at the direction of a rival gang. To this day, I feel more affection than fear for these lost souls.',439);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6128,'pdZ6rEpfjzM','Baldacci, thank you for accepting this interview. I appreciate your genuine honesty and acknowledgment of your past. I feel your strength and kindness. Real talk. Bless you man',52);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6758,'j4kI2h3iotA','I feel proud of my history teacher now. She wasn''t afraid to dig into the good, the bad, and the really ugly and disgusting parts of American history. She taught us about all of this. I hope other history teachers end up following in her footsteps.',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6760,'MSYw502dJNY','I''ve never been particularly interested in john green''s  works, but the fact that he encourages readers instead of just seeing them as beneath him says a lot about his character and his connection with his audience.',698);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6761,'MSYw502dJNY','I just found out that THIS John Green is actually THAT John Green!!',2593);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6762,'MSYw502dJNY','My literature teacher told us to come here. I now understand why and that literature goes beyond being entertained by a book or for the sake of pleasure. I now see reading is a ''tool'' that will help us in our lives, experiences, feelings (good or bad ones but still feelings) and so much more but it would be a very long list. Greetings from Argentina.',93);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6763,'MSYw502dJNY','hello John, i''d like to let you know that you''ve inspired me through your books to write my own, I''ve read "looking for Alaska" (my personal favorite), "the fault in our stars", and "paper towns" and I''ve loved each book, im 16 and I''m planning on starting my book this winter',84);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6764,'MSYw502dJNY','THANK YOU my english teacher once told my class, "take this Edgar Allen Poe story and find 10 symbols". If we didn''t have 10 we were failed and the most anyone had was 7.  They then told us about the "symbols" we missed and none of them made any sense! One was that cat represents the devil because the cat died.',144);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6765,'MSYw502dJNY','Ugh I love crash course so much! Not only because it is educational and interesting but also because it inspires me to want to learn more :)',83);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6766,'MSYw502dJNY','I know you guys are doing more CC Lit, but this is my favorite CC series, and I have read entire novels for the sole purpose of watching two 10-minute videos on them. So it would be so amazing if you made this a more regular series, because this series is what really broke the ice for me learning how to analyze books. Seriously, CC Lit has changed my life.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6767,'MSYw502dJNY','Showed this clip to a reading class I''m teaching here in the SF Bay Area-9th graders. And one of the ideas that came out of the class is that imagination and empathy-two of the main skills strengthened by reading-can be antidotes to cynicism and indifference, two of the really toxic aspects of the culture young people have to deal with.',80);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6769,'MSYw502dJNY','History, Literature and overall nerdiness...I love this man.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6771,'4RCFLobfqcw','* Literature is meaning, escapism, entertainment, psychologist, secret friend, teacher and imagination-trainer all rolled up into a spine, pages and two covers. That is literature.',413);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6772,'4RCFLobfqcw','This is absolutely brilliant! All teachers and students need to see this!',155);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6773,'4RCFLobfqcw','literature removes boundaries, allows you to read minds, time travel, all in the comfort of your own room. it also fosters empathy and fuels imagination.',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6774,'4RCFLobfqcw','The ONE thing I am really grateful for in the videos by SoL is the fact that they repeatedly assert how everyone is weird. And that we all pretend to be normal and acceptable. Believe it or not, I have spent a lot of my time wondering, worrying and feeling bad because I wasnt perfect - I would talk to myself, get completely lost in day dreams and feel empty inside. Now, I have slowly got myself to think that it is all okay, that everyone is weird and I should just embrace myself - an eternal dynamic mess.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6775,'4RCFLobfqcw','More literature-themed School of Life videos, please. I can suggest writers if you like.',280);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6776,'4RCFLobfqcw','it would be awesome to have a list of all the books referenced in this video. Thanks for this!',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6777,'4RCFLobfqcw','This makes me want to start reading again. It''s been too long since I really read a book, basically since school. Back then I didn''t like to be ''forced'' to read. I find it difficult to get hooked and I''m also quite a slow reader. Who could give me some suggestions, to give it another try?',35);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6778,'4RCFLobfqcw','I''m reading "The secret garden" right now and I couldn''t agree more that it is in fact the greatest reality simulator. More immersive than movies even.',20);
