Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7619,'xdi_yuSgQw8','Frank was a bomb ass album great lyrics with infectious beats and sassy themes. Amy was enjoying her music then and being a musician, the fame and limelight was there yet. After this album the critique and scrutiny awakened her many insecurities I guess. Sigh but what a talent, she was great!!!',570);
