Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7621,'xdi_yuSgQw8','She was soooo healthy here, hair healthy, skin healthy, body healthy, just so youthful and ripe for the world!!!  Man, I wish we could have gotten more time with her.',1839);
