Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6130,'pdZ6rEpfjzM','It''s interviews like this that remind me every day that if I''m going in with preconceived judgement about a person, I''m being an asshole. This guy is so well spoken and can tell that he can definitely put his good intentions into a powerful direction. He should take up writing so he can tell his story.',14);
