Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6133,'pdZ6rEpfjzM','He’s amazingly insightful and reflective considering the life he chose and the things he’s done.  A man of paradox in so many ways.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6135,'WOHFlwYV210','Hello Sir Richard, just to let you know that.... I GOT THE JOB!! Mission accomplished thank you so much for all the videos and the work you put up, it made all the difference in my case.',92);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6136,'WOHFlwYV210','Great news! I passed my 2nd interview yesterday and got an offer letter by email today even though I was told it would take a few days or up to a week to hear back. This was made possible by watching your videos and how to answer the possible interview questions that would come up in a way that would set me apart from other candidates and employing the STAR technique when answering some of the questions instead of just giving a closed ended response. BTW I have already subscribed to your channel. Many thanks for your valuable advice!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6137,'WOHFlwYV210','I just wanted to say a big thank you to you Richard, for all your interview tips and preparation materials.  I am from Australia.  I recently got promoted as ICT Delivery Manager.  Not only for just interview, your materials are helping me with my job as well.  I recommended your channel to all my family and friends.  Thanks again and please continue the good work ¿¿¿',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6138,'WOHFlwYV210','I just want to say thank you so much for you truly inspirational videos, your interview tips and tricks have not only have made me more confident in interviews it has helped massively with my self esteem, i left a job in oct of 11 years and took a fixed term contract hoping they would take me on permanently but unfortunately due to covid they introduced a recruitment freeze so i have been an anxious mess trying to find a job and landed two job offers one of them being my dream job as a project manager! Thank you Richard keep up this anazing content!! ¿¿',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6140,'WOHFlwYV210','Outstanding sir Richard. I will have an interview next week, your videos assisting me a lot. Pray for my interview and secure the job afterwards. Thank you',100);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6141,'WOHFlwYV210','More great content as always! I watched a TON of your stuff, and recently started my best job ever in my career 2 weeks ago, and your content def helped me pass. Thank you for what you do!',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6143,'WOHFlwYV210','Thank you so much for making these videos. Your videos gave me the confidence I needed in an interview. I was so nervous to have a interview in a research management position, but your videos helped to calm me down and give me the confidence and the answers to help me get the job. I was hired on the spot. Thank you again!',5);
