Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6822,'d1W7wqXD_b0','I strongly recommend her diaries. It is the best possible novel, her life, written in the most beautiful but unguarded prose. I go back to them every few years when I am on holiday and just want to soak up her lucid thinking and mastery of the English language.',303);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6823,'d1W7wqXD_b0','Virginia Woolf’s A Room of One’s Own inspired me to read and write. There was something about her piercing words that changed my perspective about many things. I’m grateful for her talent, sad about how much she suffered in life.',121);
