Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6827,'d1W7wqXD_b0','To The Lighthouse changed my conception of what writing could achieve. It''s one of the finest novels I''ve ever encountered, and I entreat whomever sees this comment to read it.',148);
