Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6187,'mWSVB7FMmoE','I love how she''s confident enough to put forth her views about the current issues and struggles of women and how she''s able to relate to and understand them and then throw light on what the world has probably been doing wrong and comment on that. All of her thoughts and ideas and opinions are so down to earth and genuine that they just touch your heart and I really appreciate her efforts of making this world a better place to live in by promoting valuable projects and regenerating the idea of gender equality amongst the youth and the older generation as well. So, good job. :)',74);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6188,'mWSVB7FMmoE','I was looking for "Understanding British accent", I am glad YouTube recommended me this. Her accent is beyond beautiful. She is intelligent too.',455);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6189,'mWSVB7FMmoE','I just happened to stumble upon this interview. Emma is beyond well spoken. She is highly intelligent, sweet and real. I look up to her so much. I''ll always be a huge fan!',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6190,'mWSVB7FMmoE','It''s awesome to see such a young woman with this effort to change the world. The hate that flows on the comments below just shows how deep her argument are going, disturbing those who feels personally offended by women with this behavior in face of life. And this is great, because this hatefull coments shows people''s face, people who is hided behind a keyboard and that needs to be seen, so that the good ones can target them and avoid unreasonable discussions. Thanks, Emma!',191);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6191,'mWSVB7FMmoE','I’m a guy, I listened to this interview while doing bicep curls in my basement after playing rock on the drums. I’m a right leaning guy politically as well. I loved this interview. I often feel the urge to reject feminism because I feel attacked by the most extreme people that instead of wanting men in the conversation, exclude them. But Emma’s approach to Feminism is bringing guys in to the conversation to learn new lessons and recognize biases They didn’t know they had. Conversation and compromise are the two things that hold democracy together, when neither side is willing to listen or compromise nothing is achieved. When I say compromise I don’t mean Women or Men not achieving full equality. I mean that conversation is not possible without appealing to the other side. When one person yells at another, the other person stops listening and is just getting ready to yell back. Thank you Emma for being a voice of reason and compassion.',72);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6192,'mWSVB7FMmoE','Emma''s interviews are so great and helpful in English learning¿ she''s so intelligent and just adorable! One of the best actresses of this century¿',5);
