Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6865,'pBG10XnxQaI','I''m reading a book called "Existentialists and Mystics -- Writings on Philosophy and Literature" "by" Iris Murdoch, edited by Peter Conradi, which has in it what purports to be a transcript of this interview with Bryan Magee. But the sentences are different; many words are added or deleted or changed. It''s almost as if someone decided that the actual interview wasn''t polished or "eloquent" enough and the editors made changes. Or is it possible that Iris Murdoch got the transcript and modified to her own writing standards? Does anyone out there know?',2);
