Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6870,'eREopphW5Bw','Does anyone have a love-hate relationship with analyzing literature? Like, when the teacher explains the deep meaning of something, it makes total sense and logic to get to that point of analytical conclusion. But, when I try to find a meaning of something, it always turns out to be wrong even though there’s technically no correct way to analyze a text perfectly. It just doesn’t make sense to me when I would get a 75 on a analysis paper just because the teacher didn’t see/analyze what I wrote about a certain text.',131);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6871,'eREopphW5Bw','This is why I pretty much lost a significant focus on writing and critical analysis. Much of the following is due to bad memory, but, everything I would say and write as my own point of view on the understanding of a character''s situation, I would "get it wrong". Maybe I needed to grow up from such a sheltered environment and know first hand what the characters in the novels, essays, were going through. I was only a kid.',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6872,'eREopphW5Bw','Thank you SOSOSOSOSO much for this video! My school is crap and doesn''t teach us these things, but I want to be able to analyze books and I''ve sort of been trying to, but videos like these are always a good reminder! Thank you!',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6873,'eREopphW5Bw','I disagree, I have never been able to find the deeper meaning in literature. However, I have always enjoyed when people discuss the symbolism and meaning behind parts of books that I took at face value. Videos like this give me another way to think about what I am reading, and they help me find the deeper meanings of a text when I read it. ',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6874,'eREopphW5Bw','Stuff is always so open to interpretation I ragequit before a few chapters trying to analyze literature. It takes all the joy of reading out of me.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6875,'eREopphW5Bw','Some great ideas! This is why I love reading and literature. The human condition is so complex. ',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6876,'eREopphW5Bw','You make it sound so simple... definitely using these ideas in my classroom!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6878,'eREopphW5Bw','"Books belong to their readers." ~novelist John Green',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6879,'eREopphW5Bw','Acknowledging the insight and complexity of finding small and complex clues in a literary work seems to be a way to use in any work.  This is because not only foreign literary works in this way, but also Korean works are need to show complexity and insight to understand. From now on, when I see these works, I will read them with a sense of complexity and insight.',1);
