Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6899,'RqRLC4vnJEc','i''m actually in an English major and English is not my first language (it''s Spanish) and yes reading classics is really overwhelming especially if it''s not your first language, at least for me what it helped me was start with short stories or poems so you can go slow with unknown words. Also start with classical short stories like a 20th century author for me are a way easier than ancient authors. Another thing you can do is let the text flows naturally, when i read the scarlet letter it was hard for some words but as long as you know the context or what is happening is fine.¿',81);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6900,'Lr6DYLBkyG0','Though it is hinted, the video should have mentioned that Tolstoy was one of those few writers who was famous and received recognition in his own lifetime and not posthumously.',1329);
