Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (8437,'JaqesAupcVA','Latte, would you ever consider doing a behind the scenes of your ASMR filming process? I am so fascinated by how detailed your sets are, how perfect you make them, and how you embody every aspect of the role you’re playing for these ASMR videos. It’s incredible! I’d love to see a behind the scenes of you setting up and filming! I think many others would, too! ¿¿¿¿',655);
