Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6244,'yTqafU2dWeg','I see a 50 Cent interview and I watch immediately. 50 NEVER disappoints in his interviews.',1975);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6245,'yTqafU2dWeg','I have always loved 50 interviews. He drops knowledge like a great philosophy professor. He''s always had a blueprint, a map, a plan since he first came into the game with his mixtapes. He drops gems on life, business, goals, etc. He''s a marketing genius. No one can hold a candle to him when it comes to going from the bottom to the top and maintaining, while still recreating yourself and evolving as a businessman. Give this man his ¿ roses while he''s here, not after he''s gone. He''s one of my role models.',186);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6246,'yTqafU2dWeg','That’s one of the best interviews I’ve seen recently in the hip hop space. There are so many Hip hop Podcasts now and most of them still don’t hit the way this interview hit with the amount of knowledge, business secrets & dealings, spoken in this interview! Applaud Envy & Ctgod on this piece! Respect',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6247,'yTqafU2dWeg','50 is just a pivotal person who I repeatedly lock into throughout my life. He brings the knowledge, the hustle, the comedy, the motivation, the dominance, everything you need to hear to push further in your path',133);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6248,'yTqafU2dWeg','50 knows how to lead an interview and command respect in the room. His aura and energy is just different mixed with a wealth of knowledge/intelligence. All you have to do is sit back and listen with open ears. ¿¿',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6249,'yTqafU2dWeg','This is why the breakfast club is legendary. At any given moment a super legend will pull up and do a great interview.',3188);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6250,'yTqafU2dWeg','This made me respect 50 even more. His business acumen is so on point. I love that he''s helping schools in Houston. He comes off as the bully of the block, but he''s Ultimately giving people jewels and leaves it up to them to make jewelry. This man is constantly learning the business and taking over. Kudos and blessings to him.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6251,'yTqafU2dWeg','50 is one of the few who has truly studied the industry for years and is now reaping what he has sown. Every time he interviews he drops jewels ¿ Hate him or love him but you gotta respect him.',42);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6252,'yTqafU2dWeg','50 is just a pivotal person who I repeatedly lock into throughout my life. He brings the knowledge, the hustle, the comedy, the motivation, the dominance, everything you need to hear to push further in your path',52);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6253,'yTqafU2dWeg','Man, to see dudes like 50 genuinely laughing and smiling like this and to know where they came from and how hip-hop changed their lives, is really amazing. The rap game is a blessing to the black community and it makes me wonder how some of these dudes could make it and still wanna be in crime, risking their lives and their freedom, when they could be out here living their best lives like 50.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6254,'mq-t7zw4WKA','Say what ever you want, but Boosie is the epitome of a southern raised Black man. He has real qualities and he stands on it no matter what. It doesn’t matter if you white, black, brown, don’t matter with this man. Respect him and he’s respectful back. You don’t have to agree with everything the man says, but most of what he says is the real deal facts or the hard perspectives that many people aren’t comfortable talking about. Been a huge fan of Boosie through his whole career, I wish nothing but great things for him. As a Louisiana native, it gives us hope that one day that type of success can be achieved!',104);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6255,'mq-t7zw4WKA','Madd respect for Boosie, this man talks common sense and self respect. Need more like this man and many more men out here in this world!!!!!',49);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6256,'mq-t7zw4WKA','Hands down one of the best boosie interviews, he’s always keep in it real real ¿¿',84);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6906,'Lr6DYLBkyG0','This explanation of War And Peace was way too brief. I understand that this is just a 10-minute video and you are just trying to give people a vague idea and a taste of the book, but the way you made it out in your video it may seem like War And Peace is just about Natasha, but the whole point of the book is that it is a huge, epic story, with so many characters whose lives are all intertwined.',383);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6907,'Lr6DYLBkyG0','His life is so wholesome and laddish at the same time, from being a drunk gambling layabout pestering gypsy women then getting bored and becoming an officer to penning literary masterpieces about inner kindness and understanding then just walking out on your family and dying of pneumonia. Absolute madman',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6908,'Lr6DYLBkyG0','My all time favorite writer. An entire School of Life episode could be dedicated to Tolstoy''s short stories. Strider - God Sees the Truth, but Waits - What Men Live By - Master And Man - The Wood Felling - Sevastopol... I''ve read all those stories 50 times, and hope to read them 50 more. James Joyce once said that Tolstoy''s How Much Land Does A Man Need is the greatest short story ever written.',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6909,'Lr6DYLBkyG0','Why aren''t we seeing film like this before call me old fashion but we need to introduce the public to these classics again. We need another renaissance soon',263);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6910,'EuxyQgS-Hu0','"Crying does not indicate that you are weak. Since birth, it has always been a sign that you are alive." -Jane Eyre, Charlotte Bronte',3765);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6911,'EuxyQgS-Hu0','"Everything will be fine in the end, if it''s not fine then it''s not the end." -Oscar Wilde',1086);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6912,'EuxyQgS-Hu0','"Always remember that you are braver than you believe, stronger than you seem and smarter than you think." - Winnie-the-Pooh',959);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6913,'EuxyQgS-Hu0','"Not all who wander are lost." - J. R. R. Tolkien',499);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6914,'EuxyQgS-Hu0','*“In the midst of winter, I found there was, within me, an invincible summer."* — Albert Camus',2829);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6915,'EuxyQgS-Hu0','“But I don''t want comfort. I want God, I want poetry, I want real danger, I want freedom, I want goodness. I want sin.” -Aldous Huxley, Brave New World',267);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6916,'EuxyQgS-Hu0','"Mockingbirds don''t do one thing but make music for us to enjoy. They don''t eat up people''s gardens, don''t nest in corncribs, they don''t do one the but sing their hearts out for us. That''s why it''s a sin to kill a mockingbird." - Harper Lee',1060);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6919,'EuxyQgS-Hu0','"Laugh as much as you choose but you will not laugh me out of my opinion"- Jane Austen. My absolute favorite and it never gets old ;)',1199);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6920,'vv_N_vK3OJw','i’m happy that you said that our degrees should be seen as hobbies because not everything has to be something career driven and that’s something that’s moved me back into my love for english and writing and i’m so thankful <3',740);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6921,'vv_N_vK3OJw','not gonna lie, your tiktoks and videos reignited my love for literature so much more than I already did, the way you talk about it really comes through. It made me remember why I love literature so much in the first place!',327);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6922,'vv_N_vK3OJw','you literally exude elegance. i adore you and your energy',242);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6923,'vv_N_vK3OJw','i love literature. I''ve loved it for as long as i can remember. however, i grew up dirt poor and seeing the way  my parents, who both worked day and night, struggled to provide for us and meet ends meet gives me a pretty innate fear of falling into poverty as an adult. i want to provide for my parents and i want to be able to provide abundously for a kid if i had one. i am lucky enough to have received grants for college, and as much as ait hurts, i don''t intend to waste it on a major like English. that''s kinda just how it is. wish the world was different. not everybody has that luxury.',70);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6924,'vv_N_vK3OJw','this video arrived at the most opportune moment!!  i started off college (i''m currently a sophomore) with studying biochem and holy hell was it torture. before starting college, i thought i really liked science and it is what my parents dreamed for me to study, even most of my cousins have studied something stem (science, tech, engineering, and math) related. while i did ok in my first semesters, i felt REALLY depressed and suffocated. my mental health was at its lowest, it was a terrible time for me. i realized i did not like what i was studying at all and the pressure i felt from my family made it much worse. a week ago, i talked with my academic advisor and we discussed about changing majors, from biochem to english. let me tell you, i breathed a sigh of relief and almost broke down in front of her when i was able to switch to an english major.',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6925,'vv_N_vK3OJw','I majored in Biology with minors in chemistry and philosophy. Always loved reading and sometimes I wish I majored in English. I want to start writing soon but I just need to find the time outside of my scientific career lol. Like you, I’ve always seen myself as a bibliophile but was frequently discouraged from studying the arts. I kept reading and I now have a small personal library. I love the feeling of just thinking and getting lost in a book; dissecting the words and the scenes they provoke in my mind. You brought up some good points and relatable experiences. Thank you',158);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6927,'vv_N_vK3OJw','As an artist/writer myself it has always been a hobby of mine and now I want to turn it into a full-time passion/job. But I am currently in college with my psychology degree because being an empath is also comes natural to me and I want to help people. So I have a lot planned for the future and hopefully I’ll have a work published in less than a year and a half',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6928,'vv_N_vK3OJw','this genuinely assisted me in attempting to find my passion in itself. thank you',82);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6930,'LIYiThAyY8s','Jane Austen also teaches us not to be to tough on introverts, they turn out to be her most worthy characters.',959);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6931,'LIYiThAyY8s','"Life seems but a quick succession of busy nothings" - Jane Austen',731);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6932,'LIYiThAyY8s','These videos have opened my eyes to the beauty of philosophy and literature. It''s such a comforting feeling to learn that the questions and often sad thoughts in my head have been thought of and so thoroughly worked on by these great men and women in the past. In the past two weeks since I''ve started to watch these videos, I have seriously reconsidered many topics and views I have on life. It''s a shame American core curriculum doesn''t require the teaching of philosophy and reasoning. If more people learned and discussed these issues, it could make our societies and lives so much more fulfilling..',292);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6933,'LIYiThAyY8s','Can you make more videos about women, please? (Sylvia Plath, Simone de Beauvoir,  Virginia Wolf, George Eliot, Harper lee, the Bronte sisters, etc)',496);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6934,'LIYiThAyY8s','Kudos to the animators of all the episodes. I don''t think they get nearly enough appreciation :)',116);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6935,'LIYiThAyY8s','yes, her novels" make us laugh."  Don''t forget to emphasize how witty and funny Austen is.',140);
