Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6264,'gQSdNZGUgIU','There is no way they could quarry granite with copper tools yet alone transport the blocks 100s of miles and have the blocks fit so perfectly together.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6265,'gQSdNZGUgIU','One thing that this is proof of is that mankind was a lot smarter and a lot more advanced than we give ourselves credit for, I’ve believe the pyramids were made by manpower and engineering my entire life. They probably didn’t quarry the stones they probably made them, and it’s very well possible to pull that stone if you but 100’s or even 1000’s if people to pull it. I also believe they used larger animals like elephants to help pull them quicker. Plus mankind was very strong and not fat and lazy like now so yea you get a bunch strong people to pull it they can I’ve seen power lifter body builders pull big rigs by themself, they probably had some kind of technique they made it be able to move and where they made the stones was probably close by',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6266,'gQSdNZGUgIU','I''ve already seen the ones in my country, (Mexico-) now I''d love to see the ones in Egypt!',18);
