Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6270,'gQSdNZGUgIU','I don’t think it was “aliens”. They didn’t travel through space with advanced technology to build rock monuments. I think their would have been some metal in there.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6271,'gQSdNZGUgIU','I defer to geologist. Geology is a true science. Archeology, not so much. Nobody can explain how they were quarried, transported and built. The fact that Egyptologists (not scientists btw) stick their story of when they were built is outrageous.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6272,'gQSdNZGUgIU','I still kinda believe that the great pyramid in Giza was there long before the Egyptians and the other two failed Pyramids were their attempt to recreate the first one.',72);
