Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6274,'eO1ElsB6FzY','“World governments lay in ruins, major cities smolder from the attack and those who have managed to survive struggle with a sparse food supply” That’s a description of the present day lol',234);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6275,'eO1ElsB6FzY','If they''re much more advanced technologically than us, they''re most likely highly intelligent. Also, if they have the capability to get from wherever they''re from to here, their ships are most likely gonna have shields or armor that can resist our weapons. Travel between the stars requires protection.',214);
