Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6278,'eO1ElsB6FzY','I believe that with few exceptions any aliens that are extremely advanced would be kind and beneficial to mankind and might only want to observe and not interfere with our development.  If they are that advanced they don''t need anything we have or Earth.  They would have the intelligence to produce it themselves.',28);
