Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6283,'eO1ElsB6FzY','This still makes the aliens too primitive and human like. More than likely they''d just turn everything off like a giant emp, and use some sort of frequency that affects our nervous system, knocking us out, then they come down to collect what they want or to take over. Is it exciting, full of action, giving the humans a chance to take a stand? No, but it''s more efficient and something an advanced species would do.',9);
