Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6936,'LIYiThAyY8s','What''s even more crazy is that Jane Austen wasn''t formally recognized as a great writer until the 1920''s! During her life, people did not largely read her work, and it wasn''t until many decades later when a Harvard Scholar wrote a seminal paper on her work did she finally get attention!',107);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6937,'LIYiThAyY8s','J. Austen ,Pride and Prejudice is the first novel i read when i learned english, i still found it difficult but beautiful as i improved. i was mesmerized at her writing , how well she could work on the carachters. thank you for making a video of her life, she was amazing writer',57);
