Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6940,'nllDcnfoH5A','I could have listened to more than an hour on this subject alone.  Victorian literature is an enormously broad topic, with writers as diverse as Emily Bronte and Joseph Conrad.  I''d love to see you do a more expanded version.',133);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6941,'nllDcnfoH5A','Excellent video. I appreciate all your research.The victorian era is very fascinating to me. I especially like the mystery or adventure books of the era. My favorite are Doyle, Stevenson, Verne, Melville, Wilkie Collins, and Kipling (though not his more imperialist stuff) . Does anyone have any more classic victorian adventure authors or stories I should try out?',32);
