Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6943,'nllDcnfoH5A','Thank you for a great introduction to Victorian literature. I am especially impressed by how you''ve also highlighted other aspects of Victorian culture, especially its art.',6);
