Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6951,'N9dB9BZWDBU','Charles Dickens had what is called the "Beatles factor." His writing could appeal to both the smartest and the dumbest person in the room. Like the music of The Beatles.',437);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6952,'N9dB9BZWDBU','I don''t think that Dickens'' shortcomings as a husband and parent were a result of the difficulty of being great at two things at the same time but rather is an example of how difficult it is to overcome the emotional, spiritual, and psychic damages inflicted by an unhappy childhood. While he was able to turn his pain and suffering into art, quite an achievement, he wasn''t able to heal emotionally. It''s usually easier to deal with such things in abstract, intellectual and artistic ways. He was in many ways driven by his demons, and that can, surprisingly, take you very far in life, but it doesn''t make you a better person. In fact, the success may militate against real change.',405);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6953,'N9dB9BZWDBU','Fantastic explanation of Dickens'' appeal and what he was trying to do as a novelist.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6955,'N9dB9BZWDBU','I''m reading a Charles Dickens'' book for the first time and watching this video was really impressive. The strategy he adopted seems very powerful. Maybe we need more of this general awareness and less ready solutions at some level.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6956,'N9dB9BZWDBU','Dickens''s genius was in bringing characters, and physical objects to life. He was not being "seductive" he was making us relive his experience and making  people and places come to life. No one will ever forget Miss Havisham''s wedding cake, the character of Bill Sykes, or Mr Micawber. Once you encounter the scenes and objects and characters of his novels you never forget them.',95);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6957,'N9dB9BZWDBU','It really made me sad that this person was so great and dedicated in his work but at the same time at the expense of terrible relations with his wife and 10 children…it’s just so freaking sad. You can never have it all, can you?',9);
