Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6294,'UzAzytHg5Yk','Himmlers death isn’t entirely accurate. He was detained for a short time, and although it was reported that he had died from a cyanide capsule, he was thoroughly strip searched for such an item, and during his autopsy, it was noted that he had lots of strange bruises all over his face that were not present when he had arrived. Some suspect that he was beaten to death. Historian and YouTuber “Mark Felton” researched this very subject about Himmler in a YouTube series called “The Death of Himmler” I cannot recommend his videos enough. His videos remind me of what the Military Channel once was before it became the American Hero’s Channel, if anyone remembers that.',77);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6296,'UzAzytHg5Yk','I read a book about the Battle of Berlin and it talked about how those foreign SS units fought to the bitter end. Since many had no countries to go back to because they have been captured by the allies.',70);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6297,'UzAzytHg5Yk','Goering''s original message to Hitler was very concilatory and respectfully asked if a transfer of power was neccessary.  Unfortunately for Goering, the message fell into the hands of Martin Bormann, who despised him.  Bormann changed the tone of the message to make it look like Goering was issuing and ultimatum.',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6298,'UzAzytHg5Yk','What surprises me most with this video is how many people were aware of Hitler''s demise and whom tried to destroy his body. I grew up continually surrounded with ppl expressing doubts that Hitler had actually killed himself. It seems pretty clear that he did.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6299,'UzAzytHg5Yk','The Wahlter Wenck Story is pretty cool, absolutely insane that he manged at that point in the war to successfully attack and get the people out and save their lives. Sabaton made a song about it, Hearts of Iron.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6301,'UzAzytHg5Yk','Did not know about most of his cabinet took their lives. But killing their own children? That upset me, how could any parent ever think of doing that? I realize those types of deaths still happen today, just going to show you barbarism still exists. It''s not as if those children could be tried for war crimes. I think we all know those parents have rotted in Hell, praise the Lord!',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6302,'UzAzytHg5Yk','a topic could be for weird history, where did all the nazis go, like overnight the average Joe just seem to stop being a nazi, they held de nazification sessions and had admin for this, a very big interesting topic to cover.',52);
