Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6307,'yjmp8CoZBIo','12 years of One Direction today. Thank you, boys... Harry, Louis, Niall, Liam, Zayn... Thank you, for everything you''ve done for us, for being who you are and for the family we became. You saved me and I love you. I love you so much. ¿¿¿¿¿¿',312);
