Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6310,'yjmp8CoZBIo','Aquí estoy yo nuevamente, en su doceavo aniversario. Y aún lloro con tantos recuerdos, sin embargo soy feliz de verlos crecer como solistas. Siempre orgullosa de ustedes: baby Li, Ni, Hazza, Lou, y mi chico Zayn. Los amo para siempre ¿¿¿',150);
