Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6335,'dDzp4YXpzLk','Served in the 101st airborne for 3 years. Yes, soldiers are underpaid and basically everyone that isn''t an NCO or Officer lives below the poverty line Paycheck to Paycheck regardless of time in service. We had a Specialist named Kelly who was in for 20 years who had to deliver pizza''s to make ends meet. Second, I can concur with the soldiers being from all walks of life. I actually served with the son of the CEO of KABAR who always got care packages from his family and gifted knives to guys on base regularly. He coulda taken a high salaried position in the company but wanted to serve and be independent of the family for a bit',535);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6975,'gzeDQDbJMAU','Me, going into chemical engineering but still a literature nerd: watches this entire thing for no reason',2171);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6976,'gzeDQDbJMAU','This is exactly the type of person I like to be friends with.',2950);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6977,'gzeDQDbJMAU','I graduated with an English Lit degree two years ago at age 51. I had no idea what to expect in my first year. I took a sci-fi class thinking the literature would reflect a Star Trek type narrative. I was so wrong lol same with Science, etc. I learned so much. You are absolutely right every professor is different.',499);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6978,'gzeDQDbJMAU','I have a degree in English Language and Literature and I learned so much from watching this video! Goes to show how wonderfully unique each curriculum is xx',105);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6979,'gzeDQDbJMAU','As someone who just graduated with an English (and Women and Gender Studies) degree this is just what I needed! You have no idea how much I miss this kind of conversation and love for books. I''m lucky enough that all my friends are equally as nerdy about our love for literature, but there''s something about classes and passionate professors that I is hard to replicate. Enjoy it while you can!',296);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6980,'Jw7kdOK2qUM','a tip from a once homeschooled, college student, who read a lot of classics: read the annotated versions! read the ones with context! talk to people that are nerds about the historical context of the book! it makes it so much more fun to know WHY certain weird things happen in old books :)',6226);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6981,'Jw7kdOK2qUM','as a beginner to classics myself, i would absolutely recommend the picture of dorian gray to just about anyone. it’s short, quotable, but also uses such accessible language.',4195);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6983,'Jw7kdOK2qUM','The metamorphosis by Kafka is super short, easily digestible and laugh out loud funny in an absurdist sense. 10/10 would recommend',967);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6984,'Jw7kdOK2qUM','Oh my god finally, a booktuber who talks about the kinds of books that I like. Nothing wrong with YA or fantasy, i just don''t like it but it feels like it''s the vast majority of the online book community. Can anyone recommend me more booktube accounts like this one?',1459);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6985,'Jw7kdOK2qUM','I feel like pride and prejudice by Jane Austen was the perfect introduction to classics for me because I was so familiar with the plot that the language wasn’t insanely difficult!',349);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6986,'Jw7kdOK2qUM','Really needed this because I have a weird relationship with classics. I haven’t even started Frankenstein for the book club because I’m genuinely scared lol.',707);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6987,'Jw7kdOK2qUM','For people who want to try Shakespeare but are intimidated by the language, I always recommend the No Fear Shakespeare publications that have the original language on one page opposite a "translation" in more modern language. We used them in high school when we did theatre productions to look at different interpretations of the phrases',164);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6989,'Jw7kdOK2qUM','I started reading again this year. I was probably only reading 2-3 books a year for several years straight. For a literature course, I had to read  Persuasion by Jane Austen.  I fell in love with it and finished it in a day. It''s also very short compared to her other novels. It kick-started my reading again and I''ve read 20  books so far this year! Not a crazy number compared to other''s, however that''s a huge leap from only 2 books a year.',663);
