Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7003,'qg8E-rdG6W4','This was great. So often sitting at my desk (ten metres from my bed) even seems too much effort so I just work sat in bed. Some days (rarely) I get as far as leaving the house...',57);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7004,'qg8E-rdG6W4','Thank you for the video. I am currently applying to Ph.D. programs in literature, but I have a big question that I''ve been too afraid to ask anyone: For what purpose do we analyze literature? What concrete impact do we have on the world? Engineers build structures and innovate commodities that hopefully make our lives better. Accountants and economists impact financial situations. I''m serious: What do we do? Teach? Write books? Change hearts? Ideas?',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7005,'qg8E-rdG6W4','Found this video while watching ''Day in the life'' videos of other PHD students. I''m incredibly happy that I did. Thank you for the sheer gold comedy. Subscribed.',3);
