Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7007,'qg8E-rdG6W4','Well, you have convinced me to pursue a life in academia studying literature!! :D',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7008,'qg8E-rdG6W4','Hi there! I''m actually preparing to do my Phd in abroad. I know this unusual, but you would consider chatting over skype or something to talk about certain things regarding the application process, the life of a phd student and just your overall experience regarding this subject? I promise I''m not a weirdo or a serial killer ¿',2);
