Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (8438,'JaqesAupcVA','latte is so incredible. i am a teen and struggle with anxiety, depression, ocd, adhd, paranoia, body dysmorphia and gender dysphoria, ptsd, and dissociative issues as well as chronic pain, so it is usually very difficult for me to feel relaxed and fall asleep. i discovered latte two years ago and it changed my life. she is so soothing and comforting without being condescending, annoying, or repetitive and her videos are always incredibly high quality. i’ve watched all of her videos (including the ones in languages i don’t understand) and there wasn’t a single video i didn’t like. i love and appreciate latte so much <33',28);
