Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (8441,'JaqesAupcVA','This woman is one of the few asmr tists who got exactly the concept and mastered the practice. Some asmrtists, as fine as they are, do not have the sensibility to sometimes avoid some triggers or noises that can actually bother the most sensitive listeners. There are patterns of sounds, which means some sounds will cause relaxation, other sounds might bother one same person and many youtubers don''t realize that these cannot be mixed. Me, for an example, hate very high pitched noises, hate plastic and eating sounds. Latte could never have a disturbing plastic noise on her videos. She just knows what''s up.',586);
