Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6336,'dDzp4YXpzLk','A lot of what he said in this video is correct. You ASVAB determines what MOS or military  occupational specialty you can go into. I was US Army 1986-1998. I like how there are movie references in the animation.',305);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6340,'dDzp4YXpzLk','I will say... being enlisted in the Marines for 5 years was nothing to write home about, but having them pay for my $120,000 degree with housing allowance while I worked full time (once out) was absolutely mint.',91);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6341,'dDzp4YXpzLk','As a Marine with 7 years of service, I can say that hazing 100% exists and is an integral part of Marine Corps basic training. Full Metal Jacket was the most accurate representation, but it’s more than that. Also, you don’t shoot unless it’s to kill. Not to disarm, not to scare, but to kill. And if you’re with anyone that’s afraid to do so, you can’t trust them to have your back.',270);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6342,'dDzp4YXpzLk','my great uncle served 2 tours in Vietnam as a medical huey pilot, he came back with PTSD and his episodes are usually panicking or scans the room, he only got violent once when a burglar triggered him when he pulled a knife on my great aunt, the guy is currently still recovering in the hospital 3 months later',206);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6343,'dDzp4YXpzLk','When I was drafted in 1964, my starting pay was $99 per month.  When I  got married later that year, my wife''s allotment of $230 per month was more than twice my base pay.  And, when I was injured in a role as support for a certain civilian agency violating the law in southeast Asia, I was called a liar and threatened with a court martial.  I am proud of my service to my country, but being in the service ducks.',34);
