Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6360,'9cdUxZuarL0','This, like so many other documentaries, just barely scratch the surface of the secrets these ancient times and civilizations keep. I believe we will never truly fathom the depth of their engineering feats.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6361,'9cdUxZuarL0','I never tire of learning Egyptology. Well produced and sophisticated TV.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6362,'9cdUxZuarL0','I love engineering an empire it shows a complete timeline of rulers from emperors to kings to pharaohs.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6363,'9cdUxZuarL0','Such great shows. Egypt, Aztecs, the Mayans. I love The History Channel!',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6364,'olTClLF9JuQ','It''s like Netflix for history... Sign up to History Hit, the world''s best history documentary service and get 50% off using the code ''TIMELINE'' https://bit.ly/3dPKsuC',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6365,'olTClLF9JuQ','I grew up in the shadow of Cahokia and it has been extremely influential in my appreciation and reverence for all peoples. In college we excavated a game processing camp many miles from Cahokia and the enormity of the resources needed to feed their rapidly expanding population was an incredible story all on its own. I appreciate how thoughtful and well made this documentary is and hope more will be coming in the near future.',422);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6366,'olTClLF9JuQ','There are a lot of unique aspects to this video that I really enjoyed, the small sample of languages, even the hunting reenactments.  Native American cultures are so interesting and diverse, they’re just endlessly fascinating.  I hope the native languages will always be preserved, there’s always resistance by children, especially teenagers, to adopt the more conservative aspects of their parents’ culture.  I remember listening to a Navajo radio station near Window Rock, AZ, and when the “required” traditional song was finished, the young DJ said “that’s enough of that (bleep), the tribe makes us play these!”, then put the latest rock back on.  This is universal, not specific to any cultures, kids around the world always want what’s new!   When they eventually have children of their own, they’re glad they received the traditional culture and want to pass it on.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6367,'olTClLF9JuQ','What an amazing story is being uncovered and told!  So many generations, so many lives, so many experiences!  We owe a great deal to those that came before us and should pass on the best of what we have learned to those who will follow!  We are all different and unique, yet we share what is most important: humanity.',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6368,'olTClLF9JuQ','What I always found interesting growing up in S Louis is that the Mississippi Indian Empire had its capital in what is Cahokia, IL but that they buried their dead on the other side of the River in S. Louis.  So Downtown S Louis is built on top of a massive ancient Native American Cemetery.',130);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6369,'olTClLF9JuQ','I wish you guys included the myths and stories of the Indigenous people''s of the Western Hemisphere.    They''re very interesting  and similarly eerie to some of the stories of Europe',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6370,'olTClLF9JuQ','I very much enjoyed this documentary and learned much from your most excellent examples and explanations.  I grew us with the Sioux in the Dakotas and was always intrigued by these peoples.  Thank you very much for your well-written documentary.',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (6372,'olTClLF9JuQ','I can see both the Beringia and ocean voyage being suitable paths to settle North America.  Due to the ice sheets the ocean could have meant more southern paths leading to Southern North America and South America settlement.  The Solutreans could have come across the Atlantic south of those glaciers into East North America.  Then all groups could have spread across the continents and mixed.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7013,'WcMWPIK0ysk','Seneca suggested to his friends that instead of reading ever more widely, we ought to focus on the works and authors that really inspire us.  Most readers don''t do this so their thinking tends to be dominated by the last few things they''ve read and they end up struggling with all these conflicting truths living inside them.  Seneca thought our time was better spent developing a deep understanding of ideas that are truly important to us rather than surveying a wide range of opinions without deep contemplation and reflection.  And in addition to the chance to read a book with a different purpose, re-reading is worthwhile because while the book stays the same, if you pick it up again after a few years, you''re a different person and that allows you to see it in a new way.',92);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7014,'WcMWPIK0ysk','Me, an English literature undergrad: chuckles nervously',338);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7018,'WcMWPIK0ysk','First of all, I want to say that I am genuinely in love with your essays. Second, I want to say that everything you say resonates in me in one way that I never experimented before: maybe this channel is what I was looking for. And thirdly... thirdly I want to say that I will stop commenting right now and start to watch the video! hahah',23);
