Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7041,'T2GIretcN_g','I’d love to see Andrew do more literature based videos. As a conservative patron of the arts, I feel pretty alone amidst the utter desecration of the greats by the left. Shakespeare has been cancelled in some universities in the UK (where I am from)',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7042,'T2GIretcN_g','Andrew, thanks for another great entry. Please consider turning this into a series. You do an excellent job making these classics feel relevant and essential for understanding and navigating contemporary issues.',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7043,'T2GIretcN_g','My husband looked at me in horror near the beginning of the video when I remarked I had not read any Plato. He then insisted I must read Plato''s Apology as a good start. Klavan then recommended Plato''s Apology... Guess I''m reading Plato''s Apology.',165);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7044,'T2GIretcN_g','His son, Spencer Klavan had a podcast, “Young Heretics”, that examines many of these books. I recommend it, especially if you tend to read books rather straightforwardly.',85);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7045,'T2GIretcN_g','Husband and I went to the Green Knight movie on a whim, not knowing what it was about.  We both absolutely loved it.  Thank you for reminding me about it, I want to read the story now!',35);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7046,'T2GIretcN_g','It''s a bit of a hard read at first, but "Le Morte d''Arthur" is another great piece of late medieval literature dealing with the Arthurian legend.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7047,'T2GIretcN_g','Excellent list.  I would also suggest that anyone interested in Western thought, art, and culture develop a basic understanding of the traditional Christian Mass since that is foundational.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7048,'T2GIretcN_g','I read The Great Gatsby for my AP Literature class and it is one of my favorite books ever. It''s fantastic and I had no one in my class who agreed with me. But everyone should read it, it''s a masterpiece.',53);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7049,'T2GIretcN_g','Freaked my mother out, but I remember read "The Iliad" when I was in Jr. High.  Not a class assignment, just on my own.  Talk about touching on every human emotion, act, etc.  That then led me to read "The Odyssey"',86);
