Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7051,'TdJxY4w9XKY','This was an unbelievable help. I had to write a 10 page literature review in approximately 24 hours because like any good grad student, I procrastinated. What I saw as a daunting task was quickly made easier after watching this video. I broke down 10 different peer reviewed journal articles into their own segments, then combined them. Added an intro and a conclusion and voila I was over 10 pages. I might make it through grad school after all.',194);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7052,'TdJxY4w9XKY','David, I used your guidance in my thesis for my dissertation.  The quote from my committee memebers about my literature was as follows, "This is the best literature review I have ever read and I have read a lot of them"  David, thank you, just great stuff in your videos.',117);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7053,'TdJxY4w9XKY','Thanks David, your help with this literature review during a pandemic, literally meant the difference between me passing or failing. Thank you so much.',345);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7054,'TdJxY4w9XKY','It is so amazing how one becomes so motivated to start working on something as soon as they begin to understand it. I have been putting off my lit review for 3 weeks because I did not really understand the 24-page document given to us by our tutor but after watching this video, I''m now so confident and fully understand what exactly it is that I need to do for my assessment. Thank you for such a wonderful and informative video.',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (7055,'TdJxY4w9XKY','This should be required watching for everyone writing their first literature review! The example is very helpful and I feel so much more prepared after watching :) Thank you!',13);
