Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18321,'opb2Bq4Qvyo','Just about to finish my first year studying statistics. A short course was about machine learning so I have some knowledge and understanding of machine learning so this was a very interesting video. We got to use and tweak different types of predictor models. We split the available data into training and test data and then used the training data, which included the outcome variable, to build the models and the test data, which didn''t include the outcome variable, to test the models and later compare their results to the true outcome variable',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18322,'opb2Bq4Qvyo','Good interview! But as someone who has already know the concept of data science and machine learning, I''m actually interested to know what are the differences between a data scientist and a ML engineer. Hope this question will be answered in a future video :)',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18323,'opb2Bq4Qvyo','Hey Ryan or Clement or both lol! quick question.  If you had to place these in certain categories for their specific uses/what each one excels at, what categories would you put each of these machine learning frameworks/tool kits (Tensor Flow, PyTorch, mxnet, and Hugging Face) in?',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18324,'opb2Bq4Qvyo','Thank you Clement. We need more interviews with ML engineers in your channel.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18325,'opb2Bq4Qvyo','I really hope Ryan starts a machine learning podcast or something. Its something I can pay for.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18326,'opb2Bq4Qvyo','Hi, I have a question. I am currently doing a master in mathematics with a focus on ML and statistics, but mostly theoretical. How could I transition to becoming an ML engineer. Is it enough to learn how to implement these models in Python or is there something else?',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18327,'opb2Bq4Qvyo','I believe that machine learning should be used more selectively than it is now.',6);
