Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18329,'G7fPB4OHkys','Thank you simplylearn for explaining Machine learning in the most precise and ambient manner. I have been wanting to learn machine learning since a long back and today i scouted for your video. this seriously helped me learn The basics of machine Learning. Once again Thank you so much',1);
