Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18352,'T4MLrtOKPjY','All I want to say that you are a blessing and I commend your dedication and effort. Even coming from a PhD in computer engineering your materials have helped me a lot. I wish you the best in all your endeavors.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18353,'T4MLrtOKPjY','I was searching all around the internet for something like this. Most I found are saying that we need to start with *insert ML related topic here*, but I felt that something was missing. When you started by saying that a good ML engineer should first be a good software engineer, I knew right away that this is what''s missing. It makes complete sense to start there and then move up the ladder. Thank you for taking the time to creating all of this.',18);
