Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18360,'AO6urf07KjE','In my eyes, the second con is the worst thing that can happen to you in ml. In many cases I would eagerly wait for about 5-6 hours for the model to train, to see it not work at all in the way I intended. I''d keep training the model day after day after making small changes in the  code to see its performance not getting better at all.',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18364,'AO6urf07KjE','I''m a data scientist and 95% of my job is data collection and preparation, it''s still a cool job but it''s not all model development',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18366,'AO6urf07KjE','The only thing holding me back is that it took about 30 mins to implement a classification algorithm with a data size of around 20 numbers on a powerful laptop. It was straightforward and a lot of fun but when the size of the data increases, it might go on for even a week with GPUs. It pays well but so does frontend development at any decent company. This video didn''t give any valuable inputs to make a decision',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18367,'AO6urf07KjE','IMO, Machine Learning is a lot of math. It is very difficult to find an interesting job without advance degree if it is the goal of learning ML.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18368,'AO6urf07KjE','Tim you should post more about machine Learning. Also please try to make a video on how to use the model for production. It will be really helpful!',1);
