Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18370,'7ClLKBUvmRk','Excelente explicación Haydé, conceptualmente logré relacionar el machine learning con mi carrera.  Gracias a ti, a tu mamá y a tu tía ;) "No entiendes realmente algo a menos que seas capaz de explicárselo a tu abuela" A. Einstein.',49);
