Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18372,'7ClLKBUvmRk','Muchas felicidades por los logros y excelente trayectoria Haydé. y muy buena explicación. Keep it simple !',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17032,'O9nf1CqjGzI','Hi Shane, the actuary here who has commented on your channel frequently.  I would just like to point out that actuary is a special case of data scientist.  The skill sets are extremely similar, and also, there are many data scientists who are hired by insurance companies.  I haven''t finished watching your video yet but I already know, this is a REALLY good one whether in or out of insurance.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17033,'O9nf1CqjGzI','Shane, I would highly recommend looking into sub reddit information. I looked into data science and when you go to the data science subreddit you will see how it is nearly impossible to get a job in data science. Usually people will go into something like Business analyst to data analyst to data scientist as a means of going up the scale. Also these subreddits will help you get a better idea of the requirements of different jobs. For instance in IT career questions even though IT may be a fantastic career eventually the vast majority of entry level starts at helpdesk with a salary of $15-$20 an hour and is there for a few years before being able to make something like sys admin.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17034,'fUpChfNN5Uo','Thanks Alex for all the advice, I finally landed a job as a data analyst at a tech startup. If anyones interested, I made 143 applications, had 7 interviews and got 3 offers. The process from starting the google course to landing a job took just under 3 months (I was unemployed and working on this full time). Hope that helps anyone who''s looking for their next job!',487);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17035,'fUpChfNN5Uo','Dear Alex... In 2 or 3 years from now I will look back at what I have achieved and I am pretty sure your channel will be one of the things I will be more grateful for... Thank you for all the important information you share here!! All my admiration from a Venezuelan young student living in Europe! :)',249);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17036,'fUpChfNN5Uo','Amazing video Alex! Can''t believe I''m just watching this now haha. I''m a data scientist at a larger company and I wanted to also comment that there''s also the data engineer role that is becoming more hot and covers the data cleaning and dashboard creation part :)',124);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17037,'fUpChfNN5Uo','Great job on being concise in your comparisons between the two different job titles! I begin my master''s in data science this January! I do plan to start applying to data analyst positions in the spring after I get my Oracle Database SQL Associate Certification, and may consider going for an AWS Cloud Practitioner certification as well.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17038,'fUpChfNN5Uo','Hello Alex, I currently hold a masters in healthcare informatics. I am having trouble finding a job in my field. I am wondering if I should be focusing on data scientist or data analyst. I don’t have much experience when it comes to SQL, Python etc . I am wondering if I should consider enrolling in a data analytics Boot Camp. What are your thoughts?',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17039,'fUpChfNN5Uo','Hey Alex, I''m a medical student who would love to work as a data analyst on the side, I found out there are no data analysts in the hospital I train in so I''ve been studying R programming since July, I got an online specialization in "R programming for public health" from the imperial college of London and an R programming course from John''s Hopkins University, along with other research courses, I''ll be introducing myself to the the doctors who conduct research in my hospital in January, do you have any tips for an aspiring data analyst?',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17040,'fUpChfNN5Uo','Hi Alex, you mentioned something about learning AWS/Azure for Data Analyst roles. Seeing that both of these cloud platforms have different courses/modules, where do you suggest we start from. Or is a generalist knowledge enough? Looking forward to your reply.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17041,'fUpChfNN5Uo','I really like how simple your explanation about DS and DA, very helpful. I have been thinking to trying pursuing on DS career by following boot camp and course online, despite of my background as bachelor of economic. Did you have some insight for non-STEM background to undergoes this path? Thank you.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17042,'fUpChfNN5Uo','Hello from Italy Alex, as a Data Scientist i can say that we are more focused on deployng new models into a business process that drives direct value, so the project management and the engeneering skills become really important (unix, professional coding, sql, git, spark, concept of testing and so on) because you have to ensure that the pipeline works in every situation even when you have really bad or poor annotated data. i don''t think that you need a phd cause the algorithm that you use are pretty popular in the community (xgboost, bert, resnet and so on).',81);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17046,'xpIFS6jZbe8','So I have decided that 2022 will be the best year of my life. I''ve started learning Python on 1st day of the year and up till now I have covered most of the basics and made some simple programs as well in last 20 days. So far it''s going good. Thank you for this video. I wanted to ask, when should I start practicing on Kaggle now? I Study around 1-2 hours daily after my job and 3-4 hours on weekends...',177);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17051,'xpIFS6jZbe8','I’ve been waiting all year for this! ¿¿ Solid advice Ken!',45);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17052,'xpIFS6jZbe8','Great advice on typing out other people''s work. Myself as a beginner it''s easy to get flustered on projects as some solutions/tools I have not yet been exposed to. By looking up other''s solutions/work and typing them out it really helps me to understand the anatomy of the code. Furthermore, sometimes the solutions don''t work as I am using python 3.10 and so I have to work out and start fishing around for the latest ''iteration'' of the module/code and that actually helps to drive home the knowledge.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17053,'xpIFS6jZbe8','This video is extremely accurate. I have had such a hard time learning how to be a data scientist. I am in a MS in Data Analytics program and feel that doesn''t really provide any real direction. I don''t know what I don''t know and that keeps me from learning what I need to know. Seeing the path helps, thank you. I would like to say I have struggled to learn R and I seem to be getting SQL quickly and I think this will help my confidence. Getting one language down can help to learn another, just from a confidence standpoint.',19);
