Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15448,'JbTvmqtskYY','When I was a kid in the early 90s you could still write a sloppy hand written 4 page letter with crayon drawings and send it to Nintendo of America and they would immediately write you back answering every single question you had no matter how dumb it was, and complementing your crappy drawings in detail. I think my Dad might still have some of their response letters in his desk. Those days are long gone.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15449,'JbTvmqtskYY','You’re 100% right. Everyone has to decide for themselves how serious this stuff is but at the end of the day there’s a lot of virtue signalling going on. Also, while we’re at it, let’s all admit that as much as people like to hate Kotaku, at least they’re willing to report this kind of stuff.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15450,'JbTvmqtskYY','Here’s a hot take: Most hardcore gamers/tech workers who would in “nerd” stuff are going to be a bunch of socially awkward weirdos. This is why these things happen at all gaming companies and places like Gencon where they virtue signal but these virtue signalers are the ones who commit assault and/or harassment ¿¿¿¿',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15451,'JbTvmqtskYY','No new concept was added to my life with this video. Maybe it will help someone out there to see companies as companies, not friends.',60);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15452,'JbTvmqtskYY','It''s good to see that you''re always willing to speak your mind. In a time where anybody that speaks up on anything, will be bashed and harassed for being honest. The direction things are going in general on speaking out is sad.  Appreciate you and your brutal honesty brother.  ¿',77);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15453,'JbTvmqtskYY','I like Nintendo games but not people who commit sexual harassment, which happens in too many places. Men and women do act in unsolicited ways towards others.',40);
