Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15486,'xvCmnfVQQRE','I''d like to see a 4K docked and 1080p handheld successor to the Switch that''s backwards compatible and more powerful with better graphics, online and frame rate too.',101);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15487,'xvCmnfVQQRE','What I need going forward is a Nintendo Switch successor that is backwards compatible and offers improvements to previously released games. I need to play Xenoblade Chronicles 2 and Torna over again in true 1080p or at 1440p whether it be 30fps or 60fps. I just want them to be clear with further and more saturated draw distances and that dynamic resolution removed.  Of course this would benefit many other games but I haven''t NG+ XC2 because I am hopeful I''ll get to re-experience improved on new hardware.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15488,'xvCmnfVQQRE','I actually feel Nintendo should probably leave their next gen design choice at the Nintendo Switch level. It''s the perfect system whether you want a home console, portable or both. They should just focus on upgrading hardware on each gen or giving it refreshes with better design implementations like joycons with pro controller sticks. I''d also like to see more things the Switch could be paired with ..like linking to discord and Spotify and having them run in the background.',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15490,'xvCmnfVQQRE','Given Nintendo''s track record with moves that make sense, they will use this feature sparingly as they did with cloud gaming and file transfers.',46);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15492,'xvCmnfVQQRE','I wonder if No Man''s Sky coming to Switch in October will incorporate some of this ''new'' tech we''ve been seeing more of. Seems like a game like that will need all the help it can get to run smoothly on the Switch. I''m still really curious to see how it turns out. Likely will either be a pretty solid 30FPS or 30FPS with frame drops and low res. I suspect the low rest automatically in either case but I never played the game so I''m interested to possibly give it a try if it''s a half decent port.',3);
