Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17609,'bbTGeRMy8oQ','Based on their Fiverr pages the first game appears to have cost $25, the second $35, third $5, and last one is listed at $30. I would have to say #1 was easily the best investment.',642);
