Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17611,'bbTGeRMy8oQ','The first one definitely felt more varied and had more to it, compared to the others. Which, they DID do what they were requested, but the other 3 just looked...generic in a way? While the first had enemies with AI that would attack you, interesting level design, and the movement and gunplay had more personality to them(being able to move the gun in any direction, using recoil to jump/lift off the ground), as well as different types of guns to play with. I guess it just had more polish to it, compared to the others too.',187);
