Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17613,'bbTGeRMy8oQ','What were the costs for each one? That''s very important. The first one stands out a lot. The others feel very dull.',299);
