Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17617,'286SGzpUx9o','Been in game development at least 14yrs now, I literally lost track. Greatest advice given here is to target a niche and do something special: platformers and zombie games are a dime a dozen. Pick out something unique that''s cool, maybe something that no one has done in many years. That''s how Stardew Valley blew up on Steam.',508);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17618,'286SGzpUx9o','Tip #1 can’t be stressed enough, I spent my first year learning courses on coursera and udemy, thinking I’d get into game design once I’m “ready”. That day never came, no matter what I learned I never felt ready yet. Then one day I just started working on my project and said I’d learn new things where I needed to. Honestly doing things this way made me progress faster than any course ever has',112);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17619,'286SGzpUx9o','I have to agree: There is no shame in having the docs open all the time. Memorizing everything isn''t what gives you skill. The important skill is knowing where to find the details when you need them.',52);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17622,'286SGzpUx9o','You didn''t waste those 2 years. You learned so much. You did so many things. These things add up in the future. We think we can learn everything in YT videos, but experiencing it firsthand gives you a much deeper understanding of things',58);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17623,'286SGzpUx9o','Shaders were super intimidating, but I spent a weekend learning them, and am so glad I did it. I feel pretty fluent in them not even a week later, and have been using them nonstop. I needed to use them for one effect, but the applications where shaders are useful keep appearing. It’s definitely a tool worth having in your arsenal. And like visual scripting vs actual coding, being able to write your own shaders allows you to do performance things you wouldn’t be able to do with visual scripting a shader.',70);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17624,'286SGzpUx9o','Imo something that''s Extremely underrated, especially for programmers is learning to use programming design patterns early on. Observer pattern is a MUST for game dev with larger projects. Having objects that fire events and other objects that subscribe to them is a much more sustainable way to do things than having a million references in each class to other objects, and it makes your code more modular (each class/game object is its own self contained thing). Singleton and Factory patterns, as well as SOLID principles are also good to look into. Factory less so for Unity since you can use GetComponent to retrieve references for things. If you''re using Unity, learn to use Unity events/C# events and you will make your code a lot cleaner and save time on large projects.',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17625,'286SGzpUx9o','Yes if you think you might want to add multiplayer / co-op you really should do it from the start, suddenly you have to validate everything your players are saying they are doing along with replicating all the right properties without flooding the network and your animations and simulation has to be on point since players will be doing crazy things that AI just wouldn''t / we would give AI a pass on',34);
