Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16223,'oHDi01Yn4tY','1:13 essa transição do Namor criança para ele adulto já como rei é sensacional. Só isso já passa toda a imponência do personagem. Tava em falta um personagem assim na Marvel, já que transformaram o Thor em um palhaço.',261);
