Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16226,'tgB1wUcmbbw','Thor’s lost his Brother, Sister, Mother, Father, Friends, Warriors Three, The Avengers, Girlfriend, Mjolnir, Home & People. Yet he’s still standing. He’s a true source of inspiration, that’s why I look up to Thor.',1059);
