Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16230,'tgB1wUcmbbw','Just compare this version of Thor from the Thor in the very first Thor movie, truly eye opening how much development he’s had as a character.',261);
