Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17065,'J68XETxye7g','Senior Econ major, I got an internship with data analysis. I hope to apply for a Data Science internship next semester. I love data science and I''m so glad that my major falls with most requirements. This channel was one of the reasons I started pursuing data science.',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17066,'J68XETxye7g','Shane, you should interview people on your channel that work in these fields. There''s a pretty big community on YouTube of data scientist. You can talk to people in all type of careers honestly, there''s insight they can bring that you only get by working in the field.',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17067,'J68XETxye7g','I''m trying to curve my career into the tech field after struggling for a few years with a worthless bachelors. I have some healthcare and stat software (SPSS) experience but no coding/data analysis experience. Would it be possible for me to get started in this field, and what are some job keywords and skills that I should look for?',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17068,'J68XETxye7g','Well explained topic, thanks. Data rules the world, and for businesses of all sizes, it’s vital to effectively collect, store, and analyze the data to stay ahead of the competition.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17070,'J68XETxye7g','Can you do a registered nurse overview!!! With this new video format, I think it’d many people with a more concentration inspection into the job',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17071,'J68XETxye7g','I love seeing these videos from your channel pop up on my notifications. You should do a poll on youtube to see what career we want to see next.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17072,'J68XETxye7g','Please do a video on the importance of top ranked universities in real world',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17073,'J68XETxye7g','Sweet! I would also be interested in Business Intelligence jobs.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17080,'rqvyWUODZGE','Asking if Data Science is dying would be like asking if engineering or medicine is dying. There will always be a huge demand for these sorts of careers. Tons of people thinking they want to do them is a byproduct of that. But just like engineering and medicine, most people who think they want to be in the field can''t really hack it (for whatever reason). If you are someone who is smart and hard working, you don''t have to worry about the field being "saturated." Most of that saturation is from people who aren''t very good or who call themselves data scientists because they completed a mooc or two. There''s a huge difference between completing certs and degrees and being able to actually do things in the real world. The wheat gets separated from the chaff pretty quickly.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17081,'rqvyWUODZGE','The whole data science industry is booming from analyst to engineers to scientist and you will see domain experts leading this field more and more',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17082,'rqvyWUODZGE','What a beautiful and insightful explanation of the dynamics of data science. It is true that data science demand is growing exponentially and what aspiring data scientists are fearful is lack of knowledgeable that DS is actually evolving and diverse. It is become more field specific and one need to master the area of expertise like health, business, banking etc in respect to the application of DS in it. Thanks a lot Thu Vu for your resourceful info.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17084,'5O9abIxIqNA','This video was soooo informative and encouraging. I’m a neuroscience major looking to enter data science after college and have been trying to focus my skills in learning R, data visualization, and statistical analysis. Class of ‘23!',168);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17085,'5O9abIxIqNA','not you being a literal life saver! im graduating early and i had no clue what i could do with my applied mathematics degree without going to grad school, and the way you describe this (the constant learning, the work environment) honestly makes this sound like the job for me :) thank you!',107);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17086,'5O9abIxIqNA','I so needed this video today! I just finished my Masters in Data Analytics and as someone who has always despised job hunting I was getting disenfranchised. But you have put the fire back in my belly! All of the great things you said about the career are all the reasons I started the Masters. So thank you for reminding me!',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17087,'5O9abIxIqNA','hey, awesome vid! I was a data analyst before I had a maternity leave and I wanted so much to become a data scientist because I think it''s a logical progression of my work challenge path. Unfortunately, currently I have different plans for my life but I wanted to say that you made me come back to my prev plans and inspired me again on the topic.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17088,'5O9abIxIqNA','Great video! I''m quite interested in pursuing a career in data science in the future, and I''m wondering if you''ve got any tips/tricks for someone who''s somewhat got his basics down. Looking forward to more of your videos!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17089,'5O9abIxIqNA','I have a very similar background to you. I am a former physics undergraduate that did research in high energy physics simulations, and that computational background really helped me transition into my current data science position. For any physics/math undergrads, you have the skill set to get into this field! The only obstacle is being able to express your math knowledge through code. If you can learn enough code to do that, you''re golden.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17090,'5O9abIxIqNA','Thank you for this video!  Currently applying for a Master''s in Data Science and this is great anecdotal support.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17092,'5O9abIxIqNA','Super informative thank you for all the info! I just switched majors from CS to I.T. And thinking of Pursuing a masters degree in data science. Do you think that the masters degree would make of a difference early on and for entry level roles? (Salary wise) Overall im just kind of trying to figure out where to go from here haha',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17093,'5O9abIxIqNA','Thank you so much for the insight on data science as a "new path". I have degree on agriculture and now I''m just starting on takin course, professional certification and etc in data science (I''m more interested into this stuff than my main degree tbh lol). Mainly just to get into DS job, and also getting new skill to go along with my main degree seems pretty nice addition,',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17094,'LHBE6Q9XlzI','Thank you for this course, sir. It was a great 12 hour journey. Coming from non CS background, I had little to no knowledge about all this stuff but this video has given me enormous amount of confidence that I can program and explore data science further. Thanks again!',69);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17096,'LHBE6Q9XlzI','Thanks for the course! I’m playing this at 1.25x speed and it’s perfectly understandable and saves a couple of hours of reproduction',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17097,'LHBE6Q9XlzI','Thank you for doing such a good service to the community by bringing such amazing quality content for free. I cant tell you how much I appreciate it. Lots of love and respect to the team.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17100,'LHBE6Q9XlzI','This course came at the right time... ¿ Gezz I needed to go back to the old drawing board because my python skills were not yet good enough to work on Machine Learning models haha',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15493,'xvCmnfVQQRE','I still love my Switch, but after owning the Steam Deck for a couple of weeks I have to say - Valve is doing a substantially better job supporting the Steam Deck then Nintendo is the Switch. I''ve already got more updates that have made the system even better in a couple weeks then Nintendo has in 5 years. Nintendo needs to take a page out of Valve''s playbook here.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15494,'xvCmnfVQQRE','I’d love to see Monolith apply this tech, either FSR 1.0 or DLSS when the newer model drops, in an update to Xenoblade Chronicles 2. All the Xenoblade games are in my ever-growing backlog, so I think I’ll wait to see if this actually happens ¿',8);
