Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15503,'8nkTemr8AVY','OMG, just loved hanging out with you guys in this video. It really reminded me of the time some friends and I used to go game hunting in São Paulo... like, about 20 years ago. Thanks for bringing those sweet memories back. I would definitely LOVE more videos like this one. ¿¿¿¿',17);
