Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15506,'xc7d1iU7SVI','I''ve had my Steam Deck for about a month now and your reaction to the weight was EXACTLY the same reaction I had. Everyone says it''s "so big" but honestly when you hold it in your hand and feel that weight it makes everything go away. Amazing handheld.',725);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15507,'xc7d1iU7SVI','Personally I’d much rather a free carrying case then fancy unnecessary packaging. I appreciate a company that’s forgo paying the extra bucks on packaging and placing it into something more functional to the consumer in the long run.',855);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15508,'xc7d1iU7SVI','While I really have no plans to get a Steam Deck, I''m hoping that a little healthy competition for the Switch will make Nintendo step up their game with the next Switch (or with some sort of Pro model like the fans have been crying for for years)',277);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15509,'xc7d1iU7SVI','The Steam Deck is an excellent friendly competitor. Nintendo''s advantage is many great first Ip and tons of third parties. Not to mention name recognition, but the stream deck could make Nintendo focus on creating a Nintendo Switch Pro or Nintendo Switch 2 that has more power which I think is great because it puts more pressure on Nintendo to do better.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15510,'xc7d1iU7SVI','I think fancy premium packaging would be cool, but I like the fact that they are trying to be less wasteful in comparison to other businesses.',132);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15511,'xc7d1iU7SVI','The packaging feels really nice and Valve-like. They made it simple and homey (if you get me) and it feels like a homemade dinner in comparison to the Switches package which would be compared to a fancy restaurant. The outside doesn’t matter, it’s the inside that matters; this couldn’t be more true with the Steam Deck!',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15513,'xc7d1iU7SVI','One of my favorite uses for my Steam Deck was loading emudeck and having the virtual console I''ve always wished the Switch would be!',31);
