Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15526,'mxjMX7ziMNc','He specified "One Box exclusives", in the market those exclusives are necessary in order to get subscribers, if all the services are the same there won''t be no point in services, it''s like with Netflix and Diseny +, exclusive content but that is allowed to come out on Blue ray from Disney, but not on Netflix. Same thing for services.',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15527,'mxjMX7ziMNc','I love how some people are missing the point of his statement. He literally means “one platform” Xbox been doing this for years and now even PlayStation is slowing doing it',101);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15528,'mxjMX7ziMNc','You''re constantly putting out extremely well curated and delivered content. Thank you ¿',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15529,'mxjMX7ziMNc','I think Phil is referring to games coming to PC and mobile. As for Xbox games, it means the same but also where ever game pass is too. I seen a lot of PlayStation fanboys acting like Xbox will go 3rd party and all Xbox games will be on PlayStation',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15530,'mxjMX7ziMNc','Console exclusives aren''t going anywhere. They would be insane to split market share off of their hardware, their ecosystem and ultimately their control. Nintendo has dominated both Sony and Microsoft this generation with the unreal success of the Switch. They are the proof in the pudding that hardware and exclusives are still what drive the consumer towards the platform.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15532,'mxjMX7ziMNc','I think it''s a time of wait and see. Imo, we''re seeing all these investments because interest rates are low. If at the end of the process, Sony for example don''t see financial gain, I can easily see it reverting. We''re all hoping this works as gamers, but none of us know what the end result will be.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15533,'mxjMX7ziMNc','Phil Spencer said the day of the press conference welcoming Bethesda into the fold that it was about making games available on platforms where game pass exist so this is not anything new he''s staying consistent.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15534,'mxjMX7ziMNc','I would love to boot up my console and swap from Battlefield to Halo to Spiderman to Mario Kart to Pokémon within the same ecosystem but I just don''t think something like that will happen unless there is a third party neutral console that has all the subscriptions for each major player on it',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17651,'DyVRjp0Nf7w','I know I might sound like a dreamer but I really want to make a historical medieval first person hack and slash game with Total War commands like Mordhau and Bannerlord. I know it’s a huge stretch but that’s the end goal hopefully some day I’ll get there',531);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17652,'DyVRjp0Nf7w','This is one of the most inspiring videos I''ve ever watched. Thank you so much for this. I''m new to the game design space and one of my biggest hurdles has been feeling overwhelmed about my lack of coding experience. Seeing your journey of how you went from no coding experience to being able to code a game by yourself at your first game jam really did something for me.',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17653,'DyVRjp0Nf7w','As a gamedev who uses construct 3, this is really inspiring!',62);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17654,'DyVRjp0Nf7w','This is lovely to hear how you found a whole community and amazing that you spent so long persistently making stuff, especially over a year of daily art. I just discovered Core, but didn’t realise it’s a creation tool, I haven’t loaded it up yet and they described it more as an arcade full of games. I’ve had an idea for a cat game for ages since I got three kittens last year and they’re hilarious, I don’t suppose there’s a basic cat model to edit. I draw and paint some, but the oomph goes too easily, I just got back into gaming after a while and you saying ‘I was a bored artist’ resonated. I’ve been wanting to do more with characters I was writing a story for too, heck I even learned code a few years ago, but my passion for websites waned and I found I didn’t love battling all my errors enough to keep going. So this all seems fun ¿',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17655,'DyVRjp0Nf7w','The new Don''t Explode, looks so much better already, even you have came a long way with pixel art and animation! You''re doing a great job ¿',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17656,'ez_-GKJafMU','Very inspiring for my own journey of learning unity. So far I''ve been working on my own first project for 125 days.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17657,'ez_-GKJafMU','Your one of the best coders one YouTube, thanks for helping me on my journey',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17660,'ez_-GKJafMU','I love the idea of this, it''s a great way to see your progress when you usually don''t see it ;)',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17662,'ez_-GKJafMU','Cool ¿ I hope you can do this full time someday',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17663,'ez_-GKJafMU','Awesome! :D',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17664,'ez_-GKJafMU','nice video very inspiring and also handsome face',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17665,'ez_-GKJafMU','This motivates me',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17666,'L9VXp6vGc58','Thanks so much for watchin guys, and all your support! ¿ Remember, you can get 40% off 3D Art Pro, plus 2D Art Pro Free:  https://full-time-game-dev.teachable.com/p/3d-art-pro',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17668,'L9VXp6vGc58','I really appreciate "thought process" videos. Pressing buttons on the mouse and keyboard isn''t the difficult thing -  getting into the right mindset is the real beast. Thanks for this.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17670,'L9VXp6vGc58','I absolutely love of how you show the "dark" side of gamedev too, and not just make all theese videos about how to make your game great, it always makes it more relatable and helps with motivation for me. Keep up the great work!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17671,'L9VXp6vGc58','Thanks, Thomas for being so transparent in your journey as a GameDev. You level the playing field by showing us that the grass is not always greener on the other side. You expose the struggles and show us encouraging ways to conquer the challenges along the way.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17673,'L9VXp6vGc58','I found myself in several of those steps and I was already working on solutions for each of those. Well done Thomas for putting those feelings into words so clearly.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17674,'L9VXp6vGc58','Dude, I absolutely love the course, and thanks for including the 2D Art Pro for free!  Also, thanks for being so inspiring and encouraging, you''ve learned where the sweet spot is for making games, and hit it every time you seek to educate.  Thanks again.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17675,'L9VXp6vGc58','The same goes for all the careers and fields. There are always pros and cons. A risk-free life is the most dull and boring life.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17678,'Y3Rs1z7it5M','That''s a beautifull story bro! Congrats!!',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17679,'Y3Rs1z7it5M','Coding is what got me through the lockdown...lockdowns....keeps the mind constantly occupied',2190);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17680,'Y3Rs1z7it5M','I love how you stuck to your responsibilities while still going after your dream - freaking inspiring man',716);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17682,'Y3Rs1z7it5M','My dev friend asked me to write story for his game. I''m so stoked. I''ve been dying to get into writing for games. We''re working on an indie game now and this video is everything I need.',492);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17685,'Y3Rs1z7it5M','I''m in the position starting out in film as well. I''m very excited to embark on the game dev journey!',335);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17687,'sVVn1C3F87A','4:54 Totally agree with writing readable code, I just don''t think && and ! are the problem at all, in my opinion, if someone sees that as "hard to read" they should probably take a step back. I think bad/inconsistent indentation, confusing variable names, repeated code and organization in general are way greater problems that beginner coders do very often.',350);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17688,'sVVn1C3F87A','These were lesson''s I had to learn the hard way over my four years of development. Thanks for getting this crucial tips out there for people starting out!',186);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17690,'sVVn1C3F87A','Great vid! On the "controversial" tip, I agree keep your code readable! But I''d argue this is more about naming properties and functions, and not cramming too much on one line. Replacing !variable with variable == false leans towards being overly verbose to me (I would read !variable as "not variable" personally), but whatever makes it easier for you to understand your own code when coming back to it',86);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17692,'sVVn1C3F87A','My reflexive advice for someone that''s picking between art styles is, "err on the side of what you can crank out because you can more reliably finish that."',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17695,'sVVn1C3F87A','These are great! I''m working on my ANSI / ASCII Roguelike, and I keep getting caught up in tiny details like changing the color of the player and enemies when they''re frozen or poisoned, and tweaking the UI :'')',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17697,'I9G6xJTUCHs','The fact that the second game developer was paid less than minimum wage is upsetting. None of the artists were credited as well. Such a shame.',4733);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17699,'I9G6xJTUCHs','As a developer on Fiverr, i think all 3 (but especially the last 2) should''ve gotten paid way more. This takes at least a couple hours to build, even for an experienced developer, and Fiverr takes 20% of all your revenue. That''s not even half of minimum wage.',520);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17700,'I9G6xJTUCHs','Thumbs up for the developers in your video, thumbs down for you not giving them the exposure they deserve.',253);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17701,'I9G6xJTUCHs','I feel really sorry for whomever made the second game. They sold themselves short. I mean, you don''t owe it to the developer, but it would be really cool if your worked with them to make it a full release. If they''re interested. Also, could you give these devs a shout out?',14491);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17702,'I9G6xJTUCHs','I really, REALLY hope this gets backlash. Those devs deserved to be at least credited.',72);
