Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16279,'vKKu-Wt7O2Q','Me encanta cómo después de que Thor perdiera a todos lo que amaba (mamá, papá, hermano, amigos, su reino, el amor, su cuerpo) , los guardianes de la galaxia han estado allí con él para ayudarlo y darle una familia.',1826);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16280,'vKKu-Wt7O2Q','Un propósito lo es todo. Fuiste el héroe que más perdió en su evolución. Gracias, Thor. Obtendrás el descanso que mereces.',1236);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16281,'vKKu-Wt7O2Q','Siempre he sentido que la forma en que Marvel elige a los actores ha sido perfecta. Quiero que Chris Hemsworth y Benedict Cumberbatch desempeñen sus respectivos roles en el MCU tanto tiempo como puedan. Siento que nacieron para interpretar estos papeles.',753);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16282,'vKKu-Wt7O2Q','Tengo una mezcla de emociones, estoy feliz por verlo de nuevo y triste porque cada vez son menos los vengadores originales que quedan ¿¿¿¿',266);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16283,'vKKu-Wt7O2Q','Esa canción le llego a lo mas profundo   casi 11 años siguiendo las aventuras del dios del trueno ¿¿¿¿ siento que envejecimos juntos',2610);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16284,'vKKu-Wt7O2Q','Me encanta volver a escuchar a los Guns &Roses en una película ! Ahora todo el mundo va escuchar este tema en sus play playlist y celulares ! Aguanten los Guns & Roses y Thor !¿',239);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16285,'vKKu-Wt7O2Q','Me duele porque este podría ser el final de Thor, claro el actor dijo que aún hará más películas pero es triste saber que su lugar como vengador lo tomara Jane. Espero algún día regrese al equipo y luche a su lado una vez más ya sea contra Galactus, Beyonder o en la guerra del multiverso ¿',150);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16286,'vKKu-Wt7O2Q','Y este bello universo que seguimos hace mas de 10 años sigue mas vivo que nunca ¿ vamos carajo!! por mas del MCU!!',89);
