Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16289,'KtoeIXKrU_E','Jennifer actually saying, "Lawyer show!" straight into the camera is exactly what I want to see in a She-Hulk series.',151);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16290,'KtoeIXKrU_E','I will definitely watch this show, it’s different and with all the chaos that ensues in the mcu , it’s nice to have a change. Of course there will still be chaos but not like some avengers level threat…hopefully¿¿!!!',84);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16291,'KtoeIXKrU_E','This looks amazing! They clearly are making a very entertaining show. Can''t wait to see who else the surprise characters are that shows up.',2);
