Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16293,'KtoeIXKrU_E','I honestly hope that beginning part with the Dun Dun is actually the intro for the  whole series.  Cause that''s hilarious',3649);
