Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16295,'KtoeIXKrU_E','Weirdly enough, this is the trailer that sold me. Seems like an actual breath of fresh air, looking at the MCU from a new angle and if that opening joke is any indication, looks like a fun show. I''m honestly excited now',8);
