Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16298,'u1RbN7KATAw','This was a great stream, it felt like the production quality had gone up a lot since the last Marvel one and everyone played well! I thought Peter was a great addition to the stream - he started a little quiet but really got into it.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16299,'u1RbN7KATAw','Love it! Can''t wait for this box and also the Wolverine pack! Also can''t wait to see what else you guys have in store for the X-MEN saga :)!',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16300,'u1RbN7KATAw','We can''t wait to get the box and hero packs so we can play the campaign on the channel. X-men my favorite comic franchise, glad to see them come to Champions.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16301,'u1RbN7KATAw','Great stream! Really love seeing the passion and enjoyment you all show for the game. It’s also obvious how much you understand the core of characters and continually being that across in your designs. Thanks and keep up the good work!!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16302,'u1RbN7KATAw','Great stream! Slim''s cards are subtly powerful. Really affected the outcome.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16303,'u1RbN7KATAw','Love X-Men! Hopefully they stay around a long long time! This game will now be called X-Men The Card Game as far as I’m concerned. (And if it’s not too late I’d love to see Quentin Quire aka Kid Omega!)',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16304,'u1RbN7KATAw','I got to play the Sabertooth scenario at Gen Con and we straight up got our heads kicked in.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17102,'LHBE6Q9XlzI','44:15  He says L[2] is the second value in the list... doesn''t the list start at [0], meaning the second value in the list should be L[1] ?',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17103,'LHBE6Q9XlzI','you could sent the link for the ppt which you are showing in video, i want use that as quick reference',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17104,'iPdO9MwdcLE','Thanks for watching everyone! I hope you have a better understanding of what it is like to be a professional data scientist! Sign up or learn more about SharpestMinds here: https://www.sharpestminds.com?r=ken-jee . Again, SharpestMinds is a data science mentorship marketplace that only gets paid when you land a job!',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17105,'iPdO9MwdcLE','That’s a great concise video summing up the role of a professional data scientist, this video came at the right moment as I transition from academia to industry and totally relate with many of the points mentioned in the video. As mentioned in the later part of the video, I also find the undesirable aspect of data science to be a double-edged sword as on one end the ambiguity may make things unclear but at the same time also leaves room for experimentation and innovation. Papaya Tracker sounds like an interesting personal project!',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17106,'iPdO9MwdcLE','Im 35 years old, and I just started my Data Science journey by starting college this semester.  Been an aircraft mechanic for my entire adult life and been looking for a change for years now and you inspired me to finally pursue Data science. Thank You Ken, I''ll be tuning into your channel just to keep my ''ear to the ground'' in this exciting field. Also, not sure if you spoke on this before, but what laptop do you recommend for data science? Thanks Buddy and keep up the good work!',114);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17109,'iPdO9MwdcLE','One of the most important things that I wish more people would do is documentation. Of datasets, sources, code, rationale etc. I often have to spend a long time on the dataset exploration phase of the project and trying to figure out things. Everything would be much smoother if people created detailed documents on the different Datasets, how things are collected, what features are used, distributions etc',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17111,'iPdO9MwdcLE','I''m working as an Associate Data Scientists at a startup and I honestly haven''t needed to code for like 5 months. They''ve got me focused on an e-learning initiative.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17113,'iPdO9MwdcLE','Thank you for posting this video. This past year I migrated to a new work role and am listed by my employer as a data scientist.  This video confirmed my understanding and also cleared up confusion as many people, my employer, and consumers of our products have different views of a data science work role.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17114,'iJUzouXg5kY','As a data scientist myself, I agree that anyone can become a data scientist. It definitely takes a significant amount of time and effort though. I have multiple videos about how to get into the field on my channel for those who are interested!',207);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17115,'iJUzouXg5kY','As a data scientist, I would agree with the fact that we are lazy people that want maximum results with minimum effort - and think we can solve any problem given enough data. :D',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17116,'iJUzouXg5kY','''anyone can be a data scientist'' - that''s the gist of this lecture.....What it requires is a combo of math stats n computer science skills topped u with communication and management soft skills.....Data is the new thing from which physicists, engineers, social scientists can draw n infer conclusions based on past history or some kind of logic.......And this is the best time ever for fast processing of loads of data........Right time to be data scientist! You can work in any domain! Good introductory talk¿',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17117,'iJUzouXg5kY','This was very precise and at the same time a very broad view at this field. Thank you sir.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17118,'iJUzouXg5kY','Thanks Mr.Asitang Mishra. You have motivated me more to pursue data science ¿¿',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17119,'iJUzouXg5kY','Inspiring, transparent talk! ¿',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17120,'iJUzouXg5kY','Soooo good! I love it and Mr. Mishra''s smart humor! Very good overview with some fun laughs in it too!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17121,'iJUzouXg5kY','Felt proud watching ¿¿Being a data scientist I can relate what speaker said... Problem solving is the essence..',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17123,'iJUzouXg5kY','this talk was really the best of its kind ¿',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17125,'71RVNeseKZw','Great video Tina! Loving the minimize input maximize output (MIMO) series. My step into the world of data was from a non-technical (biology) background and persistence and grit was probably one of the most important thing because it took quite some time to digest the coding or algorithmic concepts. I also resonated with your prior MIMO video on learning data science particularly on learning just enough and start doing projects. I also leveraged data science to solve biology data problem (that helps to make a positive impact in this video) which at the time was a novel thing. I repeated this cycle for solving various biology data problems and before you know it, topics that I used to get stuck on became less intimidating and started to sink in. Your persistence through 200 SWE roles is very inspirational ¿',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17126,'71RVNeseKZw','Hey Tina, thank you so much for always sharing wonderful tips. It is almost approaching a year since I had finished my bachelors and still without a job :(! I really hope I can break the barrier and get my foot in the industry. Having zero experience makes everything harder. Apart from doing some projects, I will definitely try to contribute in open source projects or pick up a consulting assignment.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17127,'71RVNeseKZw','I''m a Ocean Sciences BSc and now I''m starting another degree in Information Systems. Your channel is motivating me to follow the Data Science path. Keep up the awesome work!',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17128,'71RVNeseKZw','Amazing how much effort so many people put into to getting a job while someone with connection can bypass it all and get the job.',64);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17129,'71RVNeseKZw','Hi Tina, this was really great advice about demonstrating your impact, super useful for data science people but I feel like it''s relevant to every field too. Please could you do a video on how you deal with rejection? I''m job hunting in a field that''s very new to me (not data science) at the moment and I''m just so afraid of getting rejected because that could mean the end of my dream. Also, even if it doesn''t, the feeling just sucks lol.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17131,'71RVNeseKZw','Honestly, the frustrating thing for me at work as data analyst/scientist is I never saw our clients give any feedback about how our reports were helpful for them and change their projects. AKA. "business impact like what you described." I always comfort myself that "even just a little impact. and that''s enough."',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17132,'71RVNeseKZw','Hi Tina, you make me want to make my first comment on Youtube - your videos are SUPER helpful and please keep making more interesting and insightful videos! I am actually thinking of transitioning to data science from a business background and you gave me a lot of useful tips that solves my confusion :)',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15536,'rOYnwhKwlw8','I liked how they showed gameplay for all their games they showcased. Gives us an idea of what to expect.',870);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15537,'rOYnwhKwlw8','This looks awesome I''m really excited for most of these games. I just wish the wait time for release wasn''t so long though I respect the hard work being put in to develop them.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15539,'rOYnwhKwlw8','Probably the biggest W ever. Such amazing games and very well done to Xbox for doing this for us¿¿ Xbox better forever ¿¿¿¿',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15540,'rOYnwhKwlw8','Super happy about the pretty substantial single player games coming out. Not into online social multiplayer games at all so this was very much welcomed.',985);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15541,'rOYnwhKwlw8','Wow, I watched summerfest and was like WTF this could of been sent out in an email. This show blew it out of the water, so many GAMPASS games to actually look forward to, hopefully these games actually deliver in the hype',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15542,'rOYnwhKwlw8','This game was very beautiful in 4k. In 4k we can see very details of the game. I hope BETHESDA continues the good work until the launch of it.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15543,'rOYnwhKwlw8','Great presentation - Love the actual gameplay footage and variety of games. Very grateful for Game Pass, love this service!!',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15544,'rOYnwhKwlw8','Great presentation - Love the actual gameplay footage and variety of games. Very grateful for Game Pass, love this service!!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15545,'sN9kJY3Ie4s','What do you think about the FUTURE of console EXCLUSIVES? Thanks for watching and LIKING the video! <3',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15546,'sN9kJY3Ie4s','What would be the point in multiple consoles if they are all the same then?  We might as well have a one console nation.   No competition or reasons to buy different consoles.   Exclusives give each console an identity and reasons to invest into a particular console.  There’s a reason Netflix has different movies from HBO Max.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15547,'sN9kJY3Ie4s','I believe most exclusives will be timed exclusives. Companies like Nintendo will never ever have their first party titles on other platforms.',73);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15548,'sN9kJY3Ie4s','Xbox says “game pass is the future…. Because we have it”….then “exclusives are doomed… because we have less than none”',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15550,'sN9kJY3Ie4s','If all games were on one console that would eliminate competition and create a monopoly.',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15551,'sN9kJY3Ie4s','Considering how well Nintendo exclusives sell on all their hardware and especially so on the Switch I find Phil''s comments laughable',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15554,'sN9kJY3Ie4s','Meanwhile nintendo: Hell Nah, not me or my son.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15555,'rnn-sfBHX7o','PINNED COMMENT:  This video took a little while to put together. Sorry for the delay, but let me know what your favorite reveal was at Gamescom 2022',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15556,'rnn-sfBHX7o','Apart from Lies of P and Calisto Protocol, i really found "Atlas Fallen" to be really interesting, surprised no one is talking about this new game reveal. Also absolutely thrilled to learn that Lies of P will release day 1 on Game Pass, one of the few benefits of owning both Consoles that you get to enjoy the best of both worlds.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15557,'rnn-sfBHX7o','Lies of P looks incredible also Dead island looks like it could be good High on life looks very fun it was a good showcase lots of game but also lots of ads.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15558,'rnn-sfBHX7o','This was a very solid Gamescom, especially loved the bit of trolling we got from Kojima. Seems like this event just keeps getting better every year',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15560,'rnn-sfBHX7o','I knew something was missing out of my daily life. Thanks for the vids Jay. Your work and content is so underrated.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15561,'rnn-sfBHX7o','Atlas Fallen, The Lords Of The Fallen, and Lies of P were my favorite take aways from the show. Well Where Winds Meet too but I''m hesitant since I don''t know if it will release on Xbox or not.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15562,'rnn-sfBHX7o','High On Life is Conker but as a first person shooter I''''m hyped for that game. Lies of P is the successor of Bloodborne. Callisto Protocol looking good. Sonic Frontiers I''m impressed. Atlas Fallen and Dead Island 2 oh yea! ¿',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15563,'rnn-sfBHX7o','Pretty good show overall can’t wait for lies of P man ¿¿',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15564,'rnn-sfBHX7o','I agree that the show was average, but the Dead Island 2 reveal made my day. Dead Island and Dead Island Riptide are the most addictive zombie games I have played. I played both of them all the way to the end.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15565,'5xRFvRGMwho','Thanks for watching! What consoles do you currently own?',391);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15566,'5xRFvRGMwho','Just bought the series S. It looks great, loads fast and plays next gen games. I''ll upgrade in a couple years when the series X is easier to find. It''s worth it people',1924);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15567,'5xRFvRGMwho','Series s is PERFECT for PlayStation players who want to expand their gaming library. After getting my ps5 I wanted a cheap way into the Xbox ecosystem and this has been an amazing console that I honestly grew to appreciate more than the ps5 due to the small size and price',585);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15568,'5xRFvRGMwho','The deal breaker for me is not having a disc drive when I''ve amassed a huge collection of physical discs. That''s why I got the Series X. However, for anyone new to Xbox or someone who doesn''t own physical discs, this is a great purchase.',474);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15569,'5xRFvRGMwho','I''ve owned both and the Series S has a special place in my heart. I love the X but unless you''re rocking a TV that supports 4K120 w/ VRR, the Series S is just fine. Also, it''s SO tiny and it''s amazing what a quiet beast it is. But definitely buy the storage expansion card, regardless of which one you buy.',244);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15570,'5xRFvRGMwho','The Series S is plain amazing, especially with GamePass and if you are into backward compatibility gaming. I''ve just completed the entire Gears series on 360 because I never got to play them back in the day (Gears 1 to Judgment) and it''s been a pure blast. You can also find an online list of all the games who received an FPS boost (including Xbox and Xbox 360 games) so there''s that too. Some are now locked at 60 and some are even at 120 FPS. Yes my last name is Spencer how did you know?',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15571,'5xRFvRGMwho','The only next gen console I could find was this one. Have owned it for about a year. 0 regrets. Would buy it again. Its amazing. Its form factor blows my mind. So tiny but so powerful',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15572,'5xRFvRGMwho','I definitely have no complaints with the Series S. From what I''ve seen 1440 is still more than adequate for graphics and it runs super smooth and is still a very quick console.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15574,'5xRFvRGMwho','needless to say that the Series S is actually easy to find and purchase, while getting a Series X for not more than original retail price is difficult',1228);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15575,'qV_dH7cfbMs','Xbox just announced the Xbox Series S as a suprise, so unfortunately it''s missing in this video! The price is also announced, $499 for the Xbox Series X and $299 for the Xbox Series S! What do you think, will you buy the Series X or S?',1610);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15576,'qV_dH7cfbMs','I love your content, animation is smooth, audio isn’t weird and bad and the information is so interesting to watch.',933);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15577,'qV_dH7cfbMs','So much nostalgia.. I remember every weekend getting out of school going to my friends house and playing halo for hours on the original Xbox .. the good ol days man',76);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17703,'I9G6xJTUCHs','Second one was definitely the best, honestly with a few updates to design , ui and the background this could be a top tier mobile game, the background could change to a crystal cavern at a higher lvl and the enemies could change later lvls.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17704,'I9G6xJTUCHs','Give each of the devs 10% of the earnings by this video as bonus. You still get to keep 70% for the work they did without even getting credit for their work.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17706,'cFyBbDj9gvY','Opening Blender for the first time is terrifying, where''s the "Make Finished 3D Model" button?',71);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17707,'cFyBbDj9gvY','When your game turned pink after the render pipeline switch, that was supposed to happen. It seemed like you had forgotten to change all of the materials to the new RP materials. It should be somewhere in Edit, inside the Rendering, URP, convert all materials. Sorry if I''m wrong though. Good video!',65);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17708,'cFyBbDj9gvY','I actually LOLed a few times watching this. You perfectly described a person''s first experiences with game dev and Unity pretty well. Most people''s are worse than your experience because they have no programming experience and dont understand anything going on at all ¿',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17709,'cFyBbDj9gvY','you are very underrated. your editing and game development skills are AMAZING. when I watched ur video I have not looked at ur sub count and ii honestly though O was watching a channel that had over 100k subs if u keep this up you will get to 1 million subs in no time',117);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17710,'cFyBbDj9gvY','that''s prob the best dev log i ever seen ¿ I see so much effort put into just one video like this one ¿¿',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17711,'cFyBbDj9gvY','You really know how to edit and create games, hope you continue youtube, you are very under rated',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17712,'cFyBbDj9gvY','Congrats man, you are going places! Great editing and content. Got a new subscriber ¿¿',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17713,'cFyBbDj9gvY','underrated youtuber, i really like this editing style and it never gets boring',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17714,'cFyBbDj9gvY','hahaha great stuff! I lost it when you coded coroutine for the enemy death instead of doing it properly (which is not that hard). Such a nice workaround, Good job :D',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17715,'cFyBbDj9gvY','You have probably learned this by now, but in your animator on unity, you can make an event somewhere in the animation so when you reach a certain point in the animation you can trigger a function. I''m not very good at english, hope you understood me :)',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17717,'0FTlopQl0h0','Step 0: Just start doing it and don''t put it off! Most of this stuff is free, like Unity, Blender, and Audacity. No reason to wait!',368);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17718,'0FTlopQl0h0','4:48 I''m an Unreal Dev and the way I see engines is that they are tools. Pick the one that suit your needs and stick to it. Even change them if you need to. I don''t understand the war between Unity and Unreal. I chose Unreal because my favorite game Gears of War was made in using it and also I saw a time-lapse of a guy creating a stellar scene in Unreal. Plus Unreal was more "shiny" looking so my dumb ass just went with it.',99);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17719,'0FTlopQl0h0','When copy-pasting code, it''s important to know _what_ you''re writing. Try to understand what each line does, it helps troubleshooting and learning.',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17720,'0FTlopQl0h0','For all the new Indie Devs use which ever game engine you feel comfortable with (Unity, Godot, Gamemaker, and yes Unreal). Be persistent and make lots of games can make your dream game or side project.',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17722,'0FTlopQl0h0','I use Unity every day, and it''s great. It''s like an all-rounder game engine. Unreal is more of a 3D, artist-focused engine. So choose Unity if you''re more of a programmer and want to make cross-platform and various games. Choose Unreal if you only want to make 3D games, and you''re more of an artist. If you''re still not sure, just go with Unity.',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17723,'0FTlopQl0h0','I''ve only worked in Unity once to do a code-along game that Brackey did a series on but I plan on learning both so I can choose whichever suits my needs better. I feel like both have their pros and cons from the sound of it.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17725,'0FTlopQl0h0','Thomas is back to the old content. I’m overwhelmed with nostalgia. ¿',82);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17726,'8fcy0_FQ_OA','Hey all! Most of the models used in the vid were created by Synty Studios. They found my channel and reached out as a potential sponsor. As I love using their assets it was an easy yes, so if you want to get any synty assets for yourself, check out my affiliate link to support the channel! https://syntystore.com?ref:TJ',69);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17727,'8fcy0_FQ_OA','I thought this video was very professionally made, I was surprised when I got to the end and saw your subscriber count, you definitely deserve more! Great work on some really good looking games!',476);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17728,'8fcy0_FQ_OA','I''ve watched a few "how I started game dev / my game dev xx year journey" vids and this is by far the best one. Not the funniest one but definitely the most humble, straight forward, and informative.',117);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17730,'8fcy0_FQ_OA','The quality of what you achieved so far is amazing! Tourney Manager gave me tons of Mount & Blade vibes.',70);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17731,'8fcy0_FQ_OA','This is pretty insightful and inspiring. Also great progress! Keep it up!',108);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17732,'8fcy0_FQ_OA','Proud of your journey, man. It takes a great deal of discipline to start something new and stick it out. I think I bought your latest project "Tavern Master" on Steam a couple months ago and I thought it was pretty decent. Keep at it, only upwards from here!',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17733,'8fcy0_FQ_OA','The production quality of this video is TOO HIGH for the amount of subscribers you have. This channel will grow exponentially if you keep this up. Great work and very inspirational stuff.',42);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17734,'8fcy0_FQ_OA','Hello from a fellow dev. You have done so much in those two years. I''ve been at this for 4 years and feel like I''ve done less even though I have a game already out there in open beta. Excellent video, quality editting, very promising youtube channel.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17735,'8fcy0_FQ_OA','This is inspiring. I wish I had kept up my momentum with learning Unity. Subbed! Now I''ll binge the rest of your content.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17736,'EezyHvMbILo','you make me feel motivated to make another game that i will never finish',4395);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17737,'EezyHvMbILo','When I was 14 and thought of developing my own game, I was so overwhelmed by the code I ended up quitting. You are so talented! I’m gonna stick to playing video games lmao.',711);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17738,'EezyHvMbILo','the fact you even thought the robot saw himself as the hero for fighting pollution is really mesmerizing, probably a kind of game I''d be interested if released on Steam. Great evolution in your projects, btw',147);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17739,'EezyHvMbILo','Great job accomplishing so much when you were so young. It''s great to see how many different genres you tried too. Would love to see what you are working on currently!',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17740,'EezyHvMbILo','Wow most of your games can be combined into one huge game, just imagine a bunny shooting while on top on a plane',196);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17741,'EezyHvMbILo','damn you were one hell of a 14 year old developer',2755);
