Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16315,'gim2kprjL50','I adore Tatiana, she''s easily one of the best actors currently working, between her brilliant performances in "Orphan Black" or in 2020''s "Perry Mason," but my god this looks pretty terrible. Im so bummed for her, because this is the first mainstream exposure she''s gotten as an actor, and this looks like it''s shaping up to be a complete train-wreck.',9);
