Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16317,'gim2kprjL50','My favorite part was Morbius is saved by She-Hulk in the first episode.  Their scene celebrating in the Champaign Room afterward was a comedy goldmine.  He repays her kindness by teaching her the secret of activating full power with Morbin Time!',73);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16318,'hQKbnNhvM0U','Un crossover entre DC y Marvel es ...prematuro sin que antes DC tenga pilares sólidos.  Y con pilares sólidos me refiero a afianzar los personajes principales personajes (y no, un Black Adam que NO es un villano ni un héroe sino todo lo contrario...no es uno de ellos, ni tan siquiera se parece a su contrapartida del cómic )...',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16320,'hQKbnNhvM0U','La gente parece pensar que Daredevil siempre es como en la etapa de Frank Miller (que, por cierto, también tuvo momentos de humor), cuando tiene otras etapas en las que se permite ser menos serio.',9);
