Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16324,'hQKbnNhvM0U','Yo pensaba que The Rock nunca saldría en un crossover de DC porque perdería el protagonismo que el suele tener pero resulta que le gustaría un DC vs Marvel lo que quiere decir que si se puede contar con el para un proyecto mas grande. Sería un cañón verlo haciendo parte de la Legión del mal.',1);
