Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16326,'hQKbnNhvM0U','Según yo lo veo en Eternals Marvel fue la primera en guiñarle un ojo a DC para alguna probable película conjunta, el problema que yo veo es que evidentemente ambas compañías querrán un 50% de participación y beneficios en todo, y el mundo compartido de DC ni por asomo esta lo suficientemente consolidado como para que le dé a DC la necesaria fuerza de negociación para el proyecto',1);
