Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16331,'K8SCPBQCmjg','In the movie that came out in the 70’s , he was in a car crash with his wife or girlfriend I believe. He was able to get himself out but he couldn’t get her out. Which lead him on a mission to find the chemical that makes people strong in situations like that.',237);
