Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16348,'BE3ZMhLlsiI','So far, these animated projects look super interesting. I hope Marvel Studios continues investing more animated content in the future, because there are so many different ideas and possibilities that they can do with animation, that would be complicated doing in live-action. There’s should be variety imo. ¿',388);
