Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16350,'BE3ZMhLlsiI','As much as I was excited for What if..? and  X''Men''97 but now that mature rating for Marvel Zombies (which it should) is confirmed, its definitely on the top of my list of series to watch when it comes it...',118);
