Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17133,'71RVNeseKZw','Hmmm I''m going the applied math route with stats as a minor or possibly masters. Is there any reason in particular that you would recommend CompSci beyond just the programming background it provides? Also, how different is data science compared to machine learning? They sound almost like the same thing (given their job descriptions). Great video btw!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17134,'oMn8zc5NlL4','Glad we needed a scientist to tell us that you get rich by starting a business with a competitive advantage. :)',867);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17135,'oMn8zc5NlL4','I feel for a local business owner who opened up a coffee shop. My two sister''s worked there and were very good friends with the owner since she was a teacher at the highschool and saved up enough money to open the shop up. Sadly during the pandemic my state nuked her businesses. My sister''s lost their jobs while the governor praised herself about her actions and those evil businesses were destroying our state. She then proceeded to get caught twice having parties spending thousands on booze.  Actually watched dozens of business get nuked the same way fun times fun times.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17136,'oMn8zc5NlL4','so as a technician I worked at a dealership (two actually) owned by the same guy. He has like 10 different dealerships and he is insanely wealthy. Like, he owns all of this property north of a major highway and is literally like a king in these lands. To be honest he also seems like a pretty nice guy.',142);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17139,'oMn8zc5NlL4','This actually makes a lot of sense. The company I work for has produced a lot of commercials for a regional car dealership/racing team owner. The owner of the company isn’t a billionaire, but is in a position where he can throw around money whenever he wants. That kind of path seems much more attainable than hoping you land a one in a million chance on a startup business or some Bitcoin related gamble.',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17140,'oMn8zc5NlL4','I''m a mortgage broker. He''s completely right. Except the local monopoly thing can be done with a really good book of business. Sure you can compete but you can''t steal my referrals which supply all the business. Offering a Lower price is a poor tactic unless it''s purely how to learn how to run the business',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17141,'oMn8zc5NlL4','Depends also on what you define as rich. I don''t mean that in a philosophical way either, just that living standards vary greatly from person to person. If you need to have a mansion, a yacht, and 5 or 6 super cars then it''s a much greater challenge. Also, what are the time horizons? Is your goal to be "rich" before you turn 30? Or can you wait until 45? or 50? Because something else they didn''t mention in the video is investment, compounding interest, passive income, etc.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17142,'oMn8zc5NlL4','Being a trade professional such as plumbing or HVAC can be VERY lucrative if you spend the time and money to consistently build name recognition in your local market and maintain that for years. If you can become the name that people automatically think of for HVAC problems - you can multiple hire crews to do the work for you. You can scale as big as you want and easily become a millionaire - with a tech school diploma - you just have to grow that name recognition and provide quality service.',304);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17143,'oMn8zc5NlL4','Remember he’s a Data Scientist. He’s probably studied data on the topic immensely before this interview as that’s what we love doing especially with public data that’s nice to play with. So the advice he’s giving probably tends to bounce towards what’s most PROBABLE, not what will DEFINITELY make you rich. In most ways probability can you take you a long way.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17145,'Vfo5le26IhY','Wow, what a great course with an awesome professor.  He goes way beyond teaching the mechanics of statistics but makes distinctions and asks thought provoking questions that really help you crystallize in your head what you are trying to do.',74);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17146,'Vfo5le26IhY','Absolutely the best video on statistics that I have found on YouTube - and I''ve viewed several such videos. I like that the professor explains a topic from many angles, has charisma, patience with class questions and includes many real-world examples. It''s the perfect blend of theory and applied statistics.',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17147,'Vfo5le26IhY','As practicing design engineer in West Cost medical industry, I find Professor Dr. Sarkar way of explaining the most complex subject in a practical approach very rewarding and helps in right metal representation for long term understanding. Although I have taken similar courses in Stanford paying close to 2K plus USD came out even more confused and even gave up statistical approach . Thanks for sharing for free and hope this benefits the transition from Excel based modeling to Python and would highly recommend to any one working with data and design.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17148,'Vfo5le26IhY','Thanks a lot for putting up such great content. The instructor took a very practical approach to DS rather than just theories.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17149,'Vfo5le26IhY','Wonderful content and presentation, I feel like I missed Dr.Sarkar sir all these days. Thanks to greatlearning team for these lectures. It will be great if a video is made up on time series Analysis also. Thanks team for all your effort and introduce to us the great professor Dr.Sarkar sir.',79);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17150,'Vfo5le26IhY','He is really a great professor. I have been studying statistics since school and then using years for my profession. However, the way he teach and explain from one chapter to another chapter and subject is super. Thanks',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17151,'Vfo5le26IhY','I am greatly impressed with this lecture. So simplified with imaginable analogies. Thank you so much sir and the greatlearning team.',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17152,'Vfo5le26IhY','Fantastic course!  For those who have a fear factor of stats and probability, this course will certainly will help allay those fears.  Dr. Sarkar focused on concepts with perfect analogies which helps understand the subject better.  Thank you Dr. Sarkar.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17153,'Vfo5le26IhY','This was really the best course I Did, Learned alot and earned the certificate of completion as well.Thank you so much Great Learning for this Beautiful content and Dr.Abhinanda Sarkar Sir is the best is explaining things.Thank you very much @GreatLearning',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17156,'q2Ruz1dHnow','Great videos and great data science courses. I used the free preview option and I am happy to learn data science and machine learning. Thanks so much for this opportunity!',9);
