Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15594,'pIZW8eoxQ5o','Working on railways messing around with circuits for a living I hate troubleshooting when it''s something simple we''ve just overlooked. Last fault I had that I was there for fixing was literally a diode being the wrong way round. Cost 4 fuse, hand tracing and belling all the connection points before finally we found the diode was the wrong way round 2 hours later. It''s always the last thing you check. Love seeing this kind of content when it''s an easy fix',5);
