Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15610,'jGZzpr4BtAM','My 1st console was the original PS.  Loved it so much that I stayed with them and upgraded to PS2.  Somewhere in there I picked up a used xbox because my 1st Lan party with Halo just blew me away.  Then 3rd gen consoles came and both the price of games and consoles went above what I was willing to spend at that time so I turned to Nintendo and was happy to play their handheld systems.  Getting the Xbox series X was an easy decision for me.  I have Nintendo Switch for my exclusives, strategy, and rpg needs while the Xbox satisfied my craving for FPS and games that required higher processing and graphical power.',1);
