Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15613,'jGZzpr4BtAM','You quickly mentioned that online depends on where our friends also play.  That is a win for the Xbox, because it has direct integration with PC.  You can chat with anyone on PC, but also directly play with them in a slew of GamePass games that silently support cross-play between PC and Xbox.  Playstation is doubling down on the walled-garden approach to keep people buying their brand through sunken cost and social ostricization (perpetuating the console wars, really).  No brainer, Microsoft is the one doing far better on supporting multiple platforms and opening the experinece to a larger audience, including online.',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15614,'jGZzpr4BtAM','You are absolutely brilliant at reviewing stuff. Clear and concise',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15615,'eghRcO16Zig','This looks really fresh, definitely gonna check this out in release',70);
