Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17742,'EezyHvMbILo','You can really tell the progress! Awesome! Especially the logic behind the last one with the cars, it''s something that can get you in a Tesla like company to code the actual self driving cars! So keep up the good work!',3);
