Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17745,'EezyHvMbILo','This inspired me to look into making games! The coding looks so intense though. Is it difficult?',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17746,'V5o6CQNPgsQ','Make sure to SMASH that subscribe button for games, wings, and better special effects than The Last Airbender movie! What special effects do you want to see next?',141);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17747,'V5o6CQNPgsQ','I''m glad you didn''t show yourself eating salads and drinking Starbucks 90% of the time, but actually showed your work. Great content, subbed!',862);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17748,'V5o6CQNPgsQ','Working on your job, working on your own dreams,managing a YouTube channel and spending time with the family. Mad Respect Bro. Definitely got my sub',272);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17749,'V5o6CQNPgsQ','Found the channel today through Reddit. Admirable to see people who do full time work and find discipline and will to work on something else like a game on the side. Also: "How can I horizontally center a div" is a classic, haha.',106);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17750,'V5o6CQNPgsQ','dude it''s amazing how much you were able to balance so many things in your daily life I envy it!',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17751,'V5o6CQNPgsQ','That''s awesome man, I wish you the best of luck for your games, Im still young but I really wanna be a game designer when I''ll be older, so watching that kind of videos gives me more hope to achieve what I want.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17752,'V5o6CQNPgsQ','Love seeing people do what they really enjoyed doing. Thumbs up.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17753,'V5o6CQNPgsQ','Once again amazing stuff. I’m proud and confident to say that I’m here before you blow up! Well edited, well paced, and well shot (even with a meh camera). I know you’re going to succeed. Keep at it.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17755,'V5o6CQNPgsQ','This dude has a dream setup..... but then a family reunion lawn chair. That''s the definition of I can do what I want.',113);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17757,'1mwNrMD0Lm0','"So I did some googling, and with a bit of time, I learned quantum theory and I am speaking to you through the threads of a black hole"',2015);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17758,'1mwNrMD0Lm0','Unity and Unreal both have "un" in them but if we remove "un" we get "Real" and "ity" which makes "Reality"',109);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17760,'1mwNrMD0Lm0','Can we appreciate how he made 3 functional games in 7 days with one being vr',78);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17762,'1mwNrMD0Lm0','This video taught me to spend way too much time on ragdolls when making a 3D game',280);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17763,'1mwNrMD0Lm0','This guys humour is a gift to humanity',525);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17765,'1mwNrMD0Lm0','It''s crazy how inspiring and good this guy is, A GAME MAKER Is born, If I had the option I would put your Game GAME OF THE YEAR!! Or Decade ¿¿',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17766,'YaUdstkv1RE','The first talk was great. Solo developers can get caught up following professional project management methods but forget the factor of individual motivation. E.g., it might be faster to first deal with the most complex problem, but making small wins working on art or marketing along the way helps you to stay motivated.',151);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17767,'YaUdstkv1RE','Was amazing to be involved in this! Hopefully you all can get some good nuggets out of it, along with being more prepared for the hidden pitfalls!',93);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17768,'YaUdstkv1RE','The talks were good. But their personal reflections were amazing. We really put these guys on a pedestal but we tend to ignore the emotional impact of solo development. The gratification when the project is finished is amazing but the journey there definitely seems like a rollercoaster.',60);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17771,'YaUdstkv1RE','The common refrain is to use temp assets to prototype gameplay and systems, so that you don''t waste time remaking assets if systems demand it. It sounds like for solo devs accepting that risk is worth the boost in confidence that having art first grants.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17772,'YaUdstkv1RE','I had my second project planned before releasing the first game, which helped me skip that depressing stage after releasing. There''s really no happiness at the end of the road no matter how many sales you make, so gotta enjoy the adventure and hop on the next one right away.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17773,'YaUdstkv1RE','Such a great and relevant session! Each of the panelists had a ton of valuable insights to offer. Thank you!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17774,'YaUdstkv1RE','I''m absolutely stunned how much emotional i got with this speeches. Kind of like in the last public question I''m also doing a board game and I''m happy to hear that games take extremely long to port and that it is a rollercoaster of emotions and full of pitfalls to watch out for. But as long as I keep looking back at my younger self who started my "Streamers Ace Project" I can''t make him sad and quit. Thanks for that amazing talk and all your effort you all put into it.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17775,'YaUdstkv1RE','I love how they all highlight different spectrum of solo development!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17776,'e9N4PIeYAnY','I have to ask, how do you line up the monitor camera transitions so well XD? Is it really just holding the camera precariously at an angle that lines up the monitor bezels and then moving it out? So well done.',222);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17777,'e9N4PIeYAnY','As a dev, I liked that small insight into the code and class implementations! Would be up to see more of that in future.',164);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17778,'e9N4PIeYAnY','You motivated me to start being more orderly, to have plants and to eat healthier. I really like your routine and I''m trying to improve mine as well. Soon I will also enter patreot. I really appreciate what you are doing.',139);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17779,'e9N4PIeYAnY','I love these calm, relaxing devlogs! Keep it up! :DD',63);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17780,'e9N4PIeYAnY','I feel like enjoying your healthy daily routine, more than the coding part XD. I like how you mix designing, modeling, coding and life style content in your dev logs, great content !',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17781,'e9N4PIeYAnY','Your videos are such a treat to watch. Always excited when a new one is posted. Keep up the good work! The game is really coming along nicely!',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17782,'e9N4PIeYAnY','This game feels way better to me now that you''ve chilled out the tool usage. A really good and subtle change to the vibe.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17784,'e9N4PIeYAnY','Idea: you could have the pathways act as ‘barriers’ making it harder or impossible for weeds to spread, thus giving you a reason to separate farm plots and giving the path tiles a function',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17785,'e9N4PIeYAnY','Great update! Love your focus on the little details that ensure this game will be a relaxing experience for players. On an unrelated note, I look forward to the day when I can eat dinner without my puppy needing to go in the crate :P',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17786,'k_qILWYgaSM','Bro I am so glad I discovered your channel. These videos are gem, not only entertaining but they also highly motivate me to start with Unreal Engine. Thanks',363);
