Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17184,'AYWLZ1lES6g','¿ I try to respond to all DM''s on instagram: https://www.instagram.com/stefanovic92 & Twitter: https://www.twitter.com/stfnvic',35);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17186,'AYWLZ1lES6g','“Don’t quit” is definitely one of the biggest pieces of advice for people wanting to break into the field. Took me a year and a half of that horrible trial and error learning, quitting, starting again, and networking to finally land my DA role, and I don’t regret a second of that journey.',196);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17187,'AYWLZ1lES6g','The difference between a senior and junior data analyst: how well you’re able to formulate your question on stack overflow. Perhaps I should make a video about this.',654);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17188,'AYWLZ1lES6g','Amazing content Stefan. I’m currently a student at a university in Florida, majoring in business analytics and information systems (which yeah basically trained you to become a data analyst). I’m a senior now but i feel like i learned shit in the last 3 years (despite getting all A and paying tons of money). I learned from your videos way more than in the college classroom.',54);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17189,'AYWLZ1lES6g','Considering I am extremely broke, this was MASSIVELY helpful bc you recommended FREE ways to learn various things, and I desperately need that. I also need to know what skills will be most useful to hiring managers and recruiters AND how to effectively prove it in my CV, so that was also very appreciated. The very structured approach to this video was extremely helpful, thank you very much!',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17191,'AYWLZ1lES6g','I needed to hear this. I am starting the journey of becoming  a Data analyst at 52. Thank you so much.',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17192,'AYWLZ1lES6g','Excellent video, I''ve seen tons of this "starting" videos and you actually gave practical and specific tips to start. Thank you!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17194,'ylOILe-Sc-w','It''s so important that people like you come up with such good content in order to teach folks that data science is not just about programming language and applying random ML libraries to get >90% efficiency. Like you said, Math and stat is always the key and everyone should start with that, even though we don''t often use it in real world scenario in companies.',153);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17195,'ylOILe-Sc-w','This video was helpful! I''m currently a UX Researcher and have my feet in both qualitative and quantitative research, where the quantitative requires a lot of data analysis. I enjoy diving into data, but wasn''t sure which route I should take for my particular job to build out more of a niche in a Quant UX Researcher role. Now I feel like I know more of what I want to dive into further and want to focus more on the Data Analysis route.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17196,'ylOILe-Sc-w','+1 on the book! It is a great resource to start with! And it also has coding exercises, which helps a lot with practicing stats and coding.',46);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17198,'ylOILe-Sc-w','Thank you so much. I was literally feeling lost to figure out what should  I learn first. Python, R, SQL. Now, I got hope. Thank you so much for your videos.',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15625,'KdVM2RhDaAM','I was once in line at a GameStop to buy a used PS3 when a guy got in line behind me to trade in his PS3. So i bought the PS3 off the guy for less then what GameStop was selling them and more then what he would have received from the store. We both won on that day.',615);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15626,'KdVM2RhDaAM','As someone I used to work for GameStop, my advice is to always buy the Used system over the Refurbished ones. The refurbished ones were broken at one point, and whoever fixes them doesn''t do a great job.',328);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15627,'KdVM2RhDaAM','I was a manager at Electronics Boutique 20 years ago and we had the same problem with the PS2 “company refurbs” and they usually didn’t operate. I told my staff to unpack them when they came in, immediately mark them as defective and ship them back out. We had gotten burned too many times, and I wasn’t gonna put my customers through that anymore.',195);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15628,'KdVM2RhDaAM','I sold my Xbox One X a few months ago (on eBay), and whew... this video makes it seem like I really sold mine for far, far too cheap!  I''m one of those people that keeps everything -- including the foam wrap, plastic bags, and twist ties -- so the console looks pretty darn good once I get it all back together.  I can imagine that the only reason you''d want to buy from Gamestop is just the ease if something is wrong, and familiarity.  Also, they don''t know me, but they know Gamestop.',88);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15629,'KdVM2RhDaAM','I worked at GameStop for 5 years and that is by far one of the most unacceptable packing jobs I’ve seen. The first console you opened was likely in terrible shape when it was traded in; it’s common for those refurbished ones to have panels replaced or be opened up and fixed from the inside out. I bet it’s missing the rubber pieces on the bottom because it’s been resurfaced in some way. The second console was likely just a trade in tested by an employee for under 5 minutes. With these consoles, very little is done before they’re repackaged and sold.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15630,'KdVM2RhDaAM','Something to keep in mind i had to replace the thermal past and pads because the home screens of most games were enough to make it over heat and power off',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15631,'KdVM2RhDaAM','I used to work in a used game store. We would refurbish GameStop refurbished consoles literally daily from people who had them for just a little over a month. GameStop refurbishes are known for taking shortcuts at every possible turn, and using the cheapest replacement parts available. We had a local GameStop that was notorious for ignoring thermal paste on literally everything they did. So much so we put out a social media post letting everyone in our area know we would redo the thermal paste in any GameStop console they purchased within a week with proof, for $10. Fuck GameStop',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15632,'KdVM2RhDaAM','I used to work at gamestop and I can say they didn''t give us enough packing supplies to ship out orders',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15633,'KdVM2RhDaAM','I work at GameStop, and we aren''t supposed to package it like that. The price is high cause we are low supply of consoles but everything else is pretty accurate. ahaha',3108);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15634,'KdVM2RhDaAM','FYI, for those of us who miss out on a sale by a few days...if an item goes on sale a few days after you bought it, just call up customer service and politely ask for a partial refund. Gamestop is usually pretty good about giving you the difference in cost between what you paid and the current price of the console.',4);
