Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15636,'NdqOOCel9-o','I would love to see a series x pro version with a bit more power to run flight simulator properly especially with so many addons  that tax the system and a increase in FPS for flight sim would be great .',3);
