Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15638,'NdqOOCel9-o','A pro version of the Xbox and playstation is something that isn''t needed. They are still making cross generation games leading into the end of 2022 and possibly 2023. If there is going to be a refresh, it may not be until 2025 or 2026.',16);
