Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15641,'NdqOOCel9-o','The medium ground of these two consoles would probably be a Xbox series x sized console or thinner but slightly more powerful than the series x is',1);
