Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15648,'573n5HGVo94','The reason they said large and open space instead of largest map is because if you look at their past games and you measure the square footages of every location and put them together that may be bigger. None of their past games have had an open world. Their other games usually have one big world segmented into multiple locations. In this game it''s actually one open world so it''s the largest open space of any game they created. And they did say that this open world is bigger than Prey.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15649,'573n5HGVo94','There is no "loop hole" for how Death Stranding made it to Game Pass PC. As some have already commented, 505 owns the PC rights, so they''re free to put it on anything they want. Sony owns the console rights to DS, so this is why it will probably never come to Xbox consoles, unfortunately.',21);
