Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17796,'TnsdRa_KvbI','Go to https://bit.ly/3Bo4vh9 and use code HMW to get 15% off ClickUp''s massive Unlimited Plan for a year! Start reclaiming your time for less than $5 a month. Hurry offer ends soon.',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17797,'TnsdRa_KvbI','Microtransactions are really soiling the gaming experience imo. Everything is quickly becoming a subscription.',2989);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17799,'TnsdRa_KvbI','The reason triple AAA games are becoming so expensive and some are totally failing is just because they focus on tech and not on design. They''re treating what were supposed to be  enjoyable games as engine demos and not giving enough time to release them properly. You can''t just create another GTA V every single year, that shit takes A LOT of time.',2055);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17800,'TnsdRa_KvbI','Another issue is that whenever you sink that much money into a single project, the designers have to give up a significant amount of creative control. Business just won''t allow that much money to be spent on an experiment. Everything ends up being the old tried and true so you end up with very samey, uncreative, bland games that look really nice.',558);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17801,'TnsdRa_KvbI','When some people say "games from older generations were better" I must agree.. As a kid I imagined how insane the games would look like with so much more options to buy and play with even better graphics and physics. But sadly nowadays most titles are just cash grabs and the fun part is ignored, its hard to find triple A titles with good and fun gameplay without only pay2win features. Thats why I''m revisiting emulation, indie games and a few AAA titles which are worth the money and also the playtime.',72);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17802,'TnsdRa_KvbI','I''ve been telling my friends this for the past couple years. We are going to see fewer AAA games because games not only have to compete with other new releases but all of the pre-existing games as well. There is just so much competition in this industry.',663);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17804,'TnsdRa_KvbI','Fair to say the golden age of gaming is truly gone..sad really..but glad i grew up gaming in the 90s and early 2000s..sad a lotta kids wont experience the magic we did',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17805,'TnsdRa_KvbI','It’s awful sad to see how stuff goes to thrash when the general public gets access. Look at YouTube itself, with its mandatory  “ad friendly content”, social media taking over everything, lack of variety due to companies milking “winning formulas” dry; Game companies noticing that the casual player is not demanding quality at all… it sucks.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17806,'tV3zWkI-JGs','I remember freshman year when you would be working on your games in class. Cool to see how far you’ve come with it.',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17807,'tV3zWkI-JGs','glad to have found your channel, this gives me a lot of insight. i''m kinda feeling the "I don''t even like animating" thing right now and wondering wtf else I can put those skills towards',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17808,'tV3zWkI-JGs','I hope one day to be able to look back at your progress as greatly as you have been able! Super hyped for the release :)',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17809,'tV3zWkI-JGs','The journey from not understanding what an "if" statement is to having a complete game is always awe inspiring to look back on. Hopefully we''ll see some cool projects in Unreal Engine at somepoint!',4);
