Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17818,'E6qlaQkdAos','woah. i''ve never met somebody so underrated. your sense of humour is immaculate mixed with politeness and a good amount of jokes. the way you explain everything so crisply and manage to fit it all in in just a 10-minute long video is surprising. keep up the good content :o',168);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17819,'E6qlaQkdAos','Dani is literally the reason I''ve started game dev. He might not realize this but he''s inspired alot of people including me. And  karlson is literally my dream game...mainly because I grew up playing mirror''s edge and other parkour games.',61);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17820,'E6qlaQkdAos','underrated? I agree he’s extremely good at game development, but he also has millions of subscribers, millions more viewers, and two of his later games both got incredibly well received and took the front page of steam by storm. Not to mention Karlson is incredibly anticipated by millions, and one of the most wishlisted games on steam. Many other solo game-devs out there who pour just as much, if not more time and effort into making games just as good could not dream of that. Someone who likely everyone who clicked on this video already knows is not what i’d call underrated, there are plenty of smaller game devs who are overshadowed by the more well known ones like Dani. I’m not saying it’s his fault or anything, I watch him and support him, i’m just saying the claim that he’s underrated, let alone the most underrated, is incredibly wrong as far as i’m concerned.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17821,'E6qlaQkdAos','He ain’t overrated not underrated, he’s a extremely brilliant developer who is wellrated',37);
