Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16490,'qCzxj40A0lk','I think her sneaky lawyer tactics weren''t to find out if he was a virgin, it was to find out if he''s still alive. She said "I knew it" after Banner referred to him in the present tense. The whole virgin thing was probably a misdirect.',19);
