Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17199,'ylOILe-Sc-w','I absolutely agree with your comments about statistics and I love/own/have read the same book cover to cover. There is now a 2nd edition with python implementation. BTW, reason I am leaving comment is to hear your thought about the actual interview questions. I recently went through google data scientist interview (1 hour tech screen) and to my surprise, the question was straight out "coin flip" probability and expectation problem... I was really surprised because the question is very much contrived and I couldn''t come up with the answer very easily at first. That was the only question (some resume related question before that, of course) I got in the session. As a data scientist myself, those type of questions are really hit or miss and personally I don''t think it''d help to measure one''s understanding of stats or technical background. How would you suggest prepare those?',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17200,'ylOILe-Sc-w','Thank you for such an informative video, appreciate people from real time experienceare sharing it with people which will he a great help to so many.., I''m working as a software engineer but don''t think I''m good at technical so was thinking to move to non technical roles. And these thoughts are really tiring when u end up in too many options and not able to conclude. I am with Bsc maths and Msc computers background,  and in 2016 thought searched so much how to utilise my maths skills in IT, but unfortunately couldn''t find so much that time..now when I hear on Data scene I feel I lost so much opportunity,  but I would like to resstart my learning and your videos are really inspiring. Is it okay for a person with almost 8years gap from Bsc maths to start on Data science now? Please reply',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17201,'ylOILe-Sc-w','thanks for sharing your experience in transitioning to data scientist role.  Some of your suggestion is good which is actually what I''m doing so far, watching different you tube video on on same topic because as you pointed out  different people has their own way of  interpretation of the subject and is more simplified , until you fully grasp the subject.  Please keep sharing your knowledge.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17202,'ylOILe-Sc-w','Valuable content and glad to see someone pointing out a book they read because it''s not easy to pick a good book as there''s many of them. Thank you for sharing',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17204,'A2v4_SFd9Cc','What a journey! Hard work always pays off, thanks for sharing and motivating us all!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17205,'A2v4_SFd9Cc','Awesome video! I completed 2 years of medical school but had to withdraw due to my poor physical health (chronic pain). Computer science was my backup if I was unable to get into medical school. I''m currently learning python through Udemy''s online course. The tech world is so broad and I feel overwhelmed. I''m hopeful that things will workout for me in the end, but med school debt is no joke.',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17207,'A2v4_SFd9Cc','Great video!  Thanks for sharing all of your experiences!  How difficult was it to be proficient in Spark?  It’s such a different mindset!',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17209,'A2v4_SFd9Cc','Love your videos! I would love for you to talk more about your experience with working at a startup.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17210,'A2v4_SFd9Cc','Thank you very much for sharing your educational background with us! Exciting as ever.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17211,'A2v4_SFd9Cc','Perfect time for me to find your channel, as I will begin pursuing an MS Data Science degree at Vanderbilt in the Fall. Looking forward to more great content from you!',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17212,'A2v4_SFd9Cc','The wait is over! Glad to see you back on the YouTubes! ¿¿',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17213,'A2v4_SFd9Cc','Very informative. I’ve got an engineering degree and had courses like probability & statistics, linear algebra, integral and differential calculus. I have a letter of acceptance from a community college in Canada for Business and Advanced Analytics in a post grad diploma program with subjects like python, sql, machine learning, etc. I’m studying python and data science online at the moment in preparation for my Winter 2023 intake. Will brush up my knowledge on statistics, linear algebra and calculus by August as this is a requirement by the program. Back in the days, I had the opportunity to represent our school in Math competitions. What surprises me is that I can still study for 5 - 8 straight hours everyday and sometimes forgetting my businesses as I now leave my managers to decide on their own. What do you think are the chances of people in their mid 40’s getting a job without experience as a data analyst or data scientist?',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17214,'JUkSeqe1eYQ','Do you resonate more with software engineering or data science? Let me know in the comments below!',211);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17216,'JUkSeqe1eYQ','This helped me realise that I am more interested in building things rather than discovering them. What a great and informative video, thank you Tina!',91);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17217,'JUkSeqe1eYQ','I have a masters of data science but once I started working in a data position, I have realized that I enjoy more of the coding and building. Whether its writing Python, SQL, or R code for building and analyzing data, or building reports in SSRS, those are the aspects of my job that I most enjoy. I have been considering changing careers to software engineering. Also, I do feel like data scientists are expected to know too much these days. From communication, data visualization, statistics and deep learning, to cloud platforms, Spark and now Docker. That is a ton of skill and knowledge that seems super-human!',56);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17218,'JUkSeqe1eYQ','You are the chill girl in every class who says she hasn''t studied for exam but tops the whole college',806);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17219,'JUkSeqe1eYQ','Great explanation: "building products vs discovering insights"',734);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17221,'JUkSeqe1eYQ','Thanks for the informative video!  Just a caveat on the salary comparison: data science often requires graduate-level education (Master''s or PhD)/considers it an asset whereas software engineers do not. Or, if without a graduate degree, it''s not uncommon to work as a Data Analyst for 1-2 years before becoming a Data Scientist. So while the average salary may be higher for Data Scientists, there''s likely some additional education/work experience factored in.',48);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17222,'JUkSeqe1eYQ','This is the most systematic and detailed review of any of the two careers I’ve ever seen. Thanks for this video, it definitely helped in finding my next step!',17);
