Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15705,'_keRzD8rVp8','Getting blamed for unrelated issues sucks, but sometimes karma does work, especially in the automotive industry, being a technician, for example, someone will come for a multiple cylinder misfire and when all sorted, you''ll now be blamed for the rear passenger windows not working . . . ¿¿¿',46);
