Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15710,'_keRzD8rVp8','Reminds me of that customer who said “the screen works” and when you plugged it in in front of them it miraculously seemed to have stopped working during the customers trip to the shop. I remember years ago my friend had an old Nokia dropped off as it was under warranty, he reported it simply “stopped working” when taken apart it was soaked with water internally, all the markers were bright red. You could even see condensation on the inside of the screen! Yet according to the customer it was never exposed to water and he was trying to scam him out of his warranty… customers will be customers. Thankfully many are honest!',3);
