Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17831,'DoLbS7c9FKs','Hey Reece! This is a really cool and unique video idea and great execution :) Love the insights and entertainment I got here since I could also totally relate to all the time consuming tasks of game dev. Usually I calculate for everything 2-3x the time I write down because it usually takes longer and unexpected things start to happen, always!! :)',3);
