Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17836,'fsEwtkEBXmo','I''m just finishing up a computer science degree, and I really want to get into video game development. I play indie games almost constantly, and I love the idea of making something of my own that I myself and other people can enjoy, but I keep holding myself back because I''m scared and don''t know where to start. This video was definitely helpful and inspiring to me, and it makes me feel like I actually have a shot at gaining the skills I need and making something cool!',17);
