Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17839,'fsEwtkEBXmo','I was considering about joining a coding bootcamp program for possible game dev applications and job fittings afterwards. Most bootcamps I have come across are primarily web development for tech companies and job placement with companies like google, apple, etc. Are there any game dev bootcamps similar to those? Do they have a high percentage hire rate within so many months after completing their program?',3);
