Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17844,'fsEwtkEBXmo','I was thinking about becoming a game developer who primarily creates code as a hobby. I don''t like the art side of it. I figure I would rather download sprites from websites and use those for a 2D indie game. I am learning JavaScript and I was thinking about using three.js and JavaScript for creating a nice small 2D game. Maybe for mobile and importing it to React-Native. I am guessing this will take me another 4 months of learning JavaScript before I am able to program my first small game. I am learning JavaScript for web development, but I think I will at the end pivot into mobile development.',1);
