Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16511,'EHkkwCjQzsc','No its not an A or even a B rate movie.....the core cpl went from being a no nothing not worried about nothing , to analyzing what was going on around the world AT THAT TIME  and starting on a journey that i think many of us have been on for awhile. I will not criticize their reactions , too many people right now are right where they were at the start of this movie. Instead , they started to oopen their eyes and see what possibilitys could happen and took the first steps into prepardness. Im as bad as they are about knowing my neighbers , ill admit that , ive lived in this house 25 years and i only know and talk to 2 of my neighbers...and theres like 20 familys up here withen a mile mabey more. Folks , instead of criticizing this film , analyze it and see where YOU stand and how you can help others.',8);
