Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17239,'7eh4d6sabA0','I''m so glad I stumbled upon this. You are amazing! This was very pleasant and easy to follow. I learned a ton and I especially like that you took us through your thought process while examining the music data set, too. Thank you very much! Subscribed.',24);
