Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17244,'2qVWurPFwfc','Thanks for watching everyone! Let me know if you think data science is on the rise or decline below!',58);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17246,'2qVWurPFwfc','As someone who''s a relatively new data scientist, thanks for giving me all the confirmation bias that I needed Ken ¿',163);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17247,'2qVWurPFwfc','Mathematics never dies. Programming Languages are rising and decline,  but calculus,  matrices and numerics will exists until the known universe ends',117);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17248,'2qVWurPFwfc','Great insights Ken. I certainly agree that data science''s decline is far from sight. In the life science domain, the use of data science has started to scratch the surface and there''s a whole new frontier of possibilities.',87);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17249,'2qVWurPFwfc','The sentiment is maybe coming from the difficulties to find your fist job if you are an aspiring data scientist. Rejection and unclear expectations (most companies have no idea how to find and sort data-scientists) may make many believe that is was just a fad, and they came a little late to the party.',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17250,'2qVWurPFwfc','As a student in Data Science, in order to automate those tasks, AI needs to be much more advanced in order to actually do it so its still pretty far off.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17251,'2qVWurPFwfc','Great insights as always Ken! The data science umbrella is so large, that several "titles" will be more defined by companies to find the person with the skill set required to solve their problems.',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17252,'2qVWurPFwfc','Just recently started my first role as a data analyst/consultant for a property consultancy, people in other teams and companies have told me about the struggle they are having finding data analysts.  I''m from the UK so this may of course differ where you are living but its clear new companies are realising how imporant data is.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17253,'2qVWurPFwfc','Data science is definitely not dying and for the fact it''s only scaling much bigger. Companies have started seeing the advantage of using data and data science and organisations are adopting data which is in fact create more demand for data experts ¿.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17254,'gamjNp2CToQ','Currently building up skills to eventually try and become a data analyst! Enjoyed the dope content, should def do some more!',199);
