Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15756,'Hru1FjQUkpI','Hearing the 360 always gives me a huge load of nostalgia.',496);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15757,'Hru1FjQUkpI','The NES, SNES and N64 had no built-in startup, but most official Nintendo games would add those in if you inserted a cartridge. The spinning N that made the N64 famous would differ between games for example, and was sometimes differently (and even wrongly) colored. Furthermore, the GB and GBC also had a startup that you didn''t inlcude, and the DSi system had a different startup from the original. Lastly, the GameCube had a 3rd startup version where the soundbites would change to Japanese chanting and shamisens, but it would only fire if you pressed the Z-button on 4 connected controllers at the same time.',53);
