Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17878,'SBmeEQOh20A','The one thing I think you really missed here in the raster editing section is Krita which is especially useful for creating tiling textures as well as having a really powerful painting workflow.',147);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17879,'SBmeEQOh20A','For 2d art i personally use krita. Its free and pretty neat, its good with animation too!',127);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17880,'SBmeEQOh20A','Adding this to my Learn how to GameDev playlist',677);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17882,'SBmeEQOh20A','I would just like to say that Audio software wise you have saved me so much research. Thank you for making this video and keep up the great work!',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17883,'SBmeEQOh20A','I know that you can''t get into it in a short video, but the political philosophy behind FOSS is fascinating. In many ways, FOSS, or at least its driving philosophies, predate proprietary software!',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17885,'SBmeEQOh20A','2:47 Actually, all unity tools are available in the free version, you only need to pay when you exceed 100,000 dollars per year, there are no limits',205);
