Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17888,'RTpj9_S4zVU','Quick idea: the player is able to construct a mastership between islands with customizable elements that she/he can bring back from exploration.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17889,'RTpj9_S4zVU','i got a cool idea, maybe have space pirate raids on your ship, in order to keep track of them, you would need to use your ships cameras to see where they are heading, possibly trying to cut off specific parts of the ship with doors in order to allow you to get there in time to take them out (if there is combat), they could probably take a couple slots per chest if they get to it then retreat to their ship, maybe its always flying next to your ship while you are being raided. this could make flying through the world pretty dangerous as at any point pirates could come and raid you. maybe there could be a whole security system that enemies have to get passed, or maybe they could cut your power in half making you unable to escape until all are gone, it could really make the game incredibly fun.',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17890,'RTpj9_S4zVU','This is awesome, I''ve been working on mine for nearly two years now. Its crazy difficult to keep motivated but i always found myself coming back to get work done. My game releases next month and I can''t wait. You''ve been doing it longer though, I respect you for the sheer amount of motivation you''ve had to keep up, and for starting a project this big!',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17891,'RTpj9_S4zVU','This game has come a very long way and is looking amazing! Good job so far! Me too is working on a 3d survival game and it is quite fun',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17892,'RTpj9_S4zVU','Those models look great i love the style, also a fan of the editing :)',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17893,'RTpj9_S4zVU','This looks awesome man! I love your idea of being able to make your base mobile and fly. Your terrain designs and creatures are also very cool. Keep up the good work and thanks for the video!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17895,'RTpj9_S4zVU','the game looks great i love the models also the video editing skills are great :D i wish i could make even one 3d model lol x''''; i subscribed!!',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17896,'ueNhxQ2lYOM','It''s really bold of you to ditch the safety of your master''s degree to pursue your indie dev career. Truly inspiring and thanks for sharing your stats. I hope more indie devs do their sales overview; it helps aspiring game devs like me to gauge what''s realistic and what''s not when it comes to running a one-man studio',127);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17897,'ueNhxQ2lYOM','Dude, that''s awesome. Also making a game every 3 months ain''t so bad. You''re officially in the business now. I can''t wait to one day join the rest of you.',161);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17899,'ueNhxQ2lYOM','I appreciate you explaining the logistics of game development. It simply is something done out of passion.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17900,'ueNhxQ2lYOM','I usually don''t leave good comments, but you''re a pretty funny guy, good personality, and it''s a shame that somebody so smart made very little on a really cool game like that. I hope it becomes much more successful. Shout out to all the underdog nerds out there who don''t get what they truly deserve.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17902,'ueNhxQ2lYOM','Dude that''s awesome! It''s a lot of money, don''t knock yourself down over it. It''s nice seeing a small indie dev become successful.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17903,'ueNhxQ2lYOM','The amount of hardwork you put in your video I can''t say , you are amazing',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17904,'ueNhxQ2lYOM','I love how transparent and motivating you are, keep it up I''m supporting u  ¿¿',3);
