Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17907,'HgrFyitP4bo','You should add a playground for the seekers while they wait to be released. A mini jungle gym or something like that so they won''t be bored while waiting the 30 seconds.',953);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17908,'HgrFyitP4bo','a couple suggestions that might be fun to see in game: ropes that you can swing on would be a welcome addition to diversify gameplay. i think a small fireball would be a cool rock skin to put in the game as well (you can recolor it 5 different times to milk it as much as possible). i''m very exited to see this games future, so good luck.',88);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17909,'HgrFyitP4bo','you should add a "taunt" ability for the hiders that plays a monkey sound ( the seekers can hear it ) , the hiders can taunt manually but every 2 mins it automatically taunts , because it is still really easy to hide from the seekers',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17910,'HgrFyitP4bo','An idea for the rock skins: maybe you can make them the gemstones in the cave and make them unlockable by interacting with the gemstones down there? Sounds pretty neat',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17912,'HgrFyitP4bo','Personally I think adding a way for the seekers to set bananas'' as traps that would show the location of a hider that triggers it might be cool :)',472);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16554,'MCl7YGCTC6A','Great recommendations list, Darren. Ronin and the car chases, awesome and has a great plot. Silence Of The Lambs; just a superb horror. Agree that Anthony Hopkins is on his finest day, with his portrayal of Hannibal Lecter. Just received my latest Universal Yums, from Czech Republic, today 9/23/2021!!! Many thanks for sharing with us and catch you on your next presentation. Take care ¿¿¿¿¿¿',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16555,'MCl7YGCTC6A','These movie reviews are always good, and largely because they are honest. If a given film is admittedly not the greatest or otherwise flawed,  the reviewer still tries  to point out what might be good or desirable about the movie etc. It''s a very democratic approach. Always a good job !',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16556,'MCl7YGCTC6A','I recently watched "Hackers" again and realized that it''s a really good pairing with the original "Tron". They both present ridiculous representations of how computers work but they are complementary, just from opposite sides of the screen. Great performances from a great cast in both cases. They are solid presentations of how people wished computers worked in the late twentieth century immediately before and after Al Gore opened up the internet to everyone.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16557,'MCl7YGCTC6A','One thing that makes or breaks a film is how the filmmaker respects the source material, in this case being The Silence of the Lambs by Thomas Harris. The film respected and captured this incredible book, & the casting of Jodi Foster and Anthony Hopkins, with Jonathan Demme directing, made it a masterpiece. Some movies you sit and watch.  Others creat a dimensional world you enter completely and that never really leaves you.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16558,'MCl7YGCTC6A','While I generally agree with your comments about Ronin, the callous disregard of collateral damage - shooting into crowds and causing violent vehicle accidents - was a total turn-off for me. They spread injury and death among innocent bystanders without any sign of care or compassion.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16559,'MCl7YGCTC6A','I just watched Post Mortem on Netflix last night and really liked it.  It''s from Norway and has only six episodes in the series.  I''m not sure how I could describe it - horror? (a little); comedy? (a bit); police procedural?  (I guess...some).  It was just really strange and (at least to me), very entertaining.  Also, I watch all foreign movies with sub-titles so I don''t know if it''s dubbed or not.  Anyway, check it out!',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16560,'MCl7YGCTC6A','I''m sure you''ve seen Malevolent from 2018 with Florence Pogue, but if you haven''t it''s just a really well acted horror flick.  I seem to like just about everything Florence Pogue is in.  Thanks for another great list as I plan to check out Primer and Troll 2, both of which I never would have considered without your recommendation.  Pls keep making as many of these lists as you can!!',2);
