Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16566,'NU87A-5SQGU','This is the movie you get when you combine Mad Max, The Postman, Book of Eli, and a low budget.',19);
