Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16572,'9k1dVfkF5gk','I know that you have other things going on, but I seriously miss the regularity of your videos during the height of the pandemic. You, J. Kenji Lopez-Alt, Marion''s Kitchen, Nicki Positano, and a few others are what got me through the days (weeks!) of quarantining alone and food shortages. The fridge in your old kitchen gave me hope that I  could shop and cook for good food and make it work in my ancient undersized fridge. At the same time, I was unemployed just before the pandemic. I''m now employed again (yay!), but I miss the regularity/frequency of my favorite YouTube channels. Best wishes!',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16573,'9k1dVfkF5gk','I can’t tell you enough how excited I get every time you release a new video. I’m actually making your infamous stew today ….and probably this chicken Piccata recipe tomorrow ¿',56);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16574,'9k1dVfkF5gk','The video was only posted 5 hours ago and I already got off work, went to the grocery store, made it, and am eating it as we speak. And unsurprisingly ITS GOOD!',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16575,'9k1dVfkF5gk','I''ve been in the mood for chicken piccata for a while so this has just solidified my grocery run for this evening.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16577,'9k1dVfkF5gk','The editing is topnotch!! Oh, and the food looks incredible too!',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16578,'9k1dVfkF5gk','Alison!!! ¿¿ I absolutely love watching your videos. This looks delicious! Definitely a recipe I’ve gotta try. I was looking for a really good chicken piccata recipe and here we are! ¿',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16579,'9k1dVfkF5gk','I love you, Alison! Can’t wait to make this, this week and I hope it’s okay to call you this, but you are truly my favorite chef!!!!¿¿¿',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16581,'CE2ePMYoNaU','wow I''m so proud of lil mama. She did a great job playing this role. It really captures what goes on every day in the hood. I cried, laughed, and my heart was touched. I know so many ppl with similar situations and I am thankful someone is bringing it to light.',144);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16582,'CE2ePMYoNaU','This movie really taught me more than I already have known, I''m a young girl trying to start a new life alone after all the trauma I strongly believe that all shall come to end.... This movie also got me a bit emotional too but indeed Is a life teacher, i enjoyed and recommend that it should display movies in different contents cos it''s inspirational',133);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16583,'CE2ePMYoNaU','Lil Mama is so slept on. She is full of talent.',390);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16584,'CE2ePMYoNaU','Every movie I''ve ever seen lil Mama in has been so interesting to watch. Her calling is acting. It''s evident. I''m rooting for her.',56);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16585,'CE2ePMYoNaU','OMG LIL MOMMA is SOOOOOO TALENTED AND GORGEOUS ...I hope her acting career takes off she is one of the greatest and they don’t show her enough love this is pure talent and this movie is bomb asf',279);
