Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16587,'CE2ePMYoNaU','Wow this movie was raw...the fact that she lied to majority of the people she spoke to about her kids because she was ashamed says volumes. This was wayyyyy too good for free on YouTube but I''m glad it was.',153);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16588,'CE2ePMYoNaU','This little girl brought tears to my eyes. She’s so smart. Lil MaMa is the truth all around !',79);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17268,'PNr51ZJkoBU','Want to quickly commend you for the consistency and quality of your content. I don''t usually comment - but from helping me with my UChicago application (where I will be attending next year :D) to now supporting me in identifying my future career (I am very interested in data science), I am grateful to you for all your work. Thanks!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17270,'PNr51ZJkoBU','I’ve just concluded my bachelors in Civil engineering but I am inclined to move to the Data science field. During my course I learned how to program in phython(in Spyder) and SQL and I’m still updated with those skills. Imagine you are in my shoes what should I do moving forward to learn more about data science? and ensure I can  get a job at it? Do you think it is necessary to take another course? What are the general technical skills I have to master?',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17271,'PNr51ZJkoBU','Great video!  I appreciate the honesty.  Did you start as an analyst before moving to a Data Scientist role?  What role would you recommend for recent grads?',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17272,'PNr51ZJkoBU','A scientist who works in data science has been a godsend. Finding a job has been difficult in the wake of my graduation and several unsuccessful job applications. After weighing my options, I chose to leave physics and hunt for a position in data science. Before seeing your videos, I was baffled as to why I continued being turned down for jobs despite having two master''s degrees, one in physics and the other in applied physics. Now that I''ve seen some of your vids, I understand why. Glad I found your channel on YouTube:)',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17273,'PNr51ZJkoBU','just start my datacamp journey, thank you for this helpful insight, I have one question, how do you know that some company just using you for their free project while they actually don''t want to hire anyone.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17274,'XW0YptcgZSk','Very understandable approach to explaining the differences in these roles. It''s definitely appreciated, especially with the blurred lines that companies often use to represent these fields.',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17275,'XW0YptcgZSk','Really nice video. I am a current data analyst at a large tech company, hoping to become a ML engineer eventually (similar to a google software engineer whose capable of everything in that chart). Love the content, keep it up.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17276,'XW0YptcgZSk','great video! thanks for clearing that up and explaining the various elements of so many different roles in this field! very helpful.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17277,'XW0YptcgZSk','I am a marketing project manager and i was wondering if i could shift my path to data scientist/analyst, and your amazing video made it clear for me, thanks very much',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17278,'XW0YptcgZSk','25 hours a day are possible on days where you return from daylight saving time to standard time.',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17279,'XW0YptcgZSk','subs.. I''ve been seeing your video on my feed for a while now since I started roaming around to study software development but my true goal was to go up to the data scientist role, that''s just the goal I have in mind and you just revealed to me that I don''t exactly NEED to become a software engineer first if I can land myself to a data analyst role, the hierarchy showed me I can still walk up slowly to reaching my goal.. you are a god send.. :)',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17280,'XW0YptcgZSk','thanks man for clearing this up... especially in India ...all IT companies have made a mess about Data jobs...why don''t you make a video dscussing these JDs ...especially from India....? these all are MNC''s',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17281,'XW0YptcgZSk','That''s a very nice explanation, I''d love to see each step in-depth',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17282,'XW0YptcgZSk','Companies nowadays prefer a generalist over a specialist who is super expert at one specific field only. This is why developers experience burn outs so often, they have almost no option but to spend a great portion of their time trying out new tech, and whatever they learn will most likely be replaced by "better" resources.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17283,'XW0YptcgZSk','Yep, I can confirm as a PhD research scientist that I do in fact have a side kick ML engineer (actually 3) to help me create all my crazy shit.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17285,'4Z6lxfglvUU','This video helped me pass my data scientist interview! Thanks!',866);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17286,'4Z6lxfglvUU','I once had a question, how the regressor would look like without any coeffecient except the intercept in a linear regression. Could not answer it right away, but got the to the answer after a couple of mins. I asked the job interviewer if anyone ever got it right after immediteatly and he said only one, but he did not hire him. So don''t worry question aren''t everything, its got more to do with the way you handle the situation with dignity and without being a liar.  Also keep your head up, iwrote hundred of applications and still ended up at a big corp.',77);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17287,'4Z6lxfglvUU','I love your videos! I had one quibble about your SQL solution to #1. If some publishers have more videos than others, then their video durations will affect the mean. You could imagine one publisher with 10,000 videos and 9 publishers with 10 videos. In this case, the average duration of that one super-publisher''s videos will have way more influence on the mean than the other publishers. I think your question is better answered by first computing an average for each publisher and then averaging those averages. (of course, this detail may not matter in an interview)',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17288,'4Z6lxfglvUU','LOL very impressive that you can make a video about interview questions so fun to watch ¿ ¿',273);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17289,'4Z6lxfglvUU','I really love your channel, it has helped me understand what DS really is. I am an incoming freshmen and will be pursuing DS!! This seems hard right now but as the years go this will all make sense. Keep up the good work.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17290,'4Z6lxfglvUU','I think this is a good video for suggestions on how to get a data science job at a larger company. However in my experience data science interviews at non-large companies put a huge focus on machine learning/deep learning, linear algebra, statistics, core python programming (sometimes R), SQL, spark/AWS/GCP, and data visualization (tableau, matplotlib, R)',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17291,'4Z6lxfglvUU','I''m sure everyone would love to hear about some materials you''ve gone through to follow this DS path. Getting an internship is impossible in Japan.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17292,'4Z6lxfglvUU','Hi Jonathan, awesome video. Please rate the online data science or big data courses and share your opinion regarding if they are any good in landing you a job vs a Masters in CS.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17293,'4Z6lxfglvUU','Hey Joma - the new thing now in Data Science interviews is ''modelling'' questions (makes sense, really). Curious if you would do a video on how to prepare for that? For many companies, that is the make-or-break portion of the DS interview process.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17294,'CC66RXeTn_4','Data Nerds! What skill are you currently working on that is a non-technical skill (I.e. soft skill, analytical skill, domain knowledge)?',141);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17295,'CC66RXeTn_4','Dude love the cut outs! Great video!',109);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15775,'JzjkmhcpYYU','I’m very happy with my Series S, and I’ve been all about physical media before I got it. I do plan on getting a series X eventually, but I’ve just been playing digital games on my Xbox One most of the time because of Game Pass Ultimate. After thinking about it, I realized my physical library on Xbone was substantially smaller than my PS4 library or Switch library, so I didn’t really feel bad about getting the Series S and an external hard drive. Even though my 360 library was pretty big, I’ve been able to get a lot of my favorites on sale for like $3 each digitally. When the Series X becomes more available and becomes a bit cheaper, I’ll get one but for now I’m really enjoying my Series S',160);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15776,'JzjkmhcpYYU','As someone on a budget the series s is great game pass makes it really great especially with the deals u can get and just using external hard drives are a better option because transferring games is better than paying half the price of the console for the ssd so yeah if u have more money maybe get the series x but it just depends on ur situation',50);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15778,'JzjkmhcpYYU','It really depends on what your main platform is. If your main is Playstation, I''ve seen a lot go with the Series S to get the exclusives. Most that main a PS5 don''t want to pay the extra.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15779,'JzjkmhcpYYU','Thank you for sharing your experience with these consoles and not "fan boying". Speaking your truth will help alot of people who are on a budget. People constantly spread the narrative of digital games are horrible but why when the majority of the world doesn''t but movies or music. I''m all for digital downloads and will only purchase physical games if it''s attached to a special edition that I''m truly a fan of',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15780,'JzjkmhcpYYU','In your own words: "Do I really want an XBOX? No. Do I really need an XBOX? No. But I feel like I work hard and I deserve it." In reality, since the day you stepped onto the XBOX Series platform, you have been trying to convince yourself that you need something you didn''t really want, that''s foolish logic. The next time you don''t want something, don''t buy it because you think you work hard and deserve it.',1095);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15782,'JzjkmhcpYYU','I bought a Series S when it first came out and a 3 year gamepass subscription. Was pretty impressed with the little beast but soon ran into the lack of free space to install games.  So I decided to sell the S and buy the Series X. Had the X now for a year  but the other day I suddenly realised that I hadn''t turned on my series X for a week. And before that it was just sporadically. So decided to sell.  BUT,  I didn''t want to completely move away from gaming and I managed to find an absolute awesome deal on a Series S.  140 euros with 2 controllers and 1 of those controllers is the 20th anniversary edition.  Going to sell that,  which will make my Series S end price probably around 60 euros. Can''t get better than that!  For casual gamers,. like myself,  the Series S is a fantastic console.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15783,'JzjkmhcpYYU','Big mistake!  I own both the X Box Series X and PS 5 and alot of the older games from previous gen releases run and look alot better on the X Box Series X.  Even some of the current gen titles look better on X Box Series X.  Also, Microsoft''s recent buy outs with Bethesda, Activision and potentially other gaming software companies means future releases like COD and Skyrim releases may be X Box Series X exclusives.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15784,'dnOwCyedro8','Got my Series X on Friday, and I’m really impressed with it. The visuals are jaw dropping.',351);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15785,'dnOwCyedro8','I went from a One S to the Series X and the jump to 4K 60fps is pretty significant, everything feels much smoother and everything loads faster (thank god for SSDs). The only issue is that there aren''t really any games out right now designed specifically for the Series X with the exception of the medium aha',127);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15786,'dnOwCyedro8','I''ve been a life-long PlayStation fan, but after looking at the beauty and power of the new Series X, I just may get one.  I''m enjoying the PS5 too.',193);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15787,'dnOwCyedro8','As a huge PlayStation fan, That packaging is another level ¿',153);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15788,'dnOwCyedro8','I’ve had my series X for a week and I’m still in love with it, the visuals and overall gameplay of the games are amazing, I can’t stop playing Microsoft flight sim because of how beautiful it looks and how well the console runs the game. Strongly recommend if your an Xbox fan',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15789,'dnOwCyedro8','Great job here. Man, that is so beautifully lit, filmed and cut. It looks literally perfect! Would you ever consider making some tips how to film like that? Re the Series X, it''s such a shame supply sucks. I''ve been lucky enough to source one, but it''s such a wonderful machine that should be in so many more houses!',15);
