Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17298,'CC66RXeTn_4','Fantastic video, as a BA I can attest that SQL and Excel are still very much in demand.  After being at one job for 15 years I had to put myself back on the market.  After doing the excel, SQL and powerBI assessments on LinkedIN to back my resume ahead of the screenings the jobs and some cool offers started rolling right in.',27);
