Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17362,'k2P_pHQDlp0','Hi Krish, I have always been interested in AI and things around it & about it. You nailed it, man! A naive like me who has some faint idea of AI could simply understand and know further about DL & ML too! Very useful video. Thanks much! :)',1);
