Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17366,'gUukBKtwjQo','I have been a data scientist for three years. As a data scientist, one can only be a generalist until and unless he has domain knowledge of the field his company works in. The fascination with data science dies down once the projects are not relevant to your field of interest/domain of expertise. Moreover, companies now have a hard time justifying the massive amount of investment done towards data science. It''s better to be a domain expert and then add skills of data science rather than just being a generalist data scientist without any domain expertise. Hence, I''m leaving data science and starting my PhD ¿',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17367,'gUukBKtwjQo','I am a Structural Engineer. This is a good field for data science since most civil engineers don''t learn programming/coding and when they do they just shift to IT industry. Data science will be very crucial for monitoring the life of structures.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17368,'gUukBKtwjQo','I agree to some points but disagree to some, I don''t think studying Data Science  and knowledge gained will be worthless in 5-10 years. The core statistics and maths learned in the degree will be useful decades to come. Yes some aspects of tech stack will change but the same thing happens in other computer science fields as well. The Data Science is very broad field and if one does degree in this field they can transfer those skills into multitude of other fields and can create value for the company and lastly career trajectory in this field is still not fixed as this is nascent field and we don''t know how things will pan out in 10-20 years down the line.',79);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17369,'gUukBKtwjQo','Dear Sir, Data Analyst and Data Scientist shares a lot''s and lot''s of diffrence btw them. Data Scientist have to deal with AI which requires data to built  an algorithm based on machine learning.Self driving cars requires AI, Biotechnology companies requires AI. And in the age of AI,no one can stops AI and Data Scientist to thrive.And every profession always have pros and cons.Nothing in world is perfect.Ask yourself sir,Is Computer Science was in demand, back 20yrs,as it was now?¿¿',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17371,'gUukBKtwjQo','Thank you professor for giving such crucial information. How about MIS (Management in Information Systems) for MS in USA. Does even that has the same supply-demand ratio problem? or is it safe bet to pursue masters in that field? Throw some light on it professor!!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17372,'gUukBKtwjQo','Thank you for this video, I am going for a Ph.D. in Business Data Science and was wondering what steps I can take to make sure that I can be successful in this field. I have worked as a Data Scientist in Fintech companies in India for 2 years and now going forward with my Graduate Studies. Your videos have been very inspirational.',35);
