Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15904,'Ki2JWyOCXwo','I think once developers start to use velocity architecture, mesh shaders, direct storage, FSR2.0, VRS2.0 the full toolset then we will see some amazing results from this little beaut.. especially as the biggest issue is lack or RAM which with direct storage n velocity they will able to use the SSD as a Virtual RAM pool. the console has a lot of potential but depends if the developers use the toolset available to them when the features become available. especially as we know the GDK is New for this gen and a lot of features are still being developed and improved upon.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18025,'PeMlggyqz0Y','I love this content, and the concise nature in which its delivered!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18026,'z-EtmaFJieY','She is such a good teacher , never knew Machine leaening and AI could be this interesting.',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18027,'z-EtmaFJieY','Carrie Ann, I want to thank you for bringing so much enthusiasm to the topic. This is exciting stuff, but it can be shown in a very static and boring way, and you don''t do that.',224);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18028,'z-EtmaFJieY','I love how the code was placed right next to the decision tree! It was so simple to understand the tree and with the code right next to the branches I felt the same simplicity merge over as I looked at the code. Definitely a smart way to relieve the anxiety of trying to figure out a new code! Seeing this makes me think that if kids are exposed to math and science examples like this in programming courses or even in after school activities they''d be even more adaptable to learning how to code!  You guys are amazing! Please keep the videos coming!',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18029,'z-EtmaFJieY','My whole AI Semester in almost 12 minutes',728);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18030,'z-EtmaFJieY','The most fascinating part about DeepMind''s AlphaZero is that it did not need human-created training data. It only needed to play itself enough times, and by sheer volume, become a master. Humans can''t do that, unfortunately.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18031,'z-EtmaFJieY','As part of a plant anatomy class, many years ago, we did field measurements to determine whether a population of trees in a particular canyon represented two distinct species or showed evidence of interbreeding. I never saw the results of the analysis of that data, but it should have looked very much like some of what''s presented in this video.',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18032,'z-EtmaFJieY','I would really love to see a crash course series on the practical skills that scientists need (IE latex, soldering, writing a research paper, advanced lab skills, etc.)',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18033,'z-EtmaFJieY','as someone aiming to double major in entomology and computer science this video is right up my alley! love the example chosen for this episode!',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18034,'z-EtmaFJieY','As a newcomer to Machine Learning this was a great overview. Thank you!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18035,'z-EtmaFJieY','Spectacularly well done video on fairly complex topics! I''m new to machine learning in general and I want to learn more. I''ll be watching your other videos on related topics next. Thank you!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18051,'I74ymkoNTnw','I''m so happy i found this video and your channel! This was so useful for me, I thought I was the only one who felt Andrew Ng was speaking Zarglar after the first couple of modules. You''ve inspired me to try again with the try-get stuck-research and repeat method. Thanks!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18052,'I74ymkoNTnw','Thank you. I think my education goes well with ML or AI. I got a degree in psychology (neurobiology focus), math and CS. Just started pursuing python once more to go into data science',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18053,'I74ymkoNTnw','You did a great job introducing the "how to learn" aspect of what I think stumps a lot of intimidated curious learners. Basically, when you explained "When I saw this I didn''t know what it meant, so I googled it." That is crazily enough, a big lesson to learn.  Just hearing that at least is encouraging me to take my first independent steps to learning this stuff.  So of course, thanks for the video!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18054,'I74ymkoNTnw','This may be the best YouTube tutorial ever. Making the process of learning this entertaining is fantastic. I had to go about it in the same way, and I *wish* there had been a video like this years ago... Sending this to my son. Thanks!',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18055,'I74ymkoNTnw','I had the same exact problem when I started learning: too much jargon and not enough explaining. The tutorial series by a channel called giant_neural_network was great because he teaches you not only the theory but also how to actually code a simple neural network. He does it very visually and it is very well done.',304);
