Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18069,'nl7kDPYD20A','Thank you for the recommendations, I’m really into AI programming and I want to leave my truck driver job to start as a programmer. I’ve working with that about five years ago. Even been 36 I am definitely going for it!',62);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18070,'nl7kDPYD20A','This was awesome! As someone who is still only recently introduced into the CS field and interested in perhaps dabbling in ML/AI, this was really helpful for people like me. Thank you.',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18071,'nl7kDPYD20A','The most surprising thing for me is that I have always been interested in AI but did not know what computer science classes to take to follow this through. I ended up taking a fundamentals to data science class this semsester and it taught me much of the Basic AI algorithms that you mentioned.  I guess luck is on my side lol',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18072,'nl7kDPYD20A','Also it may be wise to learn MATLAB to a fairly advanced level before doing ML. The jump from basic Python to ML is quite a big one,  I was not able to make that jump and got fired from my job because of it. You must know how to populate matrices by row and column, take the average, etc. A basic Python course won''t cover these things, but MATLAB courses are more specific for the type of things you will be doing as an machine learning engineer or data scientist.',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18073,'nl7kDPYD20A','Hey Tim, good video! One thing I would say is that I wouldn''t recommend beginners to start with Reinforcement Learning - as a matter of fact I think that''s one of the more advanced applications. Supervised Learning with Neural Nets or Computer Vision would be my suggestions before going to Reinforcement.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16730,'1MZY_0tYmrs','The Magnificent Seven, over time, has come to describe the lead actors more than the movie. And the most  magnificent of the seven ... Yul Brynner. Impossible to match him.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16731,'1MZY_0tYmrs','Possibly not only the greatest film ever made but the greatest story. The lesson being that material possession should never take prescendence over our common humanity. ''A dollar bill always looks as big as a bedspread''. What a line!',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16732,'1MZY_0tYmrs','Yul Brynner, Steve McQueen, Charles Bronson, James Coburn, Robert Vaughn, and Elly Wallace, one can only imagine what the production took to create such a classic, all of these professionals were real actors that worked for a craft, and then defined their craft particularly according to each one''s caliber of understanding. Timeless is correct.',96);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16733,'1MZY_0tYmrs','I saw this movie in seventies as a teenager several times. They were all so larger than life heroes. There can never be another Magnificent Seven.',105);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16734,'1MZY_0tYmrs','Even though the movie is a remake, it''s one of all time greats. Sure, some plot twists are naive, and the fighting/effects don''t stand to contemporary cinematography, but everything else is simply brilliant, starting with the original score, all the way to the moral lessons the movie brings. A true inspiring masterpiece.',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16735,'1MZY_0tYmrs','I first watched this movie in a cinema in 1960s . The righteousness, truthfulness, bravery and courage shown in the characters in the movie helped to mold my character in the later days of my youth and made me join the uniformed service to serve the public.',215);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16736,'1MZY_0tYmrs','Esta película es excelente, fue filmada en México (Cuernavaca, Durango, Tepoztlán y los estudios Churubusco de la ciudad de México), además de contar con extraordinarios actores estadounidenses (Yul Brynner, Charles Bronson, Steve McQueen o James Coburn), también  contó con magníficos actores mexicanos (Jorge Martínez de Hoyos, Enrique Lucero o Rosenda Monteros)',18);
