Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16759,'aJ2I8fvo-Zw','I completely agree with you about Thirteen Lives! I watched it the other night and I wasn''t sure I was going to make it to the end. It was so intense and I felt so claustrophobic and almost panicky at times watching it. Unbelievably fantastic movie!',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16760,'aJ2I8fvo-Zw','Better Luck Tomorrow is still one of my all time favorite films. As an Asian-American, I never understood the criticism that this film made us look bad. That viewpoint was actually way worse and even racist, in my opinion. What, we can only have roles as nerds, straight A students, martial artists, dutiful sons and daughters, etc? This film portrayed more of my reality at that age than any other film ever did. Sure, I wasn''t dealing and stealing and whatnot. I was in all advanced classes and band. But I also ran track and played volleyball and had a cheerleader girlfriend and went to parties. I felt seen by this film. I may not have always agreed with Ebert but I will always respect him for using his influence and voice in the industry to shoot down that nonsense at the time.',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16761,'aJ2I8fvo-Zw','I wish someone would come up with a streaming service that includes a lot of movies from the 40s and 50s without having to pay extra for them. I''m a big fan of classics including the likes of Cary Grant, Kate Hepburn, William Powell, etc. I used to be able to watch them on YouTube, but they''ve pretty much all been pulled because of copyright infringement.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16762,'aJ2I8fvo-Zw','Thirteen Lives was incredible. It''s exactly how we as human should be behaving.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16763,'aJ2I8fvo-Zw','I really liked Bound! It shows even if you have a small budget you can still make a really good movie. 13 Lives was good also. I watched Marathon Man when I was too young to get into it or understand it, I recently watched it on Prime.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16764,'aJ2I8fvo-Zw','You could not have been more spot on with Thirteen Lives Darren. What an amazing film! Incredible. Thank you as always for the recommendations.',1);
