Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17373,'gUukBKtwjQo','Thank you for the information! I am going for a Ph.D. in Geospatial Data Science. I have experience in programming and have a background in Remote Sensing and GIS. As you talked about finance and  banking, I would like to know your opinion on the careers in the Geospatial industry if we have data science skills.  I would be glad to hear back from you. :)',8);
