Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17387,'IpawPa1e2o0','I think most of the folks(experienced ones) already know what you are suggesting. I was expecting some good advices in terms of applying for the jobs through LinkedIn & other portals from India. USA is close to impossible to get into directly from india but european countries are still open for the direct jobs. It would be great if you could throw some light on that route',22);
