Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17410,'65yXoFc5stI','Hi Sundas, great video. I am trying to make a switch from operations to analytics and I learned Excel and Tableau first and then learnt to code. Completely agreed that knowing the tool isn’t enough. You gotta be a pro to make them believe you have what it takes.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17412,'65yXoFc5stI','It''s so greatfull of you Sundas mam to mentor us gracefully. I''m just 18 but see my future as data scientist and always get many more to learn from u . Mam please keep motivating students like me and others as well . need more videos on data scientist.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17413,'65yXoFc5stI','Hi Sundas! I am a chemical engineer working in industrial automation for several years. I spent several years drawing conclusions from tons of process trendings and doing data visualization (when I I didn''t know what it really was) until I found your IG and that''s when I knew I was into data analytics. I am doing the Google data analytics certificate course and it is great so far. I am also hesitating to stepping into the data scientist role but I will see how the data analytics goes first. Thanks for inspiring me to give my career a new direction !( Changing at 35 is not easy!)',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17414,'65yXoFc5stI','Thanks so much for clearing it out. I am learning data science on my own. I started learning statistics few months ago, almost done. I was a little confused and restless if i made the right choice by learning statistics first. I read a lot of comments on quora where people said that coding should be the first step, it didn''t make much sense to me. Now its all clear and i have gained confidence after watching your video. I have a similar road map to what you just said. Thanks so much for inspiring and giving us so much info. All the best and really looking forward to watch your future videos.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15905,'Ki2JWyOCXwo','Comparing the Switch and the Series S is a good way to explain what it is. Both have a more accessible price but the difference is that Series S has a lot more power and features but cannot be used portable in a convenient way. It depends what you need/want at that price point.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15906,'Ki2JWyOCXwo','I think the implementation of FSR 2.0 and the evolution of upscaling technologies will enable the Series S to stay relevant.  The third pearly thing is a concert, but I think it’s more of a problem with games made for the previous systems ie Ace Combat 7',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15908,'Ki2JWyOCXwo','I have a PC with a 3060 in it, I have a Nintendo Switch, and I have a Series S... i have never had an issue with how the Series S runs games because my xbox is mostly for game pass, and games that run perfectly fine on the console, like NBA 2k. Optimizations for new console generations take quite some time and I''m patient, and it is not a new issue. The PS4 had its issues, the xbox one x had its issues, they were fixed, people complaining should calm down.',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15909,'Ki2JWyOCXwo','For weeks I was using the Series S as my main console unintentionally because it turned out that I was playing more where I thought I would play less. I had no complaints, it was really good. I eventually switched but it''s not like I felt there was much of a problem.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15911,'Ki2JWyOCXwo','I bought my series S on 21st jul 2022. its my first console ever and been almost a month since i got it. I absolutely love it. idk why i see people complaining about the resolution. I got it plugged in on my 4K 55" TV and boy games look amazing. I have been playing Halo infinite, Forza horizon 5, FiFA 22, Hades, two point campus, Ori and the wisp, & turbo golf racing. and after all these games, i still have around 143 gb left. so no complaints about storage either. I am totally enjoying it.¿¿',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15912,'Ki2JWyOCXwo','I absolutely love the portability of the series s.',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15914,'AhEvsny6zLQ','Quick resume is a god tier feature. PC my main platform, but damn the quick resume on my series S is something else. Brilliant for getting in quick games before work when you''ve not got much time!',8);
