Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15919,'AhEvsny6zLQ','Think of the way PS2 got into a lot of house holds. the DVD player. That DVD player turned a LOT of movie watchers into Video Game players. XBOX being on a TV with GAMEPASS could be another "Trojan Horse" brining in new gamers. Keeping video games around that much longer',27);
