Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15950,'qqR9pYcrLeU','If an Elite Series 3 controller is on the horizon, Microsoft really needs to focus on quality control. I went through 3 Series 2'' controllers before giving up and getting a refund. I experienced faulty paddles, loose buzzing rumble motors and worst of all large deadzones on the analog sticks. I really wanted to love it but I couldn''t warrant spending that kind of money on a controller with basic functionality issues.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15951,'qqR9pYcrLeU','Family plan sounds great. Miss the old version we had on 360. Considering I''ve bought at least 4 consoles per generation. And 4 subscriptions monthly isn''t exactly cheap. This is possibly the biggest news of this gen for myself.¿',0);
