Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18075,'nl7kDPYD20A','Really liked the step-by-step breakdown of the process, the whole video was very informative !',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18076,'KNAWp2S3w94','Laurence, thank you so much for taking the time to put out such concise, intuitive walkthroughs. You manage to make everything going on behind the curtain really accessible and unintimidating!',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18077,'KNAWp2S3w94','Nice explanation. I am also building a course on ML in Python (for a University) more from an implementation perspective. This surely helps!',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18078,'KNAWp2S3w94','I love these tutorials and videos that Tensorflow puts out. Super informative. Thank you Laurence, what a great video! You bet I''ll keep watching these series! Have a fantastic day everyone!¿¿',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18079,'KNAWp2S3w94','Subscribed after watching this. Love the way you explain. You explain the concept very clearly and also you add a little bit of the code which gives me a great preparation for the coding application. Keep up the good work Lawrence',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18080,'KNAWp2S3w94','Hey there Lawrence. Really good explanation. Thanks for putting together. Just wanted to ask how often these vids will come out?',129);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18081,'KNAWp2S3w94','Thank You for explaining this so clearly and eloquently.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18082,'KNAWp2S3w94','Great explanation, I loved the way you explained it! I''m excited to see more!',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18083,'KNAWp2S3w94','Was just waiting for this from  Lawrence. I m learning machine learning daily and time to take this to next level. Thanks Lawrence and Google and tensor flow',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18084,'KNAWp2S3w94','Extremely helpful explanation, thank you very much!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18087,'reY50t2hbuM','You should learn machine learning even if you don''t intend to be a machine learning engineer.   ML is a tool, an important one that can help make sense from data.   In the future,  knowing how to use ML as a tool will be equivalent to knowing how to use Excel today.   It doesn''t mean that everyone needs to know how to build a spreadsheet application but one would be highly handicapped if he or she doesn''t know how to use one.',916);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18089,'reY50t2hbuM','Well, as someone who likes research in AI, I give major credit to Software Engineer. The math is pretty intense to always remember so Software Engineers are very good at making black boxes that are reusable. So I think everyone in technology is just as important.',64);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18090,'reY50t2hbuM','I absolutely agree with you. From my experience toward my research, machine learning is only useful if there is data available to extract features. However, if you are extracting features from unknown observation then model-based approach is very useful. These days a hybrid between model-based approach and machine learning techniques are useful',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18091,'reY50t2hbuM','Great video Smitha. I have been working as a developer for about a year now and I just landed a job as a data scientist. I’m hoping to transition into ML in a few years!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18092,'reY50t2hbuM','Thank you for the honest talk. The more I learn about machine learning, the more I realize that what you say is true. At the same time, everyone is different. Some people will simply do anything to work in ML and that''s okay.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18093,'reY50t2hbuM','i took an introductory crash course and some of the simple projects that we did were so cool that i want to learn more about ML and make more exciting projects. thanks for guidance :)',69);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18095,'reY50t2hbuM','Wow, massive learnings, thanks! I wonder if you wouldn’t mind discussing the kind of limitations a hobbyist would face? What kind of projects are possible?',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18096,'VwVg9jCtqaU','I have been studying Deep Learning for the last 3 weeks or so and this guy explained it like in 20 minutes, I wish I had a teacher like him :(',1240);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18097,'VwVg9jCtqaU','There should be a button of "Mega Like" for this video. Great explanation of an epic tool. Thanks a lot!',285);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18099,'VwVg9jCtqaU','This is an amazing smooth intro to a relatively complicated topic. The QR codes are a smart move. Hoping to see more videos on similar topics. Thank you both.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18100,'VwVg9jCtqaU','Wow I''ve been reading about this stuff a lot but always had difficulty wrapping my head around it.  I did the tensorflow demos, but was unable to understand it well enough to try something on my own.  He explained it very clearly and cleaned up a lot of my misunderstanding.  Thank you so much for sharing!!!',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18101,'VwVg9jCtqaU','I can''t even tell you how much more I enjoy using TensorFlow 2.0 than I did using the previous versions. Thank you for all the great improvements. A special thank you for TensorBoard. A very useful and fun tool.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18102,'VwVg9jCtqaU','Laurence''s explanations were wonderful! Thorough, but also simple enough that even a newbie can understand it. Thank you!',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18104,'VwVg9jCtqaU','Amazing video, there''s many elements here that are explained so well. Looking forward to doing more stuff with TF in the future! :)',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18105,'VwVg9jCtqaU','I wish i had watched this a year ago. Easy to understand with great details! Thank you, sir!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18107,'Rt6beTKDtqY','This is the best quick explanation of machine learning I have seen to date. You covered the first few weeks of the course extremely well and concisely. I shared with all my friends to get them more hyped about machine learning!',120);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18108,'Rt6beTKDtqY','With gradient descent, we generally don''t  update one parameter and ''then'' another. Rather, parameter updates are done simultaneously. Great video overall. I like how you started with a simple model structure and skipped the derivations to keep things understandable to a broader audience.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18109,'Rt6beTKDtqY','Hey it would be great if u could do a  machine learning course for complete beginners, here on YouTube. I really enjoyed this vedio! Thanks you so much for this!!',249);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18110,'Rt6beTKDtqY','This topic is explained in depth in Linear algebra.',171);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18111,'Rt6beTKDtqY','Nice video! Hands down your channel has delivered the most useful information to me and my future. Not to mention interesting videos like this one. I''ve been doing discrete math stuff and so it''s refreshing to learn about more continuous and applied math concepts.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18112,'Rt6beTKDtqY','This is a great explanation of a very complex subject. While incorporating and utilizing such a topic doesn''t require an intense understanding of the process, it does help to share the facts with others.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18114,'Rt6beTKDtqY','I already took the Coursera course, but BOI was this a good refresher. Also helps me as a CS major have a clearer idea of what math I''ll need to take. Thanks again!',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18115,'Rt6beTKDtqY','You did a phenomenal job explaining this. Thanks a lot!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18117,'pHiMN_gy9mk','Daniel you, my friend, are a legend. It''s so good to see such passion and enthusiasm for your craft, and the ML community is glad to have someone like you blazing a trail so that the new members can follow.',274);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18118,'pHiMN_gy9mk','Presentations in the technical field such as this rarely have this much quality knowledge packed into them but it''s even rarer that they are this aesthetically pleasing!',37);
