Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16794,'0VwoYslTFv4','I loved the first avatar movie, thought it was amazing, couldn''t wait for the next movie. Then 13 years went by. It''s like your dad finally came back after he went to go get milk that one day when you were a kid and now you''re an adult and he asks if you want to play catch in the yard. Confused, surprised and filled with a decade and a half of resentment, you''re like "yeah sure, I just gotta go get some milk first"',193);
