Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16798,'0-MwnC4nM1I','I cried like a baby through this entire film. A biblical story brought to life with such brilliant actresses and actors.  Started watching this movie about 9:45 in the morning. I never have time for anything else, especially movie watching, but it captivated me and I decided I''ll watch it out and then get moving. Didn''t even wanna move a beat until the end. It''s worth the watch. Get your hearts warmed and the tissues out. Smiles! Ruth was deserving of all her flowers. I fell in love with this actress since Tyler  introduced her in "Why did I get married?" Naomi, Loretta Divine was perfect for this roll. Love love this movie. Again watch it.',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16799,'0-MwnC4nM1I','What a God bless movie. From the story to line to the Characters. Absolutely beautiful !!',2);
