Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16808,'5TMLa14s70s','A Writer''s Odyssey is very original and entertaining. It has flaws, but it''s wildly imaginative. Fantasy? Sci-Fi?  Pure action epic?  It''s hard to say what genre it belongs to.  But it''s certainly not the usual Hollywood remake or evil a Marvel creation.  I saw it and was pretty impressed.  I can actually see Hollywood doing a remake on it because its story is so original and amazing.',10);
