Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16824,'tq7WVgrrucY','Grandes atores que já se foram. Mesmo num enredo simples e quase cômico, eles , com suas firmes atuações, transmitiram  impacto e emoção em seus desempenhos. Kirk Douglas ( nesse filme ele já estava bem idoso ) viveu mais de 100 anos. Morreu de velhice.  James Coburn deixou-se engordar com mais idade, engordou demais e morreu de ataque cardíaco. James foi grande amigo e aluno do inesquecível Bruce Lee.',2);
