Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17458,'x5wndRdBowo','I just finished my first month of learning game dev with unity, and seeing this motivates me and excites me to see just how much I can learn in the next 2 months. Thanks for this video!',93);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17459,'x5wndRdBowo','Pre-optimisation is my biggest weakness as a sw engineer, it kills a lot of passion and motivation for projects if it’s not perfect. It’s very hard to correct!',61);
