Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17461,'x5wndRdBowo','Sometimes being an organized individual has its cons when it comes to increased task anxiety in not being able to keep a rigid schedule. Sounds like many others here in the comments can relate as well! Just gotta go with the flow and see the results build up over time.',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17462,'x5wndRdBowo','I''m not sure how I got recommended this from the Youtube Algorithm™, but I''m glad I did. After mindlessly eating half a box of cheez-its and finishing the video I was surprised to see the view count. The editing was great and I was thoroughly intrigued. I haven''t seen any other of your videos but I hope you get one that blows up. You seem to be going in the right direction though, because I got recommended this video despite sparingly watching tech content. Best of luck.',136);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17463,'x5wndRdBowo','Thank you for making this. I fall into the trap of scheduling too, I’ve recently adopted your method of just working on it when I want to, it makes the Dev much more enjoyable! Using Monogame instead of Unity tho! Amazing video!¿',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17464,'x5wndRdBowo','“I thought it would ruin the magic of video games” if anything, it enhances it tenfold (for me anyway). I love thinking about how things could possibly be programmed whenever I’m playing a game. Sometimes I think of how I would tell a computer to complete daily tasks, like pouring a glass of water',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17466,'c-aEBxGPLB0','Thankyou so much for your support over the last few weeks! Its honestly been so crazy! Also make sure you join the discord server: https://discord.gg/7eknEtp',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17467,'c-aEBxGPLB0','tbh this gives me inspiration, being someone who has wanted to make games since a very very young age, i have had the idea to make my own little studio called "the crying arcade" and im just now learning how to do stuff, seeing the amount of progress you made with just a moving cube, it genuinely gives me hope, it makes me feel like i have a chance, thanks man',8);
