Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15970,'x_WBikPDezY','Out of all of these the only one I''m looking forward too is high on life looks like I''ll be starting my second play through of kingdom come deliverance and if you haven''t played it yet and love big open world story driven RPGs with basic survival mechanics and quite different combat mechanics I highly suggest it though it''s still got a few bugs',2);
