Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15976,'9QvqBERvunI','imagine spending TENS of THOUSANDS on camera equipment so you can capture the scene at the highest fidelity and not at least close the blinds to avoid reflections',2006);
