Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15978,'9QvqBERvunI','"this doesn''t have ray tracing or anything like that, but the realism from the sun on the screen from my blinds . . . . . Priceless"',1609);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15979,'9QvqBERvunI','Love my series x. I also love my one x too. I honestly didn’t think that there would be much difference. Boy how wrong I was. Loading/downloading times are insane, and quick resume is freaking incredible. So thankful for that bad boy',42);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15980,'9QvqBERvunI','The One X is still a very relevant console as it does Native 4K on many games, even if it is a stable 30fps. And even some at 60fps, mostly MS titles. Digital Foundry even said graphical differences are very miniscule, and for the most part it would take a magnifying glass to spot the differences. Which is true since I''ve compared both side by side. When they get MUST HAVE next gen titles ONLY it''ll probably be worth it. As of now the One X...AND Pro are just fine. On a 4K display.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15981,'9QvqBERvunI','Something that can help with the storage is the new xbox feature, which admittedly is only available on games that support it, that allows you to delete certain parts of a game. Maybe you dont want a certain campaign, you can delete that and save on space.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15982,'9QvqBERvunI','Hearing Linus say it''s better than a PC in ANY way, you know it''s an amazing machine!',35);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15985,'eXSfV9F6Zcs','I own a series S. Bought it when the X was impossible to find last year and honestly it runs great. Yet to see how next gen gaming truly performs on this thing but I haven''t had a single issue with the machine. Load times are waaayy faster than the xbox one s and PS4. Looks great on my 1440p monitor and when upscaling on 4k tv''s. Gamepass is great. The hard drive is a bit small for holding s/x optimized games. I use an external for everything else. Stick to performance mode and you will not have any frame rate issues. Lastly, it fits in my backpack if I travel with it. This thing is worth every penny imo.',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15986,'eXSfV9F6Zcs','More like a 5-10% performance boost, which will allow to push the console just a lil more which could make a world of difference for the series s.',189);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15987,'eXSfV9F6Zcs','More ram being allocated to game devs is nice, but it doesn’t solve one of the biggest issues of the Series S which is the bandwidth of the memory itself. Also more ram doesn’t really mean higher frame rates, but higher quality textures or assets or increase the distance before you see LOD culling. It isn’t going to affect frame rate by going from 30 to 60, but it might allow a stuttering, inconsistent 30 FPS to hold a more locked 30 FPS.',210);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15988,'eXSfV9F6Zcs','I hope they continue to get more put of it in the future as well. We need to finally leave last gen development behind and focus on the Series S as the base for optimization going forward. It''s the perfect 1440p console and it pairs perfectly with 1440p monitors at the moment due to 1440p scaling at launch and a decent internal upscale for older content when displayed on a 1440p monitor. You can''t touch the value at this price point.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15989,'eXSfV9F6Zcs','ABOUT SFS (SAMPLER FEEDBACK STREAMING): The demo starting at the 50 second mark was configured to run in 4K and each object is a 16k x 16k BC7 texture. Ordinarily, this would take up 350MB of GPU memory for each individual object. The demo features 985 such objects, which would take up nearly 300 GB (yes, that''s GB, not MB) of GPU memory. However, as can be seen in the video, allocated VRAM usage is just over 3 GB, and dedicated VRAM usage is just over 2 GB! SFS allows for visuals that simply would not otherwise be possible due to memory constraints.',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15990,'eXSfV9F6Zcs','Sony did the same with the PS3 cell processor back in the day. The Uncharted sequels looked better than the first one because Developers were granted access to higher memory.',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15991,'eXSfV9F6Zcs','I''m loving my Series S, and this is great to hear. Can''t wait to see how far these features  along with the RDNA2 ones, will carry it.',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15992,'eXSfV9F6Zcs','They really should be doing more for this console. This is the more widely available console opposed to the ps5 and series x.',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15993,'eXSfV9F6Zcs','This is so awesome, I travel a ton so I take my *series s* with me because I wouldn''t need to take several CD''s but I have a small rotation of games I''m able to play. I love this so much.',31);
