Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18119,'pHiMN_gy9mk','Daniel, thanks for this superb video. As someone just starting out on this road, it''s very easy to get sucked into the fine details, but this has given me a much better grasp of the big picture. I love your philosophy of not learning for learning''s sake, but using this knowledge to build things that matter to people. Keep doing what you''re doing!',4);
