Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18122,'pHiMN_gy9mk','Now, this is something else. The best instructions to learning ML I have ever seen, thank you Daniel for the effort you put in this. Now I can really start to learn ML like a true Legend, thank you sir!!!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18123,'pHiMN_gy9mk','I''ve never left a comment on YouTube, but I feel like I MUST DO after watching this video. It is very organized and useful to understand how we approach ML and keep learning it. I appreciate you made this great one.',9);
