Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18126,'O5xeyoRL95U','First lecture in the 2019 deep learning series! It''s humbling to have the opportunity to teach at MIT and exciting to be part of the AI community. Thank you all for the support and great discussions over the past few years. It''s been an amazing ride.',1453);
