Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18155,'I7NrVwm3apg','This is really a good video for starters in machine learning. Thank You for it. It would be really helpful if you could share the datasets used in the examples for self-practice. I don''t prefer to share my email ID here in public chat. Please advise on alternatives to share my email ID for datasets. Thank You.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18158,'RnFGwxJwx-0','This is awesome. There''s absolutely no way I''m going to watch this right now, but it''s great to see this quantity and quality of information posted for public benefit. I''m subscribing and sharing.',53);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18160,'RnFGwxJwx-0','That''s a fantastic video, i don''t watched full but the way he taught is absolutely amazing. It will very beneficial if the videos are of 1 hour length and divided in playlist so that if a person don''t have enough data balance can download one chunk at a time. It is very difficult to watch the video of this length at a time.',0);
