Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18163,'RnFGwxJwx-0','Great introduction. Just one point at 2:02:30 Tuple for single column is passed in wrong way and thats why it returned data series. It should be df.loc[:,("START*",) instead of  df.loc[:,("START*") to get the dataframe. As in Pyhton () brackets are used for expressions or for functions. (2+3) will be evaluated into 5 and ("START*") will be evaluated into string "START*" and thus when there is single element in a TUPLE it must be represented with comma at the end.',8);
