Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16902,'4mjvZrLnlCg','The main problem with the tiger scene in fury is that decision making. Although independent thinking was encouraged in the German army, the choice here to take the tiger out of cover and engage on the move is a miserable decision on the commanders behalf. The tiger had no gyroscopic turret so would be very inaccurate whilst moving. He also has the ability to kill all of those Shermans through their front armour at that range and can’t even be sure they know his exact position. Essentially, the commander is a tool.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16903,'4mjvZrLnlCg','In fury it infuriated me that the German tank decided to blow his cover and close the distance with the Shermans. The tiger had an amazing advantage but blew it all away',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17477,'aWr95b6e73I','This video was really inspiring and insightful to watch! Thank you for sharing your story and also the tip on “Skillset to Interest Framework”. I never thought of that idea, especially since I am someone who doesn’t necessarily know what roles I would be a best fit for, but also that matches my current skillset. Still in the process of exploration. Anyways, thank you for the video! :)',97);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17478,'aWr95b6e73I','Great to hear your story! Was an amazing journey. Please use your smarts for good and make game monetization less predatory for all who play the games you work on. It''s an incredibly important issue and I''m so happy to hear that people are thinking about and specializing in work like that.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17479,'aWr95b6e73I','Hi Morgan! Just want to tell you that I really loved the "Skillset to Interest" Framework. It really did a good job. I''m not a game-related worker but this thing helps me up to retrospect my career skill set. Thanks for making this video!',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17480,'aWr95b6e73I','Loved this video! There are so many videos that just say "do this, this and you''ll eventually get into the industry", but you managed to break your journey down into a series of manageable steps. Looking forward to seeing more content from you!',56);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17481,'aWr95b6e73I','Only halfway into the video. The way of breaking down the job roles within the industry has been immensely helpful and information friendly to new gamers, designers or hopefuls wanting to join the game industry.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17482,'aWr95b6e73I','tldr: she''s not a game developer. she''s a sales/business analyst/program manager. this video didn''t really help me, but others might find your mechanism useful if they are interested in considering job requirements to your skill set framework, which to me seems obvious, but nothing wrong with that.',136);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17483,'aWr95b6e73I','It''s a very informative video and it''s genuinely interesting to hear your journey. On the other hand, the title is definitely a clickbait. The video has very little to do with how to become a developer. Rev analyst is not a developer, nor is the product manager role.',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17484,'aWr95b6e73I','Morgan this is awesome! One, because I love league of legends (been playing since like season 6) and it''s just amazing to see people that have a vision for their life, plan, work hard to achieve it and succeed. I''m one of those as well. Got a degree in Neuroscience/Psychology. Fell in love with web dev. Learned the skills that I needed, and been working as a web dev for about 6 months, and life has been a dream ever since!',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17485,'aWr95b6e73I','so basically, you aren''t a game dev... you''re a production manager.',4);
