Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17492,'7QuQa2jX6qI','Noice. Congrats on 2 years, the concept art for enemies and missions is looking sick... and I''m excited for what the future holds. ¿',20);
