Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17494,'7QuQa2jX6qI','Bro this is genuinly nuts, an inspiration to a lot of us . The amount you have got done and learned in 2 years is crazy, good job!',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17495,'7QuQa2jX6qI','It''s absolutely nuts that this is your *first* game project and it looks so promising already. Just imagine what you''ll be able to do in the future if this one is a success',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17496,'ZMbIvmv25u0','I didn''t know Mark is such a pretty good artist! those art concepts and sprites for his old game ideas looks really nice, I always thought the phase of Prototype is always super important to make sure if a game is gonna be good, I think is possible to already have [these characters and this music and this story] if that''s the goal of a game, still I can see how game design can evolved those concepts into something more fitting for whatever the gameplay can be.',1704);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17497,'ZMbIvmv25u0','I''m the dev who integrated 2D physics into Unity and I thoroughly enjoyed watching this. I think I''ll be going into the attic to dig out my folder of ideas from my youth too!',1304);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17498,'ZMbIvmv25u0','Reminds me of the first semester of my game design masters, we had a course that was just making a game, in groups of 5. After week 1 of "production" everyone presented their current state and this one game just looked amazing. I felt so jealous of how quickly they got their game looking so beautiful, but when the proffessor was giving feedback he asked "why does it look so pretty?" as a critique for this exact reason. He seemed almost mad they made things so pretty so early, because it was too early too tell if their idea worked, yet they had spent time making it look amazing.',605);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17501,'ZMbIvmv25u0','To summarize: if you don''t make a cheap and fast prototype for your game, then your game is an overdeveloped prototype. And good luck with that!',3290);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17503,'ZMbIvmv25u0','Have you considered using the "recoil" of the magnet when you catch it to give you a little push, maybe as a kind of "directional" double jump?',203);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17504,'ZMbIvmv25u0','Another really important aspect of prototyping is learning whether you actually ENJOY game design or not. If you''re having more fun coming up with the story, setting, lore, and themes than you are experimenting with gameplay ideas, then chances are you''re more into worldbuilding than game design. Learning this early can help steer you towards your strengths and interests.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17506,'iAxSqi5LBDM','Most of what you''re talking about here is called "abstraction", despecifying capabilities in order to make them generic and reusable as well as linking related settings and configurations to minimize the effort required to make further changes. It''s a core tenet of software development and my primary concern when designing application enhancements for my job. I''d much rather spend the extra time up front designing something that not only solves the current issue, but also related past issues as well as potential future ones. In the end, if done well, it significantly reduces overall complexity while skyrocketing maintainability. It''s also a puzzle that I tend to take as personal challenges.',2604);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17508,'iAxSqi5LBDM','Now that Mark knows how to make games, he can take part in the GMTK Game Jam, one of the biggest Game Jams ever',246);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17510,'iAxSqi5LBDM','I’m so grateful that you focused on the “boring stuff” in this video. It was very illuminating. Thanks!',318);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17512,'iAxSqi5LBDM','Imagine being talented and dedicated enough to not just make a game on your own, but also make a high quality video series detailing your design processes at the same time! Really amazing stuff!',129);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17517,'-FIu9SGvQZc','I was about to start making my first game my “dream game”. Glad I saw this and now I’m gonna get a few small games under my belt before my dream game.',617);
