Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16025,'w4gOESctqLU','Hope to hear about F4 casting. They’re going to need the two years. They have to complete the cast and complete the writing then shoot then reshoot (as they do) and then get a teaser out months before the release of the film. Heck they announced captain Marvel and Brie Larsen over two years in  advance.',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16027,'w4gOESctqLU','They could introduce a group of Mutants that has huge ties to the X-men, especially Wolverine. Bring in Alpha Flight and at the end have a cut scene of Heather and James on a hunting trip and encountering a wild beast in the woods. They don''t even have to show his face, not revealing who the actor is. This could lunch into the X-men Movie where Xavier is  recruiting the new team to battle Karoka to rescue the original team. They could do flash backs for the first half giving us the true original roster. I always fear that the X-men movie will feature the more popular members rather than establishing the original 5 and later Havok and Polaris. I don''t mind having the most popular members, but stay true to the originals. Hated when Fox screwed it all up. And Rogue WAS A VILLIAN before joining the X-men.',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16028,'w4gOESctqLU','Much in the way they did with Spider-Man, It does help to have Fantastic Four cast early so they can introduce them in other movies and shows. That allows them to introduce the characters and have their audience familiar with them without having to do an(other) origin story for them.',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16029,'w4gOESctqLU','We are just so blessed to be living in a time where there’s so much Marvel content… I’m a huge fan man! Been watching for a while now! I’m very grateful for the shows, movies & everything the MCU has brought us! Thanks for keeping us in the loop as always! You’re the ¿',7);
