Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16031,'w4gOESctqLU','I''m stoked for F4 casting. And while yes it''s 2 years away, it was also announced in 2019, so they''ve had 3 years to cast it. And I''m willing to bet they had it cast before Watts left the project. And they may have them cast early so they can pop up in another film before their solo outing. It would make sense for them to show up in Quantumania.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16032,'w4gOESctqLU','Sounds like a pretty solid lineup. I can''t imagine them not doing the werewolf by night or guardians holiday special some what. But I guess we''ll see.',6);
