Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18213,'R9OHn5ZF4Uo','As a comp sci student, I find it interesting how you explained this, but rather than “teaching” I would more describe it as “evolution”. You know, like only the strongest, or most fit for whatever task, survive till the next generation. Just like in real life, birds might not know why they fly south, only that they do so every year, same with the bots and their tasks. I think explaining this way (at least for me) is easier, because bots don’t “learn” they evolve through the generations.',13);
