Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16925,'X3paOmcrTjQ','Great video! As an established data scientist myself, this is definitely an accurate data science project lifecycle; however, I almost never go through all of these steps in the same day. You can spend whole days just cleaning data, tuning models, or putting things into production. The work that you do can also vary by company, some data scientists only work on part of that lifecycle just doing exploration and modeling or modeling and productionization. I have a few videos on my channel that complement this one nicely for those interested!',583);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16927,'X3paOmcrTjQ','Great video. You did great explaining this. That said, I would argue that it can never be overstated how extremely rigorous you must be in the earliest steps. Specifically data acquisition and cleaning. Mistakes in these steps will often corrupt every subsequent step in your research. Furthermore, it is these earliest steps that are the hardest if not impossible to correct if mistakes are found. Do some field work, say NSF or an FFRDC gives you 2 million dollars for it. Go out into the field and unknowingly bring the wrong brand of batteries for your solar panels that you don’t figure out until your back? Oh well. This seemingly tiny and innocent mistake turns a long lived project of monitoring an area into a very short lived one when the battery dies. All the clocks on your instruments are not correctly synced by gps and you have timing errors now? Now we have absolutely horrible data that needs to be cleaned! THE FIRST TWO STEPS (ACQUISITION AND CLEANING) ARE SO IMPORTANT!!!!!',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16929,'X3paOmcrTjQ','A nice capture of the top level elements, thank you! It easily gets convoluted, and I was looking reflect on a simple overview.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16931,'X3paOmcrTjQ','Data science explained in such a clean and brilliant manner!! Thank you for the awesome video!!',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16932,'X3paOmcrTjQ','This is really a very clear presentation of what really goes with a data science project from the very beginning. However, things do not happen very easily. There are a lot of challenges that you have to deal with. In data cleaning alone, the time that you use can be overwhelming.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16933,'X3paOmcrTjQ','Your videos are what is getting me the necessary introduction to data science. Thank you so much!',3);
