Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16957,'ua-CiDNNj30','2:12:19 so far and cannot imagine how much effort these guys have put to make this. This is really a beautiful attempt. This is great. Thank you, FCC.',140);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17518,'-FIu9SGvQZc','I started my 2D platformer when I was just starting to learn Unity and C#. I ended up taking a break to make a smaller game; a 2D bullet hell shooter called HyperShot. I put it on Steam, and I still get a sale now and then. Now I''m almost finished my platformer, which will be on Steam next year.',243);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17519,'-FIu9SGvQZc','Hey, glad to see this, I''m about to start making my first game. Thomas always has the best advice',201);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17521,'-FIu9SGvQZc','I wanted to make a 3D survival game, with a massive map with multiple biomes, weird animals, diseases, allergies and of course cut scenes. once I drew the design on some paper I realized that I never had coded before, so this would be way to hard. now I watched this video and I think my first game will just be a simple platformer.',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17523,'-FIu9SGvQZc','Your tip about knowing your forte really resonated with me. I too pride my self in character building and story telling. Those are my passions what keeps me making my game. This being my first game you’re other tip was perfect, I should make a small short game before putting my all into my dream story / dream game. This video hit at the perfect time for me, and thank you for your content. One question about your stories, do you have them all laid out first before you start building your games or do you kind of build the story and the small details of the story as you go, drawing inspiration from some of your worlds and art?',34);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17524,'-FIu9SGvQZc','I did release my own game on iOS about ten years ago. It was the only personal project I ever released. I outsourced all the creative assets just to save myself time. Crossing the finish line with this stuff is very challenging. I totally agree making your crap game first is the way to go. Great video!',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17525,'-FIu9SGvQZc','I really enjoy these tip type videos Thomas. They are really motivating. I have my first small-sized project game in mind and it motivated me to not b afraid of using assets if needed. Thanks for being motivating. Proud to be part of the gamedev community. :)',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17526,'Y7NtFNfCyi0','Cool video, I always enjoy seeing game developer improvement over time. Keep going!',0);
