Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17537,'zatQG96LYQA','I love your videos and happened upon then through my recommended feed. By showing all of your thought processes going into your designs and wealth of knowledge of architecture, your passion made me want to support you and Chef RPG through Kickstarter. I can''t wait to see the final product and finally hop into the world you created ¿',469);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17538,'zatQG96LYQA','The game has a really nice identity, I''m happy to contribute to it, Noah manages our project wonderfully and Nikita impresses me since the beginning with his pixel art. ¿',148);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17539,'zatQG96LYQA','I really like the path this game is going towards, the world looks and feels alive yet captivatingly out of this world. I would love to help you in a way, English and Turkish are my primary languages, so you can reach to me if you need any translation work to Turkish in the future, since that''s all I can do :))',201);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17540,'zatQG96LYQA','OOOH ! IT IS SO GOOD TO SEE THE NEW IN-WORLD CHARACTER''S SPRITES ! also some of the latest decors look soo insane ¿¿ you and clement did such a great job ¿',134);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17541,'zatQG96LYQA','The new character sprites look so good! Seems like you’ve come so far in such a short amount of time. With the amount of detail and complexity in not only the art, but the code, I assumed you were a seasoned game designer and programmer when I saw your 1st devlog almost 2 years ago. I was impressed then and even more so now watching Chef RPG progress and improve as you continue to grow as an artist and game developer. It’s not only fun but incredibly inspiration for the rest of us indie game dev. I can’t wait for the next update!',166);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17542,'zatQG96LYQA','The complexity throughout blows me away. There''s enough going on in a single indoor restaurant screen to make a fixed screen game out of that. Instead, you''re making a game with loads more to explore and do. The amount of generosity it takes to make this much content is what I love most and is just as difficult to achieve as making a great game in the first place.',82);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17543,'zatQG96LYQA','omg the new character sprites look fantastic!! the combination of someone with architectural experience, a character artist and a sprite artist sounds very powerful',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17544,'zatQG96LYQA','love the thought that went to this game''s design and the improvments and overall progress you made thus far. really glad i was able to back this project.',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17545,'zatQG96LYQA','Respect for all your hard work bro. The game looks so amazing. modern day art!',46);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17546,'gB1F9G0JXOo','You guys should get a world wide credit for any improvements in the field of CSE in upcoming years. Thank you for giving us these things for free.',1258);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17547,'gB1F9G0JXOo','I''m only two hours in and I feel like my brain is swelling and going to burst out of my eye sockets, ears, nose, and mouth from all the pure knowledge you''re giving me. Thank you. This is the tutorial I was looking for. You''re actually teaching me the terms and functions and what they mean, and not just teaching me how to copy text. Thank you.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17548,'gB1F9G0JXOo','this just shows how good youtube can be for teaching, several one hour long lessons compressed into a single video for everyone to watch for free no matter where you are',193);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17549,'gB1F9G0JXOo','Thank you so much. This teacher is the best teacher from a tutorial I''ve ever had. Clear, entertaining, and easy to follow. Well done.',58);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17550,'gB1F9G0JXOo','For beginners like me this is pure gold bb thanks for posting your vids!!',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17551,'gB1F9G0JXOo','I know it''s corona times but look at all the resources that are available for free. what a time to be alive love it',2662);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17552,'gB1F9G0JXOo','OMG, you don''t know how thankful I am for this tutorial. I''ve been trying to find a tutorial that explains every single thing in a line of code for me for so long! Thank you so much!',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17553,'gB1F9G0JXOo','Very good tutorial ! Even if this tutorial is one year old, I''d like to add something. For the inheritance, I think it would''ve been worth mentioning the "Protected" accessibility level for variables. For those that don''t know, a Protected variable is the same as a private one, except that the variable will be treated as if it was public for the child classes. It''s pretty useful in cases like the one shown in this video.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16043,'RlOB3UALvrQ','Honestly, i had doubts about this movie and if it should even be made. But this trailer changed my mind. It’s so powerful and this is now one of my most anticipated marvel movies. Definitely one of marvels best trailers ever. The music, the cinematography, and emotion. Incredible',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16044,'NWzBX3OP234','Also when it comes to She Hulk she said she can control herself when she goes full hulk. So that means she was fully aware that her kicking a group of men would have killed them.',607);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16045,'NWzBX3OP234','As a woman, I love this video. Something felt so off this phase I couldn’t put my finger on it and you explained it perfectly. Its so insulting for both sexes that what they’re doing is saying that men have to be so stupid and useless in order for women to be strong and smart.',219);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16046,'NWzBX3OP234','You just earned a new sub.  Excellent assessment and commentary! Wokeness and identity politics is killing movies.',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16048,'NWzBX3OP234','The thing that irks me the most is substituting good storytelling and characters for the sake of filling quotas. I love seeing diversity, it’s a wonderful thing, but it shouldn’t come at the expense of someone else or be shoehorned in for the sake of representation. Just write good stories and good characters, it’s remarkably simple.',192);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16050,'NWzBX3OP234','I’m a huge marvel fan… can’t wait to see each project. This was wonderfully done and beautifully narrated! I was hoping other people were feeling this too… it’s bizarre:(',50);
