Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18234,'t4K6lney7Zw','it''s not always that you want an unlimited dataset in machine learning. Sometimes you want to limit your dataset. For example if you''re trying to figure out if you''re in a stock market recession or expansion you don''t want to go over 2 years (+- months) of data because you''ll end up in another cycle. Symmetry and Domain limits are important in machine learning. My point is sometimes too much data is a waste of time and resources',0);
