Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18248,'y4o9hrSCDPI','Hey Smitha thank you for the road map & humbly appreciate the time you put in making these videos for us all. If I may ask, there is another book that I have heard is great regarding machine learning titled " Hands-on Machine Learning with Scikit-Learn, Keras, and TensorFlow by O''Reilly " .... please do advise on what you think about this one.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18250,'y4o9hrSCDPI','Thank you for an insightful video! ¿ I am currently leading a team of data analysts and planning to get started on some ML projects in the team. Do you have any input on how a team manager can prepare to lead a team of ML engineers? Any pointers will be great. Thank you!',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18251,'y4o9hrSCDPI','Wow, congratulations for starting such an amazing project ¿',5);
