Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18256,'IHZwWFHWa-w','Part 3 will be on backpropagation.  I had originally planned to include it here, but the more I wanted to dig into a proper walk-through for what it''s really doing, the more deserving it became of its own video.  Stay tuned!',2180);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18257,'IHZwWFHWa-w','I''m only 12 minutes into this video right now, but I just wanted to say how much I appreciate the time and spacing you give to explaining a concept. You add pauses, you repeat things with slightly different wording, and you give examples and zoom in and out, linking to relevant thought processes that might help trigger an "a-ha" moment in the viewer. Many of these "hooks" actually make me understand concepts I''ve had trouble grasping in Maths, all because of your videos and the way you choose to explain things. So thanks! You''re helping me a lot to become a smarter person. :)',1791);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18258,'IHZwWFHWa-w','Dissapointed you did not animate a 13000-dimensional graph. Would make things easier',4792);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18259,'IHZwWFHWa-w','I''m an IT student, and we have an Assignment on exactly this topic. We even have to use the MNIST data set. I have to say, this is absolutely lifesaving and I can not thank you enough Grant. What you do here is something that only a handful of people on this planet can do, explain and visualize rather complicated topics beautifully and simple. So from me and A LOT of students all around the globe, thank you so so much <3.',749);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18260,'IHZwWFHWa-w','Unlike most  teachers of subjects like this, this gentleman seems to be genuinely concerned that his audience understands him, and he makes a concerted and highly successful effort to convey the ideas in a cogent, digestible and stimulating form.',279);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16958,'ua-CiDNNj30','I have gone through the whole video and am really grateful for the time you''ve invested in this. The vivid pictures and friendly speaking pace were truly refreshing and helped balance the ubiquity of the text. Cheers from Abidjan!',59);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16959,'ua-CiDNNj30','For me as a layman, this is the best introduction in the topic I''ve found so far. A video that I can always come back to and rely back on for a solid foundation.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16960,'ua-CiDNNj30','Barely 10 minutes in and can already appreciate the time and consideration put into this video. Thanks so much.',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16961,'ua-CiDNNj30','Great course! Content is informative, well structured, and explained clearly. It is evident that Barton Poulson is very knowledgeable and his personality really shows through. His spirit is encouraging and I thoroughly enjoyed his humour. Keep up the inspiring work!',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16962,'ua-CiDNNj30','This is excellent even for people already working in related fields because it talks about many tools and concepts they may have overlooked. The organization, clarity, and Paulson''s breadth of knowledge are impressive!',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16963,'ua-CiDNNj30','1:05:41 so far it''s the best and most clearly explained video on data science I''ve watched so far. Awesome job.',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16964,'xC-c7E5PK0Y','As a current college student, I really appreciate the breakdown of the different roles and responsibilities for Data Science. Keep up the good work and I would love to learn more about DS.',1300);
