Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16967,'xC-c7E5PK0Y','I wish I saw this 6 months ago! I''ve been trying to transition careers from physics to "data science" and after not having much luck despite what I thought to be very similar methods used in my former career, now its becoming clear why my resume is getting nowhere... I''ve focused on the top too much, haven''t showcased my whole pyramid.  Thank you bro!',181);
