Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16970,'xC-c7E5PK0Y','Completely agree, as a data scientist in telco company most of time what i needed i just SQL to retrieve data, Tableau to make quick insight, Python with Jupyter Notebook to build model and experiment with dataset after assessing from data insight and business knowledge.',164);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16971,'xC-c7E5PK0Y','I''m a college student wanting to explore this field. You''re been a great help. I''d love to watch ur videos on the breakdown of the buzzwords...ml, ai, deep learning, neural networks etc... btw loved the video.',81);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16972,'xC-c7E5PK0Y','I''ve been interested in the term "data science" and what it could mean for me, my hobbies and career, and your video has been a brilliant introduction. Thank you!',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16973,'xC-c7E5PK0Y','Such a concise, easy to understand, and thorough explanation you''ve got there. It can be understood clearly by someone like me, with no prior knowledge of what data science is and what it entails. Great content!',21);
