Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16976,'N6BghzuFLIg','Awesome breakdown on this topic Max! I  have my roots in physics as well and went into it-consulting a few years ago. I have been looking for good introductions on this topic. For me it was so much easier to follow the explanations coming from a physicist. Thanks for that!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16977,'N6BghzuFLIg','Amazing, amazing job! Nice touch with the stock photography, which looks to be original. Learned a lot from this one. Keep it up!',12);
