Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16988,'sOZ8MxFw8TQ','I''ve considered data science, but, for me, it''ll come down to who wants to use the data and how. A lot of businesses want to use data science to increase profits, but I''m more interested in using data to discover things, help people, etc.',346);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16989,'sOZ8MxFw8TQ','Instead of dealing with the discomfort of whether I made the right decision, I decided to do a data science PhD so I have peace of mind knowing I made the wrong decision',54);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16990,'sOZ8MxFw8TQ','As someone who transferred from data science to data analysis I agree with every point here. Being in the everlasting learning process was particularly exhausting¿ Not that data analysis needs no learning but the intensity ds requires is of another level.',196);
