Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16992,'sOZ8MxFw8TQ','I am not totally sure about whether or not I want to be a Data Scientist. The interest towards learning has been kind of gradual for me. But for now I can say that my inclination is more on the side of Data cleaning, Data modelling and Data visualisation. I might probably end up somewhere close to being a Data Analyst, Can''t imagine beyond that for now. Checked for all points that you mentioned. Bang on. Except for the last one - Marketing one''s own work. I am someone who believes strongly in my work speaking for myself rather than otherwise. Have been trying hard to change this mindset of mine. Might take a while but will get to it definitely. Thanks for this informative one. Helped me clear my mind about certain things. See you on the next livestream.',233);
