Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18286,'QghjaS0WQQU','For example if you''re a developer and search for "Atom" the search engine will show you the the "Atom IDE" instead of biological atom but if you''re a biologist, the search engine will show you  the results about biological atom. That''s all because of machine learning and histories that search engine has about your interests.',1);
