Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18301,'6M5VXKLf4D4','Thank you for this. I''m curious about the statistical angle of the weighted sums and bias. Are these akin to regression coefficients and the bias associated with underfitting/overfitting that is adjusted with regularization in machine learning?',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18303,'6M5VXKLf4D4','First, Option B - The weighted sum of the inputs is calculated. Second, Option A - the bias is added. Third, Option D - the result is fed to an activation function. Lastly, Option C - specific neuron is activated.',3);
