Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18311,'FB5EdxAGxQg','hello great videos, loved this series.  Can you please do a video on imbalanced data sets in classifications problems?  Maybe just add onto a previous example you have but with a case where there are very few "1" or "true" values compared to "0" or "false" . thanks for you consideration!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18312,'FB5EdxAGxQg','Got 1.0 score when C=4 for iris data set. Thank you Sir! Your machine learning Playlist is a boon for beginners like me.',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18314,'FB5EdxAGxQg','Thank you very much for these videos. They are really helpful. I did the exercise and got 99% when C=4. Any increase in C did not affect the accuracy. Also, any alteration made to gamma and kernel dropped the accuracy drastically. Thank you once again.',2);
