Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18318,'FB5EdxAGxQg','What a wonderfull tutorial!! well done and well explained. Thanks a lot dude for the sharing of this expensive knowledge.',8);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18319,'opb2Bq4Qvyo','Hope you all enjoy this video; go subscribe to Ryan''s channel for more machine-learning content! https://www.youtube.com/channel/UC8Wq2V9Ws4vCUeGb-OlA9YA',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18320,'opb2Bq4Qvyo','The hard part about Machine Learning is not the how but the what. I can plot learning curves very easily, but reading them is another story. That''s why I like to focus my ML videos on the concepts rather than the code. Chances are that the code is doable in two lines. But if you can''t understand the output (or why your data might give you certain kinds of output) you''re wasting time and resources',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16993,'sOZ8MxFw8TQ','This got me so excited to be a data scientist - always learning (in different fields) and getting to continue being a scientist!!. It sounds great!',154);
