Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (16998,'Rt6eb9VOFII','this is was far more comprehensive than I expected! so many other channels will throw up python and SQL and will then recommend a boot-camp or moocs. Solid video and thank you very much!',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17000,'Rt6eb9VOFII','This was really insightful and helpful, thanks for making this!',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17001,'Rt6eb9VOFII','I’m currently an entry level Community Manager. Data Science is so intriguing to me as it would allow me to listen to userbases and other communities so much more closely. You just gave me what I need to get started learning! Thank you!',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17002,'Rt6eb9VOFII','I found this video to be very well done!! When I begin work on a new model, I always start with a Google search, and go from there. Unfortunately, you can''t do this during an interview. I feel like some of the best people on planet earth get overlooked, all the time, just because employers expect people to start with a blank piece of paper, and build out a model. I''ve been in the data science world for the past 10 years, and that''s 10 years of proven success. If that''s not good enough for you, writing code on a blank sheet of paper won''t help very much at all.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17003,'Rt6eb9VOFII','This is very helpful, thanks for putting this together :)',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17004,'pn0PUY0jwGQ','The biggest problem I’ve had so far is working with my manager. We both have very different perspectives on various problems but he simply doesn’t even want to hear my perspective even when my perspective is usually right. We are both data scientists but he graduated as a data scientist back in 2003. So he’s an old head and I recently graduated. It’s very tough to get along and having your voice heard',81);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17005,'pn0PUY0jwGQ','I''m learning Data Science and whenever I read job descriptions for entry levels or even for Interns they want you to be jack of all trades and on top of that require you to have 2,3 years of experience. Plus they include big data streamlines and ask you to be an expert on it too along with all sorts of cloud services. I mean it feels like they''re demanding an Intermediate Data Scientist and terming it as "Data Analysis Intern" or "Junior Data Analyst" role. This frustrates me a lot.',195);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17007,'pn0PUY0jwGQ','I feel like tech jobs always morph: we have hiring expansions and more specialities, then we have layoffs and more generalizations. It does seem like the demand for data scientists dropped off a cliff, but I’ve been studying it a bit as a way to complement other skills. Thanks for the video ¿¿',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17008,'pn0PUY0jwGQ','Great insight! I got into data science right after college and really struggled to do so. The fact that the data science job role is defined so differently at different companies made interviews really hard to prep for. It felt like you need to be a jack of all trades and be well versed in data science, data engineering and data analyst principles and it was just a lot to prep for. Plus a lot of roles require graduate degrees. After I got a role, I left after a year and transitioned into SWE as like you said the expectations didn’t match the reality plus I was also at a toxic workplace. I realized that I want to be in a role that is more well-defined and somewhat uniform across companies so if i need to look for a job later, I’m not being restricted to only a subset of opportunities bc of the different definitions and requirements.',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17010,'pn0PUY0jwGQ','You covered some really great points that I''m also experiencing in my current role as a "data scientist". Tbh I don''t even know what I''m supposed to be doing and it makes me feel so lost especially since I''m still early in my career. I saw 2 great people leave the team to work as a data engineer and a software engineer. It''s absolutely demotivating to see people leave. I''m also looking into transitioning into a more data engineer and/or product analytics role but the interview prep is super overwhelming/difficult and imposter syndrome really kicks in. ¿',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17011,'pn0PUY0jwGQ','Its really difficult to work as a Data scientist because every company have different expections from Data Scientist. And now a days, a data scientist should know all the skills like computer vision, deep learning, Operational research, Machine learning, SQL and many more. There must a  discrete line between data scientist work roles. And also as you have mentioned interview prep, it is really difficult because we need to prep from scratch. — Struggle of a DataScientist',7);
