Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17025,'O9nf1CqjGzI','Great video Shane! Completely Nailed it. As a data scientist myself, I was a little surprised at how high the job satisfaction scores were.  On the job, a lot of my peers find that they aren''t challenged enough by their positions. This is probably because data science is still relatively new, and companies are still figuring out how to create value with data teams. The other side of that is that once you have a data science role it is pretty easy to land another data science job so qualified data scientists can just leave if they aren''t liking the position at hand. I love seeing the data and trying to map it to what I''m hearing anecdotally!',107);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (17026,'O9nf1CqjGzI','I loved the remark about how if/when data scientists'' jobs get automated, either the world would have ended, or world peace would have been achieved. ¿',199);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14765,'k6U-i4gXkLM','This is amazing. Who could have thought, that one day i can just sit at my home in another continent and at the same time to attend an MIT course. Fascinating ! Thank You !',689);
