Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14768,'k6U-i4gXkLM','I know I can never get in to MIT, so this is such a useful  free resource for people like me who want to get into comp sci taught by masters! Thank you so much! I plan on getting either a second bachelors in comp sci (first one in music) or master''s if possible.',33);
