Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14771,'k6U-i4gXkLM','These professors seem awesome, my college professors make me feel like I''m in high school again with docked points for not showing up even if you have an A.  Kind of hard to not miss a day when you work and have a family.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14773,'ywBD6HiD8vQ','I just graduated with Honors in Computer Science in September, and I already landed a really cool software engineering job at a big and prestigious tech company! So excited!',266);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14774,'ywBD6HiD8vQ','I like the positivity you bring into computer science.  Im going into my second year and I am really enjoying the major so far. Great videos',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14775,'ywBD6HiD8vQ','I’m currently in my senior year of hs and planning to major in cs. I’ve been programming on and off for about 2 years and plan to be a software engineer. Your videos are great man ¿¿¿',93);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14776,'ywBD6HiD8vQ','I''m a senior computer science student and I have been programming ever since I was 12, although I definitely agree that computer science is the best major ever (maybe the best that ever existed) but the problem I see that a lot of people are getting into computer science just for the money, or just for the fact it is really popular right now and not for the fact that they are interested in computers and technology in general.',77);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14777,'ywBD6HiD8vQ','last year i was in my second year of Med school and i dropped out cuz i figured out that its not for me and then i decided to study CS because its the major I''ve been always interested in , and since then a lot of people been pointing at me as a failure , but i know that I''m not , i really needed such positivity especially in the meanwhile, thank you ¿',56);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14779,'ywBD6HiD8vQ','#7: Diversity of options, man you can work on so many things as a programmer. Super exciting fields like games or movies. There are jobs in solar and basic betterment of mankind. Or like, Facebook and Google for money.',122);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14780,'ywBD6HiD8vQ','I''m contemplating transitioning from the military and have been doing a ton of research in computer science. I have a bachelor''s degree in management but have coursework in aerospace engineering but only got as far as Calc II. I didn''t realize you could go for a masters in a different subject like you did. How did you find that experience changing professions? How was the application process?',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14781,'ywBD6HiD8vQ','I’m doing CS to be a software engineer, currently in 2nd year of college¿',298);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14782,'sdDklIYkWA0','¿ FREE 6 Step Guide To Choose Your Dream Career: https://bit.ly/3JLAEQh',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14785,'sdDklIYkWA0','I was a Computer Science major but I switched to Computer Engineering last year. There really isn''t much programming after your first 3 semesters in CS, after that it''s all theory, which is great for the few that want to work in academia. Computer Engineering actually allows me to apply my learned programming skills to projects, whether inside or outside of class. This is why I made the switch and have no regrets!',46);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14786,'sdDklIYkWA0','I’m an ex-CS and Math/Stats student, who actually just switched his double major to Actuarial Science and Maths/Stats. The reason being was because I found out that CS is only about 30% programming, the rest of it is theory of CS and various other theoretical, math-related CS courses like Advanced Algorithms and Theory of Computation (which I’m personally not interested in). If you really don’t find a lot of interest in algorithms, data structures, and theory of cs, as viable as it is, this major may most probably not be for you. If you love programming, but don’t find the in-depth CS stuff interesting, I’d encourage you to instead self-teach programming or go through a coding bootcamp. Computer programming is only a tool in CS, like math is a tool in Physics :)',65);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14788,'sdDklIYkWA0','I just graduated high school and was stuck between choosing CE and CS THANK YOU for the perfect timing. You should compare these 2 with electrical engineering',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14789,'sdDklIYkWA0','I actually dropped out of CS the first time around. I had no idea what I was getting myself into lol. I stomped it later in life though ¿',83);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14791,'sdDklIYkWA0','I chose a ''Computer Science with Software Engineering'' degree and the doors of opportunity ¿ have been opening ever since.',56);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14792,'TOSxb5aXKlk','imposter syndrome is SO REAL! i think that ties back in a lot to your first question- all of us out here have imposter syndrome because we don''t realize everyone else is working so hard!',215);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14793,'TOSxb5aXKlk','Currently a bio major on a pre med track. COVID had me rethinking my career choices this past year and now looking at switching to computer science. This was some really good insight!  Thank you',132);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14794,'TOSxb5aXKlk','I appreciated this so much. The problem I''m having is knowing where to focus. I am a jack of all trades when it comes to most things I do and I feel so overwhelmed looking at job descriptions that require different skills all relating to computer science. There have been a couple things that I really enjoyed, but they didn''t relate to coding as much which makes me question if this was right for me. All I can do is continue practicing in areas that interest me and look for a job that asks for that.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14795,'TOSxb5aXKlk','oh my goodness. I needed this video for years. I graduated 14 years ago. I have also struggled with imposter syndrome. In recent years I finally started vocalizing that I didn''t enjoy coding.  I felt like a rather intelligent person until I got into the deep coursework of my computer science degree. I love how honest and open you are about this and it''s going to help so many students who are currently in the thick of this difficult degree.',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14796,'TOSxb5aXKlk','I''m about to enroll in a CIS program. I wanted to know studying tips and useful tools to help me get better at coding and what I should expect to study. I really appreciate your help. I''m trying to be more confident and believe I can do this',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14797,'TOSxb5aXKlk','That was soo helpful thank you soo much. And I never knew this syndrome was a thing, but just you talking about it made me fear the major so much more knowing that ive gone through this so much during school and college, feeling like the dumbest one in class. Ill take your advice, and thanks for letting me know im not alone!',0);
