Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14081,'ISdBAf-ysI0','I am so unbelievably happy, ans I haven''t even watched part II. I mean, I know how it ends (maybe), I graduated in it, but THIS is how you should teach physics to students, THIS is entertaining, it''s simple but extremely detailed and understandable at all levels, you won''t get a class of teens looking at you like you''re reciting the bible in latin backwards and then an average C score at the end . THIS is what Physics is, FUN. Endless thinking, endless possibilities, endless learning. Physics is the language of existence and we are just toddlers slowly navigating our ways through learning the ABCs of it, at any given point in time. This is life teaching us. There''s nothing better than this. NOTHING. Yeh!',9);
