Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14094,'FMM7GWnAv0A','It''s so awesome that they managed to find a way to legitimately call something a time crystal.',942);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14096,'FMM7GWnAv0A','Time crystal just doesn''t consume energy  like any atom for example. Perpetual motion machine generates energy from nothing. The idea of the time crystal is not that it''s perpetual motion machine or breaks some physics law but that this is periodic motion without losing energy. We knew the possibility of such motion with super fluids and other exotic states for a while, but this is the first legit exactly zero energy loss demonstration.',898);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14097,'FMM7GWnAv0A','This is beautiful. This video implicitly tells you that how science works. Science doesn’t always comprise of eureka moments. Often scientists slog through different inconsistencies assumptions and opposing theories to purport a hypothesis.',261);
