Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14117,'v-aP1J-BdvE','Is it possible that the reason why we can''t answer the two questions "Are you a particle?" at the same time as "are you a wave?" is because we are not asking the question correctly? Perhaps when we find the singular question that captures both of those questions, we will understand that it isn''t a duality, but something else.',53);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14120,'v-aP1J-BdvE','This episode was such a pay off for those of us who have been on this journey of discovery with space time from the beginning. It feels like season finale of the 8th season of a show where it basically explains that everything you thought was important was actually meaningless, and that the acceptance of this fact is actually the point.',70);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14121,'v-aP1J-BdvE','What this all suggests to me is that the physical reality behind quantum mechanics is explicitly non-local (e.g. Bohmian mechanics), and it is the process of gathering information about a system that imposes locality. That is, gathering information is an inherently local process.',9);
