Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14799,'TOSxb5aXKlk','Hi first of all great video, i’m a freshman in my second semester of computer science and i’m kind of struggling, i definitely feel the imposter syndrome and i want to practice more but i’m not sure where to look. I’ve only learned a bit of java so far and i was going thru leet code and couldn’t really find anything for java. do u have any recommendations?',15);
