Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14801,'TOSxb5aXKlk','I’m kinda undecided on my major, I’ve thought about optometry but I don’t want to do 8 years of school. My mom and dad are software engineers but it’s never really been my passion, do you think a CS degree is worth it? Like especially with jobs and stuff after graduating, are you able to still enjoy or have free time?',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14807,'G6IN2UxMFpU','Here is my story: I’m currently thirteen years old and have been programming for a year. I started off with the basics of C for a few months, then I moved on to Python (I’m currently a Python intermediate) and now I started learning Java. I think what kept me going was practicing and building my own projects. I was fascinated by the cool games and projects I can create, and that made programming even more enjoyable to me. I would also recommend finding a coding partner or a coding club (as suggested in this video) because you can help each other out and build projects together. I personally wasn’t able to find a coding partner of a coding club since not many kids my age know how to code.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14808,'G6IN2UxMFpU','Hey man, I just started my Computer science journey at UCF about a month ago and I was wondering if you ever found a specific time during the day or night where you find yourself to be the most efficient with coding. In other words do you have a time during the day where you just shut everything down and force yourself to just stop programming for the day or is it usually different for you every day? I loved this video I really related to feeling pretty lost my first 2 weeks as I had no programming experience at all but am finally really starting to get the hang of things. My professor for my Intro to C class has been constantly repeating that 80% of the learning in this class will be outside of the classroom and I have found that to be some real truth.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14810,'G6IN2UxMFpU','Good to have you back Forrest. I''ve been following you since I started chasing my degree. I am now coming up on the completion of my associates in Computer Science and Math from my community college and then transferring to a university to chase a bachelors. I feel like I know barely anything about coding because all of my general education classes are so demanding. Did you feel this way? I am really looking forward to only learning programming and computer-focused information because although I am finally in a Java class, Chemistry 2 is kicking my ass and takes all my time. Thanks.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14811,'G6IN2UxMFpU','Definitely wish this was made when I first started my degree, the little bit and pieces of knowledge always manage to add up. Great video as always!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14812,'eSFA1Fp8jcU','Went through all of these during my first year at university. I know it may seem complicated here or really difficult, but it honestly isn''t. If you want to study CS or computer engineering or something like this, don''t let this keep you from doing that. Don''t be afraid by thinking it''s going to be too difficult or whatever. I promise it''s not',1119);
