Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14817,'eSFA1Fp8jcU','High school students who want to go to STEM majors in college should watch your videos. You cover subjects in-depth with practical examples. This is what is lacking in the majority of career/major prep videos on Youtube. The other channels would say "you need to know math" but are not really specific like you. It would be interesting to know how many students saved time and money by not having to switch majors because they picked the wrong major in their freshman year. Thank you!',303);
