Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14824,'rkZzg7Vowao','No question about it, this guy is a genius. The idea of using a physics-based notion of time like that of relativity, and using that as a metaphor to guide his work in distributed systems and its notions of timing is a really powerful and original way of thinking.',2582);
