Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13452,'nBzhjGblcJU','When are we as a Nation going back to sincere governance? Elections are partisan by nature but governing is not supposed to be. Encumbants are tasked to address all the needs of all the citizenry. The job of leadership should never be to retard the nations progress when their party doesn''t hold the majority. The lies and the one upmanship has got to stop. The victory should be seen as the Nation''s, rather than just one party or the other. It is the job of all who are serving to facilitate our progress. We are so much better than what we have been doing. We may have fallen short of our ideal but we should never stop striving. We are guaranteed not to make it if we quit.',21);
