Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13469,'pdyDmXtye2w','I love how you actually explain stuff instead of just shoving information into students'' heads. I think that turns many students off about learning chemistry, since they''re not understanding any of it and are just blindly memorising and accepting that things happen the way they do, without aksing why. If those students had you as a teacher, they''d be a much more interested in chemistry, as they''ll understand that it''s how we as a species study matter and the universe, and is not just a bunch of stuff to be memorised! Keep going, you''re amazing <3',49);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13470,'pdyDmXtye2w','Sir, as an older woman who found Chemistry to be impossible when I was at school,  I thank you for this!',14);
