Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13473,'pdyDmXtye2w','I recently fumbled through a Biochemistry course. It was quite difficult for me since I had completely forgotten the fundamentals of general chemistry. Looking forward to working “backwards “with you , crawling after my walking ! Even just this 1 st lesson has cleared up a lot of things that I had just memorized for biochemistry. Can’t wait for next lesson . Please keep making these videos! You are a very talented teacher',9);
