Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14131,'bUmULlGACEI','String theory could not be more simplified than this 02:10 Not all genius minds can teach well. His students are lucky.',107);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14132,'i_CijGuk7fw','This is how you teach and speak about a subject when you have mastered it; so interesting, stimulating and easy to follow, most high school teachers are not experts and have not mastered their craft, this is one issue with public education and kids get turned off and tune out...then land here and are again inspired and motivated to learn again',181);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14133,'i_CijGuk7fw','I’m eleven years old and wanting to get a start on physics early to get into a good college, and this is precisely the thing I am looking for. Thank you so much!',110);
