Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14136,'i_CijGuk7fw','I love the way you explain all of this. Thank you so much for sharing this and explaining so well, for the motivational words you throw in while you explain. I learn so much with your videos and wanted to express my gratitude ¿¿ please don’t stop making videos.',61);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14137,'i_CijGuk7fw','You are amazing. Currently taking physics in my senior year of college and got a professor who is new at teaching. Soso confusing but you explain it so well ¿¿',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14138,'i_CijGuk7fw','We live in a privileged age where we have the benefit of massive accumalated knowledge of the generations before us.',815);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14139,'i_CijGuk7fw','I''ve never felt like physics is so approachable until watching this video, great content',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14140,'i_CijGuk7fw','25 years old and well versed in physics. This was engaging to me even though I already knew the info, and that shows how well this man teaches. Future bookmark for home schooling my kids',0);
