Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14145,'3KC32Vymo0Q','I''m a physics graduate and watching the experts'' discussions made me feel like sh*t. The more you learn, the more you realize how much you actually don''t know.',738);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14146,'3KC32Vymo0Q','The first kid in this video is way beyond most kids with his ability to understand abstract concepts. The fact he was able to answer some of those questions was really impressive and not at all typical.',333);
