Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14148,'3KC32Vymo0Q','“you don’t understand anything until you’re able to explain it to someone who’s never studied it” this guy understands it',96);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14149,'3KC32Vymo0Q','That ending blew my mind. The fact that our universe brane could intersect or wrap, etc with other three dimensional universes to produce four-dimensional ones makes sense. How do you form a cube? With a bunch of slices of squares. How do you form four dimensions? With a bunch of slices of three-dimensional branes',85);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14150,'3KC32Vymo0Q','The kid explained physics very well for that man. Glad he shared his knowledge',67);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14151,'3KC32Vymo0Q','All of these people are very well educated for their respective maturity groups. The 9 year old is very bright, the teenager is wise beyond her years and the college student guy had some encouraging curiosity',61);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14152,'ZihywtixUYo','I''m curious to see what will be added to that map in 20 years',4706);
