Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14156,'ZihywtixUYo','Fun fact: My school has this poster in their physics class. I saw it was from YouTube and searched it.',873);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14157,'ZihywtixUYo','I know they''re all science subjects and I''ve found them genuinely very very helpful so I was just wondering.... if you''ve ever thought about making a map for business or economics or well, commerce students. I''m in the middle of shifting from sci to commerce, depending on my exam results that is, but I''ve loved all of your maps thus far, so I''d really appreciate it if you ever make a video on business management, or banking or stocks or anything along those lines... Just a tiny suggestion',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14158,'ZihywtixUYo','This is the most interesting video I have ever watched about physics in general. Thank you!',70);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14159,'ZihywtixUYo','I love Physics. I can''t express it in words.',60);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14160,'ZihywtixUYo','It''s one of the most interesting videos that I''ve ever seen in my life. I wanted to get an idea (a kind of overview) of the laws of our physical reality being represented as a total picture which you''ve rightly named as the Map of Physics and you''ve shown it wonderfully in your video. I''m very thankful & grateful to you for enlightening us with the gift of knowledge in such an orderly & interesting form in its totality. And many thanks to you for adding Philosophy to its end for addressing the unending quests of mankind for the unknown & unknowable truths.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14161,'ZihywtixUYo','I''ve studied a bit of all sorts of physics, quantum physics, classical and relativistic physics regarding nuclear energy and radioactive decay, but I''ve noticed that the classical physics of nyoton is still the hardest for me, especially the motion of liquids and solid objects like projectiles.¿',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14162,'SDxzZHSBhw0','In a parallel universe worthless neil would be watching me explaining quantum mechanics.',993);
