Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14170,'SDxzZHSBhw0','Quantum entanglement kinda sounds like that "if a tree falls in the woods with no one around does it make a sound" question except the answer is that it both does and doesn''t untill you hear it',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14831,'rkZzg7Vowao','One of the markers of true genius is thinking in an interdisciplinary fashion, in my opinion. This man has demonstrated only in this short time that he has knowledge of art, mathematics, and physics. It''s no surprise he contributed to our world in the way he has.',215);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14832,'5jmN_tBS0t4','Wow 5 years have passed. Ashley Gavin is a great comedian and an amazing podcast host! Crazy to see where people come from',117);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14833,'5jmN_tBS0t4','The less people going into computer science, the more the people calling me a genius.',1546);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14834,'5jmN_tBS0t4','This TED Talk encouraged me to go into computer science. Now I''m in my second year in college and I love it',51);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14835,'5jmN_tBS0t4','Studying computer science is my dream. Due to circumstances, I unfortunately couldn''t study it. I am still trying my best to learn a little about it through online courses while working.',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14836,'5jmN_tBS0t4','I think she''s talking about software engineering education, not computer science education. Math is an integral part of computer science, because math is the language of science. If you took math from computer science, by definition, you took science out of computer science, which is quite bizarre.',321);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14837,'5jmN_tBS0t4','Wow this was amazing watching and would like my instructor to be like her. She is to the point and understands that needing more programmers. I am just getting started and it is all about problem solving',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14839,'5jmN_tBS0t4','The first TED talk I''ve seen in years that was good, even great. There were some inaccuracies about CS but note that the vocabulary varies by region, school, and nation. If definitions were your main takeaway then the video is not meant for you.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14840,'5jmN_tBS0t4','I did python tutorial after python tutorial and none of it ever stuck. It wasnt until it really mattered at my job that I was pushed to learn basic computer science principles, and not long after that -Python. And I love every single part of it.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14841,'5jmN_tBS0t4','Although she’s wrong about the math part. I definitely believe that professors like to make learning CS harder than it should be.',40);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14842,'FPu2S_qEN5s','update: i switched my major to mathematics. I guess CS was not for me xD',187);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14843,'FPu2S_qEN5s','It took me like 7 years to get my undergraduate. I felt dumb all the time. I''m glad pushed through. I''m a Data Engineer and a lot of the stuff I found impossible before is easy now. I graduated with a 2.5 GPA. A lot of my teachers and the dean tried to convince me to change my major, but I never gave up. Practice makes perfect',1893);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14844,'FPu2S_qEN5s','The math shouldn’t scare you away. I was terrible at math. I just applied myself and made it. Not bad at all. It just takes effort.',1404);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14846,'FPu2S_qEN5s','CS is combination of Math, Physics, Statistics and algorithms. There is a famous quote that Computer science is as much about Computers as Astronomy is about telescopes.',2168);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14847,'FPu2S_qEN5s','You lost me at math-heavy. Thank you for this information, considering choosing another degree now',2205);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14848,'FPu2S_qEN5s','I''m a first year CS student at a major German university and my current classes are introduction to programming, computer architecture, automata theory, calculus and linear algebra. I went into it not having a background in CS at all, I really only went into it because I have a thing for logic and structure and I don''t regret my decision at all! At the beginning I was worried because I didn''t know how to code at all and I had to put in some extra hours in the beginning compared to the kids who have been doing this since they were in infant but it''s totally possible.',632);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14849,'FPu2S_qEN5s','A CS degree is basically a math major. With some programming, if you plan on taking cs make sure u actually enjoy it rather than doing it for the money.',3073);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14850,'FPu2S_qEN5s','CS requires a person who is patient, persistent, creative in solutions... Basically not someone who sees a wall and says i am done. That''s how you can know. Further as you grow into CS you will find out that you have been taught how to solve any problem, even if not from this field: think, research, learn, craft. Every experience that you go through will you improve at those steps. You will graduatelly stumble across moments where you will be overwhelmed, and it''s ok, because you also learn that progress is through error after error, only for the new problem to come to you, and apply the same process; you already can handle being overwhelmed.',392);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14851,'FPu2S_qEN5s','To add to this - CS is also a major for those who like to practice outside the classroom, I am a current CS major at Lawrence Technological University and the majority of my programming practice came from implementing the techniques taught in class to personal projects outside of the curriculum, I believe this is an important element to the CS degree path in order to get really good.',109);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14852,'rL8X2mlNHPM','I can''t believe this is free online to watch and learn you guys are doing great things. I deafinetly  want to be a computer scientist now',409);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14855,'rL8X2mlNHPM','Odds of a developer being asked to write an algorithm as part of a coding interview - 75%. Odds of same develop ever writing an algorithm in their job as opposed to reusing a system library - 10%.',531);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14856,'rL8X2mlNHPM','Loving the series, CC! Does anyone know any reference material where one can learn these algorithms?',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14857,'rL8X2mlNHPM','Ah yes, the graph:  depth-first vs breadth-first search.  I also quite enjoyed the binary search tree (BST).  Really fascinating field of algorithms and data structures.  :)',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14858,'rL8X2mlNHPM','This video was incredibly well done!  This lady is really great at teaching material in a clear, easy-to-follow manner.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14861,'rL8X2mlNHPM','In school I had to write a bubble sort in 16bit intel ASM. It worked, was efficient and was well documented. It got me an A+. Even like 15 years later, I am so damn proud of that piece of code. :-D',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14863,'D1qnuKSfPOg','I had a tutor and a friend student that excelled in classes. The tutor is doing well but my friend is now deceased beaten to death as a street person on drugs. The tutor that helped me told me that the reason one goes to school is to learn to teach yourself. If University does not teach you to teach yourself, you have failed, because if you can''t teach yourself you can not teach others what you have learned. I have this discipline in my agenda on full and have helped other students in the past.',42);
