Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14865,'D1qnuKSfPOg','As a college student this video was really great for me... with everything happening due to COVID-19 it really slowly made me lose my desire to "immerse" in CS, and I didn''t fully realize it until I heard you say it. Thanks for all the advice you put out!',38);
