Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13492,'eNsVaUCzvLA','I just wanted to say your videos have gotten me through half of my chem class so far! The only test I did bad on was the one where I had to memorize polyatomic ions, just couldn''t remember them all. I sincerely appreciate you putting your knowledge on this youtube channel, I found you back a few months ago when I first started my class because I was so frustrated and went to youtube and I happened to find you. I don''t understand why teachers don''t explain things the way you do, you show us every step while other teachers skip steps and go way too fast. It makes me feel better about myself, because I failed chem class in high school, but have to take it in college to become a Nurse. You''re beyond helpful and are impacting students in so many ways!! ill keep using as many of your videos as I can as i make my way through my chem class, you''re amazing!!',244);
