Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14171,'SDxzZHSBhw0','The universe is fractal, therefore the same rules that apply to a solar system must apply to an atom (except at faster speeds), otherwise the universe would collapse in disarray and conflict. Empirical observations of the micro universe are as good as the equipment utilized to collect them. If one observes a particle (planet) around the nucleus (sun) with a shutter speed equal to one revolution, it would register at one position only; 1/2 cycle would result in two opposite positions. At higher speeds more positions are collected and the vibration (wave) function starts to reveal itself. What is missing in our science at the particle level is the inclusion of the interaction between the particle and the energy dissipated from the device used to observe it (equipment or human brain).',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14172,'jKvjvW6a62c','Professor Kaku! I’m so glad he was asked to explain this for us. I am also excited that CNN is talking about this. It’s what we should spend more time talking about fascinating things like this.',97);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14173,'jKvjvW6a62c','In my physic class the professor said, “Just perhaps, someday we may know of there are other planets besides those our solar system.”  Now we know of over 5,000.',52);
