Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14175,'jKvjvW6a62c','How wonderful to hear from a physicist about the new information about planets in our system and seeing planets in other galaxies! My late father who was a farmer in the midwest would come into the house from the fields to watch NASA rocket  deployments and returns.  Oh how he would have loved this new exploration.  Thank you.',33);
