Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14182,'ARWBdfWpDyc','"Science should not be about whether you are good at it or not, it should only be about whether you are interested."',1109);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14184,'ARWBdfWpDyc','This talk was very healing for me. I had some difficult experiences with science as a middle schooler. I was placed in advanced english and science classes, but I never really got science. I was made fun of by my teacher. From that experience I came to believe that me and science don''t mix. But now that I''m older I realize I do love science when its explained well and when it relates to something I care about. I really do want to learn about Quantum physics, but have been intimidated about where to start. Your simple little explanations opened a door for me Dominic. I send you love and appreciation across the quantum waves.',492);
