Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14196,'1Xp_imnO6WE','3:49 This is actually one of traditional games in my country. But normally we use an oil paper or newspaper. First we glue every end of corner each other, then we make a little hole at the center by using a needle. Then we blow the paper from the hole until it expands like a pillow. Finally we light every corner of the pillow paper at the same time. It will fly and look like a Japanese fireball ghost in the sky',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14197,'1Xp_imnO6WE','Also, for all you would-be explainers: #2 works for perfectly symmetric objects in a vacuum.',108);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14199,'1Xp_imnO6WE','#4 might have something to do with the "4th phase of water." It''s a relatively newly discovered phenomena that negatively charged particles inside of water seem to cluster close to non-water surfaces. There''s a charge-less layer after that and then a layer of positive charge which creates a natural bi-pole which could act as a magnet when stimulated with another magnet and basically push the cereal along (and possibly even as work as a battery as the scientist explaining it pointed out). I''m no expert obviously, but there was a Ted talk that I watched on Youtube on the topic which was fascinating. I suggest you look it up.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14200,'1Xp_imnO6WE','First one works thanks to friction, when the imbalance occurs friction cancels out the speeds on each side which kind of forces you to move them accordingly so that the momentum on the sides are equal.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14201,'1Xp_imnO6WE','On the first one it works because when your hand is closer to one side, the friction slows it down on each side until when your fingers meet and the object is balanced. This should work as long as each hand is moving at relatively the same speed, the same force, and there isn''t any other significant variables.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14202,'hYc97J2MZIo','Teaching bleeding-edge science to a general audience (me) without making it feel watered down is done nowhere else as well as here. Thanks to all involved.',629);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14203,'hYc97J2MZIo','Years ago, I was a physics major. Life didn''t turn out the way I initially expected and now I''m in CS classes, including Theory of Computation. This video is very much the intersection of stuff I''ve studied/studying and hits hard.',153);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14204,'hYc97J2MZIo','This sounds reminiscent of Gödel''s incompleteness theorem. He was able to abstract away the mathematical operations and describe any possible equation as a binary choice between it being true or false, much like how the counterfactuals are either possible or impossible and allow you to ignore the specific equations themselves.',452);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14205,'hYc97J2MZIo','It would definitely revolutionize how science is taught in schools anyway. Whether it is the all in one thing that ties them together, or not. It could be incredibly useful as a learning tool.',46);
