Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14893,'H565avw-ufk','I’m currently studying compilers and language design, I make programming languages basically, and your explanation of high-level languages to assembly was very good. It was simple and easy to understand, I’m definitely yoinking it.',1471);
