Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14896,'H565avw-ufk','10:38 just an extra note about using SHA for passwords: while it can be used, its often not the best choice. SHA was designed to be fast to compute making it very useful for older hardware and things like signatures, but you typically want the exact opposite for passwords. For a password hashing algorithm, you want it as slow as possible until it starts annoying users. That way, an attacker will be able to calculate fewer hashes per second while brute forcing. As of right now, the usual choices for password hashing are bcrypt or argon2id, both of which were designed to be slow.',45);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14897,'H565avw-ufk','As a computer science student, I love the fact that there''s no clickbait, you know your topic and explain it very clearly. You earned yourself a new subscriber',26);
