Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13539,'bka20Q9TN6M','hey my hero ,bear in mind you are helping students who are in Somalia where there is no functional government and also cant get a great teachers like you but  when I see people like you helping me and my classmates without money that really  reminds us that we still have great heroes giving us a bright future .thank you my hero',2339);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13540,'bka20Q9TN6M','Guys, He has a Patreon, and a go fund me page in the discription. Lets all donate to this legend for helping us. I would be failing my classes if it wasn''t for him.',3010);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13541,'bka20Q9TN6M','I just want to take the time and appreciate how your background is black and not white¿. It’s so much nicer for the eyes',2972);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13542,'bka20Q9TN6M','Wow, he just covered a semesters worth of material in just three hour¿',2411);
