Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13545,'bka20Q9TN6M','There is nothing this channel doesn''t have, I studied for AP Calculus, AP Physics C Mech and Electronics and now for my university chem placement test with this channel and I have no idea how to thank you for this! You are literally saving lives with your videos! I can''t be more greatful for anything than your videos. Thank you so so so  much',315);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13546,'bka20Q9TN6M','U DESERVE A STANDING OVATION FOR TEACHING STUDENTS IN SUCH A NICE WAY.',126);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13547,'bka20Q9TN6M','I can proudly say that I''ve gone through the whole video. I started in april 20th and with larger breaks due to final exams in school, I finished today on the 15th of may. I have learned so much important stuff! I will go to university for a bachelors degree in biology yet I haven''t had chemistry and physics in over 3 years. Going through this content and studying it carefully is probably the only reason I feel comfortable to continue my journey to become a neuroscientist. Thanks :)',82);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13548,'bka20Q9TN6M','Dear Organic chemistry tutor. I am preparing for biology and chemistry exams after not taking these classes for 3 years and I don''t think anybody could explain this content more clear and organised. Thank you so much for taking the time and potentially changing the lives and futures of thousands, if not millions of kids that follow your account.',31);
