Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13568,'xPzR_D9qKeo','Once on a TV show, a mathematician and a physician were invited and were to make a fence all over some sheeps using the less material possible. The physician starts, and put all the sheeps in a circle, and try to make the fence less and less big. Then it''s the mathematician turn, he makes a fence all over him and define himself as the outside, making the sheeps on the inside of the fence. Moral : there''s none, it''s just funny stop overthinking',552);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14207,'hYc97J2MZIo','It strikes me that -- as a layman -- typically in physics there''s only one or two right answers about how a system can evolve. Seeing as this is something of an epistemological framework (I like epistemology and they''re important for getting new perspectives), and there''s a functionally infinite expansion of the number of ways a complex system can evolve, I''m struggling to see how we''re going to find this needle in a haystack of can''s and can''t''s. That is, without lots and lots of ways to generate new ideas about how the system will evolve and new razors for eliminating impossible actions.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14208,'hYc97J2MZIo','Wouldn''t constructor theory fundamentally be assuming we know all the base sets of rules in order to be correct? Otherwise it could rule out things that are possible, but they just don''t have a truth statement for in the base set of rules.',208);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14209,'hYc97J2MZIo','This is the best explanation of counterfactuals and Constructor Theory I''ve seen. I am sure a lot of good work went in to making it so simple to understand. Thank you.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14210,'hYc97J2MZIo','I very often find myself not wondering what David Deutsch is up to these days, and I would be entirely happy to hear about constructor theory after it has accomplished some accomplishments or gathered some buy-in within the discipline, instead of (as currently seems to be the case) before.',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14213,'-6IgkG5yZfo','People who take time out of their lives to make this much content over challenging subjects are the greatest types of people on the planet. Idk who runs this, but I cannot express how thankful I am for them. To get this type of assistance from a real person, I''d be paying hundreds and hundreds of dollars to learn the same thing. I actually watch these videos on Spring break for the joy of simply learning. Thank you.',2009);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14215,'-6IgkG5yZfo','I can''t begin to describe how frustrated and hopelessly lost I felt trying to learn physics the first time around. If it wasn''t for your videos and help, I don''t think I could stay within my major. Your work is absolutely invaluable, and your videos are actually life changing for me. I can''t afford tutors, but these videos give me a real fighting chance to achieve all of my educational goals. Thank you so so so so much! You are an absolute gem, and I hope you know how much we all appreciate you  <3',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14217,'-6IgkG5yZfo','I just wanted to say that your physics playlist helped me immensely to get a 5 on the AP Physics C Mechanics exam. Your videos are a godsend and I extremely appreciate all the work you put into them. I''ll definitely be revisiting this channel during college!',64);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14218,'-6IgkG5yZfo','is it weird that it''s one of the goals of my life to meet this person , just so much that he helped me a lot during a lot of hard times. Words aren''t enough to express how grateful i am and blessed are we to have someone like this amazing person teach his knowledge for free and continues to do so. I salute you sir thank you for helping me out through times!',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14220,'-6IgkG5yZfo','a mistake at 1:33:53 it was meant to be 20m on the incline instead of 10m but overall i get the way it work and good explations. thanks alot!',85);
