Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14234,'K-Fc08X56R0','When I was a kid, I discovered that you could stand up a straw in a glass of soda pop and miraculously, soda would come out of the top of the straw slowly like a tiny fountain. Back in those says, the straws were all paper. You have shown me the answer to this phenomena and I thank you.',79);
