Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14236,'K-Fc08X56R0','I''ve learned the "flicking the bottle/can" trick a while ago like 10-15+ years ago and only learned today why that works. Thanks a lot.',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14237,'K-Fc08X56R0','Imagine writing a paper that can be disproven by attaching a pressure gage to the bottle',3166);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14238,'K-Fc08X56R0','One of the only things I still remember from high school physics...shaking the bottle doesn''t increase the pressure, it allows the gas to more easily separate from the liquid.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14239,'K-Fc08X56R0','When looking at the salt water glass (around time index 6:37), if you look carefully, you can see a difference in the layers between the fresh water from the ice cube, and the salt water that the ice cube is floating in.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14240,'K-Fc08X56R0','I think it would be cool to see how the results of the ice experiment varies when you use a fresh water ice cube in the fresh water glass and a salt water ice cube in the salt water glass. You can also test using salt water cubes in both glasses and compare all the combinations. Very nice video.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14242,'ntxC5KMC4y0','Ohhhhh my God! I wait for these episodes like most people wait for the next Tom Cruise movie! Thank God for Brian Greene, for showing us the beauty of Physics!!',317);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14243,'ntxC5KMC4y0','So great to see Leonard Susskind on air! This is how physics should be presented - no egos, no showboating, just great minds discussing complex concepts that us mere mortals can begin to understand.',244);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14244,'ntxC5KMC4y0','Seriously thank you. I particularly am sad that I never pursuid physics in my higher education as these are the subjects that bring colour to my life. I think it might not be praised enough that we still get to learn about these amazing ideas, even more so from the most incredible field experts, for free from anywhere in the world. I would like to take these few minutes to show my gratitude towards these actions and to professor Brian Greene! Thank you all for your contributions looking for answers (or more questions) and communicating us the findings, forever grateful.',114);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14245,'ntxC5KMC4y0','I loved when you take a glance at Mark listening to Leonard speak because he just has the biggest smile on his face. You can tell how much respect everyone has for each other and their individual interpretations. This was a phenomenal listen and I can’t wait for more.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15038,'mQqVCYDD3sA','I love that Elfilin already has stuff in this game, Forgotten Land was just before this, so I was really surprised to see the stage, as well as the cosmetics.',65);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15039,'mQqVCYDD3sA','I love the part when Kirby is quickly eating the 50 Strawberry Cake. I imagine all this fun stuff from “Kirby’s Epic Yarn” when he couldn’t contain himself from a giant cake. I don’t care either, gotta love that cake!',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15040,'mQqVCYDD3sA','I love how you can add “Dream” in front of any regular object and make it a powerful Kirby artifact.',1846);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15041,'mQqVCYDD3sA','I''ve seen art of food-based abilities before, but not traditional abilities in the style of foods. It works unexpectedly well!',73);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15043,'mQqVCYDD3sA','This looks pretty fun, only big let down is it seems to only go up to two players in local splitscreen.',29);
