Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15045,'zDZAbmxP7Yw','Sonic can totally pull off more serious stories like in Adventure 2. I''m glad they''re taking that approach with Frontiers. I''m optimistic about this one!¿',499);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15047,'zDZAbmxP7Yw','Whether or not this Sonic plays out to what we want it to be, we should give thanks to the people that spend many hours developing this game! Looks great ¿',161);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15048,'zDZAbmxP7Yw','I''m loving the cyberspace stages and story so far. Nice to see another island in this trailer too! Can''t wait to get this at Christmas. Maybe it''ll be one of the few games I''ve 100%''d',45);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15049,'zDZAbmxP7Yw','I REALLY REALLY REALLY hope they don''t screw this one up. Like, I''d like to actually hear good things about a mainline 3D sonic game made by sonic team that''s actually good.',6593);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15050,'zDZAbmxP7Yw','Beautiful, finally a new sonic game that does justice for the original series, the first showcase was strange, but this one is definitely better compared to the old one',102);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15051,'zDZAbmxP7Yw','I can''t understand why some areas look genuinely breathtaking, then others are just floating disjoined rails and walls. I don''t understand how there''s such a massive difference!',45);
