Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15053,'zDZAbmxP7Yw','So… this actually looks good. As long as Egghead doesn’t come back as another villain pulling the strings, looks promising.',36);
