Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15056,'Yaf9h-Rceus','The 3DS is probably my favorite system of all time. With access to all DS games and the impressive digital library, almost no other system library can compare. The library isn’t only large, it’s diverse. There are bangers for every genre of game. All of this is a portable package.',221);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15057,'Yaf9h-Rceus','I recently started playing Kid Icarus Uprising and, apart from needing to take a few breaks to rest my hands, I am shocked with how much fun I''m having with it and I''m bummed that there hasn''t been a sequel made since then.',127);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15059,'Yaf9h-Rceus','Fire Emblem became one of Nintendo’s larger series thanks to the 3DS. I don’t really play Fates or SoV anymore but I still find myself revisiting Awakening, love that game. If you can step outside of your completionist mindset you’d probably love it',60);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15060,'Yaf9h-Rceus','I was surprised Kid Icarus: Uprising isn''t on here. I think it''s the best 3DS game. It''s a true masterpiece. Yet again, Sakurai developed this game too, and a lot of his games are gold. He''s a very hard worker and has high expectations for his games.',135);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15061,'Yaf9h-Rceus','3DS just felt so special. I didn''t expect it but found myself really into Pokémon Sun and Moon. I think Pokémon Refresh was a huge addition to making me attached to my team, and I found myself tearing up in a lst battle when my Mismagus held on to the end for me. I know it ruins the game for some people (the Pokémon holding on has a higher rate of stopping KO than the focus band, apparently but don''t quote me on that) but for me it was JUST want i wanted as a jaded almost-30 year old who really just wanted to enjoy the game.',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15062,'Yaf9h-Rceus','Smash on 3DS was a marvel in it''s own right. The fact the 3DS could handle it AND at 60FPS on the OG 3DS was absolutely mind blowing to me for the time',123);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15064,'Yaf9h-Rceus','Kid Icarus Uprising is my favourite game of all time. The combat is fun, the weapons are cool, the characters are funny and layered, and the story and world building is fantastic.  It''s been half the time there was between the last two games in the series, but I will gladly wait another 10 years to get more Kid Icarus goodness',40);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15065,'aiuIZN0KDFQ','I know this will get overlooked, but I really wanna give props to the announcer, she did a fantastic job and put so much energy into the announcement, it honestly made me pretty hyped',5026);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15066,'aiuIZN0KDFQ','For those who didn’t notice, the store manager for the locker items is Harmony, a character that has actually been somewhat present before in the series. She’s part of the musical band known as Chirpy Chips that plays all sorts of battle music in Splatoon 2. If you look it up, she’s right there on the album cover!',196);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15069,'aiuIZN0KDFQ','I’ll always love splatoon. They never take away things that people have always liked and instead they either make it better or add on things we’ve wanted. I’m just really obsessed because I’ve always loved this game since I was little :)',209);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15070,'aiuIZN0KDFQ','whoever this announcer was definitely needs a raise. everything was so easily digestible, and i’m glad new players can find their way even easier! she sounded so energetic, intrigued, and passionate overall. this 30 minute direct was beautifully executed!',3756);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15071,'aiuIZN0KDFQ','I''m going to miss the idols from Splatoon 2, they slayed, perfect character design, and wonderful personalities! I didn''t expect we would get three idols, Big man, Shiver and Frye! They seem to have a lot of potential, I''m looking forward to doing story mode too! The gameplay must be amazing!',196);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15072,'aiuIZN0KDFQ','I was genuinely afraid, I thought the game would be identical to the second, or even worse!  But this Direct definitely made me change my mind!  There are crazy news, the setting is much more oriental than that of previous games, and I love it.  New weapons, story mode that feels spatial, practically a free choice of character customization of much more!  I have no negative comments, the only flaw could be a short duration of the Story mode, which for lone players like me could be a problem, but I sincerely hope I''m wrong! ¿',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15073,'aiuIZN0KDFQ','The expressions of the characters are perfect and everything looks so lively like the inklings have actually remade civilisation but no humans. Nintendo doesn''t just cease to be awful. They don''t know how to!',53);
