Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13573,'OmJ-4B-mS-Y','Math was, still is and forever will be one of my favourite subjects to study. I feel in love with both its simplicity and complexity; the way it never makes sense when you go through it, but at the end everything fits together with such ease to form an answer. Some of the best memories of my school days were formed in the math class, and everytime I come back to it it astounds me all over again. I feel extremely privileged and lucky to be able to enjoy such a wonderful subject, and I hope our education system can improve enough to spark interest in more and more students. ¿',930);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13574,'OmJ-4B-mS-Y','I''m only in high school, but I love this map cause it makes me feel like I am in a video game upgrading my skill tree with experience points lol. i am 100% going into something math related in life, no idea what yet, but i find it absolutely fascinating.',46);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13575,'OmJ-4B-mS-Y','Brilliant! I now know what it is that I so love about mathematics in a nutshell! I would have loved to have had this insight when I was teaching maths for 30 years. Some of my pupils got it and many went on to study maths in some form and have had successful careers, including professorships. At 83, I''d like to believe that kids will always remain curious about the mathematical world.',151);
