Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13603,'Q8ijKtdIRMQ','Dude, thank you so much for providing this information for free on YouTube. I''m not a biology student ( amateur ), nor do I have anything to do with it, career wise, but I just like to have knowledge, and I watch your videos multiple times, and I still do. It''s people like you and Sal khan from khan academy, that make this world a better place. I can learn anything I want, without going broke! Lol thanks once again.',97);
