Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13609,'Q8ijKtdIRMQ','Sir, thank you very much for posting this. I have learned a lot just by watching your video. I also took the important details on my notes so that I can review it. You are such an amazing professor just like my biology prof when I was in grade 12 who can explain everything in detailed and examples. By the way I am from the Philippines and I am having a college entrance exam this May ¿ Thank you again Sir for the series of video you''ve made for biology. I am currently watching them ¿',11);
