Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14246,'ntxC5KMC4y0','Yet another marvelous production from the World Science Festival. I wait for every new episode as if sitting at the edge of my seat as these brilliant, hardworking individuals reveal more details about the saga we call “life”. Thank you so much, Brian Greene, for taking the time to help connect us with all of this valuable insight.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14247,'ntxC5KMC4y0','Thank you Brian and everyone behind the scenes who make WSF, you are doing a great service!',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14248,'ntxC5KMC4y0','I hope to see more of Ana. I can imagine discussing concepts like this in depth in your non native language would be extremely difficult. But I also think that in situations like that, the different viewing angle can be very revealing. For example, there are words in native culture''s languages that describe entire concepts in the English language, and vice versa. Sometimes things that are hidden from one perspective become obvious when looked at from another, because parallels between concepts emerge, beyond the language itself. I think I may have just broken my brain.... hahaha. Anyway, I love these. Thanks to everyone who was on it, and of course Brian!',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14249,'ntxC5KMC4y0','I was gratified & enticed by Dr. Susskind’s implication of the time ‘shear’ near the Event Horizon(EH) because it supports questions I have been asking for years about the structure of a black hole, (which is commonly dismissed as “an unexplainable singularity at the center of the EH”).  That, I have long believed is nonsensical without mention of relative rates of time layering.  I note that Feynman''s QED is not actually sensible, explanatory, or even rational but only exquisitely descriptive.  This vid also illuminated for me, the ubiquitous ‘hairiness’ of the universe as a thick tangle of ER/EPR entanglement ‘filaments’ stretched in at least 4D by an infinitude of time sheared partners.  I think this makes the universe a relatively big, but very tiny place.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14250,'ntxC5KMC4y0','Please keep these amazing episodes coming. Brian Greene is so good at bringing everything and everyone together to present these amazing theories to all. Compelling with stellar production. More please.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14251,'ntxC5KMC4y0','Brian is just incredible- I loved physics growing up and wanted to be a quantum physicist but also loved medicine and became a doctor but my heart feels alive when I read any papers on quantum physics and attend such lectures - may be one day I will become physicist for now I learn through such amazing videos and papers thanks so so much',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14252,'B1GO1HPLp7Y','Which basic concepts of physics would you like to learn more about?',803);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14254,'B1GO1HPLp7Y','I love you and your books Mr. Kaku¿ I''m almost clueless when it comes to physics but your books are so well written that I could understand the concept to some extent. I am easily hooked on reading every line in your books because they all are intriguing. Thank you and wish you everything ¿¿',65);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14255,'B1GO1HPLp7Y','Michio is such a gem for the world.  Pushing our minds is always a good thing! I don''t understand most of his ideas, but I try, it he is so inspirational!',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14256,'B1GO1HPLp7Y','It only took one year of physics at uni to demonstrate to me that I would be better off studying biological sciences ¿.  The mind of a high level physicist is an awesome and occasionally strange thing to behold when it is on display.   I have great respect for any scientist who is also an educator!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14257,'B1GO1HPLp7Y','Thank you for finally explaining “string theory” in words a non-physics person as myself could understand.  Now maybe you could explain why it isn’t called vibration theory.  I believe, with that,  I would have been more accepting of what you said today years ago.',48);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14258,'B1GO1HPLp7Y','I remember watching Michio Kaku''s shows on discovery science as a kid, he made me interested in science and I probably learned English from those shows, and if I traveled back in time to close the TV then, it''s likely I wouldn''t go back to being an engineer. I''m a little sad to see him getting older 10 years later, but I''m glad that he is as passionate about string theory as ever. It''s funny how some people can change your life without them ever knowing.',233);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14259,'B1GO1HPLp7Y','I have a theory that I would like to get out... If this is the leading theory we are to accept... You inspired me when I was a young child, Michio Kaku. I read your book Hyperspace when I was about 12 and it changed my life. I have since been building upon many theories of many great minds such as yourself... And I think I have discovered something that I feel I should go public with as soon as possible. I''ve never written a book before... It is intimidating... And one day, I hope to have your blessing. Because without you, I may have never come to these ideas... And, even within my theory, there is a place for string theory, as it embodies such a theory in a way. I hope to meet you one day. Thank you for everything. :)',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14260,'B1GO1HPLp7Y','As history goes all that was once a theory/Hypothesis/dream   has been turning out to be possible in more than one occasion  kudos to you Professor  Kaku',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14261,'B1GO1HPLp7Y','Dr. Kaku. Nice to see you still educating us on the exciting elements of life in the Universe. You and I met in December of 1999, when I was a producer at Fox News Channel working on our Y2K special. The program, focusing on what the future held for humankind, was a big success, and in my opinion you were the star.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14263,'0NbBjNiw4tk','This dude makes it look easy!  Respect!',1689);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14264,'0NbBjNiw4tk','He repeats his stories alot. and tbh i think that''s what made him such a good explainer. He hones the same explanation until he masters it and finally blesses us young minds.',59);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14266,'0NbBjNiw4tk','He makes everything seem so evident and easy. I''m glad to be born in a period where this man exists ¿¿',76);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14267,'0NbBjNiw4tk','This was the most comprehensible and engaging physics lesson I’ve ever witnessed. The realization that the Big Bang was the fissioning of universes…wow. And I actually understood the description of worm holes. Incredible knowledge and presentation!',14);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14268,'0NbBjNiw4tk','I have been a fan of Dr. Kaku for decades. His knack for breaking down complex subjects into easily understandable terms, combined with a refreshing sense of humor, makes Dr. Kaku a natural teacher and a pleasure to listen to.',1389);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14269,'0NbBjNiw4tk','I would like to say, thank you to all of the historical pioneers that have discovered the building blocks of both,science and mathematics. Each of you are brilliant shining “stars”.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14270,'0NbBjNiw4tk','This guy never fails to make me feel like I''m learning something while also teaching absolutely nothing new and simply conceptualizing every sentence.',10);
