Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15355,'gOGJGv6OoXA','This looks a lot better than the version they showed last year. Smooth framerate, fast-paced action and over the top silliness. Welcome back Bayonetta. ¿¿',3278);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15356,'gOGJGv6OoXA','I’m hoping Jeanne plays more of a role in this game. It’s going to be the first time that she’ll be active throughout the story without being mind controlled. She really only appeared in the prologue and epilogue last time.',360);
