Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15358,'gOGJGv6OoXA','the fact that Sigurd mentions a way to an “alpha-verse” (with alpha usually meaning first) kinda reinforces the idea that we’re in the universe where Cereza wasn’t sealed away, and the climax of the story could probably involve our main Bayonetta because it’s confirmed we’re gonna meet other Bayonettas. this also kinda ties into how Hellena Taylor tweeted about getting used to not hearing her iconic voice, which could mean the kinda low and seductive one she uses for our main Bayo.',212);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15360,'gOGJGv6OoXA','The music, the story, the characters, the boss fights in the future… I’m getting hyped for this game! OwO',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15361,'gOGJGv6OoXA','Looks so good !!!!!!! That game clearly looks like platinum was given all the time in the world to make the game as best as they can on the switch , can’t praise Nintendo enough for keeping this franchise alive',44);
