Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15366,'LoumzWmxUDo','Downloading the DLC from NSO feels a little confusing so maybe they just got too many complaints or questions about it, plus DLC on NSO is a key part of the benefits so they just want to have it covered. My take.',73);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15367,'LoumzWmxUDo','Idk man I think it’s smart to tell some parents (who are not gamers) how to download DLC because it allows them to give more exposure to their subscription (which I argue is a great value to those interested in the content it provides).',32);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15369,'LoumzWmxUDo','It was about downloading the DLC included with the NSO Expansion which is done differently than other DLC. And I''m pretty sure it came out to coincide with the new pack of tracks with MK8 Deluxe',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15370,'LoumzWmxUDo','The problem is it''s not telegraphed well to the general user that they have access to the Mario kart tracks for example. They need to upgrade their UX and put it in the switch online section of the OS and also message it better. My guess when I saw this was that they can see loads of people aren''t taking advantage of downloading DLC as part of their sub.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15372,'LoumzWmxUDo','After going through and seeing the user interface, the "download" button is not as prominent as the "proceed to purchase" button is obvious.  I can see people hitting the purchase button thinking that will get them to where they need to go, but then they see that they have to pay for it and get frustrated.  I have some experience with UX/UI design so that stands out.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15373,'LoumzWmxUDo','Wave race being here is pretty damn hype, hoping we get DK64 and uh.. maybe goldeneye soon',50);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15374,'LoumzWmxUDo','Virtual boy games for nintendo labo would be nice. As well as optional colour pallete swaps so you can either play in authentic red scale or have it recoloured to include all colours of the rainbow.',1);
