Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15386,'EvMp_cnU1Cc','Yo estaba viendo cada vez más factible que el Nintendo Direct fuese el día 1. Me monté la película de que Nintendo quería hacer eventos o dar noticias cada semana desde el Partner Showcase hasta el Direct de Septiembre y tenía la sensación de que el Treehouse era como su útimo recurso para cumplir dicho objetivo. Aunque, a saber, incluso siendo la  semana del 12, puede que sea cierto y estas semanas las completen con Treehouses de otros juegos como Mario + Rabbids o Sonic Frontiers.                                                                                                                                        Por cierto, se agradece mucho que también deis noticias pequeñas como la del canal de Sakurai.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15387,'EvMp_cnU1Cc','También el día 15 en la Tokyo Game Show, Capcom que ya ha confirmado su participación tanto presencial como online, retransmitirá ese mismo día a las  16:00h CEST , un programa online centrándose en títulos de la propia Capcom,como Monster Hunter(hablarán de la 2° actualización gratuita de MH Sunbreak, fechada para finales de Septiembre) y MegaMan , y luego el día 16 a las 17:00h CEST , retransmitirá un programa especial dedicado a Street Fighter 6 .',3);
