Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15392,'EvMp_cnU1Cc','Nintendo ha anunciado la fecha en la que cerrarán las tiendas digitales de Wii U y Nintendo 3DS. Será el próximo 27 de marzo de 2023 y ya no se podrá comprar nada, aunque si tienes el juego podrás seguir descargándolo, recibiendo actualizaciones de software y jugando online',6);
