Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13650,'6v8djXa-IPQ','A virus interacts with its environment, uses energy and reproduces, but viruses are argued to be not living organisms. Maybe this is because they can''t independently reproduce, they require the cellular machinery of the host cell to manufacture new viruses.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13653,'mFP_AjJeP-M','Having done a lot of diving - I can say that the octopus is an absolute marvel to encounter. Some (mostly the younger ones) are ... So curious. At first it''s like "WOW! U THREAT?!" once it establishes that you are not, it''s like "Eeer ... What are you then? I''ve never seen one of you around before." and there begins the act of mutual curiosity :3. You slowly reach with a finger, it sends a tentacle ... you both touch, sometimes they get frightened and clamp your entire hand, flashing black before letting go, but not swimming away. They are playful, find a shiny pebble, hand it to the octopus, it''ll take it, check if it can be eaten ... discard it ... then a few sec after send a tentacle back to the pebble out of curiosity as to "why did he give me this pebble ... gotta check again for anything special". They really hold a very special place in my heart, it''s not everyday that two species get curious about one another and attempt mutual understanding :)',7138);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13655,'mFP_AjJeP-M','My favorite creature ever.  I was on a crab ship in Russia.  I was the green horn so I had to empty out the pots.  I was also making hooch quietly because it was forbidden (it was lighting in a cup) so I could swap liquor with the chef for him making me private meals.  One day there was an octopus in a crab pot.  I tossed it a live well. Came back once everyone was off the deck.  Was gonna take it to the chef. it softly wrapped itself around my arm and I felt like I could see the fear in its eyes.  I couldn''t do it.  I took it over to the side of the ship, held it over.  It looked down, looked back at me, let go of my arm, and worked its way down the side of the ship until it got to the water.  AMAZING CREATURES!',57);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13657,'mFP_AjJeP-M','I can genuinely say I have never been more astounded by another being on this planet.  The evolution of this beautiful creature is literally out of this world.  This video left such an imprint on me that being able to "pet," play, handle, or be in close graces of this animal are on my life''s bucketlist for sure.  Being apart of research and doing a 180 degree career change may be in my future.',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13658,'mFP_AjJeP-M','I gotta go to work in 4hours and I''m over here learning about octopuses at 2 AM',19583);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13659,'mFP_AjJeP-M','You know, in our hunt for intelligent life in space, it''s heartwarming and humbling to know there are other creatures on this planet other than humans who very well in the distant future, could eventually be seen as a higher intelligence.',211);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13660,'mFP_AjJeP-M','One of the most amazing species of Octopus is the Mimic Octopus, it not only uses it''s shape changing skin and camouflage to hide but also imitates other sea life both as a way to escape predators (when being chased by a damselfish it''ll make itself look like a banded sea snake, which is a damsel fish predator) but also to hunt (imitating a crab to draw in another crab). The list of animals it''s been observed to imitate is quite long (Jelly Fish, Lionfish, Sea Snakes, Zebra Sole, Flatfish, Giant Crab, Sea Horses ect) it has also been recorded imitating at least two species we don''t know about (the same shape were recorded in separate locations being used by different individuals).',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13661,'mFP_AjJeP-M','I feel that this is a great place to recommend the book Children of Ruin - it depicts a society of octopuses that were subject to a virus which causes accelerated evolution and the struggle of humans to communicate with them. Some of the best sci-fi I''ve read.',8);
