Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14283,'p118YbxFtGg','Neutrinos are what got me into physics when I was 18 years old, and the more I learn about them the more fascinating they become!',421);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14284,'p118YbxFtGg','"Neutrino oscillations might sound somewhat mysterious but really it''s just linear algebra, complex numbers, unitary matrices, eigenvectors and so on"  she always makes me smile ¿',454);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14285,'p118YbxFtGg','I remember reading about neutrinos 40 years ago. They had just built neutrino detectors and had calculated the predicted number of events from solar neutrinos. The estimates were off by 1/3. They had not hypothesized the neutrino mixing at that time.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14286,'p118YbxFtGg','A thing I found amazing is that something like  10% of the energy from a nuclear reactor is carried away by the neutrinos it radiates.',80);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14287,'p118YbxFtGg','Thank you Sabine! I love when you go into this level of detail or more.',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14288,'p118YbxFtGg','Sabine, please keep making these videos about what''s NOT KNOWN in physics. It''s these types of things that can really drive a person to want to study the field. I also appreciate you talking about situations where physics may be on the wrong track. Physics shouldn''t be about jumping on the bandwagon of what''s popular.',192);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14289,'p118YbxFtGg','Ahhh, problems with the Standard Model, who''d have guessed. I had some wonderful arguments with ''particle'' physicists while living near CERN a few years back... but I''ve had problems with this particular theory since the Copenhagen Interpretation of the 1920s.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14290,'p118YbxFtGg','Thank you Sabine,  so we’ll thought out and executed.  My mind expands every time I hear you explain. ¿¿',8);
