Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14304,'mYcLuWHzfmE','As a Physics student, I have to say that this is an amazing introduction to the standard model. This video deserves to be played at schools as part of their curriculum! It explains all of the important aspects in a simple way that upcoming students can easily understand. Thank you for your contributions to science communication.',710);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14305,'mYcLuWHzfmE','Less than halfway through the video and it''s already one of the best-explained quantum physics videos I''ve ever seen.',93);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14306,'mYcLuWHzfmE','24:00 Interestingly enough, at high enough optical intensities (beyond those attainable by current lasers) it is possible for photons to interact with one another. This study of photon-photon interactions is known as nonlinear optics. For example, two photons can combine to create a photon with twice as much energy. However, due to these high intensities not being common in daily life, this isn''t frequently observed outside of laboratories.',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14307,'mYcLuWHzfmE','I''ve been rewatching this for a while now¿. It''s actually pretty interesting but I''m finding it hard to understand the leptons( especially the lepton numbers) symmetries and the neutrinos. But except all that I understood the rest. You really explained very well and you made it very comprehensive and detailed. Thanks very much¿¿¿¿.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14308,'mYcLuWHzfmE','Hey, thanks for including the bit about the neutron lifetime question. I have worked on the UCNtau experiment and its nice to see this parameter mentioned as an important question. For those curious, the lifetime is believed to be around 880 sec, but the statistics are still underperforming, and of course this result deviates from the older bottle/beam experiments by such a degree that there is not yet a consensus.',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14309,'mYcLuWHzfmE','The best explanation I have ever seen about the standard model. Congratulations!',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14310,'mYcLuWHzfmE','Can you do a map of all simple groups in abstract algebra? That would be awesome',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14311,'mYcLuWHzfmE','I wish I had seen this years ago!  Trying to visualize particle physics in my head has always been my stumbling block and this video just made it a whole lot easier.',8);
