Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14314,'4i1MUWJoI0U','I''ve been doing thermodynamics in some way, shape or form for three years now and this has been by far the best presentation for these concepts that I''ve come across. Thanks Dr. Shini. Lecturers could literally spend two days explaining what she did in ten minutes in class. You guys are awesome.',33);
