Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15197,'cCyPBq_u638','I''m not too worried. Nintendo usually does a Direct on September since 2016. They need a September direct to promote stuff in time for the holliday season when people get new Switches.',42);
