Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15200,'cCyPBq_u638','Not necessarily. If a September Direct came out in the middle or near the end of September it makes sense that it wouldn’t cover the already released Splatoon 3 and I don’t see  Harveststella gameplay coverage as something that would have gotten significant coverage on a general Direct either.',2);
