Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15214,'T17B7v6T8W4','Wood! Thanks for reviewing this and introducing me to a new controller (I know you were mainly focusing on the mini streamdeck, but still)! I had never heard of it and I was looking for something like that because believe it or not, my pro controller/joycons all HAVE STICK DRIFT, so finding a controller that addresses that problem is exactly what I needed especially when it''s got gyroscope capabilities too! (I play splatoon, so I need gyro and sticks with no drift of course.)',4);
