Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12962,'ObMP3SxPVbs','I''d like to see a panel of security experts -- gov''t officials intimately familiar with Standards for handling TS/SCI, such as the ICS-705-1 and the like. Anyone who has held a cleared position in DoD is familiar with the mandatory security training they had to take every year and probably remembers the many references to the DoDM 5105.21, ICS, and other standards. I think the public needs to hear first hand -- officially -- how this material was supposed to be taken care of; they need to hear about SCIFs, combo safes, cypher locks, cover sheets, security procedures, and all the penalties associated with mishandling such material. This is not a political discussion; it''s a national security matter.',226);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12963,'ObMP3SxPVbs','When you have a two, three,  four tier justice system, things like this happen and criminals run rampant.',102);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13665,'HdwzJLTLFqc','As a biology major this video made me feel sad for not having great professionals as passionate to their jobs as this man!',791);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13666,'HdwzJLTLFqc','His enthusiasm is so contagious, and he makes biology sound so interesting. This was awesome, thank you, Wired!',638);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13667,'HdwzJLTLFqc','I love the way he talks with such enthusiasm but in a calm way that’s inviting and makes you want to learn',337);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13668,'HdwzJLTLFqc','This man brought half of his office with him just to show us the most details, so humble and kind',19710);
