Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13670,'HdwzJLTLFqc','thor used to give talks at my tiny little elementary school in the pnw, genuinely one of the smartest and most passionate people i have ever met in my life (and yes, he brought this many props for presentations, too)',70);
