Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13676,'sweN8d4_MUg','His body language says a lot about him he''s very ambitious willing to share and learn more but also he''s really competitive',3957);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13678,'sweN8d4_MUg','2:44 I love how she just drops the P53 protein knowledge out there all the sudden. Definitely subverted the expectations of a lot of viewers there I bet.',2326);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13683,'ADiql3FG5is','The number of times I''ve heard "we don''t know" and "partially understood" gives me hope for science.',1154);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13684,'ADiql3FG5is','This is amazing and really interesting. I  got so lost  because I have insufficient scientific education  to follow this completely but it is fascinating to me and  I really enjoyed this video. I  have saved it and will play it over and over again to try and  understand it. I love the humor and the  very clear way they are trying to explain this to the layman. It is wonderful that they have this on youtube so we can all explore this amazing subject.',259);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13685,'ADiql3FG5is','I just want to say that I absolutely love this. I''m both mind-blown, entertained and inspired. As a mere psych student I still feel like I understood a whole lot of it, and they even made some psych references. And the way they talked about children having an intuitive understanding of quantum stuff made me think of theory-theory and this quote: "It''s not that children are little scientists — it''s that scientists are big children."',90);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13686,'ADiql3FG5is','This was a phenomenally moderated session. Serious kudos to John.',75);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13687,'ADiql3FG5is','I am very thankful for this presentation, I was afraid I was the only one that was pondering these ideas specifically concerning microbiology. Specifically the ability of bacterium changing their polarity quickly through chemical absorption of charged ions that are easily available through their outer cell wall causing that microbe to move, in a since, chemically. That would explain the speed of its movement as if turning on and off a light. In effect, just by changing of polarity of a biome would move it through time and space while leaving it''s structure idle, at its point of origin, but alter the quality of a distant biome into the parent''s original quality. In this accomplishing the  quantum speeds. Said energy in itself could then be transferred into movement, pressure fluctuation to force fluid movement or constriction, as well as color change. We see this in octopus or the movement of photophilic  plant cells. Great  discussion.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13688,'ADiql3FG5is','I just started enjoying watching this with closed captioning but 20 minutes in, it stopped working. I hope this can be fixed so I can watch the whole segment. Absolutely loved what was mentioned already so far. Thank you all for putting this together!',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13689,'ADiql3FG5is','I wonder if some of these systems could be studied in the two organisms I know of that go into a frozen stasis during winter. Perhaps as the thaw begins to occur some of the bio- quantum mechanical features could be observed and measured.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13690,'ADiql3FG5is','Thank you so much for this video. Very helpful for a biology teacher like me.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13691,'ADiql3FG5is','Take note: At 52:00, the assertion is made that cellular biology, especially how DNA directs construction of its copy during mitosis, is "incredibly complex". This should answer my critics who say I''m overstating the facts when I refer to DNA as a 4D molecule. It functions like a computer program, or at least like a program controller within a cell.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13692,'iJi61NAIsjs','I remember being only able to see content like this on the Discovery Channel. It''s crazy that I can watch content like this (arguably waaay better) at anytime and not being glued to my TV. Brilliant.',2594);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13694,'iJi61NAIsjs','I once was kayaking with my father in Florida when I took a break from rowing a beautiful dragonfly landed on the end of my ore. About 12 seconds of me gawking at it went by before a bigger dragonfly landed on top of the first and proceeded to quickly rip its head off. After it decapitated my new found friend it took off with the body leaving the head sitting on my ore with my jaw on the floor in total shock of what murder I had just witnessed. That day I learned that Dragon flies are metal as fuck.',147);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13695,'iJi61NAIsjs','That was probably one of the more intelligent "clicks" I''ve chosen in a while. Thank you for sharing and creating that incredible video! Now I absolutely have an even deeper appreciation for dragonflies than I already did. ¿¿¿¿¿¿¿',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13696,'iJi61NAIsjs','I once found a cold dragonfly who couldn''t move. I put it into diret sunlight and it warmed and flew away. I''m glad to have been of help.',108);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13697,'iJi61NAIsjs','This was one of the best documentaries I’ve ever seen. Perfect organization, perfect visuals, extremely high information content… Well done, and thank you!',78);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13699,'iJi61NAIsjs','I''ve seen a dragon fly with 6 wings once. I was floating down a river and it was flying near me and then landed on me for a short time. All of the wings worked. A cool mutation, I wonder how rare it is. Wish I had a camera with me',84);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13700,'iJi61NAIsjs','What intelligence to be able to skillfully control those beautiful wings! About 22 years ago, my husband and I stopped by a large creek to meditate. As I opened my eyes, a group of five dragonflies that were traveling over the water suddenly stopped in front of my face, hovered there for about 10 seconds, then suddenly did a 90 degree turn in synchronized fashion and continued on their way down the creek. It was otherworldly. I’ll never forget it. Thank you for this excellent content!',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13701,'iJi61NAIsjs','The counter-balance to deal with aerodynamic flutter is some really incredible biomechanics. I''ve seen videos of flutter being tested on airplanes and it''s no joke, that can quickly ruin your day.',2007);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13702,'1tOx_Vh5diE','Read the articles in full at Quanta: https://www.quantamagazine.org/the-year-in-biology-20211221/',120);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14320,'4i1MUWJoI0U','Thx for this. .) I have exam next week, this is lifesaving. :) But exam is just "little" more complex but it whould start me up realy good. :) Love this channel.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14321,'4i1MUWJoI0U','Physics is so interesting when you actually get to know and understand it, I really want to sue all my school teachers for not doing their jobs correctly and for only scraping the surface when it comes to Physics, it really is just so frustrating when you are so interesting in something that you can''t even understand properly',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14323,'IzQsYnLz2Gc','Very cool stuff. At first I thought, "They need to explain these effects verbally." Then I saw the written notes. You have pointed out some very good examples of how Physics can be weird, and provided links and explanations for effects.  Very Good job!',69);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14325,'IzQsYnLz2Gc','I love these experiments! So usable and functional for people in quarantine at home! Love it ¿¿',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14326,'IzQsYnLz2Gc','A similar demonstration of the dropping magnet is a solid metal disk connected to a pivot so it swings through the jaws of a large powerful magnet. The metal disk is not attracted to the magnet, but when allowed to swing through the magnetic field its motion is slowed and almost stopped. If a series of closely spaced slots are cut into the disk and the experiment repeated, the disk swings through almost unhindered. The slots disrupt the currents needed to generate the opposing magnetic field.',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14327,'IzQsYnLz2Gc','I really enjoyed this video! I love how it "teach" everything in a  so simple and easy way!!! and best of all, it''s short and eye-catching',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14328,'IzQsYnLz2Gc','This is absolutely amazing! thank you for explaining everything, no numbers, no annoying narrators, and just actually being legit good people',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14329,'IzQsYnLz2Gc','Thumbs up for a great video of really cool physics demonstrations. An extra thumbs up for excellent explanations in the description. Well done!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14331,'IzQsYnLz2Gc','Amazing!! Love these videos and can''t wait until my kids are a bit older so I can show them the beautiful world of science.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14332,'aXg3edeUrtc','After all the years I have been interested in physics, I love finding out new things about how the discoveries were  made, and the people involved.',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14333,'aXg3edeUrtc','Amazing lecture Suzie and excellent way of taking a stand on the nature of science and how we have used it and how we should use it. You could have even talked more about the scientist+civilians "sacrificing" or loosing their lives after doing experiences with new inventions etc. Many lives were lost due the lack of safety issues back in the days or just due to not knowing all the side effects etc. Excellent job Suzie. I am very amazed by your work and by your wisdom.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14334,'aXg3edeUrtc','What a fantastic journey through the discovery of physics..... Fascinating! Well done Suzie for making a difficult subject to understand so accessible. Frankly, I didn''t think that this would be an easy watch, but it was well explained and your excitement for science is quite infectious. I''m looking forward to reading your book. Excelsior!!!!!!!',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14335,'aXg3edeUrtc','Outstanding lecture. Interesting and fun. Thank you.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14337,'aXg3edeUrtc','An excellent subject and lecture! Thank you!',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14338,'aXg3edeUrtc','Really inspiring talk. Thank you so much',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14339,'aXg3edeUrtc','Very well presented and informative. Well done Suzie and I will buy her book.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14340,'aXg3edeUrtc','what a great way of explaining with a love for the subject .....thank you',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14341,'aXg3edeUrtc','If I was to predict the future now, I''d make future architecture look more like hobbit holes for rural areas, and artificial hills with forest-cover up top for the urban ones. For we either manage to bring some space for nature back, or we won''t have a future.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14342,'kpsu9_ql0-M','Read more about 2D materials in Charlie Wood''s extended profile of Jie Shan and Kin Fai Mak for Quanta Magazine: https://www.quantamagazine.org/physics-duo-finds-magic-in-two-dimensions-20220816/',44);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14343,'kpsu9_ql0-M','Almost like they''re making their own "fields" and then creating particles by putting different levels of energy into those "fields." Amazing.',112);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14344,'kpsu9_ql0-M','I saw a video by Veritasium where he showed the Moiré lattice pattern, he held two transparent sheets of a honeycomb-ish pattern overlapping, and I remember seeing the different shapes and structures emerging, being completely fascinated! I got way too excited about it and felt silly. I''m a 30 year old woman, and I wanted to have these sheets myself to explore these patterns, they''re beautiful. I knew there was something to it, and this video makes me very, very happy! Can''t wait to see more from this research and channel, I''m a new subscriber.',129);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14346,'kpsu9_ql0-M','So many developments like this seem hypey. But this one, dropping to 2D is such a beautiful simplification, lends itself to sane-time computer simulation. The moiré bit, again, beautiful. Reminds me a lot of X-ray crystallography, maybe similar potential for discovering how stuff works.',22);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14347,'kpsu9_ql0-M','This channel is so high quality and criminally under-watched. Another A+ video',505);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14348,'kpsu9_ql0-M','Can someone explain something to me (not a trained scientist): how many of these "virtual atoms" can they manipulate at once? Are they able to scale the quantity up enough to make, for instance, clouds of virtual hydrogen, helium, etc?',125);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14350,'kpsu9_ql0-M','Wow. This feels like game changing research. New technology here we come. Material sciences are fascinating.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14351,'kpsu9_ql0-M','Whoa. I love this type of minimalist approach to problems in general. It''s so elegant here. Very inspiring!',53);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14352,'GBs8e2KRLDg','Humans are smart, but I think we are really learning insight into our abilities when we try to understand what we perceive. Is the moon there when we don''t look at it, read about object permanence in psychology for instance. There are many other interesting correlations like this which may shed some light on observation. We are reaching the limit of being able to discern what is novel with what could be attributed to another already agreed understanding even if the correlation is not obvious. Even our inherent bias may get in the way, and like any puzzle, such as a sadoku, we may eventually learn that the complex mathematics could be on the wrong track and have to be scrapped only to have to start basically from some previous branch no matter how far back, and finally, it seems we are fast running out of feasible experiments to confirm or deny the predictions made by quantum mechanics.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14353,'GBs8e2KRLDg','There actually just has to be some sort of connection that we don’t see or understand yet.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14355,'GBs8e2KRLDg','I have for many years studied this phenomenon and i am still awestruck',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14356,'GBs8e2KRLDg','Bell''s Inequality settled the argument between Einstein and Bohr, showing that entanglement was a real phenomenon.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14357,'GBs8e2KRLDg','It tells us that we are looking at the universe through the wrong end of the telescope.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14358,'GBs8e2KRLDg','Quantum is a telescope to the vast!',3);
