Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15076,'z7SGxS0h8YQ','It''d be nice that even when digital takes over for games that they offer a buy from the manufacturer option where you could order a physical copy online and get it shipped from wherever they made the game. Because I fully expect digital merchandise to be abused/capitalized in some way out of favor for the consumer.',19);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15077,'z7SGxS0h8YQ','For these kinds of shows, I think I''d prefer a rapid-fire series of announcements in 30-60 minutes, followed by a lengthier presentation going in-depth into specific games. That way, those that are interested in a specific title can check out the deep-dive of that game in specific after the main presentation.',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15078,'z7SGxS0h8YQ','Wanted to wish everyone a Happy Wednesday today & love watching your video game news everyday Jon keep up the great Work! ¿',70);
