Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15080,'z7SGxS0h8YQ','The fact that the version of RE7 that came out was considered "marketing''s worst nightmare" shows you that listening to marketing people is a foolish idea when it comes to creative endeavours.',19);
