Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15083,'z7SGxS0h8YQ','Whenever I see a company announce a release date I never take it seriously anymore and almost expect there to be a delay',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15084,'z7SGxS0h8YQ','As term of gamescom I was excited for Gotham Knights villain trailer and the release moving up to October 21st I''m still getting day 1. I''m excited for Castillo protocol I''m excited for sonic frontiers finally getting a release date in November. And I loved the new trailer of Hogwarts legacy',7);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15220,'QkQ2TlVoXVg','So many quality of life upgrades, gameplay upgrades, and things the fanbase has been asking for have now been included. This game truly is set apart from splat 2. Thank you so much Nintendo and Splat3 dev team. You all did amazing ¿',43);
