Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15230,'y9b2vxjP0po','My brothers have one of each of these and I use them sometimes, the only problem we''ve run into with them is the joycons bugging out with the display. He has had to send them in twice for that and they still get that problem, but other than that it''s a great system for us.',1);
