Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12964,'ObMP3SxPVbs','I can tell you why Trump filed it with this judge in particular: he thinks every judge he appointed owes him for that and will overlook their oath to help him out. If this judge says no he will call her a rino and appeal it with another judge. As for why now, he is hoping he can stall the investigation.',569);
