Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12972,'LJx4AJNvyss','That... is pure desperation. I''m glad they''re safe. I''ve spent years in poor 3rd world countries, and I perfectly understand why some people will risk it all to get out of there, and maybe be able to create a better life for them and their kids.',50);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12974,'LJx4AJNvyss','You know things are desperate when your furniture starts to resemble an ocean-going vessel.  I''m glad they were found by the cruise ship, but did the cruise ship really have to make them hand-paddle their way aboard?',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12975,'LJx4AJNvyss','You got to respect a high group of people that are willing to risk their lives just to live for freedom¿',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12976,'LJx4AJNvyss','This is what desperation looks like. I''m glad they were rescued. Hopefully they will be accepted into the country and have a chance at a better life. We could use these hard working ingenuitive people to strengthen our nation.',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12977,'LJx4AJNvyss','This happened on my thanksgiving cruise a few years back. It was Carnival 2016 fall. We picked up immigrants fleeing from Cuba.',21);
