Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12993,'7SJA7_tz-kg','"It doesn''t solve every problem in the higher education system, so do nothing" is analysis you really need to be in a very privileged and comfortable place to serve with a straight face.',7);
