Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (12999,'7SJA7_tz-kg','It’s the interest that compounds that becomes a problem. Puts graduate in a financial prison for years. I paid my student loans and I support debt relief. It was hard to pay of 10k because of interest.',55);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13000,'7SJA7_tz-kg','Student loans should be dischargeable or modifiable in bankruptcy proceedings based on a proper showing of financial hardship.  It is absurd that the credit card debt on a Spring Break trip to Cancun is unquestionably dischargeable by a bankruptcy court, but tuition, housing, and fees for college are not.',19);
