Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13706,'1tOx_Vh5diE','Quanta Magazine always does a brilliant job at condensing scientific discoveries for a wider audience. I love what you do.',314);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13707,'1tOx_Vh5diE','I usually hold pop-sci in disdain, but this series is an exception. Actually communicating the discoveries in a way that is suited to those who are scientifically literate but not experts in the field, and not exaggerating/mystifying things for the sake of click-bait.',117);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13709,'1tOx_Vh5diE','I was waiting for this. This blew my mind. Gotta wait for the physics and math one. !!! There are so much to tell!!! Great work!',506);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13711,'1tOx_Vh5diE','I just completed my first year if psychology and neuroscience at university! Scientists are learning new things about the brain all the time, it’s super cool',114);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13712,'lgTbQlfOSKE','And if you haven’t had enough ocean creature facts for one day, head over to listen to our new podcast episode “Deciphering the Mind of the Octopus” on Nebula. It will take you behind the scenes on what it’s like to take care of these mischievous animals. This is probably my favorite episode yet!¿ https://nebula.app/modulus',1416);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13713,'lgTbQlfOSKE','The existence of hammerhead sharks implies there exists a nail fish somewhere out there to be discovered.',20207);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13715,'lgTbQlfOSKE','That footage of the finless shark plummeting to the sea floor was appalling. I''m incredibly glad you showed it, but it''s appalling. I''m not outright against the killing of animals, but the combination of outright cruelty and waste is just mind bending. I struggle with how humans can so easily disconnect from certain realities (I struggle with how I see it in myself as well). A fisherman would know that these sharks would still be alive when they''re thrown back in, if they just stopped to even think about what they''re doing. If they''re hellbent on wasting the rest of the shark, just slit the damn thing''s throat before you throw it back, you sick fuck',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13716,'lgTbQlfOSKE','It’s really interesting to think about how, an animal that has been around for literally million of years just out of the blue made a species so different from the rest and out of the ordinary, yet it ended up being very complex and enhanced from the norm',556);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13717,'lgTbQlfOSKE','Awesome work! Love the video! Thank you for what you do!',113);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13718,'lgTbQlfOSKE','"Sharks have survived all 5 mass extinctions." - Prime suspects, I would say.',7911);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13719,'lgTbQlfOSKE','Hammerheads are amazing...  Years ago, while trolling off the coast of Florida, I encountered one...  I was headed due south, and we spotted it heading aproximately SE.  Fin out the surface, big fella...  But we were on an intercept course.  He came to within ~100 ft of the boat, then turned off to the west.  He circled around, well behind our baits, and resumed his original course.  I swear he had GPS.',279);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13720,'lgTbQlfOSKE','Your speech at the end of this video really struck me. It makes me so happy to hear someone able to take their dream and make it a reality! Both your channel and Real Engineering are two of my favorites for interesting and niche technology and science, and I am always excited to see a new video :) THANK YOU for being you and sharing what you care about to the rest of the world.',50);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13721,'lgTbQlfOSKE','The technical side of this video and this channel is truly impressive. Have to admit the fact they are providing free useful scientific information with such a great quality. A very big thanks for the people behind this channel ¿¿¿¿',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13722,'qPKHna_P9zE','Check out even more from Thor! >> https://www.youtube.com/watch?v=dgEYV2s8Pg4',175);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13723,'qPKHna_P9zE','Every time he answers its like he''s telling us a story, rather than regurgitating an answer. I could listen to him all day.',2258);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13724,'qPKHna_P9zE','Give this guy his own animal documentary series like a more chill Bill Nye. His explanations are like a little story and you don''t make anyone feel bad about their questions. Bravo this was one of the most entertaining biology videos I have watched in awhile',1188);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13725,'qPKHna_P9zE','Came for the biology facts, stayed for his infectious positivity. His energy alone is more of a dopamine hit than anything else has been all day.',612);
