Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13727,'qPKHna_P9zE','He seems VERY passionate about Biology. The way that he explains these things makes it seem like he really loves his job. I admire people who can be passionate about their jobs.',7426);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13728,'qPKHna_P9zE','Not only is he crazy passionate and knowledgeable about biology, he''s also called Thor. How much cooler can this guy get??',269);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13730,'qPKHna_P9zE','My favorite example of weird evolution is the Aldabra rail, a small flightless bird that lived on a single island and went extinct when the island sunk. Later when sea levels dropped, its ancestor migrated back to the island and re-evolved into the same species',427);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13731,'qPKHna_P9zE','he is the type of biology teacher that would be able to easily hold the attention of any classe just by the way he speaks so excited about things',101);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13732,'wENhHnJI1ys','As someone obsessed with biology, I''m pretty disappointed that the Map of Biology received the least views of all the sciences :''(',612);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13733,'wENhHnJI1ys','I''ve been waiting forever for this one. Although I''m biased by being a biochemist myself, he did an amazing job at bringing all the branches together in a smooth, non-confusing way! I would like to see a map of medicine or linguistics in the future.',130);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13735,'wENhHnJI1ys','this is helping me understand what parts of biology i like, and therefore helping me choose my education! thank you for a very informational video',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13736,'wENhHnJI1ys','The Mitochondria is the powerhouse of the cell',1161);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13737,'wENhHnJI1ys','I love your maps, they are fantastic!  Thank you for putting them together, they are super helpful.  One nitpick - what about Microbiology?  This is a VERY important subject, given that unicellular microorganisms vastly outnumber the multicellular organisms most people are familiar with.  Of course, I may be biased, since I am a microbiologist...anyway, keep up the great work!  I am blown away by the breadth of your knowledge, and have learned a ton about scientific fields I am less familiar with through your work.',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13740,'wENhHnJI1ys','You mentioned that bioinformatics is the field that uses computers to analyze genetic data when statistical methods aren''t enough, but when statistical methods are enough, that is a field called quantitative genetics. And using it we can often tell whether a trait is genetic without having to know which specific genes are involved. It can also help give candidates for molecular genetic study to find the genes relating to those traits.',13);
