Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14373,'k-vm3ZWnMWk','Meanwhile this evening I did a (bad) impression of Prof Cox on stage to a few hundred people. And even though it was so dodgy, everyone knew who it was as he’s such a legend. Nice to hear him talk about Sagan, as many see him as a modern version',559);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14375,'k-vm3ZWnMWk','You sir, are a superlative teacher! And so is Professor Cox.  This has been one of the most fascinating interviews and YouTube presentations that I have seen. But then, I’m an old man, an old medical doctor of a man, who has had the pleasure of experiencing many good and great teachers in his lifetime. And learning new things, for me, remains one of my greatest pleasures. And this border/ conjunction between the life sciences and the physical sciences is one of my greatest fascinations.  I am so very glad that I found your channel and subscribed to it.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14376,'k-vm3ZWnMWk','Brian Cox as always, doesn’t disappoint… He’s very deep and thoughtful in a very accessible way…',26);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14377,'k-vm3ZWnMWk','I absolutely love Professor Brian Cox, after watching his TedTalk about a year ago I watched as many videos of him as I could and he has incredibly increased my interest in physics and astronomy! Thank you for the great video!',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14378,'k-vm3ZWnMWk','This channel is a key example of why publicly funded media is still so important in the digital era. The right people given the right resources can do amazing things and grow to provide so much more value to society than what was invested. Keep up the amazing work!',1355);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14379,'k-vm3ZWnMWk','Very thought provoking video.  I''ve always found Brian Cox''s viewpoints VERY Interesting.  He sees the same things as other scientists, but he helps us think about it just a little differently than many, which can help us think differently ourselves. Fascinating!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14380,'k-vm3ZWnMWk','One of the most interesting, informative and thought-provoking discussions   I have ever seen. Thanks guys.¿',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14381,'k-vm3ZWnMWk','Something funny I just noticed. Aside from looking sort of alike both Brian Cox and Shigeru Miyamoto seem to almost be incapable of speaking without smiling. Being experts in completely different fields both just seem so curious and enjoying what they do. What a joy to listen to these guys and just have them around.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14383,'3lTQqEehEhI','Welp there are literally no excuses at this point. You can literally teach yourself anything',573);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14384,'3lTQqEehEhI','Its truly a great time to be alive, to be able to have resources like this be so freely available for anyone to use.',203);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14385,'3lTQqEehEhI','This is remarkably clearly communicated. Almost unique. Every single wording, every sentence, is chosen with a purpose. The examples are very descriptive. Needless to say, the topic is a bit complex. It is adressed, subject to an almost perfect understanding of exactly when the apprentice finds some topic extra difficult. Imagine having a teacher like this when being in formative years. Sometimes in life, you happen to encounter people with an above-human talent to communicate complex matters in an accessible way. Simple enough but not to simple. It is important to recognize this and to cherish those rare moments.',39);
