Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14389,'3lTQqEehEhI','Thanks for the video! I''ve always been interested in physics, but chose to go into chemistry for undergrad. It''s awesome to have great explanations and videos so easily accessible.',46);
