Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15404,'92F46l6vpRs','This was a joy to watch. I really like this series. Just wrapping up a whole year in sections is a great way to look back. This year felt pretty monotone for me. I wasn''t over hyped for anything and as a pokemon fan PLA was cool but BDSP felt janky. Kirby was incredible. Kingdom hearts being cloud versions was the biggest let down for me though.',81);
