Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15407,'Rkz-PjCQjWk','Is it just me or does it look like everyone will be able to dodge roll now and not just duelie mains? I think Splatoon three is gonna be easy to pick up but hard to master, nothing wrong with that though! Can''t wait to meet everybody in the turf war!',199);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15408,'Rkz-PjCQjWk','0:48 New inkzoka looks cool, looks very strong and the 3 shot limit really helps balance it out a bit. My Question however is if the rainmaker will take on this kind of “triple spiral shot” that the inkzoka has, as the rainmaker always takes after the cannon like special in each game. Would make for interesting ranked matches',188);
