Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13744,'8kK2zwjRV0M','My earphones get tangled all the time, but miles and miles of DNA don''t. Mind blowing.',3641);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13745,'8kK2zwjRV0M','I started teaching biology in 1993 and I KNOW my kids (now middle aged) KNOW it was Rosalind Franklin who did the work. Hank, thank you. I left teaching, but am thinking about getting back into the classroom. Using your videos to study up for the test to get recertified. :)',389);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13746,'8kK2zwjRV0M','Thank you so much for covering Rosalind Franklin, some of my previous instructors only briefly mention her and they rarely discuss her major contributions to the discovery of the DNA structure.',345);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13747,'8kK2zwjRV0M','The funny part about biology is that everyone pronounces everything differently',304);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13749,'8kK2zwjRV0M','I don''t remember Crash Course being this complicated when I was in 9th grade biology, though I guess I should be thankful that 6 years later it is still helpful for my college level genetics class.',29);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13750,'8kK2zwjRV0M','Editing team:   "Hank please hold up a shoelace and be amazed by it"',953);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13751,'8kK2zwjRV0M','For the first time in my two years in college, I actually understand what I am seeing. Thank you. I am in the MLT program trying to understand how PCR testing works but in order to do that I realized that I REALLY need to comprehend DNA and how it is made in order to understand how it is taken apart and analyzed. You have really given me a strong visual and I can''t thank you enough.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13752,'NNnIGh9g6fA','Lectures hit different when you’re not pressured by grades.',34776);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13753,'NNnIGh9g6fA','honestly, Its crazy how much easier information is retained when you voluntarily seek it. When i was in school i would have never listened to this and would have been dying to get out of there. Now that i have the ability to learn on my own time I retain and look for information on a much higher level. Incredible.',2566);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13754,'NNnIGh9g6fA','This professor is wonderful, I’ve been in a lot of lectures and the way he immediately captured my attention, held it, injected humor, and made me like him- was fantastic. Intro to human behavior indeed.',556);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13756,'NNnIGh9g6fA','I really hope that Professor Sapolsky knows how many people all over the world he captures through the screen with his amazing ability to teach ¿',181);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13757,'NNnIGh9g6fA','The fact that we can access this lecture without having to attend Stanford is mind-blowing. What a time to be alive!',25414);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13758,'NNnIGh9g6fA','I''m literally in middle school yet I''m able to follow this to an extent, really makes it obvious that this professor''s great at his job',379);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13759,'NNnIGh9g6fA','I''m so grateful for living in an era where this kind of content is available like this. I''m from Brazil and I wouldn''t be able to listen to this amazing classes if Stanford and professor Sapolsky weren''t so kind to make it available online. Thank you.',132);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13760,'NNnIGh9g6fA','Coming back on that lecture, you''re an absolute gem Robert Sapolsky. I''ve discovered this video a year ago, searched my way through the infite possibilities of life, finally started my bachelor in psychology, and I head on becoming a researcher in evolutionary psychology or something like that if things go well and if I still like it. Hopefully I see you some day at Stanford University',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13761,'NNnIGh9g6fA','This is an absolutely amazing lecture because he doesn''t just dive into the subject. He outlines the way to approach it without thinking in boxes. Its a refresher for scientific and critical thinking abilities. Designed to help unravel a very complex and challenging subject. I think I''m going to be spending some quality hours here with the Dr. One of his lectures on KoKo the gorilla brought me to this playlist.',53);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13762,'GimCcrwYxdE','The fact that baby orcas have to learn their language shows how intelligent these beings are',6811);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13763,'GimCcrwYxdE','the fact that whales/dolphins can legally just be kept at places like Seaworld is just insane given just the information in this video.',2384);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13764,'GimCcrwYxdE','21:50 It''s really fascinating to see the Orca''s movements in front of the mirror. They move with this careful consideration and grace that you also see in species like the dolphin or gorilla. Or humans for that matters.',449);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13766,'GimCcrwYxdE','One of the coolest things to me about orcas that the video doesn’t mention is that there has never been a recorded human death from a wild orca. But orcas have been recorded and seen leading humans towards pods of whales to hunt. They might see humans as a potential symbiotic relationship since they’re known to eat human leftovers from whaling or snag stray fish when fishermen use nets. Just super cool that they easily could attack and kill humans but seemingly have no interest in doing so',449);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13768,'GimCcrwYxdE','I remember watching Black Fish and hearing one of the sailors sent to capture the first set of Orca calves remark about how when getting the calves in the boats the vocalizations they heard made them realize they were taking a baby and that its family was crying because of it. Really unnerving information for a college student aiming to become a scientist',76);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13769,'GimCcrwYxdE','Orcas really are the humans of the sea. They''re everywhere, eat anything, work in groups, have dialects, pass down skills over generations, and have great teamwork skills. If they were humans I would say they are in a sort of "tribal stage." It''s only a matter of time before they become advanced one way or another.',237);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13770,'GimCcrwYxdE','I love that seafaring mammals evolved out of the ocean, were unimpressed with the land, and just went back.',46);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13771,'GimCcrwYxdE','What a dream it would be to be able to actually communicate to orcas at some point. Communicating with other intelligent species is so huge',2839);
