Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14432,'2WPA1L9uJqo','I think it''s really a testament to your explanation skills that the Schrodinger equation seems like it''s the obvious solution once you''ve seen it. It was, of course, not obvious, even to Schrodinger himself. The time and effort you must put into these videos is astounding, and I thoroughly enjoy watching them. Great work!',506);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14433,'2WPA1L9uJqo','In all of my university courses, textbooks, websites, and videos I''ve indulged to learn intro QM, this is easily the best overview with the clearest and most well-put explanations and motivations. Thank you.',74);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14434,'2WPA1L9uJqo','I love how you start building up from the historical background, something we don’t see often. I hope you will upload more often¿¿',124);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14435,'2WPA1L9uJqo','It always amazed me, that when I was in school everything about quantum mechanics was a synonym of something very difficult and counterintuitive, thanks to the pop culture and popular science articles/videos on youtube. After studying in university it turned out to be much easier, espesially considering that classcial mechanics is not that simple either. If i saw this video 5 years ago I would have understood that fact earlier. Thank you for this clear and neat explonation.',141);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14436,'2WPA1L9uJqo','Outstanding work.  I somehow managed to understand all of it, whilst understanding none of it at each stage.  Coming from a non-physics background, and with only a limited understanding of calculus, to be able to carry a viewer with my limited ability along is testament to your superb communication.  Thank you.',85);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14437,'2WPA1L9uJqo','Having taken a physics degree many decades ago may I congratulate you on such an excellent presentation.',81);
