Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14906,'-Zj1kepwRuw','Yes, this is what was able to get me to wrap my head around coding. For anyone that''s getting deeper into learning web dev stuff, I highly recommend Scrimba. It has a great problem-solving based approach to learning where you get small challenges constantly so you can come up with the solution by tying what you''ve learned together instead of just showing you the solution first. There''s also some really cool tech on their platform where you get a live integrated cloud-based coding environment with all of the source files for each challenge automatically updated as you go through the course so it''s very seamless and the video tutorial part of it is not a video but instead is a scripted live editing of the code in the text editor. You can pause it at any time and directly edit the code that''s being written during the tutorial.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14907,'-Zj1kepwRuw','First of all, congratulations, you''ve earned around 40 subs in the last 2 hours; from 12.9K to 13.3K! Second of all, I love your content and the  fact that you''ve encouraged me and many others to take this course is amazing. I''ve been doing frontend for 4 months now and sometimes I struggle with some programing concepts in JavaScript so...I''m enrolling now.',7);
