Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13782,'SqrRW3CMOzo','Worth every minute I listened. I am not either a scientist or a researcher. I am just the average Joanne who is so grateful that there are enquiring minds always striving to know more',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13783,'SqrRW3CMOzo','This lecture just flew by — always a good sign (for me) and kept me interested throughout — thanks. Love how seemingly unrelated events/discoveries lead to more investigation, experimentation and discovery. Reminds me of that great BBC series Connections.',36);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13784,'SqrRW3CMOzo','That alien analogy works well in every branch of science....what a wonderful way to establish a context for such an engaging lecture...thank you',78);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13785,'SqrRW3CMOzo','To visually see, the smallest machines working in a living cell is a wonderment.  The smallest machines in the cell exhibit intelligence and decision making.  To actually see them in action in real time is astonishing.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13786,'SqrRW3CMOzo','Very well done. I liked your analogy with football (soccer) and the microscope to start. As you went on I got more interested and I had to buy the book to learn more. Although I am not a scientist of cells, I am a scientist of knowledge, so your book will add to my knowledge base and maybe a breakthrough for me in certain aspects of my domain.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13787,'SqrRW3CMOzo','The start was excellent. A good metaphor! Maybe it''s the way we understand the world around us. And the way we learn any subject! Thanks for sharing!',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13788,'SqrRW3CMOzo','This was absolutely fascinating! One of the best lectures on YouTube ever; well presented, very enthusiastic, knowledgeable and informative. I look forward to making my choices in the future. (I think!) The quote at the end was superb.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13789,'SqrRW3CMOzo','Thank you for this lecture. I''m still amazed about origin of those tools.',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13790,'SqrRW3CMOzo','In my dissertation work, I used the non-fluorescent halves of different fluorescent proteins and engineered expression vectors for genes that encoded these appended to target proteins (wt and oncogenic mutant c-Fes kinases) such that the targets would be competent/functional with the attached FP halves, but then when they bind/dimerize/oligomerize to perform phosphorylation-dependent enzymatic activity, then the FP halves would bind as well to become a whole fluorescent protein tagging the target protein dimers! This approach allowed us to observe the action of our targets, localization, quantify dimerization (as a proxy for kinase function in this case as well), etc. Molecular biology is built upon so many tools/techniques that are in and of themselves amazing!',11);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13792,'bFkIG9S2Mmg','I had one as a pet when a kid.  Didn''t realize I had a god in my fishtank.',7092);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13793,'bFkIG9S2Mmg','Bought two as a present for my wife. They''re interesting little animals and a lot more intelligent than I would have thought. They recognize my wife as the one who feeds them; when she walks in the room they come to the front of the tank and start swimming up and down to get her attention. If someone told me they do that never would have believed them.',2999);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13794,'bFkIG9S2Mmg','I''m from Mexico and it kills me to see that one of our national treasures is dying off. Also feel very much impotent at the fact that I can''t do much about it. :c',2031);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13795,'bFkIG9S2Mmg','I have an axolotl currently and he’s been with me since 2000 or 2001.  And he wasn’t a newborn when I received him.  Believe it or not.  He is definitely a god in the amphibian world at least.',619);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13796,'bFkIG9S2Mmg','While really interesting, I can''t help but feel bad for all the Axelotl that had to endure amputation and maybe worse for this to be researched. Especially the one that got their rejuvenation blocked.',792);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13797,'bFkIG9S2Mmg','I spent 20 minutes watching a bunch of cute salamanders while learning about them you earned a sub',638);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13798,'bFkIG9S2Mmg','Learning about scientists finding a new home literally made me choke up. Axolotls are my favorite animal and I try to support any conservation organization centered around them as much as I can. They are such beautiful and magnificent creatures, and Im so happy they have been in the limelight more often these days. I truly hope their wild population can begin flourishing again :,)',175);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13799,'bFkIG9S2Mmg','I cut off tip of my thumb and it regrew.  I was told it was because i retained nail bed which produces stem cells.  It was incredible process.  There was nothing to stitch shut (no skin) and couldn''t reattach tip so they used a special material on it for a while.  Removing that was horrifying.  But there isn''t even any scar tissue and my finger print grew back too.  However the nerves didn''t fair quite as well.  It has that asleep pins and needles feeling to it so i did physical therapy to get used to fine motor tasks, and it''s pretty much normal now.  I wonder if animals new limbs have less sensitivity too though ¿',429);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13800,'bFkIG9S2Mmg','My 10yo daughter loves axolotls. I don’t know why I’m being particularly emotional from this video, but it has really made me cry. I’m going to look and see what digital adoptions there are for axolotls. My daughter has a birthday coming up and a good gift would be a sponsorship in her name. She’s just a bit too young to keep one herself; maybe in high school if she’s still into it.',757);
