Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14455,'Qi9ys2j1ncg','Wow! I am so glad I discovered Dr. Penrose today. I wanted to refrain from any comments, but I have to say that the Interviewer asked better questions than Dr. Peterson and he seemed to understand what Prof. Penrose was meaning, whilst Dr. Peterson''s brain seemed to short-circuited a few times. My view is that Dr. Peterson came in with an upfront agenda, not to learn but to convince. Kudos to Prof Penrose for schooling Dr. Peterson. Okay, I said enough.',7);
