Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13165,'slrYhhU7ybM','What is one of the first things a defense lawyer will do when faced with anyone who has vital information that can result in the summary conviction of their client? If you can''t discredit the evidence, discredit the witness by any means possible, either through facts, relevant or otherwise, or innuendoes . . . That is exactly what Trump and the Republican party are attempting to do',73);
