Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13822,'CAUOhG_c4Go','The part about the mutated DNA is insane. During the process of evolution, some of these plants basically repurposed and readjusted their basic plant tool-kit for a drastically different purpose. The fundamental working remains similar, clearly establishing a link to the original version, yet the execution and result are completely new.',445);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13823,'CAUOhG_c4Go','What I find most interesting of all of this is how the underlying mechanisms for carnivory are rooted-pun intended-in the genomes of many plants, since they''re usually used for defense against pathogens and herbivorous insects. With how common knowledge carnivorous plants are, it really surprises me that they aren''t used as examples of how evolution works with what it has. Also, makes one realise how plants are very much alive and "aware" of the world surrounding them',250);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13824,'CAUOhG_c4Go','Loved this video! I have always found carnivorous plants fascinating had had several venus flytraps. But I didn´t know how they actually worked or evolved. Thank you for the video ^^',273);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13825,'CAUOhG_c4Go','Yes, an “Insane Biology of” carnivorous plants! I’m an amateur CPs grower on my free time and a fan of the channel, it’s the perfect combination. Though on 1:38, aren’t waterwheels’ (aldrovanda) traps also snap traps? I believe bladderworts (utricularia) are the ones with suction traps.',136);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13827,'CAUOhG_c4Go','Woh I can''t wait to learn about the biology of venus fly traps so I can genetically engineer my own carnivorous plants',527);
