Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13830,'CAUOhG_c4Go','600 species of carnivorous plants? Wow! And how did I never know that Venus Fly Trap & Pitcher Plants were both native to the US, I had always assumed they were exotic tropical plants. This was a fascinating & informative video ¿',25);
