Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13854,'QnQe0xW_JY4','I just wanted to thank y''all at Crash Course for this biology series!! Last year I had to take a state biology test that is a part of a series of tests that are mandatory to pass to get your high school diploma. I decided to watch these biology vids to help prep because I wasn''t feeling prepared enough. It ended up that a big section of the test was on a topic we didn''t go over in class but I had watched Crash Course vids about it. Anyway I just recently found out that I did pass my test!!!! So just thank you guys so much!! I don''t know if I would''ve made it through my test if it wasn''t for these vids!!!¿¿¿¿¿¿¿¿¿¿',123);
