Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14534,'4JXjqaN97IY','The trouble with the holographic notion is POV (point of view) on the one hand and photon density on the other, …… then if we had three or more hands all of the substance that can’t be “projected” and of course light speed. Having said that, I do agree that all of the forces are actually expressions of the same phenomenon, that being the interaction of matter energy with the Higgs Field at the plank scale. To my thinking this interaction elevates the energy level of the field proportional to the interacting mass and this is gravity the energy level of which creates the effect of the curvature of space. So that is another effect that cannot be projected as a hologram.',0);
