Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14536,'4JXjqaN97IY','So correct. A civilization can''t only rely on an abstract science but on technology as well...',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14537,'4JXjqaN97IY','What would it look like if we met the extent of the knowledge God allowed us to know? It would be like we were contained inside of a realm, like a bubble and so one part of the bubble is connected to the next part of the bubble and it is all connected but we can never know what is outside of the bubble to know how the bubble truly works because we can never be outside the bubble. When pressed against the bubble we can see a bit ways outside of it to see that we are inside a bubble, like finding balance between the left and right side of a bicycle. God set limits of the ocean and of the mountains and of the thickness of our skin and since He will always know more than us He has set limits on what we are allowed to know. But it is a good thing to flesh out all the areas we are allowed to know to make use of them.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14538,'4JXjqaN97IY','The audio is pulled from a talk given by Susskind at UC Berkeley. Search for it on YouTube and you’ll find it. Not sure why this channel doesn’t cite that talk in the description. They’re just repackaging sound bites with impressive graphics.',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14540,'4JXjqaN97IY','I love how all the old theories that haven’t quite been proved to a few have been jumbled together into new science, we are as a species so intelligent, through trial error and years and years of mechanics and maths has brought us so close to answering so many deep questions about the universe, when we as a species unlock all its secrets we will be the most dominant force in the universe',4);
