Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14545,'BickMFHAZR0','The goal of evaporation is to cool down the leaf. The reason leafs are green is to avoid absorbing too much radiation. The sun produces a lot of energy, and similar to humans a tree needs to protect himself from sunlight. Think about how hot it gets at solar noon, and the fact that the tree needs to sit in direct sunlight for the entire day. The tree is literally cooling itself down through evaporative cooling, similar to how humans do it through sweating. This process is known as evapotranspiration.',621);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14546,'BickMFHAZR0','Hank saying "right?" was just praying to the gods of physics that there wasn''t a pure vacuum in tree leaves.',807);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14550,'BickMFHAZR0','I’m a refrigeration technician, and I realized a while back that the water evaporates out of the bottoms of the leaves to refrigerate them, when water evaporates, the vapor pulls heat from the remaining source water, cooling it. This is necessary because sunlight has the potential to heat the leaves beyond the temperature they can still function for photosynthesis.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14551,'BickMFHAZR0','So in short, trees do not bend the laws of physics, trees use the laws of physics cleverly...',2053);
