Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15098,'I0wIauQ0wMs','The graphics actually look a lot smoother, more intricate and more polished, as well as the frame rate and overall flow of movement, which is super nice. I wasn''t expecting a graphical improvement after the first footage we saw, but now I''m happy.',341);
