Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15101,'I0wIauQ0wMs','I feel like the biggest sell for Splatoon 3 is the timing. With the switch being as old as it is now, most people have a switch in their home. So for kids this is a big buy, especially if you haven''t played it yet, but all your friends are playing it. I haven''t played in a few years and I''m really excited. Just to chill, enjoy all it has to offer along with the community surrounding it. It''s a lot easier to sell this game to a Japanese audience as well because of all the marketing and promotional events after the game comes out. As well as the IRL concerts with their in game idols.',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15102,'I0wIauQ0wMs','My biggest hope for splatoon three is to get it and have fun playing through the waves of content as they tend to be fun and hype as they come out, that being said for outsiders of the community I’m disappointed and really wish that it gives enough to entice new fans and not just old ones',31);
