Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13876,'vsQYI5Ajwp4','It''s shocking, how your videos are so consistently amazing! I would say this is the best series of videos, I know of on youtube. There''s the whole rest of the channel however, that''s just as good.',165);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13877,'vsQYI5Ajwp4','Genuine question: During the experiment with the dead fish, how did the eel knew the fish responded to its doublet when there was an agar barrier between them placed there to particularly impede the electric shock. You mentioned the eel''s eyesight is poor and they rely heavily on their electrolocation of prey. Answers are appreciated. Thanks!',47);
