Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13879,'vsQYI5Ajwp4','Omg that little comment at the end about Texas'' electric grid had me gagged lol (I live in Texas and experienced the utter failures of the February 2021 winter storm). I love these videos so much and even just a passing mention of the electricity crisis here by anyone is something that makes me very happy to hear. Keep up the awesome videos, they are very much loved and appreciated!',35);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13881,'vsQYI5Ajwp4','Really appreciate this series for both the entertainment and how scientifically backed everything is.  I had no idea they were the inspiration for voltaic cells and the remote control before an attack.  So cool!',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13882,'pJ41WRSrrOo','First, there was a World ruled by Birds and now, a World ruled by Frogs? What''s next? Cats? Snakes? Elephants? The possibilities are truly *endless* in Speculative Evolution.',3593);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13883,'pJ41WRSrrOo','I love speculative biology, but this project has one problem as I see it. The idea is presented that these amphibians wouldn''t transition to forms of exothermic metabolism. We have evidence that both crocodilians and dinosaurs could change from warm-blooded to cold-blooded and back again. Birds, being warm-blooded reptiles, show the transition from ectothermic to exothermic lifestyles. Why wouldn''t amphibians do the same over the eons in one shape or another?',223);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13884,'pJ41WRSrrOo','i had the incredible luck of being roxy''s classmate in university, and coworker through some crazy jobs :) she is one of the best artists i have ever met, and a truly top notch person and friend <3 thank you for highlighting her amazing work!! isn''t it cool as hell?',142);
