Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13893,'H8WJ2KENlK0','Let me just say: God bless this brilliant man and his brother for teaching topics in 10-15 minutes that teachers needed weeks for. No offense teachers.',272);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13894,'H8WJ2KENlK0','Crash Course: "Helping Kids Cram For Their Exams Since Day One."',3297);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13895,'H8WJ2KENlK0','Started watching this my freshman year in high school, now I''m watching them my freshman year in college.',1272);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13896,'H8WJ2KENlK0','It has been eight years since this video was uploaded. I watched it for the first time about four or five years ago, when I was in high school. I prepared for the biology exam by these videos. I wathced this course when I was on the first year of medical university. And now I''m watching it again. I''m already finishing the third year and I teach biology scholars who, like myself some time ago, are about to enroll a med university. This is awesome. Thank you, Hank, and thanks to all of the CrashCourse team for this truly the greatest course of biology ever made.',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13897,'H8WJ2KENlK0','This really helps! My teacher only lectures and she skips a lot because we "are already supposed to  know it" and we are expected to know 10x the information she actually gives us.',87);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13898,'H8WJ2KENlK0','I keep on getting med school ads on these bio videos and I''m like... Dude... I''m just tryna pass grade 10 calm down',5429);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13899,'H8WJ2KENlK0','My bio teacher is well-known for not paying attention to any of her classes except chemistry, and then at the end of the year, giving out candy to all of her other classes and apologizing for being a shitty teacher. Of course, that does nothing to raise my grade in her class. But these videos do. Thanks so much y''all for helping me understand this flipping course.',108);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13901,'H8WJ2KENlK0','As a nutrition professor, thank you for this! Such a great resource for students!',4);
