Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14568,'Tzl0ELY_TiM','Good video. Im in the least popular branch in CS, cs theory research. I''m glad you mentioned induction, if one dives into program verification, you''ll see that induction is essential to doing any kind of proof because induction corresponds to recursion in programming. Induction on the natural numbers may not be interesting, but think about induction on your data types and proving properties about them. In fact, induction does not only apply to natural numbers, but any inductively defined set.',25);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14569,'Tzl0ELY_TiM','Damn, this got me more excited for computer science. The discrete maths seems very interesting and eager to learn about it.',24);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14570,'Tzl0ELY_TiM','Great video!!! I’m back in school taking classes for my masters of computer science. My bachelors was in economics. I''m trying to decide on if I should do a concentration in big data management or cybersecurity. What do you think is the better choice? Income and job market differences between these two?',6);
