Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14596,'SzJ46YA_RaA','I started my ''Computer Engineering'' course this year, at age 32. Sometimes I feel so bad in the classes, cause I''m "too old", and everyone else there is almost teenagers. Also, at this age, everyone expect me to have childrens and a job, not to be in college. But now, watching this video, this made me so PROUND and happy. All of this is too beatifull, and I''ll do whatever it takes. Science is my passion since I was a kid, and this is all that really matter.',17);
