Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14971,'ReQdX04S00w','When I took my exams so I can get in a university I really wanted to study architecture or art. However things didn''t go well and my score was extremely low so I was left with a few options. One of them was computer science and telecommunications. And tbh despite the fact that I had zero interest in programming before, I freaking love this major so much. Sure it''s hard and frustrating af but every day you learn something new and it feels so good when you run your code and it actually works.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14972,'aDfqRbGk_Yk','Andrew Tanenbaum books on CS helped me a lot during uni years and sometimes during discussions at work but they give theoretical knowledge not practical applications',213);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14973,'aDfqRbGk_Yk','My biggest tip: if you''re a computer science student and have the chance (it was not required at my college) to take software engineering, make sure you take all the software engineering classes you can because that''s what you''ll be doing.  Most of CS is a lot of abstract data structures and ideas that you may never even ever use, but knowing the pipeline of actually creating software and those different methodologies (Agile which is just old school RAD with more crap to have to deal with, Waterfall, Spiral, etc. etc.) will give you a better idea of what you''ll be doing on the day to day.  You''ll tailor your data structure and algorithm knowledge to what you''re tasked with at work, but the software engineering portion you''ll use anywhere you go.',137);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14976,'aDfqRbGk_Yk','Thanks! Great advice! just starting out pursuing a BA CS after being out of school for 20 years!  I have been having a similar dilemma, I originally signed up for software development, but my counselor said I should do CS since I said I want the ability to be hands on, on top of developing.  Not sure if I am thinking too big....... but thanks great video!',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14977,'aDfqRbGk_Yk','To hear that you didn''t have any preparation before college makes me feel better for being in the same position. I really didn''t have any experience with code, other than html, and felt behind because other student because half of them either smarter or extremely experienced with the area.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14979,'aDfqRbGk_Yk','I go to ODU - so do you actually feel like you learned a lot in 350? I haven''t taken it yet, but a lot of people I''ve talked to say it''s massively outdated and just a ton of busy work. I understand that can help you practice discipline, but was it useful any other way in getting ready for your career?',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14980,'aDfqRbGk_Yk','So my University currently has both Software Engineering and Computer Science. Both majors are pretty much the same thing and the only difference is about 3 or 4 classes. For example, for the Data Structures and Algorithms course, there is CIS 350 (theory based) and CIS 3501 (SE side of the class) also the core requirements has SE majors take SE 2 after SE 1 while CS majors only take SE 1. So its really the same degree, same requirements, only difference is a couple of classes (that are very similar).',4);
