Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14985,'GiDsjIBOVoA','TSP is a NP hard problem but so is making this video. Every seconds of the video I see an exponential effort invested. Thank you so much!',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14989,'GiDsjIBOVoA','I''m quite impressed that you managed to avoid mentioning entropy while discussing the annealing approach and the pheromone approach. I once tried to explain pheromone optimization to a friend of mine who wasn''t familiar with using entropy to backtrack a search, and I simply wasn''t able to explain the process. Well done!',82);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14990,'GiDsjIBOVoA','PSPACE problems, common in planning, are arguably "harder", as TSP is "only" NP-hard.',155);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14991,'GiDsjIBOVoA','I did a report in Linear Algebra discussing using Adjacency Matrices to find paths from any point to any other point by raising matrices to their power step by step.  I managed to make it work for minimum hop count and shortest path between two points.  Unfortunately it doesnt solve the TSP because it does not go back to it starting point.. only that it can hit every point.  We had another idea of using something similar to what we called gravitic weighting to image creating the shortest path by picking any point and then "lifting it" and seeing the other points fall based upon distance.. we ran into problems with pruning of ineffecient routes.. if we could identify routes that were not going to be used we think it would have worked.. unfortunately our advisor didnt seem to care to help us at all... to him TSP was just an impossible problem and we were waisting our time.',14);
