Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13262,'rJV014ojKPk','What nobody is talking about is, “The leads.”  When a search warrant is presented to a judge, the affiant explains exactly what they’re looking for and where to find it.  The person or persons (or tipster/s) on this sealed affidavit has intimate knowledge of what could be found, taken and where it could be located in that super-secure, gigantic complex of mar-a-lago.  Was it a close personal lawyer?  Ivanka or Jared? Melania?  Wesselberg?  Eric? Don Jr?  Or Donald himself as part of a pending plea deal…Somebody was pressed out big time to give away the information used in the statement of probable cause.  And I wonder what charges are pending for those people as well.',209);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13910,'bBPtP4t2J1k','In my humble opinion, this is THE best pop song of the ''noughties.'' A three-minute masterpiece. Pop music is so dull at the moment -oh for a group this much fun again. As for those rather sad people who still think it''s ok to describe the bright, interesting, talented Nicola Roberts as "ugly, ginger"...easy to say it anonymously isn''t it? Hmm. Oh - and forgot to say "Downright gorgeous!''',421);
