Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13921,'dgEYV2s8Pg4','Fun fact on that last question: a good 80-90% of the foods we refer to as ''vegetables'' are actually fruits, there are actually not that many edible ''vegetable'' kind of plants. The reason these fruits are called ''vegetables'' is a result of culinary distinction rather than a biological one, labelling the plant by its use in dishes rather than what it is categorically.',371);
