Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13924,'sQK3Yr4Sc_k','I remembered having to learn about this when I was in high school Biology so I came back to see if it would come back to me at age 37. Nope, I ended up rocking back and forth in the corner of my office in the feeble position. Then I snapped out of it... I now embrace this truth - plants turn water, sunlight, and CO2 into food using magic',756);
