Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14605,'ReVeUvwTGdU','I watched this video around two years ago when I was a senior in high school with pretty much zero programming experience. I''m in college right now earning a degree in computer engineering and it''s crazy how I''ve gone from understanding nothing in this video, to understand most of it.',643);
