Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14610,'ReVeUvwTGdU','In your video description, you might "regard" C as the fastest language, but this isn''t always the case. Both C++ and Rust can achieve the same performance even with higher-level language features (zero-cost abstractions). Compiler optimization is a large part of language performance.',4);
