Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14617,'EJiVWoFk8GA','0:24 That is a special kind of tree -> Binary search Tree, 1:29 Since stack is a Last in First Out Data structure push/pop is (usually) shown the other way round',50);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14618,'EJiVWoFk8GA','5:40 Another advantage of two''s complement is that addition, subtraction, and multiplication on it are simpler. You just do the same as with unsigned values. One way to explain that is using modular arithmetic: unless you use long arithmetic, numbers are computed modulo 2 to the power of the number of bits in an integer, and the numbers that the same bit string represents in unsigned types and in two''s complement are equivalent',23);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14619,'EJiVWoFk8GA','What a well laid out video! I''m starting a master''s programme in CS at the end of the month after graduating as a BSc in physics, and this video really helped in assuring myself that I''m not in over my head and am actually surprisingly familiar with the topics to come. Of course, I don''t mean to underestimate the amount of work to come, but at least I''m more confident now.',84);
