Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15337,'kmgWldPQ6t0','I''m finally going to try splatoon since there''s a free trial and looking forward to harvestella. There are so many games I want coming out in September too. I''m looking forward to ooblets, Disney dreamlight valley, lemoncake, wyldeflowers, potion permit, and hokko life so far.',26);
