Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15342,'kmgWldPQ6t0','Hey! I''ve been a really big fan of your channel for a long time now, keep up the great work! But if possible and not to cause too much of an inconvenience, would it be cool if you added CST timezones as well? I know I could just convert the times online but I would feel a lot better and more confident about the absolute schedule if YOU were the one who also inputted a central timezone schedule. Again I''m not trying to cause any inconvenience, only if you''re cool with it! Thanks! I really love your content, definitely, one of the best Nintendo intel providers I can rely on (and watch almost daily)!',1);
