Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15346,'AsuXEeDKRoQ','TBH I believe Mario+Rabbids belonged in that list, it had a great villain and a great problem creator. It also had great battle actions and cutscenes. I also love the fact that the villains of the game were mixed together with something to make them who they are!!!',27);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15347,'AsuXEeDKRoQ','I got my first Switch a month ago, the OLED edition, and i gotta say its one of my favorite consoles ever. I started with the PlayStation 1, then the GameCube, Gameboy Advanced SP, Wii, Xbox 360, 3DS XL, then really got into PC games, and then stopped playing videogames for many years. So it was a delight getting the Switch specially because of the great games it has. My favorite so far have been Fire Emblem Three Houses, Animal Crossing New Horizons, and Smash Ultimate. Also really surprised with Mario Kart 8 its a lot of casual fun! Well this is my paragraph that no one asked for lol. Great video btw!',371);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15348,'AsuXEeDKRoQ','5 years later, the switch library is amazing and I have most of these games. What a nice list of games :) Great video editing as well. Luigi''s Mansion''s animations/graphics are top tier. Pikmin 3 Deluxe is amazing on that as well and hope more people pick it up. Waiting on Pikmin 4. You have a new subscriber.',62);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15349,'AsuXEeDKRoQ','Xenoblade 3 needs the first spot imo, such a beautiful and amazing game that actually manage to perfect a system that was already in place...',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15350,'AsuXEeDKRoQ','definitely dragon dogma. for the best, most complex combat system and great character development so many factors come into play. npc companions learn player behavior, improve, can be borrowed from other players, and then come back with gifts and trophies and new knowledge. Class change at any time. A game that went down with the release of Skyrim, but remains one of the best fantasy RPGs to this day. the sequel, Arisen, finally brought a few more Fast Travel Crystals into play.',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15351,'AsuXEeDKRoQ','I''m not a big Mario fan but Paper Mario on Switch is really really good. Picnic Road and so many other soundtracks are sooooo good. Amazing game play too. Clean 8/10',31);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15352,'AsuXEeDKRoQ','Thank you for explaining that Turf war is the casual mode in Splatoon. It seems silly, but so many people judge the entire game on that mode alone.',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15353,'AsuXEeDKRoQ','As a OLED switch owner I have to say that it’s a great list BUT I’d include switch sports and mario party superstars in the honorable mentions. Those are the type of games that makes the nintendo switch be different than any other consoles in the market. The local multiplayer of this little thing called nintendo switch is nasty',28);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13264,'rJV014ojKPk','"Same as Watergate" Not hardly,  I was a teenager when it happened, and I seem to know more than Trump knows about it.',41);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13265,'rJV014ojKPk','Media has been focused on the FBI search and not about the classified documents Trump had in his home,why he took them,why he didnt give them back when asked and what he could possibly do with that information. Glad to see this has been the focus here.',118);
