Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13267,'rJV014ojKPk','The FBI didn''t "break into" Mar a Lago.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13268,'rJV014ojKPk','So I''ve been reading republican feedback that it is totally fine for trump to take government docs as long as they don''t contain sensitive info, or that it''s fine for trump to keep docs because they''re safe at mar a lago with all the security he enjoys...?? That sounds so off. Right??',52);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13269,'O15EHN6tlVM','Rent is going up because stock companies are buying up all the properties and they will charge the highest amount they can.',17);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13270,'O15EHN6tlVM','I am a landlord and realize I could get so much more for my well-maintained and in a great neighborhood houses. I have chosen over the 25 plus years of owning these homes, that I would rather treat people fairly and respectfully. I did not raise rents for MANY years. In NC, landlords can only raise rents by 5% per year. Because I did not do that, my tenants are paying a few hundred dollars below what I could get with new tenants. I have had tenants for more than 20+ years. We all become a part of each other''s lives. I care about my tenants. Please do not bash ALL landlords. Good landlords do care about their tenants.',30);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13272,'O15EHN6tlVM','People were saying there would be a Housing cash!!  There are companies buying up home to turn owning a home into a business, pricing regular people out of buying a house!  There is a shortage of homes and Las Vegas, I haven''t seen the prices go down.  Greedy companies are pricing renters out of the ability to find a place to rent!',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13275,'O15EHN6tlVM','That is a load of crap!  The reason rents are going up is Corporations buying up rentals - houses, apartment buildings and then escalating the rent to make money.  Mortgage rates are not that high -look what they were under Reagan 18.5%, now that was high.',13);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13276,'O15EHN6tlVM','Rents are going up because of greed.',16);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13277,'O15EHN6tlVM','3:33 WTF makes landlords think they''re entitled to make up for pandemic-related losses? ¿ Why are they special and deserving of being immune and exempted from taking a hit? Can all the people who weren''t able to go to work for several months and had to live off of their savings (or become homeless) demand a raise to make up for the money they didn''t make? Why are landlords and banks and such allowed to demand to not share the burden? ¿',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13278,'O15EHN6tlVM','At least in my town, we have 1 old zoning law that prevents THOUSANDS of affordable lots from being developed. Lift that restriction and ideally streamline permitting and loosen regulations. But they won''t. Too much local vested interest in keeping the supply down. I know my town isn''t the only one with this zoning law.',0);
