Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13281,'uN930SNDLhQ','Those of us who had Security Clearances while serving in the military know how ''truly serious'' the mishandling and appropriation of Classified materials is.',321);
