Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13284,'uN930SNDLhQ','I had a TS-SCI clearance when I was in the Air Force. I had to go into a special facility called a “SCIF” that was under 24 hour armed guard etc to even have access to that type of information. Unbelievable.',395);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13285,'uN930SNDLhQ','The question is, why wasn''t he arrested back when it was first discovered he''s taken the documents. He claims that his staff must have "accidentally" grabbed them with the moving boxes as he was leaving the WH. Has that ever happened before? Has any other president accidentally moved over 20 boxes full of classified documents when they left?',225);
