Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13300,'1H-EWHVziNw','He was a captain?  As a veteran of the US Army, I am appalled that someone in the military would act this way.  I said this before and I''ll say it again, "I am proud to have worn the uniform.  I''m just not proud of who else has."  Sabatini is a clown and a disgrace to the uniform and the country.',309);
