Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13302,'1H-EWHVziNw','As a former military officer myself, I cannot fathom how Sabatini ever passed a background check, let alone became an infantry officer.  His actions and comments are a classic example of "conduct unbecoming of an officer."  He needs to resign from the National Guard before he destroys its reputation.',713);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13962,'HSVUtNRNcS4','These speculative biologies are always fun to watch. Always makes you wonder what really is out there.',1055);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13963,'HSVUtNRNcS4','dumb idea: a C.A. video thats literally just exploring life on earth, describing the lifeforms with examples from fictional works in a role reversal way. treating the very real animals like their pieces of speculative work and vice versa. I.E. "in the vast earth oceans live an apex predator unchanged for millions of years, the shark. though they look remarkably simular to the squidsharks of 4546B, but are more closely related to earth fish than squids" as a terrible example',1088);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13964,'HSVUtNRNcS4','I really like these speculative Alien lifeforms better than many we''ve seen on here - I think it''s bc they feel aesthetically natural, like they are unlike most earth organisms but feel like they still obey the constraints of biophysics',816);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13966,'HSVUtNRNcS4','Another well-made video about speculative biology. Keep it up, sir.',299);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13967,'HSVUtNRNcS4','This is one of the most fleshed out speculative biologies I''ve seen in this channel so far! The illustrations are high quality and the little interactions between these organisms in their alien ecosystem can be derived from the illustrations themselves and it''s really interesting',68);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13968,'HSVUtNRNcS4','Something I''ve noticed about alien spec bio things is that I don''t often see structures analogous to fur or feathers on the critters. I wonder why?',133);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13969,'HSVUtNRNcS4','I love that this had very distinct biomes and body plans from each other. They all looked like they’d evolved together but really varied in color, size, and overall form. It also allowed for much more realistic looking (while still bloody  great and weird) scenes. Idk, I really liked this one, it was cool and kinda realistic in a weird way',47);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13970,'HSVUtNRNcS4','I would suggest checking out the anime "Made in the Abyss" for a potential episode. The fictional creatures in the work are downright awe inspiring as they are bizarre.',108);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13973,'SGxDv7XybSo','Thanks to cameraman live from million years ago for the documentary',16240);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13974,'SGxDv7XybSo','It''s amazing that the skulls remain in the soil for millions of years for us to do such detailed scientific researches on. Without them, we never knew what they looked like or how they evolved. Fossils really are precious legacy of our ancestors.',629);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13975,'SGxDv7XybSo','It''s truly mind-blowing to know how far we''ve come and how we''ve become the dominant species on Earth in such a short amount of time. Considering how advanced we''ve become technologically, it seems almost impossible to think that we are also animals. Evolution is truly amazing!',91);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13976,'SGxDv7XybSo','I''ll never forget visiting the Natural History section of the Smithsonian Institute as a kid with my parents back in the 60''s (I''m 69 now, BTW). They had an exhibit there that would blow your mind! It consisted of a wall depicting human evolution where they had probably a hundred or so skulls in rows against a dark backdrop, I assume so the images would stand out better. It led the viewer visually from human''s earliest known ancestors with authentic fossil skulls from the most primitive (e.g. Australopithicus) all the way to modern man (Homo sapiens). It was quite impressive and left the viewer with no doubt about human evolution. There it was - in terms of a tangible fossil record, expertly organized - right before the viewers eyes.  ¿¿¿',113);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13977,'SGxDv7XybSo','Wow.  I would love an hour long video with who ever made this.   That was so informative. And to the point. Thank you',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (13979,'SGxDv7XybSo','So over 70,000 years ago, we actually came to, what experts believe, the closest to extinction we’ve ever been. It’s believed to have been caused by a supervolcano. The Toba supervolcano then sunk into the ground and became lake Toba',41);
