Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14004,'NXlTO0dti3k','I like how the "true dragons" didn''t end up looking like the "stereotypical" dragon. Instead they had a very Quetzalcoatl appearance, which makes it believable. As cool as a dragon looking like Draco from Dragonheart would be, I could see a pterosaur-like dragon being more realistic.',288);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14005,'NXlTO0dti3k','Have you ever heard of the 1982 animated movie “A Flight of Dragons.” They answer a lot of Dragon biology questions like the fact that Dragons can fly because they are essentially organic hydrogen balloons and they breathe fire to vent it off.',504);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14006,'NXlTO0dti3k','I remember a high-school biology project in which we had to create a basic phylogeny graph for dragons, including drawings. It was very fun.',4045);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14657,'k0GlqFrRQI0','When I started in Computer Science I was surprised how many of my classmates didn''t even like to code.  They saw programming as at best a steeping stone to their real career.  My CS coursework certainly never taught me much programming.  My best teacher was my library of Plum Hall books.  In my case a professor liked my code and recommended me as a research assistant which was my first computer job.  The position was supposed to go to a CS grad student and I was an undergrad music major.  My research areas were mainly data compression and pattern recognition.  I was within a stone''s throw of finishing my music degree when I realized that I met the requirements for a CS degree so I ended up graduating with a CS major, music minor even though I had 3 times as many hours in music as CS.  In my case I didn''t program for long. Even though I enjoyed coding my bigger interest was systems and that is the direction I went after graduating.',40);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14658,'k0GlqFrRQI0','TechLead this is a fantastic video, very well done. In my experience as a physics major with a minor in math and computer science. I found that there are classes in every major that use computers and computer programming extensively. In math we used programming to model complex physical systems that you could never do with out numerical analysis.  In physics we had a year lab where we made our own high speed data capture card.  We programmed it to capture data and then we wrote programs to analyze and display that data. I think you are 100% correct when you state that the act of programming is very important for every discipline.',12);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14659,'k0GlqFrRQI0','I was really under a lot of stress and pressure to pursue a masters degree and I was thinking of doing a computer science degree since I had a bachelors in it too. But just like you said, apart from 1 or 2 courses here, the other courses are havoc. The photographer example was spot on. This video REALLY helped me change my perspective. Thanks a lot. I really feel like this video was tailor made for me. Thanks again ! Subscribed, ofc :)',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14660,'k0GlqFrRQI0','for me, what got my career in coding started was my experience as a student programmer for a company near my university that hired me on basically as an intern. They hired me because I worked for them on my Senior capstone project (fall semester) so I worked for them as an intern during my last semester, through that following summer, and then I landed my first full time job in the fall. I would have stayed with them had they been talking to me and expressed interest in actually treating me like an actual employee.',21);
