Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14679,'dh7IwmBQZeI','I just started and I am a freshman, it makes me feel a lot better to know that someone else didn''t have their resume ready. I started HTML, CSS, and JS on my own and am doing to website/resume thing now so I can practice web development all through out college along with other stuff that I learn so I can put all of my projects on there kind of like a show case.',27);
