Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15166,'tDdvopwhCaE','The fact that you revisit some patched games is one of the things I love most about your channel.  While I’ll say that many games should not release in the poor state that they do, such is the state of the gaming world in 2022.  You guys do all of a wonderful service by updating your reviews when possible.  Thank you!',49);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15167,'tDdvopwhCaE','It’s easy to be harsh on the Switch and the way some ports perform but it’s amazing to have full games like this on the move. When developers get it right it really sings',16);
