Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15169,'tDdvopwhCaE','I suppose it''s because I grew up when all video games had pop in so it doesn''t really create a negative connotation for me with a game.  I know that if a game isn''t wholly designed for the Switch that issues can occur with frame rates, pacing and the like but it is always nice to see when developers continue to work on and iron out the problems with their games. I think the patch was needed and accomplished what it was supposed to.',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15170,'tDdvopwhCaE','A note for your souldiers revisit, while the patch fixed a lot of the worst issues, the fire temple, a late game area, is still prone to a lot of  crashing when saving at dragon swords, it was 50/50 every time I saved in that dungeon whether it would crash or not, didn''t get any crashes anywhere else so I''m not sure why that area specifically is so problematic (it was also an area where one room in particular had a game breaking performance bug before the big patch)',4);
