Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14007,'NXlTO0dti3k','I’m surprised there isn’t more dragons with names taken directly from mythical dragons. I could absolutely see Orochi, Gorynych, Lindwurms, Basilisks, Serrushes, Leviathan, Behemoth, Ziz, Python, Ladon, and even to an extent Typhon fitting in well to this family tree.',157);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14008,'NXlTO0dti3k','I’d love this as a video game. Create a Skyrim-esque world except where dragons aren’t mythical creatures but wild animals that could have adequate intelligence and small levels of society (like a smart dolphin). I think the approach would be cool bc it could be a mechanism for keeping humans in a medieval age since dragons would prey on cities like wolves on sheep.',43);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14009,'NXlTO0dti3k','I actually pondered on how dragons would be able to breath fire and I brought the topic up to my mom. I had the idea that they had to have an organ in their body that would produce a highly reactive gas, or liquid, and that when it was forced out it would either ignite from the oxygen or something else would ignite it internally, which is where my mom got the idea that Dragons would have a crop like chickens have, and throughout a dragons lifetime they would eat rocks of Flint that would go into that crop. When the dragon needed to breath fire that crop would constrict extremely fast while the gas/liquid came up, igniting and sending out flames. The Dragons internals being protecting by a thick, flame retardant, mucus.',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14010,'NXlTO0dti3k','Since we did dragons, and horse paleontology is so rarely touched on, a unicorn or other myth creature could be another cool video',77);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14011,'NXlTO0dti3k','Until a few years ago, I didn''t even know about the dragon - wyvern debate. I''ve always thought (and still do): all wyverns are dragons, not every dragon is a wyvern, just like every duck is a bird, but not every bird is a duck. Dragon is just a broad term for many different creatures. The one with four legs and two wings are european dragons (just my way of thinking, not saying it as a fact...not sure what most people''s opinion is).',2582);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14013,'HVT3Y3_gHGg','I''m an accounting student, but I had a horrible chemistry teacher in high school and I''m taking this courses solely to have a better understanding of the world around me, and all I wanted to say was that they''ve been really helpful in making me understand (with a little extra reasearch) all the basics of chemistry! Thank you crashcourse!',434);
