Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14023,'xvWdIi6_fGg','The best part about his style of teaching is the storyline and narrative visuals. He doesn’t just point out and explain, he makes you UNDERSTAND the whole biological process regardless how abstract the concept is. He paints a picture that you will remember, and that in itself, is a true talent. ¿',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14024,'xvWdIi6_fGg','I''m a dentist. Passed my boards years ago and am fully licensed but... man, I feel like a student all over again! This is a phenomenal presentation and a great review! I hope you consider becoming a university professor one day. (I like studying USMLE material to make me a better overall provider - in case you may wonder why a dentist would be on this video).',53);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14025,'xvWdIi6_fGg','I need his enthusiasm for my studies!!!! His passion for Medical Science is contagious and so his happiness while explaining concepts. How even the most complex of topics start appearing lucid. Such a kind soul... I owe him so much !!',85);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14026,'xvWdIi6_fGg','Hi, I am a med school student and I hadn''t been able to grasp the whole concept for my bioscience class until now. Just wanted to thank you for helping me prepare for my final exam which is coming soon!',266);
