Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14030,'xvWdIi6_fGg','Look, I want to thank you to the infinity; you have managed to make me love medicine with your fantastic explanations of things. You are a wonderful lecturer keep going and remember that there are many people who appreciate what you are doing. I''m a medical student by the way',10);
