Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14032,'ydqReeTV_vk','This is literally an entire semester of a 400-level Evolutionary Developmental Biology course, summed up in a 5 minute song. Fucking legendary.',3804);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14033,'ydqReeTV_vk','Biology aside, someone has to mention how absolutely INSANE this acapella is musically. He is not using any external instruments apart from his damn mouth.  Absolutely incredible.',1522);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14034,'ydqReeTV_vk','I STILL get shivvers from how good this is. 3 years later.',378);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14035,'ydqReeTV_vk','This is a masterpiece and must be protected for future generations',211);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14036,'ydqReeTV_vk','This song is Fuckin Legendary! It''s been 4 years and I still can''t get it to stop playing in my mind. At totally random times, I sometimes shout ''Signal signal!'' or hum random parts of the song while reading. This song is like the Genetic code itself, tightly packed with the entire summary of Evolutionary and developmental biology in a few minutes. I was starting out with Embryology when this song came out and this made me understand the genetic regulation part so well. Still waiting for some more amazing songs like this one. This is still my favorite though. It was my ringtone for a year.',52);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14037,'ydqReeTV_vk','This is such a great song! I can’t imagine the amount of effort put into this video. I remember watching this at school two years ago- my science teacher would randomly play your videos in class sometimes! This deserves so much MORE attention! Love the content on here. Keep Going!!',105);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14038,'ydqReeTV_vk','This is so incredible. The fact that he can put all these talents into one. The singing, the acappella, the scientific knowledge, the brilliantly clever song writing. Literally amazing',82);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14690,'2VpDcjFshJI','I love your videos, man! Mechanical Engineering sounded really apealing to me at first, but after seeing the mech eng, Elec eng, and CS videos, I''m thinking Electrical Engineering with a focus on electronics or computers sounds more like me. May also minor in CS... But idk yet. Thanks for making these!',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14691,'2VpDcjFshJI','Let me note that "Computer Graphics" programming doesn''t only involve images. There''s been some work on writing GPGPU software, i.e. CUDA/OpenCL, that accelerates system processes that are traditionally given to CPUs. In particular, anything that can benefit from parallel computing will need GPU software.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14694,'xa6me8wou_k','I totally agree on internships! I am a graduating senior in Computer Engineering, and I have done 4 internships. Internships really showed me what working was really like, and helped me find where I want to work. Despite being in the depressed COVID economy, I already have a job offer lined up for when I graduate in December!',444);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14695,'xa6me8wou_k','When he said googling things every other minute I felt that',2231);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14697,'xa6me8wou_k','Also don’t forget to code outside of class and work on projects that interest you.',8837);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14698,'xa6me8wou_k','I think that’s what I’m most afraid of – getting internships early. I’m currently a freshman in college majoring in CS, and I have little to no knowledge about coding. So, when I try to apply for internships, I’m afraid that these jobs that an intern does will involve hacking Amazon’s database or something wild.',113);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14699,'xa6me8wou_k','Dude looks like he works at a surf board shop in Florida, chills with his friends at the beach on the weekends while listening to glam metal.  And knows how to enjoy life better than anyone in this comment section',897);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14701,'xa6me8wou_k','One of the biggest things people should take into consideration if they’re gonna pursue any IT jobs or anything related to CS is that it never ends. You’ll constantly be trying to keep up with the latest tech or wondering if you need to bring getting the newest CompTIA cert or if your current if good enough. It’s a rough life especially if you’re married or in a relationship, it’s just constantly hours in front of the screen.',243);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14702,'AnVBCyzNgaU','the videos on this channel are so great! it''s really a pity that you don''t seem to be creating content anymore :(',37);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14703,'AnVBCyzNgaU','Nice work! The animations did a great job of illustrating your points and it was well presented and explained. I really enjoyed it! :)',9);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14704,'AnVBCyzNgaU','A modern computer science degree is basically a degree in discrete math. But when computer science was founded, it was much more closely related to being a science than it might be considered today. However, even if it has become more about proofs, math and logic, there still are investigations that require observing, and testing factual information to determine breakthroughs. As an example, consider quantum computing and it''s development.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14705,'AnVBCyzNgaU','This is an awesome video! I haven''t found anything else that gives such a good intro to the P?=NP problem',4);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14706,'AnVBCyzNgaU','Mario is PSPACE-complete and factoring is in NP \cap BQP. It''s a bit misleading to say that all that stands between crackers and your data is a mario level, because breaking encryption is much easier than beating Mario.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14707,'AnVBCyzNgaU','i don''t know a lot about computer science, but your visuals and the way you formulate the argument are very good',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14708,'AnVBCyzNgaU','Most technically it''s the study of algorithms, which are a very specific way of solving problems, but it''s hard to define exactly what an algorithm is without getting a good ways into computer science.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14709,'AnVBCyzNgaU','I don''t have a computer but it seems very helpful so I hope soon to get one ¿¿ ¿¿ I like how it teaches you about it so fascinating',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14710,'AnVBCyzNgaU','Pretty good summary! I disagree with the statement that it isn''t a science, however. CS researchers routinely make falsifiable claims about the real world and then test those claims through experiments. In fact, that''s how I''m spending my winter holiday :) Like, "If I solve this problem with method X instead of method Y, I get a more reliable answer." Of course, if you only have empirical evidence (i.e. it''s been tested in the real world) your case is weaker than if you have a mathematical proof. So in that way, it might be that some problems CS folks tackle are "scientific" empirical questions until they can be handled more rigorously with mathematics. But some big, popular branches of CS like Machine Learning and AI advance primarily through empirical, rather than mathematic, evidence. Whether mathematics itself is a science I will leave to the writers of dictionaries :)',18);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14711,'AnVBCyzNgaU','As a sidenote, we don''t know if prime factorization is NP-complete… and we don''t know if it''s P either! We only know it''s NP. I''d be surprised if someone discovered it to be in P—and also if someone found it to be NP-complete, because this would mean quantum computers would solve NP-complete problems in polynomial time. If someone proofs that prime factorization is not P, and not NP-complete, we''d finally know once and for all that P != NP (via Ladner''s theorem).',1);
