Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14714,'FpMNs7H24X0','Learning how to code helps your everyday logic tremendously. You''ll learn how to think more efficiently.',615);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14715,'FpMNs7H24X0','If you want to motivate people for your subject, your goal should not be to show them how simple it is, but instead how deep it is!',168);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14717,'FpMNs7H24X0','What a brilliant speaker. I appreciate that he stood and didn''t move. The effect was I listened instead of being distracted by him moving and gesturing. As a result of his presentation I intend to take his advice to learn more about computer science. Thank you Hadi Partovi for being a person who has changed the world with your passion and knowledge.',15);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14718,'FpMNs7H24X0','I''m also a computer science graduate from Iran and i''m completely agree with the transformation of this field which is happening to the world.',6);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14719,'FpMNs7H24X0','What I love about computer programming in particular, is that unlike any other subject taught in schools, this one forces students to use the creative and logical parts of their brains for once. What every country needs for success is smart people that can come up with solutions, so I believe computer programming is something that should be taught from early on in order to train young minds. Of course it''s not for everyone, I know people who won''t understand it no matter how they explain it to them, but then again mindless memorizing is not for everyone either.',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14720,'FpMNs7H24X0','Last year, I helped 4th and 5th grade students participate in Hour of Code. This year, our second graders got involved, as did a class of special needs middle school students. Our students are begging to do more and I am going to give them as many opportunities as I can!',95);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14996,'LN0ucKNX0hc','Congrats, Carrie.  You''re officially my favorite non-Green-Brothers (hereafter NGB), Crash Course Host. None of the other NGB CC Hosts manage to hold my interest long enough to watch their stuff.   You''ve got a good mixture of interesting subject matter and a pleasant delivery style.  The GB''s are both naturally funny and that works for the.  I feel like the other NGB Hosts try to be too much like the GB''s and it comes off false.  For what it''s worth.  Keep up the good work.',63);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14997,'LN0ucKNX0hc','I''m an IT professional. Still is always good to visit the origins of what we are today. :) keep doing this great job!',368);
