Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15004,'LN0ucKNX0hc','Grace Hopper is awesome in so many ways but not for coining the term "bug." Bug, meaning a technical problem, had already been in use for several decades (1800''s) so, as Hopper recorded in her journal when she taped in that moth, it was funny to find the "First actual case of a bug being found." It was a good joke after a long day at work dealing with problems, basically.',3);
