Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15007,'DUnjnfcpn3M','My advice as someone who just graduated with a CS degree and was also a peer tutor is to take the time to do your work and understand the code that you''re writing. Too many times I see people slap shit together and then wonder why it doesn''t work',845);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15008,'DUnjnfcpn3M','I''m in 4th year of my CS studies right now. Unfortunatelly, I needed to realize all of the stuff you mentioned on my own. I feel like in some cases it can be a little bit late. I just hope somebody would talk to me about this at the beggining. I would say to all new CS students: ''This will be harder than you think. But the balance is the most important thing''.',265);
