Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15010,'DUnjnfcpn3M','Another thing I''ve found helpful as a CS major is to make sure to capitalize on those required gen-ed classes (subjects like History, English, Philosophy, etc.). Having a spare 100-level "Intro to X" class in your workload during a tough quarter doing hours upon hours of Java/Python can really defray the pressure. Many of these are also just as good when taken online as well!',271);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15013,'DUnjnfcpn3M','Another tip is to take your time. Don''t force yourself into like 5-6 classes. 4 classes (3 majors, one elective) would be your best friend.',55);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15014,'DUnjnfcpn3M','My advice: Get into your school''s CS discords and class specific discords (if they have them, or make one if there isn''t) . Graduate and undergraduate students work together to give lots of resources for all students and it help a lot. Especially with what proffesors are good and bad, they help with assignments and even answer general questions.',87);
