Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15020,'zg9ih6SVACc','Having been a senior developer for some 15 years now, I still found this a very useful recap and great at articulating certain salient points. Thank you!',1);
