Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15025,'yKJz5IntDW8','I failed my precalc class my first semester of college. I did an easier math class the second semester and passed it. I''m ready to try the precalc again. Even though I failed the class, I learned that math is one of the most beautiful languages in the world. Math is great. I''m not good at it by any stretch. I will still conquer this though.',149);
