Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (15028,'yKJz5IntDW8','Lmao just changed my major to CS and was nervous for the math portion. Then I realized I’m not actually that bad at math and I was making it seem worse than it was. Don’t know if that will change when the semester starts but I’m excited! Gotta say thank you Forrest you’re the reason I felt confident in changing my major to Computer Science!',178);
