Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14042,'jxg-N7Ld3H0','Why recreate adversity? I''m definitely part of that sub-group against bonsai - it''s crippling trees for just aesthetics and there''s also some weird control issues to unpack around it. Just get some plants that are good for your local wildlife.',2125);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14043,'jxg-N7Ld3H0','People like to talk about "torturing" trees like they don''t cut their grass every week.',2427);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14044,'jxg-N7Ld3H0','I like the part that bonsai tree can grow big if allowed and can still make fruit/seed... so we could theoretically save endangered giant trees by making bonsais of them and have a hope that one day... there will be place where they can / their offspring can grow big again.',3438);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14045,'jxg-N7Ld3H0','There are also natural bonsai, they form in small pockets of soil on certain rock formations and are really rare.',2988);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14048,'jxg-N7Ld3H0','To the people saying that growing bonsais is torture, I just want to say that many of the training methods are also applies in other tree nurseries, where the trees for parks, streets and gardens are grown. They are repotted, pruned (the roots too), wired and they get limited amounts of nutrients in order to grow into the desired shape. Of course, it isn''t neccessary to keep bonsais at such a small size when the trees could become much bigger, but as long as they are kept healthy I don''t see a problem with it. I think that few wild trees actually have the resources to grow to their full potential, and especially not the ones that grow in urban settings.',576);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14050,'jxg-N7Ld3H0','There''s no way you could assume that it''s doing actual harm to the tree. After all you reassure the plant has got all it needs to survive and actually flourish on a smaller scale since you''re eliminating the constant struggle for survival that happens in nature',124);
