Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14058,'F38BmgPcZ_I','Thank You Hank for acknowledging the constant change in our understanding of the world. It amazes me that even just 5 years after this video went up, the taxonomic system has changed so much that my college Biology of Organisms course has to teach an entirely new classification. Science has made a victory in the description of Supergroups and the integration of the meltingpot that was kingdom Protista into groups which better fit their traits and evolution (just as you hinted might be a good idea).',2);
