Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14730,'c-41IY0bOGU','Here''s another con: CS is not an easy degree to get. I''m currently a graduate student in computer science and I also teach freshman computer science courses (I''m a teaching assistant so I teach labs, professors give lectures), and from what I''ve seen, at least 40% of the freshmen entering computer science will be weeded out by the end of the year. Or as Tren Black would say: business by christmas. Also very important: contrary to what a lot of people think, CS is NOT software engineering. You''re not just going to be writing code all the time, you''re going to have to study algorithms, data structures, formal methods, discrete math, computer architecture, etc. If you don''t like math and you''re not good at math, you better buckle up and start reviewing or you too will be "business by Christmas".',173);
