Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14734,'9uASADiYe_8','Glad to have been a contributing member to this field had  my first peer reviewed paper published in IEEE this year :)',1125);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14735,'9uASADiYe_8','Slight correction. The infinite limit of shallow neural networks as kernel machines (specifically Gaussian processes) was established in 1994 (Radford Neal). This was updated for ''ReLU'' non-linearities in 2009 (Cho & Saul). In 2017 Lee & Bahri showed this result could be extended to deep neural networks. Not sure this counts as "2021''s biggest breakthrough", though it is a cool result, so happy to have it publicised. ¿',561);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14736,'9uASADiYe_8','I appreaciate the efforts in trying to make these heavily technical subjects understandable to the general public. Thank you all : )',101);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14737,'9uASADiYe_8','It''s crazy that we''ve been able to do so much with deep neural networks and we are only now starting to figure out how they work',82);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14739,'9uASADiYe_8','I have been using these kernel vector spaces for QML recently and this is one of those mathemagics I honestly adore!',152);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14740,'9uASADiYe_8','It''s crazy how much stuff from uni started flowing back watching this. The fact that I can actually be able to understand all these complicated maths is crazy but exciting',39);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14741,'9uASADiYe_8','These videos are severely underrated- Thank you for the knowledge you share and hopefully millions of people will be watching these per week- It''s so good for people to know about these things',2);
