Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14752,'gI-qXk7XojA','*CORRECTION* AT 1:27 the graph says "Quinary System" but then the graph shows 10 possible states - which is actually decimal. Technically, there should be only 5 possible values there, but the overall concept is still the same. NOTE: Since we can''t use annotations in our videos going forward if we find any smallish errors in our videos like this we''ll leave clarifications in the episode description. Thanks all for the wonderful feedback! -brandon',1194);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14753,'gI-qXk7XojA','I am a third year majoring in computer engineering and this video explains transistors and logic gates better than a semester class.',2030);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14754,'gI-qXk7XojA','It must be basic as hell for comp scientists or philosophers but this was fascinating.',2235);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14755,'gI-qXk7XojA','Bit at the end made me wonder if I''m merely a computer. Great episode! -John',2108);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14756,'gI-qXk7XojA','Unlike most CS introductions, Crash Course does a great job in giving the student context, explaining how computers function at a fundamental level before applying layers of abstraction. Very well done --  As a Sophomore ComputerSci major, I''m excited to see more enriching content every week(:',358);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14757,'gI-qXk7XojA','Just passing by to say that I''m loving her course and excellent diction.',456);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14758,'gI-qXk7XojA','Just wanted to say I love the themed animations for this series. The computer UI, old Mac OS UI, etc. Always great work to the animators and team.',510);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14760,'gI-qXk7XojA','Oh my god, THANK YOU for clearly explaining how each logic gate is physically represented in an electrical circuit.  A lot of that abstraction makes it really daunting and hard for dummies like me to get it through our thick heads.',172);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14761,'gI-qXk7XojA','My first real exposure and application of logic gates was in Minecraft with Redstone',1420);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14762,'k6U-i4gXkLM','Advice to all beginner programmers: computer science is not that hard, it just takes time and effort!',2028);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14763,'k6U-i4gXkLM','We dont want over qualified students to intimidate others....... wow thats the best and honest thing I ever heard from a professor. No wonder MIT is a top institution. The level of deliverance of education is way too perfect.',223);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (14764,'k6U-i4gXkLM','This dude is an absolute legend. Spitting wisdom and working the class like a bad crowd on an open mic night and the 872 thumbs down are from unemployed Harvard students.',288);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18373,'7ClLKBUvmRk','Qué charla tan genial e inspiradora. Yo también soy desarrolladora y estoy empezando en este área para mi tesis y me ha motivado un montón ver a alguien que ya está en el tema y que le augura un futuro tan prometedor!  Además, estoy totalmente de acuerdo contigo: el esfuerzo nunca traiciona y estudiar es el catalizador más eficiente para lograr el éxito. Gracias por haber subido el vídeo!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18374,'7ClLKBUvmRk','Gran explicación, he pasado horas intentando entender qué es Machine Learning y finalmente lo he logrado. Saludos y éxitos !',3);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18375,'7ClLKBUvmRk','Pocas veces te encuentras personas que realmente transmitan el amor por lo que hacen y con las palabras adecuadas como he visto aquí. Un abrazo y muchas gracias por ayudar a derretir barreras.',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18376,'7ClLKBUvmRk','Muchas gracias Haydé por tu plática. Me inspiró muchísimo. Actualmente trabajo en USA como arquitecto de sistemas y le he puesto muchas pausas el empezar a aprender algo de machine learning. Me genera inseguridad el hecho de que en la escuela no me fue muy bien en las matemáticas, sin embargo como tú dices es solo cuestión de entrenarse y entrenarse. Muchas gracias!!!',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18377,'7ClLKBUvmRk','uuyyyy gracias por compartir tu experiencia que va a ser de inspiración para mi vida: Soy estudiante de ingeniería electrónica de quinto semestre y con estas historias mi motivación crece para ser ingeniero que haga cosas grandiosas y no ser del montón. GRACIAS GRACIAS GRACIAS......',10);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18378,'7ClLKBUvmRk','Haydé: Como colega en IT y persona te mereces mi más grande respeto. Te felicito no solo por esta excelente explicación sino también por tu desarrollo profesional. Hacen más mujeres como tú en la industria.',1);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18380,'0jspaMLxBig','I have a PhD in AI and I can say that Andrew is THE BEST machine learning/AI educator I have ever seen on the field! The deeplearning specialization is just invaluable for any interested learner in DL.',263);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18381,'0jspaMLxBig','One of the people that inspired me to do artificial intelligence in areas that matter. Without Coursera I would have not gotten where I am today. Thank you for this conversation Lex!',180);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18382,'0jspaMLxBig','Whenever someone uses the word "It turns out", I remember Andrew Ng. I love Andrew Ng.',359);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18383,'0jspaMLxBig','“when someone else allowed me the good fortune of helping them a little bit”...It''s a great time to be alive when people like you, Lex, and Andrew share your knowledge with the world simply to help them "a little bit".  I believe the little bits will make the world a better place.',119);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18384,'0jspaMLxBig','As a GenX''er I enjoyed this interview so much. It made me actually feel like I was experiencing the internet we were promised decades ago. A well thought out and intelligent conversation that, in the end, leaves the viewer in a state better than when they first pressed the play button. Well done.',21);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18385,'0jspaMLxBig','I took Ng''s class on Coursera years ago. It switched my career trajectory from academic to industry, and spurred my interest in making things. Awesome to see this interview!',159);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18386,'0jspaMLxBig','This man got a great voiceover career available at anytime.',66);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18388,'0jspaMLxBig','Im a physician from Brazil learning ai and this fine man helped me a lot thank you sir I salute you',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18389,'f_uwKZIAeM0','Machine learning is an incredibly powerful numerical tool. Man, I love how far we''ve come technologically!',38);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18392,'f_uwKZIAeM0','I love the way you explained, plus the diversity :)',2);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18393,'f_uwKZIAeM0','AI is already here, and that is not such a bad thing. Can computers become self aware? Yes I think so in the not too distant future.',0);
