Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18399,'cyLWtMSry58','I am currently enrolled in a MSc Machine learning masters here in the UK, and we are learning both the theory and putting it into practice using the assignments. There really isn''t a problem of doing it both. Stop telling yourself you can''t.. If you put in the time and effort with the right learning mindset and method, you can learn to eat and drink at the same time. Just need to be smart about it. Stop putting these limiting thoughts on yourself. It really isn''t that hard.',575);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18402,'cyLWtMSry58','I come from a physics background, and usually we spend a lot of time concerning with theory, trying to enrich our theoretical knowledge as much as we can. A lot of colleagues in my department don''t understand that trying to learn everything is an infinite loop. During my masters I realized how important is to just start doing things with curiosity, which led me to collaborate in two amazing projects. Now that I''m finishing my masters and starting to get into ML engineering I see how this mindset is even more crucial to let you accomplish the things you want. Amazing content you put there, mate! Thanks from Brazil!',5);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18403,'cyLWtMSry58','Back when I was learning to code I didn’t know anything or what to do and how to do it. I asked a friend of mine how I could what books I should read etc. first thing he did was stop me in my sentence and say “you don’t need to research all these functions and data structures and take notes from textbooks, you just need to know what is possible” and that really reasonated  with me because once you know what is possible, you can think of a problem and as the video states “learn by doing”, my friend said to work I’m projects I want to solve or replicate and implement what I have learned that way. Rather than sitting around reading these books.',33);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18404,'cyLWtMSry58','I really like the point about engineering toolboxes. I think that’s where a lot of the burnout comes from. I work in DevOps and teach full stack so going to school for machine learning sounds like a large leap. Learning how to build better ML pipelines are much more worth my time.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18405,'cyLWtMSry58','I’ve just started exploring this field. And this was a really good reminder to get so early on the journey. Thanks a lot!',20);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18407,'cyLWtMSry58','Hey Daniel, just discovered your channel a couple days ago and I''m learning lots. Thank you!',35);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18408,'cyLWtMSry58','This is great. Focus is key. A playful approach can also speed things up depending on how you learn and of course patience. For those interested in R and python, the latest R studio IDE is great and allows you to run both side by side with reticulate. It can seem a steep curve but those with a grounding in R and statistics you can run ML scripts side by side and learn the similarities and where they differ.',0);
Insert into JOO26.COMMENTINFO (COMMENTID,VIDEOID,COMMENTS,COMMENTLIKES) values (18,'b3x28s61q3c','LMGs growth is honestly something to truly aspire for, this IS the content we want to watch.',null);
